        public static ReadOnlyDictionary<PBEMove, PBELocalizedString> Descriptions { get; } = new ReadOnlyDictionary<PBEMove, PBELocalizedString>(new Dictionary<PBEMove, PBELocalizedString>()
        {
            { PBEMove.None, new PBELocalizedString("\n", "\n\n", "-", "", "―\n―\n―\n―\n―", "―\n―\n―\n―\n―", "", "") },
            { PBEMove.Pound, new PBELocalizedString("The target is physically pounded with\na long tail or a foreleg, etc.", "Écrase l'ennemi avec les pattes\navant, la queue, etc.", "Ein Hieb mit den Vorderbeinen\noder dem Schweif.", "Colpisce il nemico con la coda o le zampe\nanteriori.", "ながい　しっぽや　てなどを　つかって\nあいてを　はたいて　こうげきする。\n", "長い　しっぽや　手などを　使って\n相手を　はたいて　攻撃する。\n", "긴 꼬리나 손 등을 사용하여\n상대를 때려서 공격한다.", "Golpea con las patas o la cola.") },
            { PBEMove.KarateChop, new PBELocalizedString("The target is attacked with a sharp chop.\nCritical hits land more easily.", "L'ennemi est tranché violemment.\nTaux de critiques élevé.", "Gute Möglichkeit, einen Volltreffer\nzu landen.", "Colpisce il nemico con un colpo netto.\nProbabile brutto colpo.", "するどい　チョップで\nあいてを　たたいて　こうげきする。　\nきゅうしょに　あたりやすい。", "鋭い　チョップで\n相手を　たたいて　攻撃する。　\n急所に　当たりやすい。", "날카로운 당수로\n상대를 때려서 공격한다.\n급소에 맞기 쉽다.", "Da un golpe cortante.\nSuele ser crítico.") },
            // { PBEMove.3, new PBELocalizedString("The target is slapped repeatedly, back\nand forth, two to five times in a row.", "Gifle rapidement l'ennemi\nde 2 à 5 fois d'affilée.", "Trifft das Ziel 2- bis 5-mal hintereinander\nmit einem Duplexhieb.", "Schiaffeggia il nemico da due a cinque\nvolte di fila.", "おうふく　ビンタで\nあいてを　たたいて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "おうふく　ビンタで\n相手を　たたいて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "연속 뺨치기로\n상대를 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Abofetea de dos a cinco veces seguidas.") },
            // { PBEMove.4, new PBELocalizedString("The target is hit with a flurry of punches\nthat strike two to five times in a row.", "Une tornade de coups de poing\nqui frappe de 2 à 5 fois d'affilée.", "Trifft das Ziel 2- bis 5-mal hintereinander\nmit kräftigen Hieben.", "Colpisce il nemico con una scarica di pugni\nda due a cinque volte di fila.", "どとうの　パンチで\nあいてを　なぐりつけて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "どとうの　パンチで\n相手を　なぐりつけて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "노도 같은 펀치로\n상대를 세게 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Pega de dos a cinco veces seguidas.") },
            { PBEMove.MegaPunch, new PBELocalizedString("The target is slugged by a punch thrown\nwith muscle-packed power.", "L'ennemi reçoit un coup de poing\nd'une puissance incroyable.", "Ein unglaublich kräftiger Hieb.", "Colpisce il nemico con un pugno poderoso.", "ちからを　こめた　パンチで\nあいてを　こうげきする。\n", "力を　こめた　パンチで\n相手を　攻撃する。\n", "힘을 담은 펀치로\n상대를 공격한다.", "Un puñetazo de gran potencia.") },
            // { PBEMove.6, new PBELocalizedString("Numerous coins are hurled at the\ntarget to inflict damage.\nMoney is earned after the battle.", "Des pièces sont lancées sur l'ennemi.\nPermet d'obtenir de l'argent à la fin\ndu combat.", "Das Ziel wird mit Münzen beworfen. Das\nGeld wird nach dem Kampf aufgesammelt.", "Colpisce il nemico con una gran quantità\ndi monete recuperabili dopo la lotta.", "あいての　からだに\nこばんを　なげつけて　こうげきする。\nせんとうの　あとで　おかねが　もらえる。", "相手の　体に\n小判を　投げつけて　攻撃する。\n戦闘の　あとで　お金が　もらえる。", "상대의 몸에\n돈을 세게 던져서 공격한다.\n배틀 후에 돈을 받을 수 있다.", "Arroja monedas al objetivo.\nLas recupera al final del combate.") },
            { PBEMove.FirePunch, new PBELocalizedString("The target is punched with a fiery fist.\nIt may also leave the target with a burn.", "Un coup de poing enflammé vient\nfrapper l'ennemi. Peut le brûler.", "Feuriger Schlag, der dem Ziel eventuell\nVerbrennungen zufügt.", "Colpisce il nemico con un pugno ardente\nche può scottarlo.", "ほのおを　こめた　パンチで\nあいてを　こうげきする。\nやけど　じょうたいに　することが　ある。", "炎を　こめた　パンチで\n相手を　攻撃する。\nやけど状態に　することが　ある。", "불꽃을 담은 펀치로\n상대를 공격한다.\n화상 상태로 만들 때가 있다.", "Puñetazo ardiente.\nPuede quemar.") },
            { PBEMove.IcePunch, new PBELocalizedString("The target is punched with an icy fist.\nIt may also leave the target frozen.", "Un coup de poing glacé vient\nfrapper l'ennemi. Peut le geler.", "Ein eisiger Schlag, der das Ziel\neventuell einfriert.", "Colpisce il nemico con un pugno di ghiaccio\nche può congelarlo.", "れいきを　こめた　パンチで\nあいてを　こうげきする。\nこおり　じょうたいに　することが　ある。", "冷気を　こめた　パンチで\n相手を　攻撃する。\nこおり状態に　することが　ある。", "냉기를 담은 펀치로\n상대를 공격한다.\n얼음 상태로 만들 때가 있다.", "Puñetazo helado.\nPuede congelar.") },
            { PBEMove.ThunderPunch, new PBELocalizedString("The target is punched with an electrified\nfist. It may also leave the target\nwith paralysis.", "Un coup de poing électrique vient\nfrapper l'ennemi. Peut le paralyser.", "Ein elektrischer Schlag, der das Ziel\neventuell paralysiert.", "Colpisce il nemico con un pugno elettrico\nche può paralizzarlo.", "でんげきを　こめた　パンチで\nあいてを　こうげきする。\nまひ　じょうたいに　することが　ある。", "電撃を　こめた　パンチで\n相手を　攻撃する。\nまひ状態に　することが　ある。", "전격을 담은 펀치로\n상대를 공격한다.\n마비 상태로 만들 때가 있다.", "Puñetazo eléctrico.\nPuede paralizar.") },
            { PBEMove.Scratch, new PBELocalizedString("Hard, pointed, and sharp claws rake\nthe target to inflict damage.", "Lacère l'ennemi avec des griffes acérées\npour lui infliger des dégâts.", "Das Ziel wird mit scharfen\nKlauen zerkratzt.", "Infligge danni al nemico con artigli\nacuminati, duri e affilati.", "かたく　とがった　するどい　ツメで\nあいてを　ひっかいて　こうげきする。\n", "硬く　とがった　鋭い　ツメで\n相手を　ひっかいて　攻撃する。\n", "단단하고 뾰족한 날카로운 손톱으로\n상대를 할퀴어서 공격한다.", "Araña con afiladas garras.") },
            { PBEMove.ViceGrip, new PBELocalizedString("The target is gripped and squeezed from\nboth sides to inflict damage.", "L'ennemi est attrapé et compressé\npar les côtés.", "Das Ziel wird umklammert\nund zusammengequetscht.", "Stringe il nemico in una morsa usando\nenormi e possenti tenaglie.", "あいてを　りょうがわから　はさんで\nダメージを　あたえる。\n", "相手を　両側から　はさんで\nダメージを　あたえる。\n", "상대를 양쪽에서 집어서\n데미지를 준다.", "Atrapa y atenaza al objetivo.") },
            { PBEMove.Guillotine, new PBELocalizedString("A vicious, tearing attack with big pincers.\nThe target will faint instantly\nif this attack hits.", "De méchantes pinces lacèrent\nl'ennemi, le mettant K.O. sur\nle coup s'il est touché.", "Kräftige Scheren-Attacke. Führt beim\nZiel sofort zum K.O.", "Attacca il nemico con pericolose tenaglie.\nSe l'attacco va a segno, il nemico va\nsubito KO.", "おおきな　ハサミで\nあいてを　きりさいて　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "大きな　ハサミで\n相手を　切り裂いて　攻撃する。\n当たれば　一撃で　ひんしに　する。", "큰 집게로\n상대를 베어 갈라 공격한다.\n맞으면 일격에 기절한다.", "Ataque con pinzas que debilita al oponente\nde un golpe si acierta.") },
            // { PBEMove.13, new PBELocalizedString("A two-turn attack. Blades of wind hit\nopposing Pokémon on the second turn.\nCritical hits land more easily.", "Attaque en 2 tours.\nDes lames de vent frappent l'ennemi au\n2⒅ tour. Taux de critiques élevé.", "Eine Attacke, die über zwei Runden\ngeht. Hohe Volltrefferquote.", "Chi la usa genera un turbine al primo\nturno e attacca al secondo.\nProbabile brutto colpo.", "かぜの　やいばを　つくり\n２ターンめに　あいてを　こうげきする。\nきゅうしょに　あたりやすい。", "風の　刃を　つくり\n２ターン目に　相手を　攻撃する。\n急所に　当たりやすい。", "바람의 칼날을 만들어\n2턴째에 상대를 공격한다.\n급소에 맞기 쉽다.", "Primero se prepara y en el segundo turno\nataca al oponente con ráfagas de viento\ncortante. Alta probabilidad de ser crítico.") },
            { PBEMove.SwordsDance, new PBELocalizedString("A frenetic dance to uplift the fighting\nspirit. It sharply raises the user's\nAttack stat.", "Danse frénétique qui exalte l'esprit\ncombatif. Augmente beaucoup\nl'Attaque du lanceur.", "Ein wilder Kampftanz, der den eigenen\nAngriffs-Wert stark erhöht.", "Danza frenetica che incrementa lo spirito\ncombattivo. Chi la usa aumenta di molto\nil suo Attacco.", "たたかいのまいを　はげしく　おどって\nきあいを　たかめる。\nじぶんの　こうげきを　ぐーんと　あげる。", "戦いの舞を　激しく　おどって\n気合を　高める。\n自分の　攻撃を　ぐーんと　あげる。", "싸움의 춤을 격렬하게 추며\n기세를 높인다.\n자신의 공격을 크게 올린다.", "Baile frenético que aumenta mucho\nel Ataque.") },
            { PBEMove.Cut, new PBELocalizedString("The target is cut with a scythe or a claw.\nIt can also be used to cut down\nthin trees.", "Coupe l'ennemi avec des lames\nou des griffes. Hors combat,\npermet de couper des arbres fins.", "Ein Basisangriff mit Schere oder Klaue.\nDamit können kleine Bäume gefällt werden.", "Attacca il nemico con artigli o falci\naffilate. Fuori dalla lotta si usa per\ntagliare piccoli alberi.", "カマや　ツメなどで\nあいてを　きりつけて　こうげきする。\nほそいきも　きることが　できる。", "カマや　ツメなどで\n相手を　切りつけて　攻撃する。\n細い木も　きることが　できる。", "낫이나 손톱 등으로\n상대를 베어 공격한다.\n가느다란 나무도 자를 수 있다.", "Corta con garras, guadañas, etc.\nTambién sirve para cortar árboles\nfinos.") },
            { PBEMove.Gust, new PBELocalizedString("A gust of wind is whipped up by wings and\nlaunched at the target to inflict damage.", "Le lanceur bat des ailes pour\ngénérer une bourrasque\nqui blesse l'ennemi.", "Trifft das Ziel mit einem Windstoß\ndurch einen Flügelschlag.", "Infligge danni al nemico con una folata\ndi vento sollevata dalle ali.", "つばさで　おこした　はげしい　かぜを\nあいてに　ぶつけて　こうげきする。\n", "翼で　おこした　激しい　風を\n相手に　ぶつけて　攻撃する。\n", "날개로 일으킨 격한 바람을\n상대에게 부딪쳐서 공격한다.", "Crea un tornado con las alas y lo lanza\ncontra el objetivo.") },
            { PBEMove.WingAttack, new PBELocalizedString("The target is struck with large, imposing\nwings spread wide to inflict damage.", "L'ennemi est frappé par de larges ailes\ndéployées pour infliger des dégâts.", "Trifft das Ziel mit ausgebreiteten\nFlügeln.", "Infligge danni al nemico spiegando\ndelle grandi ali possenti.", "おおきく　ひろげた　りっぱな　つばさを\nあいてに　ぶつけて　こうげきする。\n", "大きく　ひろげた　りっぱな　翼を\n相手に　ぶつけて　攻撃する。\n", "크게 펼친 훌륭한 날개를\n상대에게 부딪쳐서 공격한다.", "Golpea al objetivo con unas grandes alas.") },
            { PBEMove.Whirlwind, new PBELocalizedString("The target is blown away and switched.\nIn the wild, a battle against a single\nPokémon ends.", "Éjecte le Pokémon ennemi\net le remplace par un autre.\nDans la nature, met fin au combat.", "Weht das Ziel weg und ersetzt es durch ein\nanderes Pokémon. In der Wildnis endet\nder Kampf.", "Il bersaglio lascia il campo e viene\nsostituito. Mette fine alle lotte contro\nsingoli Pokémon selvatici.", "あいてを　ふきとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "相手を　吹きとばして\n控えの　ポケモンを　ひきずりだす。\n野生の　場合は　戦闘が　終わる。", "상대를 날려버려서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Se lleva al objetivo, que es cambiado\npor otro Pokémon. Si es un Pokémon\nsalvaje, acaba el combate.") },
            { PBEMove.Fly, new PBELocalizedString("The user soars, then strikes its target\non the second turn. It can also be\nused for flying to any familiar town.", "Le lanceur s'envole au 1⑩ tour et\nfrappe au 2⒅. Permet aussi de voler\njusqu'à une ville déjà visitée.", "Steigt in Runde 1 empor und trifft das\nZiel in Runde 2. Ermöglicht Flug in\njede bekannte Stadt.", "Chi la usa si alza in volo per attaccare\nal turno seguente. Fuori dalla lotta\npermette di volare in città già visitate.", "１ターンめで　そらへ　とび\n２ターンめに　あいてを　こうげきする。\nしっている　まちに　とぶことも　できる。", "１ターン目で　空へ　飛び\n２ターン目に　相手を　攻撃する。\n知っている　街に　飛ぶことも　できる。", "1턴째에 하늘을 날아\n2턴째에 상대를 공격한다.\n알고 있는 도시로 날아갈 수 있다.", "Primer turno: vuela. Segundo turno:\nataca. Fuera de combate, permite ir\na sitios ya conocidos.") },
            // { PBEMove.20, new PBELocalizedString("Things such as long bodies or tentacles\nare used to bind and squeeze\nthe target for four to five turns.", "Ligote l'ennemi avec les tentacules\nou le corps pour l'écraser\ndurant 4 à 5 tours.", "Umklammert und quetscht das\nZiel über 2 bis 5 Runden.", "Il lungo corpo o i tentacoli di chi la usa\nlegano e stritolano il nemico per quattro\no cinque turni.", "ながい　からだや　つるなどを　つかい\n４ー５ターンの　あいだ　\nあいてを　しめつけて　こうげきする。", "長い　体や　つるなどを　使い\n４ー５ターンの　あいだ　\n相手を　締めつけて　攻撃する。", "긴 몸이나 덩굴 등을 써서\n4-5턴 동안\n상대를 조여 공격한다.", "Ata y oprime de cuatro a cinco turnos.") },
            { PBEMove.Slam, new PBELocalizedString("The target is slammed with a long tail,\nvines, etc., to inflict damage.", "Fouette l'ennemi avec la queue, une\nliane, etc. pour infliger des dégâts.", "Schlag mit einem langen Schweif,\neiner Ranke oder Ähnlichem.", "Infligge danni al nemico con una coda,\nuna liana o simili.", "ながい　しっぽや　つるなどを　つかい\nあいてを　たたきつけて　こうげきする。\n", "長い　しっぽや　つるなどを　使い\n相手を　たたきつけて　攻撃する。\n", "긴 꼬리나 덩굴 등을 사용해\n상대를 힘껏 쳐서 공격한다.", "Golpea con las extremidades.") },
            { PBEMove.VineWhip, new PBELocalizedString("The target is struck with slender,\nwhiplike vines to inflict damage.", "Fouette l'ennemi avec de fines lianes\npour infliger des dégâts.", "Peitschenähnlicher Schlag mit Ranken.", "Infligge danni al nemico con liane sottili\nsimili a fruste.", "ムチのように　しなる　ほそながい　つるで\nあいてを　たたきつけて　こうげきする。\n", "ムチのように　しなる　細長い　つるで\n相手を　たたきつけて　攻撃する。\n", "채찍처럼 휘어지는 가늘고 긴 덩굴로\n상대를 힘껏 쳐서 공격한다.", "Azota al objetivo con ramas finas.") },
            { PBEMove.Stomp, new PBELocalizedString("The target is stomped with a big foot.\nIt may also make the target flinch.", "Écrase l'ennemi avec un énorme pied.\nPeut aussi l'apeurer.", "Stampfen mit dem Fuß. Das Ziel\nschreckt eventuell zurück.", "Colpisce il nemico con un grosso piede\ne può anche farlo tentennare.", "おおきな　あしで\nあいてを　ふみつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "大きな　足で\n相手を　踏みつけて　攻撃する。\n相手を　ひるませることが　ある。", "큰 발로\n상대를 짓밟아서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Tremendo pisotón que puede hacer\nretroceder al objetivo.") },
            // { PBEMove.24, new PBELocalizedString("The target is quickly kicked twice in\nsuccession using both feet.", "Deux coups de pied qui frappent l'ennemi\ndeux fois d'affilée.", "Der Anwender tritt in einer Runde\nzweimal schnell zu.", "Colpisce il nemico due volte con un paio di\nrapidi calci inferti con entrambi i piedi.", "２ほんの　あしで　あいてを　けとばして\nこうげきする。２かい　れんぞくで\nダメージを　あたえる。", "２本の　足で　相手を　けとばして\n攻撃する。２回連続で\nダメージを　与える。", "2개의 다리로 상대를 걷어차서\n공격한다. 2회 연속으로\n데미지를 준다.", "Una patada doble.\nGolpea dos veces.") },
            { PBEMove.MegaKick, new PBELocalizedString("The target is attacked by a kick launched\nwith muscle-packed power.", "Un coup de pied superpuissant\net intense qui frappe l'ennemi.", "Das Ziel wird mit einem extrem\nheftigen Tritt angegriffen.", "Colpisce il nemico con un calcio sferrato\ncon la forza di muscoli poderosi.", "ものすごい　ちからを　こめた　キックで\nあいてを　けとばして　こうげきする。\n", "ものすごい　力を　こめた　キックで\n相手を　けとばして　攻撃する。\n", "굉장한 힘을 담은 킥으로\n상대를 걷어차서 공격한다.", "Patada de extrema fuerza.") },
            // { PBEMove.26, new PBELocalizedString("The user jumps up high, then strikes\nwith a kick. If the kick misses, the\nuser hurts itself.", "Le lanceur s'envole pour décocher\nun coup de pied sauté. S'il échoue,\nle lanceur se blesse.", "Der Angreifer hüpft hoch und tritt zu.\nBei Misserfolg schadet er sich selbst.", "Permette di saltare in alto per attaccare\ncon un calcio. Se non va a buon fine, chi\nla usa si ferisce.", "たかい　ジャンプからの　キックで\nあいてを　こうげきする。\nはずすと　じぶんが　ダメージを　うける。", "高い　ジャンプからの　キックで\n相手を　攻撃する。\nはずすと　自分が　ダメージを　受ける。", "높이 점프해서 킥으로\n상대를 공격한다.\n빗나가면 자신이 데미지를 입는다.", "Da un salto y pega una patada.\nSi falla, se lesiona.") },
            // { PBEMove.27, new PBELocalizedString("The user lashes out with a quick, spinning\nkick. It may also make the target flinch.", "Le lanceur effectue un coup de pied\ntournoyant et extrêmement rapide.\nPeut apeurer l'ennemi.", "Heftiger Tritt aus einer schnellen\nDrehbewegung. Lässt das Ziel\neventuell zurückschrecken.", "Chi la usa infierisce sul nemico con\nun calcio rotante. Può anche farlo\ntentennare.", "からだを　すばやく　かいてん　させながら\nあいてを　けとばして　こうげきする。\n", "体を　素早く　回転させながら\n相手を　けとばして　攻撃する。\n", "몸을 재빨리 회전시키며\n상대를 걷어차서 공격한다.", "Una patada rápida y circular.\nTambién puede hacer retroceder\nal objetivo.") },
            { PBEMove.SandAttack, new PBELocalizedString("Sand is hurled in the target's face,\nreducing its accuracy.", "Lance du sable au visage de l'ennemi\npour baisser sa Précision.", "Senkt Genauigkeit des Zieles,\nindem ihm Sand ins Gesicht\ngeworfen wird.", "Getta sabbia in faccia al nemico e ne\nriduce la precisione.", "あいての　かおに　すなを　かけて　\nめいちゅうりつを　さげる。\n", "相手の　顔に　砂を　かけて　\n命中率を　さげる。\n", "상대의 얼굴에 모래를 뿌려서\n명중률을 떨어뜨린다.", "Arroja arena a la cara y baja la Precisión.") },
            { PBEMove.Headbutt, new PBELocalizedString("The user sticks out its head and attacks\nby charging straight into the target.\nIt may also make the target flinch.", "Le lanceur donne un coup de tête.\nPeut apeurer l'ennemi.\n", "Rammt das Ziel mit einer Kopfnuss.\nZiel schreckt eventuell zurück.", "Chi la usa si lancia diritto di testa contro\nil nemico. Può anche farlo tentennare.", "あたまを　つきだして\nまっすぐ　つっこんで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "頭を　突きだして\nまっすぐ　つっこんで　攻撃する。\n相手を　ひるませることが　ある。", "머리를 내밀어\n곧장 돌진하여 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Lanza un potente cabezazo que puede\nhacer retroceder al objetivo.") },
            { PBEMove.HornAttack, new PBELocalizedString("The target is jabbed with a sharply\npointed horn to inflict damage.", "Frappe l'ennemi d'un coup de corne\npointue pour infliger des dégâts.", "Spießt das Ziel mit einem spitzen\nHorn auf.", "Danneggia il nemico infilzandolo con un\ncorno affilato.", "するどく　とがった　つので\nあいてを　こうげきする。\n", "鋭く　とがった　つので\n相手を　攻撃する。\n", "날카롭고 뾰족한 뿔로\n상대를 공격한다.", "Ataca al objetivo con una cornada.") },
            // { PBEMove.31, new PBELocalizedString("The target is jabbed repeatedly with a\nhorn or beak two to five times in a row.", "Frappe l'ennemi 2 à 5 fois d'affilée\navec un bec ou une corne.", "Spießt das Ziel 2- bis 5-mal mit spitzem\nHorn oder Schnabel auf.", "Infilza il nemico con corna affilate o\nun becco da due a cinque volte di fila.", "つのや　くちばしで\nあいてを　つついて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "つのや　くちばしで\n相手を　つついて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "뿔이나 부리로\n상대를 찔러서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Cornea al objetivo de dos a cinco veces.") },
            { PBEMove.HornDrill, new PBELocalizedString("The user stabs the target with a horn\nthat rotates like a drill.\nIf it hits, the target faints instantly.", "Un coup de corne en vrille qui empale\nl'ennemi, le mettant K.O. sur le coup\ns'il est touché.", "K.O.-Attacke, die ein Horn als\nBohrer einsetzt.", "Colpisce il nemico con un corno perforante\ncome un trapano. Se il colpo va a segno,\nil nemico va KO.", "かいてんする　つのを\nあいてに　つきさして　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "回転する　つのを\n相手に　突き刺して　攻撃する。\n当たれば　一撃で　ひんしに　する。", "회전하는 뿔을\n상대에게 꿰찔러서 공격한다.\n맞으면 일격에 기절한다.", "Ataque con taladro que fulmina\nen un golpe al objetivo si le toca.") },
            { PBEMove.Tackle, new PBELocalizedString("A physical attack in which the user\ncharges and slams into the target\nwith its whole body.", "Le lanceur charge l'ennemi et\nle percute de tout son corps.", "Trifft das Ziel mit vollem\nKörpereinsatz.", "Attacco fisico che colpisce il nemico\ninvestendolo con tutto il corpo.", "あいてに　むかって　からだ　ぜんたいで\nぶつかって　いき　こうげきする。\n", "相手に　むかって　全身で\nぶつかっていき　攻撃する。\n", "상대를 향해서 몸 전체를\n부딪쳐가며 공격한다.", "Embiste con todo el cuerpo.") },
            { PBEMove.BodySlam, new PBELocalizedString("The user drops onto the target\nwith its full body weight. It may also\nleave the target with paralysis.", "Le lanceur se laisse tomber sur l'ennemi\nde tout son poids. Peut le paralyser.", "Trifft das Ziel mit vollem\nKörpereinsatz. Bewirkt\neventuell Paralyse.", "Chi la usa carica il nemico con tutto\nil corpo. Può causarne anche la paralisi.", "からだ　ぜんたいで\nあいてに　のしかかり　こうげきする。\nまひ　じょうたいに　することが　ある。", "全身で\n相手に　のしかかり　攻撃する。\nまひ状態に　することが　ある。", "몸 전체로\n상대를 덮쳐 눌러 공격한다.\n마비 상태로 만들 때가 있다.", "Salta sobre el objetivo con todo su peso.\nPuede paralizar.") },
            // { PBEMove.35, new PBELocalizedString("A long body or vines are used to wrap and\nsqueeze the target for four to five turns.", "Le lanceur ligote l'ennemi avec des\nlianes ou son corps pour l'écraser\ndurant 4 à 5 tours.", "Umwickelt das Ziel über 4 bis 5 Runden\nmit Ranken oder Ähnlichem und fügt\nihm Schaden zu.", "Il lungo corpo o le liane di chi la usa\navvolgono e stritolano il nemico per\nquattro o cinque turni.", "ながい　からだや　つるなどを　つかって\n４ー５ターンの　あいだ\nあいてに　まきついて　こうげきする。", "長い　体や　つるなどを　つかって\n４ー５ターンの　あいだ\n相手に　まきついて　攻撃する。", "긴 몸이나 덩굴을 사용해\n4-5턴 동안\n상대를 휘감아 공격한다.", "Oprime al objetivo de cuatro a cinco\nturnos con ramas o con su cuerpo.") },
            { PBEMove.TakeDown, new PBELocalizedString("A reckless, full-body charge attack for\nslamming into the target.\nIt also damages the user a little.", "Une charge violente qui blesse aussi\nlégèrement le lanceur.", "Rücksichtslose Attacke, bei der sich\nder Angreifer selbst leicht verletzt.", "Carica spericolata con tutto il corpo\ncontro il nemico. Danneggia un po'\nanche chi la usa.", "すごい　いきおいで\nあいてに　ぶつかって　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "すごい　勢いで\n相手に　ぶつかって　攻撃する。\n自分も　少し　ダメージを　受ける。", "굉장한 기세로\n상대에게 부딪쳐 공격한다.\n자신도 조금 데미지를 입는다.", "Carga desmedida que también hiere\nal agresor.") },
            // { PBEMove.37, new PBELocalizedString("The user rampages and attacks for two\nto three turns. It then becomes\nconfused, however.", "Une attaque furieuse qui dure de 2 à 3\ntours. Le lanceur devient confus.", "Attacke über 2 bis 3 Runden,\ndie den Angreifer verwirrt.", "Assale e attacca il nemico per due o tre\nturni, ma confonde chi la usa.", "２ー３ターンの　あいだ\nあばれまくって　あいてを　こうげきする。\nあばれた　あとは　こんらん　する。", "２ー３ターンの　あいだ\n暴れまくって　相手を　攻撃する。\n暴れたあとは　混乱する。", "2-3턴 동안\n마구 난동부려서 상대를 공격한다.\n난동부린 뒤에는 혼란에 빠진다.", "Ataca de dos a tres turnos y acaba\nconfundiendo al agresor.") },
            { PBEMove.DoubleEdge, new PBELocalizedString("A reckless, life-risking tackle.\nIt also damages the user by a fairly large\namount, however.", "Une dangereuse charge. Inflige aussi des\ndégâts assez importants au lanceur.", "Lebensgefährlicher Angriff, bei dem\nsich der Angreifer selbst verletzt.", "Carica spietata e pericolosa che\ndanneggia molto anche chi la usa.", "いのちを　かけて\nあいてに　とっしんして　こうげきする。\nじぶんも　かなり　ダメージを　うける。", "命を　懸けて\n相手に　突進して　攻撃する。\n自分も　かなり　ダメージを　受ける。", "목숨을 걸고\n상대에게 돌진하여 공격을 한다.\n자신도 상당한 데미지를 입는다.", "Ataque arriesgado que también hiere\nal agresor.") },
            { PBEMove.TailWhip, new PBELocalizedString("The user wags its tail cutely, making\nopposing Pokémon less wary and\nlowering their Defense stat.", "Le lanceur remue son adorable queue\npour tromper la vigilance de l'ennemi\net baisser sa Défense.", "Hieb mit dem Schweif. Senkt die\nVerteidigung des Gegners.", "Chi la usa agita la coda per distrarre\ni nemici, riducendone la Difesa.", "しっぽを　さゆうに　かわいく　ふって\nゆだんを　さそう。\nあいての　ぼうぎょを　さげる。", "しっぽを　左右に　かわいく　ふって\n油断を　誘う。\n相手の　防御を　さげる。", "꼬리를 좌우로 귀엽게 흔들어\n방심을 유도한다.\n상대의 방어를 떨어뜨린다.", "Agita la cola para bajar la Defensa\ndel contrincante.") },
            { PBEMove.PoisonSting, new PBELocalizedString("The user stabs the target\nwith a poisonous stinger.\nThis may also poison the target.", "Un dard toxique qui transperce l'ennemi.\nPeut aussi l'empoisonner.", "Angriff mit Giftstachel. Das Ziel\nwird eventuell vergiftet.", "Colpisce il nemico con un aculeo tossico\nche può anche avvelenarlo.", "どくの　ある　ハリを\nあいてに　つきさして　こうげきする。\nどく　じょうたいに　することが　ある。", "毒の　ある　ハリを\n相手に　突き刺して　攻撃する。\n毒状態に　することが　ある。", "독이 있는 침을\n상대에게 꿰찔러서 공격한다.\n독 상태로 만들 때가 있다.", "Lanza un aguijón tóxico que puede\nenvenenar al objetivo.") },
            // { PBEMove.41, new PBELocalizedString("The user damages the target twice in\nsuccession by jabbing it with two spikes.\nIt may also poison the target.", "Un double coup de dard qui\ntransperce l'ennemi 2 fois d'affilée.\nPeut aussi l'empoisonner.", "Stacheln an den Vorderbeinen\ntreffen das Ziel zweimal.\nZiel wird eventuell vergiftet.", "Colpisce il nemico due volte di seguito\ncon un paio di aghi. Può anche avvelenarlo.", "２ほんの　ハリを　あいてに　つきさし\n２かい　れんぞくで　ダメージ。\nどく　じょうたいに　することが　ある。", "２本の　ハリを　相手に　突き刺し\n２回連続で　ダメージ。\n毒状態に　することが　ある。", "2개의 침을 상대에게 꿰찔러\n2회 연속으로 데미지를 준다.\n독 상태로 만들 때가 있다.", "Pincha dos veces con dos espinas.\nPuede envenenar.") },
            // { PBEMove.42, new PBELocalizedString("Sharp spikes are shot at the target\nin rapid succession.\nThey hit two to five times in a row.", "Envoie une rafale de dards.\nPeut toucher de 2 à 5 fois.", "Spitze Nadeln treffen das Ziel\n2- bis 5-mal hintereinander.", "Il nemico viene colpito da due a cinque\nvolte con spilli appuntiti in rapida\nsuccessione.", "するどい　ハリを\nあいてに　はっしゃして　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "鋭い　ハリを\n相手に　発射して　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "날카로운 침을\n상대에게 발사해서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Lanza finas púas que hieren de dos\na cinco veces.") },
            { PBEMove.Leer, new PBELocalizedString("The user gains an intimidating leer with\nsharp eyes. The opposing team's\nDefense stats are reduced.", "Le lanceur fait les gros yeux à l'ennemi\npour l'intimider et baisser sa Défense.", "Gegnerischer Verteidigungs-Wert wird\ndurch angsteinflößenden Blick gesenkt.", "Terrorizza i nemici con uno sguardo\nfulminante e intimidatorio riducendone\nla Difesa.", "するどい　めつきで　おびえさせて\nあいての　ぼうぎょを　さげる。\n", "鋭い　目つきで　おびえさせて\n相手の　防御を　さげる。\n", "날카로운 눈초리로 겁을 주어\n상대의 방어를 떨어뜨린다.", "Intimida al objetivo para bajar\nsu Defensa.") },
            { PBEMove.Bite, new PBELocalizedString("The target is bitten\nwith viciously sharp fangs.\nIt may make the target flinch.", "L'ennemi est mordu par de tranchantes\ncanines. Peut l'apeurer.", "Beißt zu und lässt das Ziel\neventuell zurückschrecken.", "Il nemico viene morso da denti affilatissimi\nche possono farlo tentennare.", "するどく　とがった　はで\nかみついて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "鋭く　とがった　歯で\nかみついて　攻撃する。\n相手を　ひるませることが　ある。", "날카롭고 뾰족한 이빨로\n물어서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Un voraz bocado que puede hacer\nretroceder al objetivo.") },
            { PBEMove.Growl, new PBELocalizedString("The user growls in an endearing way,\nmaking the opposing team less wary.\nThe foes' Attack stats are lowered.", "Le lanceur pousse un cri tout mimi\npour tromper la vigilance de l'ennemi\net baisser son Attaque.", "Der Anwender nimmt den Gegner\nfür sich ein und senkt dessen\nAngriffs-Wert.", "Distrae i nemici con un ruggito potente e\nne riduce l'Attacco.", "かわいい　なきごえを　きかせて\nきを　ひき　ゆだんを　させて\nあいての　こうげきを　さげる。", "かわいい　なきごえを　聞かせて\n気を　ひき　油断を　させて\n相手の　攻撃を　さげる。", "귀여운 울음소리를 들려주고\n관심을 끌어 방심한 사이에\n상대의 공격을 떨어뜨린다.", "Dulce gruñido que reduce el Ataque\ndel contrincante.") },
            { PBEMove.Roar, new PBELocalizedString("The target is scared off and switched.\nIn the wild, a battle against a single\nPokémon ends.", "Effraie le Pokémon ennemi et\nle remplace par un autre. Dans\nla nature, met fin au combat.", "Verjagt das Ziel und ersetzt es\ndurch ein anderes Pokémon.\nBeendet den Kampf in der Wildnis.", "Il bersaglio lascia il campo e viene\nsostituito. Mette fine alle lotte contro\nsingoli Pokémon selvatici.", "あいてを　にがして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "相手を　逃がして\n控えの　ポケモンを　ひきずりだす。\n野生の　場合は　戦闘が　終わる。", "상대를 도망가게 해서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Se lleva al objetivo, que es cambiado\npor otro Pokémon. Si es un Pokémon\nsalvaje, acaba el combate.") },
            { PBEMove.Sing, new PBELocalizedString("A soothing lullaby is sung in a calming\nvoice that puts the target into a deep\nslumber.", "Une berceuse plonge l'ennemi\ndans un profond sommeil.", "Ein Lied, das das Ziel in tiefen\nSchlaf versetzt.", "Dolce ninnananna, cantata da una voce\nsuadente, che fa addormentare il nemico.", "ここちよい　きれいな\nうたごえを　きかせて\nあいてを　ねむり　じょうたいに　する。", "心地好い　きれいな\n歌声を　聞かせて\n相手を　眠り状態に　する。", "기분 좋은 예쁜\n노랫소리를 들려주고\n상대를 잠듦 상태로 만든다.", "Cancioncilla que hace dormir\nprofundamente al objetivo.") },
            { PBEMove.Supersonic, new PBELocalizedString("The user generates odd sound waves from\nits body. It may confuse the target.", "Le lanceur produit d'étranges ondes\nsonores qui rendent confus.", "Ausstoß bizarrer Schallwellen.\nDas Ziel wird verwirrt.", "Chi la usa genera dal proprio corpo\nstrane onde acustiche che possono\nconfondere il nemico.", "とくしゅな　おんぱを\nからだから　はっして　\nあいてを　こんらん　させる。", "特殊な　音波を\n体から　発して\n相手を　混乱させる。", "특수한 음파를\n몸에서 발산하여\n상대를 혼란시킨다.", "Raras ondas sónicas que confunden\nal objetivo.") },
            { PBEMove.SonicBoom, new PBELocalizedString("The target is hit with a destructive shock\nwave that always inflicts 20 HP damage.", "Une onde de choc destructrice qui\ninflige toujours 20 PV de dégâts.", "Das Ziel wird von einer Schockwelle\ngetroffen, die stets 20 KP Schaden\nanrichtet.", "Il nemico viene colpito da onde acustiche\ndevastanti che gli provocano un danno\ncostante pari a 20 PS.", "しょうげきはを\nあいてに　ぶつけて　こうげきする。\n２０の　ダメージを　きまって　あたえる。", "衝撃波を\n相手に　ぶつけて　攻撃する。\n２０の　ダメージを　決まって　与える。", "충격파를\n상대에 부딪쳐서 공격한다.\n언제나 20의 데미지를 준다.", "Lanza ondas de choque que restan\n20 PS al objetivo.") },
            // { PBEMove.50, new PBELocalizedString("For four turns, this move prevents the\ntarget from using the move it last used.", "Empêche l'ennemi d'employer à nouveau\nsa dernière attaque. Dure quatre tours.", "Die zuletzt eingesetzte Attacke\ndes Zieles wird für mehrere Runden\nblockiert.", "Per quattro turni impedisce al bersaglio\ndi riutilizzare l'ultima mossa usata.", "あいての　うごきを　とめて\nちょくぜんに　だしていた　わざを\n４ターンの　あいだ　つかえなく　する。", "相手の　動きを　とめて\n直前に　だしていた　技を\n４ターンの　あいだ　使えなくする。", "상대의 움직임을 막아\n바로 전에 쓴 기술을\n4턴 동안 사용할 수 없게 만든다.", "Desactiva el último movimiento del\nobjetivo durante cuatro turnos.") },
            { PBEMove.Acid, new PBELocalizedString("The opposing team is attacked with a spray\nof harsh acid. The acid may also lower\nthe targets' Sp. Def stats.", "Le lanceur attaque l'ennemi avec un jet\nd'acide corrosif. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Versprüht ätzende Flüssigkeit, die\neventuell die Spezial-Verteidigung\ndes Zieles senkt.", "Colpisce i nemici spruzzando un acido\ncorrosivo. Può anche ridurne la Difesa\nSpeciale.", "つよい　さんを　あいてに　かけて\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "強い　酸を　相手に　かけて\n攻撃する。相手の　特防を\nさげることが　ある。", "강한 산을 상대에게 끼얹어\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Rocía con un ácido corrosivo.\nPuede bajar la Defensa Especial.") },
            { PBEMove.Ember, new PBELocalizedString("The target is attacked with small flames.\nIt may also leave the target with a burn.", "L'ennemi est attaqué par de faibles\nflammes. Peut aussi le brûler.", "Schwache Feuer-Attacke, durch die das\nZiel eventuell Verbrennungen erleidet.", "Il nemico viene colpito da fiammelle\nche possono anche scottarlo.", "ちいさな　ほのおを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "小さな　炎を\n相手に　発射して　攻撃する。\nやけど状態に　することが　ある。", "작은 불꽃을\n상대에게 발사하여 공격한다.\n화상 상태로 만들 때가 있다.", "Ataca con llamas pequeñas que\npueden causar quemaduras.") },
            { PBEMove.Flamethrower, new PBELocalizedString("The target is scorched with an intense\nblast of fire. It may also leave the target\nwith a burn.", "L'ennemi reçoit un torrent de flammes.\nPeut aussi le brûler.", "Starke Feuer-Attacke, durch die das\nZiel eventuell Verbrennungen\nerleidet.", "Il nemico viene colpito da intense\nfiammate che possono anche scottarlo.", "はげしい　ほのおを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "激しい　炎を\n相手に　発射して　攻撃する。\nやけど状態に　することが　ある。", "세찬 불꽃을\n상대에게 발사하여 공격한다.\n화상 상태로 만들 때가 있다.", "Ataca con una gran ráfaga de fuego que\npuede causar quemaduras.") },
            // { PBEMove.54, new PBELocalizedString("The user cloaks its body with a white mist\nthat prevents any of its stats from being\ncut for five turns.", "Une brume blanche enveloppe l'équipe\ndu lanceur et empêche la réduction\ndes stats pour 5 tours.", "Anwender schützt das Team mit einem\nNebel. Verhindert Statussenkungen\nfür fünf Runden.", "Chi la usa attira una nebbia che blocca\nla riduzione delle statistiche della sua\nsquadra per cinque turni.", "しろいきりで　からだを　おおう。\n５ターンの　あいだ　あいてに\nのうりょくを　さげられなく　なる。", "白い霧で　体を　おおう。\n５ターンの　あいだ　相手に\n能力を　さげられなく　なる。", "하얀 안개로 몸을 덮는다.\n5턴 동안 상대에 의해\n능력이 떨어지지 않게 된다.", "Rodea de fina niebla al usuario y\nprotege las características de su\nequipo durante cinco turnos.") },
            { PBEMove.WaterGun, new PBELocalizedString("The target is blasted with a\nforceful shot of water.", "De l'eau est projetée sur l'ennemi\nen arc de cercle.", "Das Ziel wird mit Wasser bespritzt.", "Il nemico è colpito da un potente getto\nd'acqua.", "みずを　いきおいよく\nあいてに　はっしゃして　こうげきする。\n", "水を　勢いよく\n相手に　発射して　攻撃する。\n", "물을 기세 좋게\n상대에게 발사하여 공격한다.", "Ataca disparando agua con gran potencia.") },
            { PBEMove.HydroPump, new PBELocalizedString("The target is blasted by a huge volume\nof water launched under great pressure.", "Un puissant jet d'eau est\ndirigé sur l'ennemi.", "Spritzt eine Menge Wasser mit\nHochdruck auf das Ziel.", "Il nemico è travolto da un potente getto\nd'acqua spruzzato ad altissima pressione.", "たいりょうの　みずを\nはげしい　いきおいで\nあいてに　はっしゃして　こうげきする。", "大量の　水を\n激しい　勢いで\n相手に　発射して　攻撃する。", "대량의 물을\n세찬 기세로\n상대에게 발사하여 공격한다.", "Lanza una gran masa de agua a presión\npara atacar.") },
            { PBEMove.Surf, new PBELocalizedString("It swamps the area around the user\nwith a giant wave.\nIt can also be used for crossing water.", "Une énorme vague s'abat sur le\nchamp de bataille. Permet aussi\nde voyager sur l'eau.", "Eine Welle bricht über alle Pokémon in der\nNähe des Anwenders herein. Macht Surfen\nmöglich.", "Un'onda enorme sommerge il campo\ndi lotta. Fuori dalla lotta si usa\nper spostarsi sull'acqua.", "おおきな　なみで　じぶんの\nまわりに　いるものを　こうげきする。\nみずの　うえも　およいで　すすめる。", "大きな　波で　自分の\n周りに　いるものを　攻撃する。\n水上も　泳いで　進める。", "큰 파도로 자신의\n주위에 있는 포켓몬을 공격한다.\n물 위도 헤엄쳐서 나아간다.", "Inunda el campo de batalla con una ola\ngigante. Fuera de batalla sirve para\nmoverse sobre el agua.") },
            { PBEMove.IceBeam, new PBELocalizedString("The target is struck with an icy-cold\nbeam of energy.\nIt may also freeze the target solid.", "Un rayon de glace frappe l'ennemi.\nPeut aussi le geler.", "Das Ziel wird von einem Eisstrahl\ngetroffen und friert eventuell ein.", "Il nemico è colpito da un raggio di energia\ngelida che può anche congelarlo.", "こごえる　ビームを\nあいてに　はっしゃして　こうげきする。\nこおり　じょうたいに　することが　ある。", "凍える　ビームを\n相手に　発射して　攻撃する。\nこおり状態に　することが　ある。", "냉동빔을\n상대에게 발사하여 공격한다.\n얼음 상태로 만들 때가 있다.", "Rayo de hielo que puede llegar a congelar.") },
            { PBEMove.Blizzard, new PBELocalizedString("A howling blizzard is summoned to strike\nthe opposing team. It may also freeze\nthem solid.", "Une violente tempête de neige\nest déclenchée sur l'ennemi.\nPeut aussi le geler.", "Ein Schneesturm wütet, der das\nZiel einfrieren kann.", "Colpisce i bersagli con una tremenda\ntempesta di ghiaccio che può anche\ncongelarli.", "はげしい　ふぶきを\nあいてに　ふきつけて　こうげきする。\nこおり　じょうたいに　することが　ある。", "激しい　吹雪を\n相手に　吹きつけて　攻撃する。\nこおり状態に　することが　ある。", "세찬 눈보라를\n상대에게 내뿜어 공격한다.\n얼음 상태로 만들 때가 있다.", "Tormenta de hielo que puede llegar\na congelar.") },
            { PBEMove.Psybeam, new PBELocalizedString("The target is attacked with a peculiar ray.\nIt may also cause confusion.", "Un étrange rayon frappe l'ennemi.\nPeut aussi le rendre confus.", "Feuert einen Strahl ab, der das\nZiel verwirren kann.", "Colpisce il nemico con un raggio speciale.\nPuò anche confonderlo.", "ふしぎな　こうせんを\nあいてに　はっしゃして　こうげきする。\nこんらん　させることが　ある。", "不思議な　光線を\n相手に　発射して　攻撃する。\n混乱させることが　ある。", "이상한 광선을\n상대에게 발사하여 공격한다.\n혼란시킬 때가 있다.", "Extraño rayo que puede causar confusión.") },
            { PBEMove.BubbleBeam, new PBELocalizedString("A spray of bubbles is forcefully ejected\nat the opposing team. It may also lower\ntheir Speed stats.", "Des bulles sont envoyées avec\npuissance sur l'ennemi. Peut\naussi baisser sa Vitesse.", "Versprüht Blasen, die eventuell den\nInitiative-Wert des Zieles senken.", "Colpisce il nemico con una forte scarica\ndi bolle. Può anche ridurne la Velocità.", "あわを　いきおいよく\nあいてに　はっしゃして　こうげきする。\nすばやさを　さげる　ことが　ある。", "泡を　勢いよく\n相手に　発射して　攻撃する。\n素早さを　さげる　ことが　ある。", "거품을 기세 좋게\n상대에게 발사하여 공격한다.\n스피드를 떨어뜨릴 때가 있다.", "Diluvio de burbujas que puede bajar\nla Velocidad.") },
            { PBEMove.AuroraBeam, new PBELocalizedString("The target is hit with a rainbow-colored\nbeam. This may also lower the target's\nAttack stat.", "Envoie un rayon arc-en-ciel sur l'ennemi.\nPeut aussi baisser son Attaque.", "Regenbogenfarbener Strahl,\nder eventuell den Angriffs-Wert\ndes Zieles senkt.", "Colpisce il nemico con un raggio dai\ncolori dell'iride. Può anche ridurne\nl'Attacco.", "にじいろの　ビームを\nあいてに　はっしゃして　こうげきする。\nこうげきを　さげる　ことが　ある。", "にじいろの　ビームを\n相手に　発射して　攻撃する。\n攻撃を　さげる　ことが　ある。", "무지개색의 빔을\n상대에게 발사하여 공격한다.\n공격을 떨어뜨릴 때가 있다.", "Rayo multicolor que puede reducir\nel Ataque.") },
            // { PBEMove.63, new PBELocalizedString("The target is attacked with a powerful\nbeam. The user must rest on the next\nturn to regain its energy.", "Projette un puissant rayon sur l'ennemi.\nLe lanceur doit se reposer\nau tour suivant.", "Starke Attacke, die den Angreifer\nzwingt, eine Runde auszusetzen.", "Colpisce il nemico con un potente raggio.\nChi la usa salta il turno successivo per\nrecuperare energia.", "つよい　こうせんを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "強い　光線を\n相手に　発射して　攻撃する。\n次の　ターンは　動けなくなる。", "강한 광선을\n상대에게 발사하여 공격한다.\n다음 턴은 움직일 수 없다.", "Es eficaz, pero el atacante deberá\ndescansar en el siguiente turno.") },
            { PBEMove.Peck, new PBELocalizedString("The target is jabbed with a sharply\npointed beak or horn.", "Frappe l'ennemi d'un bec pointu ou\nd'une corne pour infliger des dégâts.", "Greift das Ziel mit dem Schnabel\noder Horn an.", "Colpisce il nemico con un becco appuntito\no un corno.", "するどく　とがった　くちばしや　つので　\nあいてを　つついて　こうげきする。\n", "鋭く　とがった　くちばしや　つので　\n相手を　突いて　攻撃する。\n", "날카롭고 뾰족한 부리나 뿔로\n상대를 쪼아서 공격한다.", "Ensarta al objetivo con un cuerno o pico\npunzante.") },
            { PBEMove.DrillPeck, new PBELocalizedString("A corkscrewing attack with the\nsharp beak acting as a drill.", "Une attaque utilisant le bec\ncomme une perceuse.", "Korkenzieherangriff, bei dem der\nSchnabel als Bohrer dient.", "Attacco a spirale con un becco aguzzo\nche fa da trapano.", "かいてん　しながら　とがった　くちばしを\nあいてに　つきさして　こうげきする。\n", "回転しながら　とがった　くちばしを\n相手に　突き刺して　攻撃する。\n", "회전하면서 뾰족한 부리를\n상대에게 꿰찔러 공격한다.", "Picotazo giratorio y perforador\nmuy potente.") },
            { PBEMove.Submission, new PBELocalizedString("The user grabs the target and recklessly\ndives for the ground. It also hurts the\nuser slightly.", "Le lanceur agrippe l'ennemi et\nl'écrase au sol. Blesse aussi\nlégèrement le lanceur.", "Harte Körperattacke, bei der sich\nder Angreifer selbst leicht verletzt.", "Chi la usa carica il nemico in modo\nspericolato, ma danneggia anche\nse stesso.", "じめんに　じぶんごと\nあいてを　なげつけて　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "地面に　自分ごと\n相手を　投げつけて　攻撃する。\n自分も　少し　ダメージを　受ける。", "땅에 자신과 함께\n상대를 내던져 공격한다.\n자신도 조금 데미지를 입는다.", "Tira al objetivo al suelo.\nTambién hiere al agresor.") },
            { PBEMove.LowKick, new PBELocalizedString("A powerful low kick that makes the target\nfall over. It inflicts greater damage on\nheavier targets.", "Un puissant coup de pied bas qui fauche\nl'ennemi. Il est plus efficace contre\nles ennemis lourds.", "Tritt, der das Ziel umwirft. Je schwerer\ndas Ziel ist, desto mehr Schaden fügt\nihm die Attacke zu.", "Un calcio basso e potente che fa cadere\nil nemico. Danneggia maggiormente i nemici\npiù pesanti.", "あしを　つよく　けり　あいてを\nころばせて　こうげきする。あいてが\nおもいほど　いりょくが　あがる。", "足を　強く　けり\n相手を　転ばせて　攻撃する。\n相手が　重いほど　威力が　あがる。", "발을 강하게 걸고\n상대를 넘어뜨려 공격한다.\n상대가 무거울수록 위력이 올라간다.", "Patada baja. Cuanto más pesa\nel objetivo, más daño causa.") },
            // { PBEMove.68, new PBELocalizedString("A retaliation move that counters any\nphysical attack, inflicting double the\ndamage taken.", "Une riposte qui répond à toute\nattaque physique en infligeant\nle double de dégâts.", "Kontert physischen Treffer und fügt dem\nGegner das Doppelte des Schadens zu,\nden der Anwender erlitten hat.", "Mossa che contrasta ogni attacco fisico,\narrecando il doppio del danno ricevuto.", "あいてから　うけた　ぶつり　こうげきの\nダメージを　２ばいに　して\nおなじ　あいてに　かえす。", "相手から　受けた　物理攻撃の\nダメージを　２倍に　して\n同じ　相手に　返す。", "상대로부터 받은 물리공격의\n데미지를 2배로 만들어\n같은 상대에게 돌려준다.", "Devuelve un golpe físico por duplicado.") },
            { PBEMove.SeismicToss, new PBELocalizedString("The target is thrown using the power of\ngravity. It inflicts damage equal to\nthe user's level.", "L'ennemi est projeté grâce au pouvoir de\nla gravité. Inflige des dégâts équivalents\nau niveau du lanceur.", "Ziel wird mit der Kraft der Gravitation\numgeworfen. Richtet Schaden gemäß Level\ndes Angreifers an.", "Colpisce il bersaglio con la forza di\ngravità. Infligge un danno pari al livello\ndi chi la usa.", "いんりょくを　つかい　なげとばす。\nじぶんの　レベルと　おなじ　ダメージを\nあいてに　あたえる。", "引力を　使い　投げとばす。\n自分の　レベルと　同じ　ダメージを\n相手に　与える。", "인력을 사용해 내던진다.\n자신의 레벨과 똑같은 데미지를\n상대에게 준다.", "La gravedad derriba al objetivo.\nSe restarán tantos PS como nivel\ntenga el agresor.") },
            { PBEMove.Strength, new PBELocalizedString("The target is slugged with a punch thrown\nat maximum power. It can also be used\nto move heavy boulders.", "Le lanceur cogne l'ennemi de toutes\nses forces. Permet aussi de déplacer\ndes rochers.", "Das Ziel wird extrem stark getroffen.\nMacht Verschieben von Felsen möglich.", "Colpisce il nemico con un'enorme energia.\nFuori dalla lotta si usa per spostare i\nmassi.", "こんしんの　ちからで\nあいてを　なぐりつけて　こうげきする。\nおもたい　いわを　おすことも　できる。", "こん身の　力で\n相手を　なぐりつけて　攻撃する。\n重たい　岩を　押すことも　できる。", "혼신의 힘으로\n상대를 세게 때려서 공격한다.\n무거운 돌을 밀 수도 있다.", "Potente puñetazo.\nFuera de combate sirve\npara mover piedras.") },
            { PBEMove.Absorb, new PBELocalizedString("A nutrient-draining attack. The user's\nHP is restored by half the damage taken\nby the target.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Attacke, die die Hälfte des\nSchadens absorbiert.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "ようぶんを　すいとり　こうげきする。\nあいてに　あたえた　ダメージの\nはんぶんの　ＨＰを　かいふくできる。", "養分を　吸い取り　攻撃する。\n相手に　与えた　ダメージの\n半分の　ＨＰを　回復できる。", "양분을 흡수하여 공격한다.\n상대에게 입힌 데미지의\n절반에 해당하는 HP를 회복할 수 있다.", "Absorbe la mitad del daño producido\nen el objetivo para restaurar los PS\ndel usuario.") },
            { PBEMove.MegaDrain, new PBELocalizedString("A nutrient-draining attack. The user's\nHP is restored by half the damage taken\nby the target.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Attacke, die die Hälfte des\nSchadens absorbiert.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "ようぶんを　すいとり　こうげきする。\nあいてに　あたえた　ダメージの\nはんぶんの　ＨＰを　かいふくできる。", "養分を　吸い取り　攻撃する。\n相手に　与えた　ダメージの\n半分の　ＨＰを　回復できる。", "양분을 흡수하여 공격한다.\n상대에게 입힌 데미지의\n절반에 해당하는 HP를 회복할 수 있다.", "Absorbe la mitad del daño producido\nen el objetivo para restaurar los PS\ndel usuario.") },
            { PBEMove.LeechSeed, new PBELocalizedString("A seed is planted on the target. It steals\nsome HP from the target every turn.", "Une graine est semée sur l'ennemi.\nÀ chaque tour, elle lui dérobe des PV\nque le lanceur récupère.", "Ziel wird bepflanzt und verliert jede\nRunde KP, die ein Pokémon aus dem\nTeam des Anwenders heilen.", "Vengono piantati semi sul bersaglio. Questi\nsottraggono PS a ogni turno permettendo\na chi la usa di curarsi.", "うえつけた　あいての　ＨＰを\nまいターン　すこしだけ　すいとり\nじぶんの　ＨＰを　かいふく　する。", "植えつけた　相手の　ＨＰを\n毎ターン　少しだけ　吸い取り\n自分の　ＨＰを　回復する。", "씨가 뿌려진 상대의 HP를\n매 턴 조금씩 흡수하여\n자신의 HP를 회복한다.", "Planta semillas que absorben PS\npara recuperar la salud del usuario\nen cada turno.") },
            { PBEMove.Growth, new PBELocalizedString("The user's body grows all at once,\nraising the Attack and Sp. Atk stats.", "Le corps du lanceur se développe.\nAugmente l'Attaque et l'Attaque Spéciale.", "Der Körper wächst. Dadurch steigen\nAngriff und Spezial-Angriff.", "Provoca la crescita immediata del corpo\ne l'aumento dell'Attacco e dell'Attacco\nSpeciale di chi la usa.", "からだを　いっきに\nおおきく　せいちょう　させて\nこうげきと　とくこうを　あげる。", "体を　一気に\n大きく　生長させて\n攻撃と　特攻を　あげる。", "몸을 일시에\n크게 성장시켜\n공격과 특수공격을 올린다.", "El cuerpo del usuario crece a\nmarchas forzadas y aumenta\nel Ataque y el Ataque Especial.") },
            { PBEMove.RazorLeaf, new PBELocalizedString("Sharp-edged leaves are launched\nto slash at the opposing team.\nCritical hits land more easily.", "Des feuilles aiguisées comme des\nrasoirs entaillent l'ennemi.\nTaux de critiques élevé.", "Trifft das Ziel mit Blättern.\nHohe Volltrefferquote.", "Foglie taglienti sferzano i nemici.\nProbabile brutto colpo.", "はっぱを　とばして　\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "はっぱを　とばして　\n相手を　切りつけて　攻撃する。\n急所に　当たりやすい。", "잎사귀를 날려\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Corta con hojas afiladas.\nSuele ser crítico.") },
            // { PBEMove.76, new PBELocalizedString("A two-turn attack. The user gathers\nlight, then blasts a bundled beam on the\nsecond turn.", "Absorbe la lumière au premier tour\net envoie un rayon puissant au\ntour suivant.", "Absorbiert Licht in Runde 1.\nIn Runde 2 erfolgt der Angriff.", "Chi la usa assorbe luce al primo turno per\nproiettare un raggio intenso al turno\nsuccessivo.", "１ターンめに　ひかりを　いっぱいに\nあつめ　２ターンめに　ひかりの　たばを\nはっしゃして　こうげきする。", "１ターン目に　光を　いっぱいに　集め\n２ターン目に　光の　束を\n発射して　攻撃する。", "1턴째에 빛을 가득 모아\n2턴째에 빛의 다발을\n발사하여 공격한다.", "Primer turno: absorbe luz.\nSegundo turno: ataca.") },
            { PBEMove.PoisonPowder, new PBELocalizedString("The user scatters a cloud of poisonous\ndust on the target. It may poison\nthe target.", "Une poudre toxique empoisonne l'ennemi.", "Verstreut giftigen Puder auf das Ziel.", "Investe il bersaglio con una nuvola di\npolvere tossica che avvelena.", "どくの　ある　こなを\nたくさん　ふりまいて\nあいてを　どく　じょうたいに　する。", "毒の　ある　粉を\nたくさん　ふりまいて\n相手を　毒状態に　する。", "독이 있는 가루를\n많이 흩뿌려서\n상대를 독 상태로 만든다.", "Polvo tóxico que envenena al objetivo.") },
            { PBEMove.StunSpore, new PBELocalizedString("The user scatters a cloud of paralyzing\npowder. It may leave the target\nwith paralysis.", "Le lanceur répand sur l'ennemi une\npoudre qui le paralyse.", "Verstreut lähmenden Puder.", "Investe il bersaglio con una nuvola di\npolvere che paralizza.", "しびれる　こなを\nたくさん　ふりまいて\nあいてを　まひ　じょうたいに　する。", "しびれる　粉を\nたくさん　ふりまいて\n相手を　まひ状態に　する。", "저리 가루를\n많이 흩뿌려서\n상대를 마비 상태로 만든다.", "Esparce polvo que paraliza al objetivo.") },
            { PBEMove.SleepPowder, new PBELocalizedString("The user scatters a big cloud\nof sleep-inducing dust\naround the target.", "Le lanceur répand une poudre\nsoporifique qui endort la cible.", "Verstreut Schlafpuder, der das\nZiel eventuell in Schlaf versetzt.", "Investe il bersaglio con una grande nuvola\ndi polvere soporifera che lo fa\naddormentare.", "ねむくなる　こなを\nたくさん　ふりまいて\nあいてを　ねむり　じょうたいに　する。", "眠くなる　粉を\nたくさん　ふりまいて\n相手を　眠り状態に　する。", "잠이 오는 가루를\n많이 흩뿌려서\n상대를 잠듦 상태로 만든다.", "Esparce polvo que duerme al objetivo.") },
            // { PBEMove.80, new PBELocalizedString("The user attacks the target by scattering\npetals for two to three turns.\nThe user then becomes confused.", "Le lanceur attaque en projetant\ndes pétales pendant 2 à 3 tours\navant de céder à la confusion.", "Angriff mit Blütenblättern für 2 bis 3\nRunden. Angreifer wird verwirrt.", "Attacca il nemico cospargendolo di petali\nper due o tre turni, ma chi la usa rimane\nconfuso.", "２ー３ターンの　あいだ　はなを\nまきちらして　あいてを　こうげきする。\nまきちらした　あとは　こんらん　する。", "２ー３ターンの　あいだ　花を\nまきちらして　相手を　攻撃する。\nまきちらした　あとは　混乱する。", "2-3턴 동안 꽃을\n흩뿌려서 상대를 공격한다.\n흩뿌린 뒤에는 혼란에 빠진다.", "Lanza pétalos de dos a tres turnos\ny acaba confundiendo al atacante.") },
            { PBEMove.StringShot, new PBELocalizedString("The targets are bound with silk blown\nfrom the user's mouth. This silk reduces\nthe targets' Speed stat.", "Le lanceur crache de la\nsoie pour ligoter l'ennemi\net baisser sa Vitesse.", "Umwickelt Gegner in der Nähe mit\nFäden aus dem Mund und senkt\nden Initiative-Wert.", "Chi la usa produce della seta che avvolge\ni nemici e ne riduce la Velocità.", "くちから　ふきだした　いとを　まきつけて\nあいての　すばやさを　さげる。\n", "口から　吹きだした　糸を　まきつけて\n相手の　素早さを　さげる。\n", "입에서 뿜어낸 실을 휘감아서\n상대의 스피드를 떨어뜨린다.", "Lanza seda al objetivo y reduce\nsu Velocidad.") },
            { PBEMove.DragonRage, new PBELocalizedString("This attack hits the target with a shock\nwave of pure rage. This attack always\ninflicts 40 HP damage.", "La colère du lanceur déclenche une onde\nde choc destructrice qui inflige\ntoujours 40 PV de dégâts.", "Stößt eine wutgeladene Schockwelle aus,\ndie stets 40 KP Schaden anrichtet.", "Colpisce il nemico con un'onda d'urto\ngenerata dall'ira. Questo attacco\nprovoca sempre un danno di 40 PS.", "いかりの　しょうげきはを\nあいてに　ぶつけて　こうげきする。\n４０の　ダメージを　きまって　あたえる。", "怒りの　衝撃波を\n相手に　ぶつけて　攻撃する。\n４０の　ダメージを　決まって　与える。", "분노의 충격파를\n상대에게 부딪쳐서 공격한다.\n언제나 40의 데미지를 준다.", "Ráfaga de furiosas ondas de choque\nque quitan 40 PS.") },
            // { PBEMove.83, new PBELocalizedString("The target becomes trapped within a\nfierce vortex of fire that rages for four\nto five turns.", "Un tourbillon de flammes emprisonne\nl'ennemi pendant 4 à 5 tours.", "Das Ziel wird für 4 bis 5 Runden in\neinem Feuerkreis gefangen.", "Intrappola il bersaglio in un turbine di\nfuoco che dura per quattro o cinque turni.", "はげしく　うずをまく　ほのおの　なかに\n４ー５ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "激しく　渦をまく　炎の中に\n４ー５ターンの　あいだ\n相手を　閉じこめて　攻撃する。", "세차게 소용돌이치는 불꽃 속에\n4-5턴 동안\n상대를 가두어 공격한다.", "Un aro de fuego que atrapa al objetivo\nde cuatro a cinco turnos.") },
            { PBEMove.ThunderShock, new PBELocalizedString("A jolt of electricity is hurled\nat the target to inflict damage. It may\nalso leave the target with paralysis.", "Une décharge électrique tombe sur\nl'ennemi. Peut aussi le paralyser.", "Eine Elektro-Attacke, die das\nZiel eventuell paralysiert.", "Danneggia il bersaglio con una scarica\nelettrica che può anche paralizzarlo.", "でんきの　しげきを\nあいてに　あびせて　こうげきする。\nまひ　じょうたいに　することが　ある。", "電気の　刺激を\n相手に　浴びせて　攻撃する。\nまひ状態に　することが　ある。", "전기 자극을\n상대에게 날려서 공격한다.\n마비 상태로 만들 때가 있다.", "Ataque eléctrico que puede paralizar\nal objetivo.") },
            { PBEMove.Thunderbolt, new PBELocalizedString("A strong electric blast is loosed at the\ntarget. It may also leave the target\nwith paralysis.", "Une grosse décharge électrique tombe\nsur l'ennemi. Peut aussi le paralyser.", "Eine starke Elektro-Attacke, die das\nZiel eventuell paralysiert.", "Il bersaglio viene colpito da una potente\nscarica elettrica che può anche\nparalizzarlo.", "つよい　でんげきを\nあいてに　あびせて　こうげきする。\nまひ　じょうたいに　することが　ある。", "強い　電撃を\n相手に　浴びせて　攻撃する。\nまひ状態に　することが　ある。", "강한 전격을\n상대에게 날려서 공격한다.\n마비 상태로 만들 때가 있다.", "Potente ataque eléctrico que puede\nparalizar al objetivo.") },
            { PBEMove.ThunderWave, new PBELocalizedString("A weak electric charge is launched at\nthe target. It causes paralysis if it hits.", "Un faible choc électrique frappe\nl'ennemi. Si l'attaque touche,\ncelui-ci est paralysé.", "Ein schwacher Stromstoß, der\ndas Ziel paralysiert.", "Il nemico viene colpito da una debole\nscarica elettrica che, se va a segno,\nne causa la paralisi.", "よわい　でんげきを　あびせる　ことで\nあいてを　まひ　じょうたいに　する。\n", "弱い　電撃を　浴びせることで\n相手を　まひ状態に　する。\n", "약한 전격을 날려서\n상대를 마비 상태로 만든다.", "Una ligera descarga que paraliza\nal objetivo si lo alcanza.") },
            { PBEMove.Thunder, new PBELocalizedString("A wicked thunderbolt is dropped\non the target to inflict damage. It may\nalso leave the target with paralysis.", "La foudre tombe sur l'ennemi\npour lui infliger des dégâts.\nPeut aussi le paralyser.", "Eine verheerende Elektro-Attacke,\ndie das Ziel eventuell paralysiert.", "Il nemico è colpito da un lampo molto\nviolento che può anche paralizzarlo.", "はげしい　かみなりを\nあいてに　おとして　こうげきする。\nまひ　じょうたいに　することが　ある。", "激しい　雷を\n相手に　落として　攻撃する。\nまひ状態に　することが　ある。", "강한 번개를\n상대에게 떨어뜨려 공격한다.\n마비 상태로 만들 때가 있다.", "Un poderoso rayo que daña al objetivo\ny puede paralizarlo.") },
            { PBEMove.RockThrow, new PBELocalizedString("The user picks up and throws a small\nrock at the target to attack.", "Le lanceur lâche une\npierre sur l'ennemi.", "Das Ziel wird mit einem kleinen\nStein beworfen.", "Chi la usa solleva una roccia e la\nlancia contro il nemico.", "ちいさな　いわを　もちあげて\nあいてに　なげつけて　こうげきする。\n", "小さな　岩を　持ちあげて\n相手に　投げつけて　攻撃する。\n", "작은 바위를 들어올려\n상대에게 내던져서 공격한다.", "Tira una pequeña roca al objetivo.") },
            { PBEMove.Earthquake, new PBELocalizedString("The user sets off an earthquake that\nstrikes those around it.", "Le lanceur provoque un tremblement\nde terre touchant tous les Pokémon\nautour de lui.", "Ein mächtiges Beben, das die anderen\nPokémon in der Nähe des Anwenders\ntrifft.", "Chi la usa provoca un potente sisma\nche colpisce gli altri Pokémon in campo.", "じしんの　しょうげきで　じぶんの\nまわりに　いるものを　こうげきする。\n", "地震の　衝撃で　自分の\n周りに　いるものを　攻撃する。\n", "지진의 충격으로 자신의\n주위에 있는 포켓몬을 공격한다.", "Un terremoto que afecta a los Pokémon\nde alrededor en combate.") },
            { PBEMove.Fissure, new PBELocalizedString("The user opens up a fissure in the ground\nand drops the target in.\nThe target instantly faints if it hits.", "Le lanceur fait tomber l'ennemi dans une\ncrevasse. Si cette attaque réussit,\nelle met K.O. sur le coup.", "Das Ziel wird in eine Erdspalte\ngeworfen. Ist die Attacke erfolgreich,\nführt sie zu einem K.O.", "Chi la usa crea una spaccatura nel terreno\ne cerca di gettarvici dentro il nemico. Se\nva a segno, il nemico va KO.", "じわれの　さけめに\nあいてを　おとして　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "地割れの　裂け目に\n相手を　落として　攻撃する。\n当たれば　一撃で　ひんしに　する。", "땅이 갈라진 곳에\n상대를 떨어뜨려 공격한다.\n맞으면 일격에 기절한다.", "Abre una grieta en el suelo y mete al\nobjetivo en ella. Fulmina en un golpe.") },
            { PBEMove.Dig, new PBELocalizedString("The user burrows, then attacks\non the second turn.\nIt can also be used to exit dungeons.", "Le lanceur creuse au 1⑩ tour et\nfrappe au 2⒅. Permet aussi de\ns'échapper d'un donjon.", "In Runde 1 eingraben und in Runde 2 an-\ngreifen. Macht Flucht aus Höhlen möglich.", "Chi la usa scava al primo turno e attacca\nal successivo. Fuori dalla lotta fa uscire\nda alcuni luoghi.", "１ターンめに　もぐり　２ターンめで\nあいてを　こうげきする。どうくつ\nからの　だっしゅつも　できる。", "１ターン目に　潜り　２ターン目で\n相手を　攻撃する。\nどうくつからの　脱出も　できる。", "1턴째에 파고들어 2턴째에\n상대를 공격한다.\n동굴에서 탈출할 수도 있다.", "Primer turno: cava.\nSegundo turno: ataca.\nTambién sirve para salir de ciertas zonas.") },
            { PBEMove.Toxic, new PBELocalizedString("A move that leaves the target\nbadly poisoned.\nIts poison damage worsens every turn.", "Empoisonne gravement l'ennemi. Les dégâts\ndus au poison augmentent à chaque tour.", "Vergiftet das Ziel mit einem potenten\nToxin schwer. Vergiftung wird von Runde\nzu Runde stärker.", "Iperavvelena il nemico con una potente\ntossina. Il danno peggiora ad ogni turno.", "あいてを　もうどくの\nじょうたいに　する。ターンが　すすむほど\nどくの　ダメージが　ふえていく。", "相手を　猛毒の　状態に　する。\nターンが　すすむほど\n毒の　ダメージが　増えていく。", "상대를 맹독의 상태로 만든다.\n턴이 진행될수록\n독의 데미지가 증가한다.", "Envenena gravemente al objetivo y causa\nun daño mayor en cada turno.") },
            { PBEMove.Confusion, new PBELocalizedString("The target is hit by a weak telekinetic\nforce. It may also leave the\ntarget confused.", "Une faible vague télékinésique\nfrappe l'ennemi. Peut aussi le\nplonger dans la confusion.", "Das Ziel wird von schwacher\ntelekinetischer Energie getroffen\nund eventuell verwirrt.", "Colpisce il nemico con una leggera forza\ntelecinetica e può anche confonderlo.", "よわい　ねんりきを\nあいてに　おくって　こうげきする。\nあいてを　こんらん　させることが　ある。", "弱い　念力を\n相手に　送って　攻撃する。\n相手を　混乱させることが　ある。", "약한 염동력을\n상대에게 보내어 공격한다.\n상대를 혼란시킬 때가 있다.", "Débil ataque telequinético que puede\ncausar confusión.") },
            { PBEMove.Psychic, new PBELocalizedString("The target is hit by a strong telekinetic\nforce. It may also reduce the target's\nSp. Def stat.", "Une puissante force télékinésique\nfrappe l'ennemi. Peut aussi faire\nbaisser sa Défense Spéciale.", "Starke Psycho-Attacke, die eventuell die\nSpezial-Verteidigung des Zieles senkt.", "Il nemico viene colpito da una potente\nforza telecinetica che può anche ridurne\nla Difesa Speciale.", "つよい　ねんりきを　あいてに　おくって\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "強い　念力を　相手に　送って\n攻撃する。相手の　特防を\nさげることが　ある。", "강한 염동력을 상대에게 보내어\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Fuerte ataque telequinético que puede\nbajar la Defensa Especial del objetivo.") },
            { PBEMove.Hypnosis, new PBELocalizedString("The user employs hypnotic suggestion\nto make the target fall into a deep sleep.", "Le lanceur hypnotise l'ennemi pour le\nplonger dans un profond sommeil.", "Hypno-Attacke, die das Ziel\nin Schlaf versetzt.", "Chi la usa si avvale della suggestione\nipnotica per far addormentare il nemico.", "ねむけを　さそう　あんじを　かけて\nあいてを　ねむり　じょうたいに　する。\n", "眠気を　誘う　暗示を　かけて\n相手を　眠り状態に　する。\n", "졸음을 유도하는 암시를 걸어서\n상대를 잠듦 상태로 만든다.", "Ataque hipnótico que hace dormir\nprofundamente al objetivo.") },
            { PBEMove.Meditate, new PBELocalizedString("The user meditates to awaken the power\ndeep within its body and raise its\nAttack stat.", "Le lanceur médite pour éveiller son\npouvoir latent et augmenter son Attaque.", "Anwender aktiviert Kräfte, die tief in\nseinem Inneren schlummern, und\nsteigert so seinen Angriffs-Wert.", "Chi la usa medita per risvegliare la propria\nforza interiore e migliorare l'Attacco.", "ねむっている　ちからを\nからだの　おくから　ひきだして\nじぶんの　こうげきを　あげる。", "眠っている　力を\n体の　奥から　ひきだして\n自分の　攻撃を　あげる。", "잠들어 있는 힘을\n몸속에서 끌어내어\n자신의 공격을 올린다.", "El usuario reposa y medita para potenciar\nel Ataque.") },
            { PBEMove.Agility, new PBELocalizedString("The user relaxes and lightens its body to\nmove faster. It sharply boosts\nthe Speed stat.", "Le lanceur se relaxe et allège son corps\npour augmenter considérablement\nsa Vitesse.", "Entspannt den Körper, um den\nInitiative-Wert stark zu steigern.", "Chi la usa rilassa e alleggerisce il proprio\ncorpo per far salire di molto la Velocità.", "ちからを　ぬいて　からだを　かるくして\nこうそくで　うごく。\nじぶんの　すばやさを　ぐーんと　あげる。", "力を　ぬいて　体を　軽くして\n高速で　動く。\n自分の　素早さを　ぐーんと　あげる。", "힘을 빼고 몸을 가볍게 해서\n고속으로 움직인다.\n자신의 스피드를 크게 올린다.", "Relaja el cuerpo para ganar\nmucha Velocidad.") },
            { PBEMove.QuickAttack, new PBELocalizedString("The user lunges at the target at a speed\nthat makes it almost invisible. It is sure\nto strike first.", "Le lanceur fonce sur l'ennemi si rapidement\nqu'on parvient à peine à le discerner.\nFrappe en premier.", "Sehr schneller Angriff mit\nErstschlaggarantie.", "Chi la usa colpisce sempre per primo e\nad una tale velocità da rendersi quasi\ninvisibile.", "めにも　とまらぬ　ものすごい　はやさで\nあいてに　つっこむ。\nかならず　せんせい　こうげき　できる。", "目にも　留まらぬ　ものすごい　速さで\n相手に　つっこむ。\n必ず　先制攻撃　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진한다.\n반드시 선제공격할 수 있다.", "Ataque rápido que permite golpear\nen primer lugar.") },
            // { PBEMove.99, new PBELocalizedString("As long as this move is in use, the power\nof rage raises the Attack stat each\ntime the user is hit in battle.", "Une fois activée, cette capacité augmente\nl'Attaque du lanceur à mesure que celui-ci\nsubit des attaques.", "Erhöht Angriff des Anwenders, wenn\ndieser getroffen wird, solange die\nAttacke aktiviert ist.", "Questa mossa ha il potere di aumentare\nla statistica Attacco ogni volta che chi\nla usa viene colpito durante una lotta.", "わざを　だしたときに　こうげきを\nうけると　いかりの　ちからで\nこうげきが　あがる。", "技を　だしたときに　攻撃を\n受けると　怒りの　力で\n攻撃が　あがる。", "기술을 썼을 때 공격을\n받으면 분노의 힘으로\n공격이 올라간다.", "Al usarse, aumenta el Ataque del\nusuario cada vez que es golpeado.") },
            { PBEMove.Teleport, new PBELocalizedString("Use it to flee from any wild Pokémon.\nIt can also warp to the last Pokémon\nCenter visited.", "Permet de fuir un Pokémon sauvage.\nPermet aussi de revenir au dernier\nCentre Pokémon visité.", "Flieht sofort vor wilden Pokémon.\nWarp zum letzten Pokémon-Center.", "Fa fuggire dai Pokémon selvatici.\nFuori dalla lotta porta all'ultimo\nCentro Pokémon visitato.", "やせい　ポケモンとの　せんとうを\nやめる。さいごに　はいった\nポケセンの　ある　まちにも　いける。", "野生ポケモンとの　戦闘を　やめる。\n最後に　はいった\nポケセンの　ある　街にも　行ける。", "야생 포켓몬과 배틀을 그만둔다.\n마지막에 들어갔던\n포켓몬센터가 있는 도시에도 갈 수 있다.", "Permite huir al instante de combates\ncontra Pokémon salvajes o viajar\nal último Centro Pokémon visitado.") },
            { PBEMove.NightShade, new PBELocalizedString("The user makes the target see a\nfrightening mirage. It inflicts damage\nmatching the user's level.", "Le lanceur invoque un mirage. Inflige des\ndégâts équivalents au niveau du lanceur.", "Das Ziel sieht eine Illusion. Richtet\nSchaden gemäß dem Level des\nAnwenders an.", "Fa apparire un orribile miraggio al nemico\ne infligge un danno pari al livello di chi\nla usa.", "おそろしい　まぼろしを　みせて\nじぶんの　レベルと　おなじ　だけの\nダメージを　あいてに　あたえる。", "恐ろしい　幻を　みせて\n自分の　レベルと　同じだけの\nダメージを　相手に　与える。", "무시무시한 환상을 보게 해서\n자신의 레벨과 똑같은 만큼의\n데미지를 상대에게 준다.", "Produce un espejismo ante el\nobjetivo, que pierde tantos PS\ncomo nivel tenga el agresor.") },
            // { PBEMove.102, new PBELocalizedString("The user copies the target's last move.\nThe move can be used during battle\nuntil the Pokémon is switched out.", "Le lanceur copie la dernière capacité\nutilisée par la cible et la conserve\ntant qu'il reste au combat.", "Kopiert die zuvor ausgeführte Attacke\ndes Zieles. Kann im Kampf bis zur\nAuswechslung verwendet werden.", "Copia l'ultima mossa usata dal bersaglio.\nLa mossa copiata si può utilizzare fino\nalla sostituzione del Pokémon.", "あいてが　さいごに　つかった　わざを\nせんとうの　あいだ\nじぶんの　わざに　することが　できる。", "相手が　最後に　使った　技を\n戦闘の　あいだ\n自分の　技に　することが　できる。", "상대가 마지막에 사용한 기술을\n배틀을 하는 동안\n자신의 기술로 만들 수 있다.", "Copia el último movimiento usado por\nel objetivo. Dicho movimiento se podrá usar\nmientras el Pokémon no sea cambiado.") },
            { PBEMove.Screech, new PBELocalizedString("An earsplitting screech harshly reduces\nthe target's Defense stat.", "Cri strident qui baisse beaucoup\nla Défense ennemie.", "Stößt einen Schrei aus, um die\nVerteidigung des Zieles stark\nzu senken.", "Stridio assordante che riduce di molto\nla Difesa del nemico.", "おもわず　みみを　ふさぎたくなる\nいやなおとを　だして\nあいての　ぼうぎょを　がくっと　さげる。", "おもわず　耳を　ふさぎたくなる\nいやなおとを　だして\n相手の　防御を　がくっと　さげる。", "그만 귀를 막아버리고 싶은\n싫은 소리를 내어\n상대의 방어를 크게 떨어뜨린다.", "Alarido agudo que reduce mucho\nla Defensa del objetivo.") },
            { PBEMove.DoubleTeam, new PBELocalizedString("By moving rapidly, the user makes illusory\ncopies of itself to raise its evasiveness.", "Le lanceur se déplace si vite qu'il\ncrée des copies illusoires de lui,\naugmentant son Esquive.", "Erzeugt durch schnelle Bewegungen\nEbenbilder, um den Fluchtwert zu erhöhen.", "Chi la usa si muove in fretta e crea copie\nillusorie di se stesso che aumentano\nla capacità di elusione.", "すばやい　うごきで　ぶんしんを　つくり\nあいてを　まどわせて\nかいひりつを　あげる。", "素早い　動きで　分身を　つくり\n相手を　まどわせて\n回避率を　あげる。", "재빠른 움직임으로 분신을 만들어\n상대를 혼란시켜\n회피율을 올린다.", "Crea copias de sí mismo para mejorar\nla Evasión.") },
            { PBEMove.Recover, new PBELocalizedString("Restoring its own cells, the user\nrestores its own HP by half of\nits max HP.", "Un soin qui permet au lanceur de récupérer\njusqu'à la moitié de ses PV max.", "Eine Selbstheilung. KP des Anwenders\nwerden um 50 % des maximalen Wertes\naufgefüllt.", "Mossa autocurativa. Chi la usa recupera\nmetà dei PS massimi.", "さいぼうを　さいせい　させて\nじぶんの　さいだい　ＨＰの\nはんぶんの　ＨＰを　かいふく　する。", "細胞を　再生させて\n自分の　最大ＨＰの\n半分の　ＨＰを　回復する。", "세포를 재생시켜\n자신의 최대 HP의\n절반만큼 HP를 회복한다.", "Restaura hasta la mitad de los PS máximos.") },
            { PBEMove.Harden, new PBELocalizedString("The user stiffens all the muscles in its\nbody to raise its Defense stat.", "Le lanceur contracte tous ses muscles\npour augmenter sa Défense.", "Stärkt die Muskulatur und\nerhöht den Verteidigungs-Wert.", "Tutti i muscoli del corpo si tonificano\nper aumentare la Difesa.", "ぜんしんに　ちからを　こめて\nからだを　かたくして\nじぶんの　ぼうぎょを　あげる。", "全身に　力を　こめて\n体を　硬くして\n自分の　防御を　あげる。", "전신에 힘을 담아\n몸을 단단하게 해서\n자신의 방어를 올린다.", "Tensa la musculatura del usuario\npara aumentar la Defensa.") },
            { PBEMove.Minimize, new PBELocalizedString("The user compresses its body\nto make itself look smaller,\nwhich sharply raises its evasiveness.", "Le lanceur comprime son corps pour se\nfaire tout petit et augmenter fortement\nson Esquive.", "Anwender schrumpft, um seinen\nFluchtwert stark zu erhöhen.", "Il corpo di chi la usa si comprime e diventa\npiù piccolo. La sua capacità di elusione\naumenta di molto.", "からだを　ちぢめて　ちいさく　みせて\nじぶんの　かいひりつを\nぐーんと　あげる。", "体を　ちぢめて　小さく　みせて\n自分の　回避率を\nぐーんと　あげる。", "몸을 축소하여 작게 보임으로써\n자신의 회피율을 크게 올린다.", "El usuario mengua para aumentar\nmucho la Evasión.") },
            { PBEMove.SmokeScreen, new PBELocalizedString("The user releases an obscuring cloud\nof smoke or ink. It reduces the\ntarget's accuracy.", "Le lanceur disperse un nuage d'encre ou\nde fumée. Réduit la Précision de l'ennemi.", "Senkt Genauigkeit des Zieles mit\nRauch, Tinte oder Ähnlichem.", "Nuvola di fumo o inchiostro che riduce\nla precisione del nemico.", "けむりや　スミなどを　ふきかけて\nあいての　めいちゅうりつを　さげる。\n", "煙や　墨などを　吹きかけて\n相手の　命中率を　さげる。\n", "연기나 먹물을 내뿜어\n상대의 명중률을 떨어뜨린다.", "Baja la Precisión del objetivo con una nube\nde humo o tinta.") },
            { PBEMove.ConfuseRay, new PBELocalizedString("The target is exposed to a sinister\nray that triggers confusion.", "Un rayon sinistre qui plonge l'ennemi\ndans un état de confusion.", "Ein fieser Strahl, der das Ziel\nverwirrt.", "Colpisce il nemico con un raggio funesto\nche lo confonde.", "あやしい　ひかりを　\nあいてに　みせて　まどわせる。\nあいてを　こんらん　させる。", "怪しい　光を　\n相手に　みせて　まどわせる。\n相手を　混乱させる。", "이상한 빛을\n상대에게 비춰 당황하게 한다.\n상대를 혼란시킨다.", "Rayo siniestro que confunde al objetivo.") },
            { PBEMove.Withdraw, new PBELocalizedString("The user withdraws its body into its hard\nshell, raising its Defense stat.", "Le lanceur se recroqueville dans sa\ncarapace, ce qui augmente sa Défense.", "Rückzug in den harten Panzer.\nErhöht den Verteidigungs-Wert.", "Il corpo si ritira nel suo duro guscio\nper aumentare la Difesa.", "からに　もぐりこんで　みをまもり\nじぶんの　ぼうぎょを　あげる。\n", "殻に　潜りこんで　身を守り\n自分の　防御を　あげる。\n", "껍질에 숨어 몸을 보호하여\n자신의 방어를 올린다.", "El usuario se protege en su coraza y sube\nla Defensa.") },
            { PBEMove.DefenseCurl, new PBELocalizedString("The user curls up to conceal weak spots\nand raise its Defense stat.", "Le lanceur s'enroule pour cacher ses\npoints faibles, ce qui augmente sa Défense.", "Verbirgt Schwächen durch Einrollen und\nhebt gleichzeitig den Verteidigungs-Wert.", "Chi la usa si raggomitola per nascondere\ni punti deboli e aumentare la propria\nDifesa.", "からだを　まるめて　ちぢこまり\nじぶんの　ぼうぎょを　あげる。\n", "体を　まるめて　ちぢこまり\n自分の　防御を　あげる。\n", "몸을 둥글게 웅크려서\n자신의 방어를 올린다.", "Se enrosca para ocultar su punto débil.\nSube la Defensa.") },
            { PBEMove.Barrier, new PBELocalizedString("The user throws up a sturdy wall that\nsharply raises its Defense stat.", "Le lanceur érige un mur solide qui\naugmente fortement sa Défense.", "Erzeugt eine Barriere, die den\nVerteidigungs-Wert stark erhöht.", "Innalza una barriera resistente che\naumenta molto la Difesa.", "がんじょうな　かべを　つくって\nじぶんの　ぼうぎょを　ぐーんと　あげる。\n", "頑丈な　壁を　つくって\n自分の　防御を　ぐーんと　あげる。\n", "튼튼한 장막을 만들어\n자신의 방어를 크게 올린다.", "Crea una barrera para aumentar\nmucho la Defensa.") },
            { PBEMove.LightScreen, new PBELocalizedString("A wondrous wall of light is put up to\nsuppress damage from special attacks\nfor five turns.", "Un fabuleux mur de lumière qui réduit les\ndégâts causés par les attaques spéciales\ndurant 5 tours.", "Erzeugt eine Lichtwand und senkt Schaden\ndurch Spezial-Angriffe für fünf Runden.", "Innalza una barriera di luce fantastica\nper ridurre i danni degli attacchi\nspeciali alla squadra per cinque turni.", "５ターンの　あいだ　ふしぎな　かべで\nあいてから　うける　とくしゅ　こうげきの\nダメージを　よわめる。", "５ターンの　あいだ　不思議な　かべで\n相手から　受ける　特殊攻撃の\nダメージを　弱める。", "5턴 동안 이상한 장막으로\n상대로부터 받는 특수공격의\n데미지를 약하게 한다.", "Pared de luz que reduce durante\ncinco turnos el daño producido\npor los ataques especiales.") },
            // { PBEMove.114, new PBELocalizedString("The user creates a haze that eliminates\nevery stat change among all the Pokémon\nengaged in battle.", "Un brouillard qui annule les\nchangements de stats de tous\nles Pokémon au combat.", "Erzeugt einen dunklen Nebel. Alle\nVeränderungen der Statuswerte der\nKampfteilnehmer werden annulliert.", "Chi la usa crea una nube nera che annulla\nogni modifica delle statistiche di tutti\ni Pokémon in campo.", "くろいきりを　だして　せんとうに\nでている　ポケモン　ぜんいんの\nのうりょく　へんかを　もとに　もどす。", "黒い霧を　だして　戦闘に\nでている　ポケモン　全員の\n能力変化を　もとに　もどす。", "흑안개를 뿜어 배틀에\n참가 중인 포켓몬 전원의\n능력 변화를 원래대로 돌린다.", "Neblina que elimina los cambios\nde características de todos\nlos Pokémon en combate.") },
            { PBEMove.Reflect, new PBELocalizedString("A wondrous wall of light is put up to\nsuppress damage from physical attacks\nfor five turns.", "Un fabuleux mur de lumière qui réduit les\ndégâts causés par les attaques physiques\ndurant 5 tours.", "Eine mysteriöse Wand, die fünf Runden den\nSchaden von physischen gegnerischen\nTreffern reduziert.", "Innalza una barriera di luce fantastica\nper ridurre i danni degli attacchi fisici\nalla squadra per cinque turni.", "５ターンの　あいだ　ふしぎな　かべで\nあいてから　うける　ぶつり　こうげきの\nダメージを　よわめる。", "５ターンの　あいだ　不思議な　かべで\n相手から　受ける　物理攻撃の\nダメージを　弱める。", "5턴 동안 이상한 장막으로\n상대로부터 받는 물리공격의\n데미지를 약하게 한다.", "Pared de luz que reduce durante\ncinco turnos el daño producido\npor los ataques físicos.") },
            { PBEMove.FocusEnergy, new PBELocalizedString("The user takes a deep breath and\nfocuses so that critical hits land\nmore easily.", "Le lanceur prend une profonde inspiration\net se concentre pour augmenter son taux\nde critiques.", "Anwender atmet ein und bündelt Kraft.\nDie Volltrefferquote steigt dadurch.", "Chi la usa fa un profondo respiro e si\nconcentra per rendere più probabili\ni brutti colpi.", "ふかく　いきを　すい　きあいを　こめる。\nじぶんの　こうげきが\nきゅうしょに　あたりやすく　なる。", "深く　息を　吸い　気合を　こめる。\n自分の　攻撃が\n急所に　当たりやすくなる。", "깊게 숨을 들이마셔 기합을 넣는다.\n자신의 공격이\n급소에 맞기 쉬워진다.", "Concentra energía para aumentar\nlas posibilidades de un golpe crítico.") },
            // { PBEMove.117, new PBELocalizedString("The user endures attacks for two\nturns, then strikes back to cause\ndouble the damage taken.", "Le lanceur encaisse les coups durant 2\ntours et réplique en infligeant le double\ndes dégâts subis.", "Erträgt zwei Runden Angriffe und schlägt\ndann mit dem doppelten Wert des erlittenen\nSchadens zurück.", "Chi la usa subisce attacchi per due turni\ne poi restituisce il danno moltiplicato\nper due.", "２ターンの　あいだ　こうげきに　たえて\nうけた　ダメージを　２ばいに　して\nあいてに　かえす。", "２ターンの　あいだ　攻撃に　たえて\n受けた　ダメージを　２倍にして\n相手に　返す。", "2턴 동안 공격을 견뎌\n입은 데미지를 2배로 만들어\n상대에게 돌려준다.", "Espera dos turnos para atacar\ncon el doble de potencia del\ndaño recibido.") },
            { PBEMove.Metronome, new PBELocalizedString("The user waggles a finger and stimulates\nits brain into randomly using nearly\nany move.", "Agite un doigt et stimule le cerveau\npour utiliser presque n'importe\nquelle capacité au hasard.", "Bewegt Finger, um das Gehirn zu\nstimulieren. Wählt zufällig eine\nAttacke aus.", "Chi la usa fa di no con un dito e stimola il\ncervello a usare a caso una delle tante\nmosse esistenti.", "ゆびをふり　じぶんの　のうを　しげきして\nすべての　わざの　なかから\nどれか　１つを　くりだす。", "指をふり　自分の　脳を　刺激して\nすべての　技の　なかから\nどれか　１つを　くりだす。", "손가락을 흔들어 자신의 뇌를\n자극해서 모든 기술 중\n어느 하나를 날린다.", "El usuario mueve un dedo y\nestimula su cerebro para usar\nal azar casi cualquier movimiento.") },
            // { PBEMove.119, new PBELocalizedString("The user counters the target by mimicking\nthe target's last move.", "Le lanceur riposte à l'attaque de l'ennemi\navec la même attaque.", "Kopiert die letzte Attacke des\nZieles und greift es an.", "Chi la usa colpisce il bersaglio copiandone\nl'ultima mossa usata.", "あいての　つかった　わざを　まねして\nじぶんも　おなじ　わざを　つかう。\n", "相手の　使った　技を　まねして\n自分も　同じ技を　使う。\n", "상대가 사용한 기술을 흉내 내어\n자신도 똑같은 기술을 쓴다.", "Contraataca con el mismo movimiento\nempleado por el objetivo.") },
            { PBEMove.Selfdestruct, new PBELocalizedString("The user attacks everything around it\nby causing an explosion.\nThe user faints upon using this move.", "Le lanceur explose en blessant\ntous les Pokémon autour de lui.\nLe lanceur tombe K.O.", "Anwender sprengt sich, richtet\nrundum Riesenschaden an und\nwird dabei besiegt.", "Chi la usa esplode e infligge danni agli\naltri Pokémon in campo, ma poi va KO.", "ばくはつを　おこして　じぶんの\nまわりに　いるものを　こうげきする。\nつかった　あとに　ひんしに　なる。", "爆発を　おこして　自分の\n周りに　いるものを　攻撃する。\n使ったあとに　ひんしに　なる。", "폭발을 일으켜서 자신의\n주위에 있는 포켓몬을 공격한다.\n쓰고 나서 기절하게 된다.", "El atacante explota y hiere a todos\na su alrededor. El usuario se debilita\nde inmediato.") },
            { PBEMove.EggBomb, new PBELocalizedString("A large egg is hurled at the target\nwith maximum force to inflict damage.", "De toutes ses forces, le lanceur\njette un gros œuf sur l'ennemi\npour lui infliger des dégâts.", "Ein großes Ei wird auf das Ziel\nabgefeuert, um ihm zu schaden.", "Colpisce il nemico con un grande uovo\nscaraventato con enorme forza.", "おおきな　タマゴを　ちから　いっぱい\nあいてに　なげつけて　こうげきする。\n", "大きな　タマゴを　力いっぱい\n相手に　投げつけて　攻撃する。\n", "큰 알을 온 힘을 다해\n상대에게 내던져서 공격한다.", "Arroja un huevo al objetivo con\ngran fuerza.") },
            { PBEMove.Lick, new PBELocalizedString("The target is licked with a long tongue,\ncausing damage. It may also leave\nthe target with paralysis.", "Un grand coup de langue qui inflige des\ndégâts à l'ennemi. Peut aussi le paralyser.", "Leck-Attacke mit langer Zunge.\nDas Ziel wird eventuell\nparalysiert.", "Una lingua lunga infligge danni al nemico e\npuò anche paralizzarlo.", "ながい　したで\nあいてを　なめまわして　こうげきする。\nまひ　じょうたいに　することが　ある。", "長い　舌で\n相手を　なめまわして　攻撃する。\nまひ状態に　することが　ある。", "긴 혀로\n상대를 핥아서 공격한다.\n마비 상태로 만들 때가 있다.", "Una lengua ataca al objetivo.\nPuede causar parálisis.") },
            { PBEMove.Smog, new PBELocalizedString("The target is attacked with a\ndischarge of filthy gases.\nIt may also poison the target.", "Le lanceur attaque à l'aide d'une\néruption de gaz répugnants.\nPeut aussi empoisonner l'ennemi.", "Angriff mit Gas. Das Ziel kann\neventuell vergiftet werden.", "Colpisce il nemico con una scarica di gas\nmaleodoranti. Può anche avvelenarlo.", "よごれた　ガスを\nあいてに　ふきつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "汚れた　ガスを\n相手に　吹きつけて　攻撃する。\n毒状態に　することが　ある。", "더러운 가스를\n상대에게 내뿜어 공격한다.\n독 상태로 만들 때가 있다.", "El objetivo es atacado con gases tóxicos\nque pueden llegar a envenenar.") },
            { PBEMove.Sludge, new PBELocalizedString("Unsanitary sludge is hurled at the target.\nIt may also poison the target.", "Des détritus toxiques sont projetés sur\nl'ennemi. Peut aussi l'empoisonner.", "Wirft Schlamm auf das Ziel,\ndas eventuell vergiftet wird.", "Lancio di fango malsano che arreca danno\nal nemico. Può anche avvelenarlo.", "きたない　ヘドロを\nあいてに　なげつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "汚い　ヘドロを\n相手に　投げつけて　攻撃する。\n毒状態に　することが　ある。", "더러운 오물을\n상대에게 내던져서 공격한다.\n독 상태로 만들 때가 있다.", "Arroja residuos al objetivo.\nPuede llegar a envenenar.") },
            { PBEMove.BoneClub, new PBELocalizedString("The user clubs the target with a bone.\nIt may also make the target flinch.", "Le lanceur frappe l'ennemi à grands\ncoups d'os. Peut aussi apeurer l'ennemi.", "Schlägt das Ziel mit einer Keule\nund verschreckt es eventuell.", "Chi la usa colpisce il nemico con un osso e\npuò farlo anche tentennare.", "てに　もった　ホネで\nあいてを　なぐりつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "手に　持った　ホネで\n相手を　なぐりつけて　攻撃する。\n相手を　ひるませることが　ある。", "손에 들고 있는 뼈로\n상대를 세게 때려서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Aporrea con un hueso.\nPuede hacer retroceder al objetivo.") },
            { PBEMove.FireBlast, new PBELocalizedString("The target is attacked with an intense\nblast of all-consuming fire.\nIt may also leave the target with a burn.", "Un déluge de flammes ardentes submerge\nl'ennemi. Peut aussi le brûler.", "Feuersbrunst, die das Ziel versengt\nund ihm eventuell eine Verbrennung\nzufügt.", "Investe il nemico con un'intensa fiammata\nche fa terra bruciata. Può anche\nscottarlo.", "だいのじの　ほのおで\nあいてを　やきつくす。\nやけど　じょうたいに　することが　ある。", "大の字の　炎で\n相手を　焼きつくす。\nやけど状態に　することが　ある。", "큰 대자의 불꽃으로\n상대를 불태운다.\n화상 상태로 만들 때가 있다.", "Llama intensa que chamusca\ny puede causar quemaduras.") },
            { PBEMove.Waterfall, new PBELocalizedString("The user charges at the target\nand may make it flinch.\nIt can also be used to climb a waterfall.", "Le lanceur charge l'ennemi à une vitesse\nremarquable, ce qui peut l'apeurer.\nPermet aussi de franchir une cascade.", "Eine mächtige Attacke, durch die das\nZiel evtl. zurückschreckt. Wasserfälle\nkönnen damit erklommen werden.", "Carica il nemico a grande velocità e può\nfarlo tentennare. Fuori dalla lotta fa\nrisalire le cascate.", "すごい　いきおいで　あいてに　つっこむ。\nあいてを　ひるませる　ことが　ある。\nたきも　およいで　のぼれる。", "すごい　勢いで　相手に　つっこむ。\n相手を　ひるませることが　ある。\n滝も　泳いで　のぼれる。", "굉장한 기세로 상대에게 돌진한다.\n상대를 풀죽게 만들 때가 있다.\n폭포도 거슬러 올라갈 수 있다.", "Embiste con un gran impulso que puede\nhacer retroceder. También sirve para\nremontar cascadas.") },
            // { PBEMove.128, new PBELocalizedString("The target is clamped and squeezed by\nthe user's very thick and sturdy shell for\nfour to five turns.", "Le lanceur piège l'ennemi dans sa dure\ncoquille et l'écrase pendant 4 à 5 tours.", "Fängt und quetscht das Ziel über\n4 bis 5 Runden durch die harte Schale\ndes Anwenders.", "Chi la usa intrappola e stritola il nemico\ncon la sua corazza spessa e forte per\nquattro o cinque turni.", "とても　がんじょうな　ぶあつい　からに\n４ー５ターンの　あいだ\nあいてを　はさんで　こうげきする。", "とても　頑丈な　ぶあつい　殻に\n４ー５ターンの　あいだ\n相手を　はさんで　攻撃する。", "매우 튼튼하고 두꺼운 껍질에\n4-5턴 동안\n상대를 끼워서 공격한다.", "Atrapa y atenaza con fuerza durante\ncuatro o cinco turnos.") },
            { PBEMove.Swift, new PBELocalizedString("Star-shaped rays are shot at the opposing\nteam. This attack never misses.", "Le lanceur envoie des rayons d'étoiles.\nTouche toujours l'ennemi.", "Verschießt sternförmige Strahlen,\ndie stets treffen, auf Gegner in\nder Umgebung.", "Colpisce i nemici con raggi a forma\ndi stella. Questo attacco è infallibile.", "ほしがたの　ひかりを　はっしゃして\nあいてを　こうげきする。\nこうげきは　かならず　めいちゅう　する。", "星型の　光を　発射して\n相手を　攻撃する。\n攻撃は　必ず　命中する。", "별 모양의 빛을 발사해서\n상대를 공격한다.\n공격은 반드시 명중한다.", "Lanza rayos en forma de estrella que no\nfallan nunca.") },
            // { PBEMove.130, new PBELocalizedString("The user tucks in its head to raise its\nDefense in the first turn, then\nrams the target on the next turn.", "Le lanceur baisse la tête pour augmenter\nsa Défense au 1⑩ tour et percuter\nl'ennemi au 2⒅.", "Der Anwender erhöht in Runde 1\nseine Verteidigung und greift in\nRunde 2 an.", "Chi la usa ritira la testa per aumentare\nla Difesa e poi attacca al turno\nsuccessivo.", "１ターンめに　あたまを　ひっこめて\nぼうぎょを　あげる。\n２ターンめに　あいてを　こうげきする。", "１ターン目に　頭を　ひっこめて\n防御を　あげる。\n２ターン目に　相手を　攻撃する。", "1턴째에 머리를 움츠려\n방어를 올린다.\n2턴째에 상대를 공격한다.", "Primer turno: se prepara\ny sube la Defensa del usuario.\nSegundo turno: da el cabezazo.") },
            // { PBEMove.131, new PBELocalizedString("Sharp spikes are shot at the target\nin rapid succession.\nThey hit two to five times in a row.", "Envoie une rafale de dards.\nPeut toucher de 2 à 5 fois.", "Spitze Nadeln treffen das\nZiel 2- bis 5-mal.", "Il nemico viene colpito da due a cinque\nvolte in rapida successione da spilli\nappuntiti.", "するどい　ハリを\nあいてに　はっしゃして　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "鋭い　ハリを\n相手に　発射して　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "날카로운 침을\n상대에게 발사해서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Lanza finas púas que hieren de dos\na cinco veces.") },
            // { PBEMove.132, new PBELocalizedString("The target is attacked with long, creeping\ntentacles or vines.\nIt may also lower the target's Speed stat.", "De longs tentacules ou lianes attaquent\nl'ennemi. Peut aussi baisser sa Vitesse.", "Angriff mit langen Tentakeln oder Ranken.\nSenkt eventuell den Initiative-Wert.", "Colpisce il nemico con lunghi tentacoli\no piante rampicanti. Può anche ridurne\nla Velocità.", "しょくしゅや　ツタ　などを　からみつけて\nこうげきする。あいての　すばやさを\nさげることが　ある。", "触手や　ツタなどを　からみつけて\n攻撃する。相手の　素早さを\nさげることが　ある。", "촉수나 덩굴 등을 휘감아서\n공격한다. 상대의 스피드를\n떨어뜨릴 때가 있다.", "Constriñe para herir y puede bajar\nla Velocidad.") },
            { PBEMove.Amnesia, new PBELocalizedString("The user temporarily empties its mind to\nforget its concerns.\nIt sharply raises the user's Sp. Def stat.", "Le lanceur fait le vide dans son esprit\npour oublier ses soucis. Augmente\nfortement sa Défense Spéciale.", "Gedächtnisverlust, der die\nSpezial-Verteidigung stark\nerhöht.", "Chi la usa svuota per un po' la mente per\ndimenticare i problemi. La Difesa Speciale\naumenta di molto.", "あたまを　からにして\nいっしゅん　なにかを　わすれる　ことで\nじぶんの　とくぼうを　ぐーんと　あげる。", "頭を　からにして\n一瞬　なにかを　忘れることで\n自分の　特防を　ぐーんと　あげる。", "머리를 비워서 순간적으로\n무언가를 잊어버림으로써\n자신의 특수방어를 크게 올린다.", "El usuario olvida sus preocupaciones\ny aumenta mucho la Defensa Especial.") },
            { PBEMove.Kinesis, new PBELocalizedString("The user distracts the target\nby bending a spoon.\nIt lowers the target's accuracy.", "Le lanceur distrait l'ennemi en pliant\nune cuillère. Peut baisser la Précision\nde l'ennemi.", "Lenkt Ziel durch Verbiegen\neines Löffels ab. Senkt\ndessen Genauigkeit.", "Chi la usa distrae il bersaglio piegando\nun cucchiaio e ne riduce la precisione.", "スプーンを　まげて　ちゅういを　ひき\nあいての　めいちゅうりつを　さげる。\n", "スプーンを　まげて　注意を　ひき\n相手の　命中率を　さげる。\n", "숟가락을 휘어서 주의를 끌어\n상대의 명중률을 낮춘다.", "Dobla una cuchara para distraer\nal objetivo y bajar su nivel de Precisión.") },
            { PBEMove.Softboiled, new PBELocalizedString("The user restores its own HP\nby up to half of its maximum HP.\nMay also be used in the field to heal HP.", "Le lanceur récupère jusqu'à la moitié de\nses PV max. En dehors des combats, permet\nde transférer des PV du lanceur à un allié.", "KP des Anwenders werden um 50 %\nder maximalen KP aufgefüllt. Heilung\ndes Teams außerhalb von Kämpfen.", "Chi la usa recupera metà dei propri PS\nmassimi. Fuori dalla lotta può anche far\ntrasferire PS ai propri compagni.", "さいだい　ＨＰの　はんぶん\nじぶんの　ＨＰを　かいふく　する。\nなかまに　ＨＰを　わけることも　できる。", "最大ＨＰの　半分\n自分の　ＨＰを　回復する。\n仲間に　ＨＰを　わけることも　できる。", "자신의 최대 HP 절반을\n회복한다. 동료의 HP를\n회복시킬 수도 있다.", "Restaura la mitad de los PS máximos del\nusuario. Fuera de combate se usa para\ntransferir parte de sus PS a un aliado.") },
            // { PBEMove.136, new PBELocalizedString("The target is attacked with a knee kick\nfrom a jump. If it misses, the user is hurt\ninstead.", "Le lanceur s'élance pour effectuer un\ncoup de genou sauté. S'il échoue, le\nlanceur se blesse.", "Sprungtritt mit Knie. Bei Misserfolg\nverletzt sich der Anwender selbst.", "Chi la usa colpisce il nemico con una\nginocchiata in volo: se fallisce, subisce\ndanni.", "ジャンプからの　ひざげりで\nあいてを　こうげきする。\nはずすと　じぶんが　ダメージを　うける。", "ジャンプからの　ひざげりで\n相手を　攻撃する。\nはずすと　自分が　ダメージを　受ける。", "점프해서 무릎차기로\n상대를 공격한다.\n빗나가면 자신이 데미지를 입는다.", "Salta muy alto y lanza una patada.\nSi falla, dañará al usuario.") },
            { PBEMove.Glare, new PBELocalizedString("The user intimidates the target with the\npattern on its belly to cause paralysis.", "Le lanceur intimide l'ennemi grâce à son\nregard terrifiant pour le paralyser.", "Schüchtert Ziel mit dem Muster\nauf seinem Bauch ein, sodass dieses\nparalysiert wird.", "Chi la usa spaventa il nemico con\nuno sguardo terrificante e ne causa\nla paralisi.", "おなかの　もようで　おびえさせて\nあいてを　まひの　じょうたいに　する。\n", "おなかの　模様で　おびえさせて\n相手を　まひの　状態に　する。\n", "배의 무늬로 겁을 주어\n상대를 마비 상태로 만든다.", "Intimida y asusta al objetivo con la mirada\npara dejarlo paralizado.") },
            { PBEMove.DreamEater, new PBELocalizedString("The user eats the dreams of a sleeping\ntarget. It absorbs half the damage\ncaused to heal the user's HP.", "Le lanceur mange le rêve de l'ennemi\nendormi. Le lanceur récupère en PV\nla moitié des dégâts infligés.", "Attacke gegen schlafendes Ziel.\nDie Hälfte des zugefügten Schadens\nwird dem Anwender gutgeschrieben.", "Attacco che funziona solo su un nemico\nche dorme. Chi lo usa riceve metà dei PS\npersi dal nemico.", "ねている　あいての　ゆめを　たべて\nこうげきする。　ダメージの　はんぶんの\nＨＰを　かいふく　する。", "寝ている　相手の　夢を　食べて\n攻撃する。ダメージの　半分の\nＨＰを　回復する。", "잠자고 있는 상대의 꿈을 먹어\n공격한다. 데미지의 절반을\nHP로 회복한다.", "Restaura al usuario la mitad del daño\ncausado a un objetivo dormido.") },
            { PBEMove.PoisonGas, new PBELocalizedString("A cloud of poison gas is sprayed\nin the face of opposing Pokémon.\nIt may poison those hit.", "Un nuage de gaz toxique est projeté au\nvisage de l'ennemi. Peut l'empoisonner.", "Hüllt Gegner in der Umgebung\nin Gas ein, das sie vergiftet.", "Spruzza in faccia al nemico una nuvola\ndi gas tossico che avvelena.", "どくガスを　あいての　かおに　ふきかけて\nどくの　じょうたいに　する。\n", "毒ガスを　相手の　顔に　吹きかけて\n毒の　状態に　する。\n", "독가스를 상대의 얼굴에 내뿜어\n독 상태로 만든다.", "Lanza una nube de gas tóxico al objetivo.\nProduce envenenamiento.") },
            // { PBEMove.140, new PBELocalizedString("Round objects are hurled at the target\nto strike two to five times in a row.", "Projette de 2 à 5 grosses boules\nsur l'ennemi.", "Wirft 2- bis 5-mal runde Gegenstände\nauf das Ziel.", "Piovono enormi sfere sulla testa del nemico\nda due a cinque volte di fila.", "まるい　ものを\nあいてに　なげつけて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "まるい　ものを\n相手に　投げつけて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "둥근 것을\n상대에게 내던져서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Arroja esferas al objetivo entre dos y\ncinco veces seguidas.") },
            { PBEMove.LeechLife, new PBELocalizedString("The user drains the target's blood.\nThe user's HP is restored by half the\ndamage taken by the target.", "Une attaque qui aspire le sang de l'ennemi.\nLa moitié des dégâts sont convertis en\nPV pour le lanceur.", "Die Hälfte des zugefügten Schadens\nwird dem Anwender gutgeschrieben.", "Mossa succhiasangue. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "ちを　すいとって　あいてを\nこうげきする。　あたえた　ダメージの\nはんぶんの　ＨＰを　かいふく　できる。", "血を　吸い取って　相手を\n攻撃する。与えた　ダメージの\n半分の　ＨＰを　回復できる。", "피를 빨아서 상대를\n공격한다. 준 데미지의\n절반을 HP로 회복한다.", "Restaura al usuario la mitad del daño\ncausado al objetivo.") },
            { PBEMove.LovelyKiss, new PBELocalizedString("With a scary face, the user tries to\nforce a kiss on the target. If it\nsucceeds, the target falls asleep.", "Le lanceur fait un bisou à l'ennemi\nen prenant une mine effrayante.\nEndort l'ennemi.", "Anwender zwingt dem Ziel einen\nKuss auf, der Schlaf verursacht.", "Chi la usa intimidisce il nemico con\nuna faccia paurosa e gli schiocca\nun bacio che lo fa addormentare.", "おそろしい　かおで　キスを　せまる。\nあいてを　ねむり　じょうたいに　する。\n", "恐ろしい　顔で　キスを　せまる。\n相手を　眠り状態に　する。\n", "무서운 얼굴로 키스한다.\n상대를 잠듦 상태로 만든다.", "Con una cara que asusta, da un beso\nal objetivo y lo adormece.") },
            // { PBEMove.143, new PBELocalizedString("A second-turn attack move where\ncritical hits land more easily.\nIt may also make the target flinch.", "Une attaque en 2 tours au taux de\ncritiques élevé. Peut aussi apeurer\nl'ennemi.", "Anwender greift in der zweiten Runde\nmit hoher Volltrefferquote an. Ziel\nschreckt eventuell zurück.", "Un attacco in due turni e probabile\nbrutto colpo. Può anche far tentennare\nil nemico.", "２ターンめに　あいてを　こうげきする。\nたまに　ひるませる。\nきゅうしょにも　あたりやすい。", "２ターン目に　相手を　攻撃する。\nたまに　ひるませる。\n急所にも　当たりやすい。", "2턴째에 상대를 공격한다.\n가끔 풀죽게 만든다.\n급소에도 맞기 쉽다.", "Ataque en dos turnos que suele ser\ncrítico. Puede hacer retroceder\nal objetivo.") },
            { PBEMove.Transform, new PBELocalizedString("The user transforms into a copy of the\ntarget right down to having\nthe same move set.", "Le lanceur devient une copie de sa cible\net obtient la même palette de capacités.", "Anwender verwandelt sich in ein Abbild des\nZieles und kann so auf die gleichen\nAttacken zugreifen.", "Chi la usa si trasforma in una copia\nesatta del bersaglio per sfruttarne\nle caratteristiche.", "あいての　ポケモンに　へんしん\nすることで　あいてと　まったく\nおなじ　わざが　つかえる。", "相手の　ポケモンに　変身することで\n相手と　まったく\n同じ　技が　使える。", "상대 포켓몬으로 변신하여\n상대와 완전히 똑같은\n기술을 사용할 수 있다.", "El usuario se transforma en una copia del\nobjetivo, con los mismos movimientos.") },
            { PBEMove.Bubble, new PBELocalizedString("A spray of countless bubbles is jetted at\nthe opposing team. It may also lower the\ntargets' Speed stats.", "Des bulles frappent l'ennemi.\nPeut réduire sa Vitesse.", "Angriff mit Blasen. Initiative-Wert des\nGegners wird eventuell gesenkt.", "Una pioggia di bolle investe i nemici e può\nanche ridurne la Velocità.", "むすうの　あわを　あいてに　ふきかけて\nこうげきする。あいての　すばやさを\nさげることが　ある。", "無数の　泡を　相手に　吹きかけて\n攻撃する。相手の　素早さを\nさげることが　ある。", "매우 많은 거품을 상대에게 내뿜어\n공격한다. 상대의 스피드를\n떨어뜨릴 때가 있다.", "Lanza burbujas al contrincante y puede\nreducir su Velocidad.") },
            { PBEMove.DizzyPunch, new PBELocalizedString("The target is hit with rhythmically\nlaunched punches that may also\nleave it confused.", "Un enchaînement de coups de poing\ncadencés. Peut aussi rendre confus.", "Rhythmische Schläge, die das Ziel\nverwirren können.", "Colpisce il bersaglio con una sequenza\ndi pugni che può anche confonderlo.", "リズミカルに　パンチを　くりだして\nあいてを　こうげきする。\nこんらん　させることが　ある。", "リズミカルに　パンチを　くりだして\n相手を　攻撃する。\n混乱させることが　ある。", "리드미컬한 펀치를 날려\n상대를 공격한다.\n혼란시킬 때가 있다.", "Rítmicos puñetazos que pueden causar\nconfusión.") },
            { PBEMove.Spore, new PBELocalizedString("The user scatters bursts of spores\nthat induce sleep.", "Le lanceur répand un nuage de\nspores qui endort.", "Erzeugt eine Wolke aus einschläfernden\nSporen.", "Nube di spore che fa sempre addormentare\nil nemico.", "さいみん　こうかの　ある\nほうしを　パラパラと　ふりまき\nあいてを　ねむり　じょうたいに　する。", "催眠効果の　ある\n胞子を　パラパラと　ふりまき\n相手を　眠り状態に　する。", "최면 효과가 있는\n포자를 훌훌 흩뿌려서\n상대를 잠듦 상태로 만든다.", "Esparce esporas que inducen al sueño.") },
            { PBEMove.Flash, new PBELocalizedString("The user flashes a bright light that cuts\nthe target's accuracy.\nIt can also be used to illuminate caves.", "Explosion lumineuse qui fait baisser la\nPrécision de l'ennemi. Permet aussi\nd'éclairer les grottes.", "Erzeugt helles Licht, das die\nGenauigkeit des Zieles senkt\nund Höhlen ausleuchten kann.", "Investe il nemico con un flash che ne\nriduce la precisione. Fuori dalla lotta\nserve per illuminare le grotte.", "まぶしい　ひかりで　\nあいての　めいちゅうりつを　さげる。\nくらい　どうくつも　あかるく　てらせる。", "まぶしい　光で　\n相手の　命中率を　さげる。\n暗い　どうくつも　明るく　照らせる。", "눈이 부신 빛으로\n상대의 명중률을 떨어뜨린다.\n어두운 동굴도 밝게 비춰준다.", "Luz cegadora que baja la Precisión\ndel objetivo. Fuera de combate sirve\npara iluminar.") },
            { PBEMove.Psywave, new PBELocalizedString("The target is attacked with an odd\npsychic wave.\nThe attack varies in intensity.", "Une étrange onde d'énergie chaude\nfrappe l'ennemi. Cette attaque est\nd'intensité variable.", "Anwender erzeugt eine mysteriöse\nEnergiewelle, deren Intensität von\nMal zu Mal unterschiedlich ausfällt.", "Colpisce il nemico con una strana onda\npsichica. Ha un'intensità variabile.", "ふしぎな　ねんぱを\nあいてに　はっしゃして　こうげきする。\nつかう　たびに　ダメージが　かわる。", "不思議な　念波を\n相手に　発射して　攻撃する。\n使うたびに　ダメージが　変わる。", "이상한 염력파를\n상대에게 발사하여 공격한다.\n사용할 때마다 데미지가 바뀐다.", "Ataque con una onda de energía\nde intensidad variable.") },
            // { PBEMove.150, new PBELocalizedString("The user just flops and splashes around\nto no effect at all...", "Le lanceur barbote et éclabousse les\nenvirons. Cette capacité n'a aucun effet.", "Nur ein Platscher, der überhaupt\nnichts bewirkt.", "Chi la usa sguazza nell'acqua, senza\nottenere alcun effetto.", "こうげきも　せずに　ピョン　ピョンと\nはねるだけで　なにも　おこらない　……。\n", "攻撃もせずに　ピョン　ピョンと\n跳ねるだけで　なにも　おこらない……。\n", "공격도 하지 않고 팔딱팔딱 튈 뿐\n아무 일도 일어나지 않는다...", "No tiene ningún efecto. Solo salpica.") },
            { PBEMove.AcidArmor, new PBELocalizedString("The user alters its cellular structure to\nliquefy itself, sharply raising its\nDefense stat.", "Le lanceur modifie sa structure\nmoléculaire pour se liquéfier et\naugmenter fortement sa Défense.", "Verflüssigt Körperzellen des Anwenders.\nErhöht den Verteidigungs-Wert stark.", "Chi la usa altera la sua struttura\ncellulare passando allo stato liquido:\nla Difesa sale di molto.", "さいぼうの　へんかで　えきじょうに　なり\nじぶんの　ぼうぎょを　ぐーんと　あげる。\n", "細胞の　変化で　液状に　なり\n自分の　防御を　ぐーんと　あげる。\n", "세포의 변화로 액체가 되어\n자신의 방어를 크게 올린다.", "Transforma la estructura celular\npara hacerse líquido y aumenta\nmucho la Defensa.") },
            { PBEMove.Crabhammer, new PBELocalizedString("The target is hammered with a large pincer.\nCritical hits land more easily.", "Une grande pince martèle l'ennemi.\nTaux de critiques élevé.", "Schlägt mit Schere zu.\nHohe Volltrefferquote.", "Colpisce il nemico con una grande tenaglia.\nProbabile brutto colpo.", "おおきな　ハサミを\nあいてに　たたきつけて　こうげきする。　\nきゅうしょに　あたりやすい。", "大きな　ハサミを\n相手に　たたきつけて　攻撃する。　\n急所に　当たりやすい。", "큰 집게를\n상대에게 내리쳐서 공격한다.\n급소에 맞기 쉽다.", "Golpea con fuerza con unas pinzas.\nSuele ser crítico.") },
            { PBEMove.Explosion, new PBELocalizedString("The user explodes to inflict damage on\nthose around it.\nThe user faints upon using this move.", "Le lanceur explose et inflige des\ndégâts à tous les Pokémon autour\nde lui. Met K.O. le lanceur.", "Anwender explodiert, richtet bei allen\nPokémon in seiner Umgebung großen\nSchaden an und wird besiegt.", "Chi la usa esplode per infliggere danni\nagli altri Pokémon attorno, ma va KO.", "おおきな　ばくはつで　じぶんの\nまわりに　いるものを　こうげきする。\nつかった　あとに　ひんしに　なる。", "大きな　爆発で　自分の\n周りに　いるものを　攻撃する。\n使ったあとに　ひんしに　なる。", "큰 폭발로 자신의\n주위에 있는 포켓몬을 공격한다.\n쓰고 나서는 기절한다.", "El atacante explota y hiere a todos\na su alrededor. El usuario se debilita\nde inmediato.") },
            // { PBEMove.154, new PBELocalizedString("The target is raked with sharp claws or\nscythes for two to five times in\nquick succession.", "L'ennemi est lacéré par des faux\nou des griffes de 2 à 5 fois.", "Beharkt das Ziel 2- bis 5-mal mit\nscharfen Klauen oder Sicheln.", "Colpisce il nemico con artigli o falci\naffilate da due a cinque volte in rapida\nsuccessione.", "ツメや　カマなどで\nあいてを　ひっかいて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "ツメや　カマなどで\n相手を　ひっかいて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "발톱이나 낫 등으로\n상대를 할퀴어서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Araña rápidamente de dos a cinco veces.") },
            // { PBEMove.155, new PBELocalizedString("The user throws the bone it holds. The\nbone loops to hit the target twice,\ncoming and going.", "Le lanceur projette son os comme un\nboomerang. Cette attaque frappe à\nl'aller et au retour.", "Ein Bumerang aus Knochen, der\nzweimal trifft.", "Chi la usa lancia l'osso che tiene. L'osso\ncolpisce due volte e ritorna come un vero\ne proprio boomerang.", "てに　もった　ホネを　あいてに　なげつけ\nいきと　かえりで　２かい　れんぞくで\nダメージを　あたえる。", "手に　持った　ホネを　相手に　投げつけ\n行きと　帰りの　２回連続で\nダメージを　与える。", "손에 들고 있는 뼈를 상대에게 날려서\n날아갈 때와 돌아올 때 2회 연속\n데미지를 준다.", "Lanza un hueso a modo de bumerán\nque golpea dos veces.") },
            { PBEMove.Rest, new PBELocalizedString("The user goes to sleep for two turns.\nIt fully restores the user's HP and heals\nany status problem.", "Le lanceur dort pendant 2 tours. Il\nregagne tous ses PV et n'a plus de\nproblèmes de statut.", "Anwender wird vollkommen\ngeheilt und schläft die\nfolgenden zwei Runden.", "Chi la usa dorme per due turni.\nRecupera, però, tutti i PS e risolve\ntutti i suoi problemi di stato.", "２ターンの　あいだ　ねむり　つづける。\nじぶんの　ＨＰと　じょうたいいじょうを\nすべて　かいふく　する。", "２ターンの　あいだ　眠り続ける。\n自分の　ＨＰと　状態異常を\nすべて　回復する。", "2턴 동안 계속 잠잔다.\n자신의 HP와 상태 이상을\n모두 회복한다.", "Restaura todos los PS y cura todos los\nproblemas de estado del usuario.\nDuerme los dos próximos turnos.") },
            { PBEMove.RockSlide, new PBELocalizedString("Large boulders are hurled at the opposing\nteam to inflict damage. It may also make\nthe targets flinch.", "Envoie de gros rochers sur l'ennemi\npour infliger des dégâts.\nPeut aussi l'apeurer.", "Schleudert riesige Felsen auf\nGegner in der Umgebung, die\neventuell zurückschrecken.", "I nemici vengono colpiti da grandi massi\nche possono anche farli tentennare.", "おおきな　いわを\nはげしく　ぶつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "大きな　岩を\n激しく　ぶつけて　攻撃する。\n相手を　ひるませることが　ある。", "큰 바위를\n세차게 부딪쳐서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Lanza grandes pedruscos.\nPuede hacer retroceder al objetivo.") },
            { PBEMove.HyperFang, new PBELocalizedString("The user bites hard on the target\nwith its sharp front fangs.\nIt may also make the target flinch.", "Le lanceur mord l'ennemi à l'aide de\nses incisives aiguisées. Peut aussi\napeurer l'ennemi.", "Angriff mit scharfen Reißzähnen.\nZiel schreckt eventuell zurück.", "Chi la usa morde il nemico con i suoi incisivi\naffilati. Può anche farlo tentennare.", "するどい　まえばで\nつよく　かみついて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "鋭い　前歯で\n強く　かみついて　攻撃する。\n相手を　ひるませることが　ある。", "날카로운 앞니로\n강하게 물어서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Ataque con finos colmillos.\nPuede hacer retroceder al objetivo.") },
            { PBEMove.Sharpen, new PBELocalizedString("The user reduces its polygon count to\nmake itself more jagged, raising the\nAttack stat.", "Le lanceur réduit son nombre de polygones\npour accentuer ses angles et augmenter\nson Attaque.", "Anwender senkt die Polygonzahl,\num Kanten zu erzeugen, die den\nAngriffs-Wert erhöhen.", "Chi la usa riduce il numero di poligoni sul\nproprio corpo per accentuarne gli spigoli\ne aumentare l'Attacco.", "からだの　かどを　ふやして\nカクカクに　なることで\nじぶんの　こうげきを　あげる。", "体の　かどを　増やして\nカクカクに　なることで\n自分の　攻撃を　あげる。", "몸의 각을 늘려서\n더욱 각지게 하여\n자신의 공격을 올린다.", "El perfil del usuario se hace más afilado\ny su Ataque mejora.") },
            // { PBEMove.160, new PBELocalizedString("The user changes its type to become the\nsame type as one of its moves.", "Le lanceur change de type pour prendre\ncelui de l'une de ses capacités.", "Wandelt den Typ des Anwenders in den Typ\neiner Attacke des Anwenders um.", "Il tipo di chi la usa muta in quello di una\nsua mossa a caso.", "じぶんの　タイプを\nおぼえている　わざの　なかの\nどれか　１つと　おなじ　タイプに　する。", "自分の　タイプを\nおぼえている　技の　なかの\nどれか　１つと　同じ　タイプに　する。", "자신의 타입을\n배운 기술 중 어느 하나와\n같은 타입으로 바꾼다.", "Cambia el tipo del usuario por el de uno\nde sus movimientos.") },
            // { PBEMove.161, new PBELocalizedString("The user strikes with a simultaneous\nthree-beam attack. May also burn, freeze,\nor leave the target with paralysis.", "Le lanceur envoie trois boules d'énergie\nsimultanément. Peut aussi paralyser,\nbrûler ou geler l'ennemi.", "Feuert drei Strahlen ab. Verursacht\neventuell Paralyse, Verbrennung\noder Einfrieren.", "Colpisce il nemico con tre sfere simultanee\ncapaci di paralizzarlo, scottarlo o forse\ncongelarlo.", "３つの　こうせんで　こうげきする。\nまひか　やけどか　こおりじょうたいの\nどれかに　することが　ある。", "３つの　光線で　攻撃する。\nまひか　やけどか　こおり状態の\nどれかに　することが　ある。", "3개의 광선으로 공격한다.\n마비, 화상 또는 얼음 상태 중\n어느 하나로 만들 때가 있다.", "Ataque triple que puede paralizar,\nquemar o congelar al objetivo.") },
            { PBEMove.SuperFang, new PBELocalizedString("The user chomps hard on the\ntarget with its sharp front fangs.\nIt cuts the target's HP to half.", "Une vilaine morsure d'incisives qui réduit\nde moitié les PV de l'ennemi.", "Greift mit scharfen Reißzähnen an.\nKP des Zieles werden halbiert.", "Chi la usa salta sul nemico azzannandolo\ncon i suoi incisivi affilati e facendogli\nperdere metà dei PS.", "するどい　まえばで\nはげしく　かみついて　こうげきする。\nあいての　ＨＰは　はんぶんに　なる。", "鋭い　前歯で\n激しく　かみついて　攻撃する。\n相手の　ＨＰは　半分に　なる。", "날카로운 앞니로\n강하게 물어서 공격한다.\n상대의 HP는 절반이 된다.", "Finos colmillos que reducen a la mitad\nlos PS del objetivo.") },
            { PBEMove.Slash, new PBELocalizedString("The target is attacked with a slash\nof claws or blades.\nCritical hits land more easily.", "Un coup de griffe ou autre tranche\nl'ennemi. Taux de critiques élevé.", "Hieb mit Klauen oder Ähnlichem.\nHohe Volltrefferquote.", "Attacca il nemico con artigli, falci o altro.\nProbabile brutto colpo.", "ツメや　カマ　などで\nあいてを　きりさいて　こうげきする。\nきゅうしょに　あたりやすい。", "ツメや　カマなどで\n相手を　切り裂いて　攻撃する。\n急所に　当たりやすい。", "발톱이나 낫 등으로\n상대를 베어 갈라서 공격한다.\n급소에 맞기 쉽다.", "Ataca con cuchillas o con pinzas.\nSuele dar un golpe crítico.") },
            { PBEMove.Substitute, new PBELocalizedString("The user makes a copy of itself using\nsome of its HP.\nThe copy serves as the user's decoy.", "Le lanceur fait une copie de lui-même en\nsacrifiant quelques PV. La copie sert de\nleurre.", "Anwender setzt eine kleine Menge an KP\nein, um einen Doppelgänger zu erzeugen,\nder für ihn Schläge einsteckt.", "Chi la usa crea una copia di se stesso\nusando alcuni PS. La copia serve come\nesca per il nemico.", "じぶんの　ＨＰを　すこし　けずって\nぶんしんを　だす。\nぶんしんは　じぶんの　みがわりに　なる。", "自分の　ＨＰを　少し　削って\n分身を　だす。\n分身は　自分の　身代わりに　なる。", "자신의 HP를 조금 깎아서\n분신을 만든다.\n분신은 자신의 대타가 된다.", "Utiliza parte de los PS propios para crear\nun sustituto que actúa como señuelo.") },
            { PBEMove.Struggle, new PBELocalizedString("An attack that is used in desperation\nonly if the user has no PP. It also hurts\nthe user slightly.", "Une attaque désespérée, lancée\nquand le lanceur n'a plus de PP.\nLe blesse aussi légèrement.", "Angriff nur bei verbrauchten AP.\nAnwender verletzt sich selbst leicht.", "Mossa da usare solo in caso estremo,\nquando non si hanno più PP. Danneggia\nanche chi la usa.", "じぶんの　ＰＰが　なくなると\nあがいて　あいてを　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "自分の　ＰＰが　なくなると\nあがいて　相手を　攻撃する。\n自分も　少し　ダメージを　受ける。", "자신의 PP가 떨어지면\n발버둥쳐 상대를 공격한다.\n자신도 조금 데미지를 입는다.", "Solo se usa como último recurso\nal acabarse los PP.\nHiere un poco al agresor.") },
            // { PBEMove.166, new PBELocalizedString("It enables the user to permanently learn\nthe move last used by the target.\nOnce used, Sketch disappears.", "Le lanceur apprend le dernier coup\nutilisé par la cible. Gribouille disparaît\naprès utilisation.", "Anwender lernt die letzte Attacke\ndes Zieles dauerhaft. Nachahmer\nverschwindet nach Gebrauch.", "Permette a chi la usa di imparare l'ultima\nmossa usata dal bersaglio. La nuova mossa\nappresa sostituisce Schizzo.", "あいてが　つかった　わざを\nじぶんの　ものに　する。\n１かい　つかうと　スケッチは　きえる。", "相手が　使った　技を\n自分の　ものに　する。\n１回　使うと　スケッチは　消える。", "상대가 쓴 기술을\n자신의 것으로 만든다.\n한 번 사용하면 스케치는 사라진다.", "Aprende de forma permanente\nel último movimiento del objetivo.\nEs de un solo uso.") },
            // { PBEMove.167, new PBELocalizedString("A consecutive three-kick attack that\nbecomes more powerful with each\nsuccessive hit.", "Une salve de 1 à 3 coups de pied dont la\npuissance augmente à chaque coup porté.", "Tritt das Ziel 1- bis 3-mal nacheinander.\nDie Härte der Tritte nimmt von Treffer zu\nTreffer zu.", "Chi la usa esegue fino a tre calci\nconsecutivi la cui potenza aumenta\nad ogni colpo.", "３かい　れんぞくで　キックを　くりだして\nこうげきする。わざが　あたる　たびに\nいりょくは　あがる。", "３回連続で　キックを　くりだして\n攻撃する。技が　当たるたびに\n威力は　あがる。", "3회 연속으로 킥을 날려\n공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "Patea hasta tres veces seguidas y\ncada vez más fuerte.") },
            // { PBEMove.168, new PBELocalizedString("The user attacks and steals the target's\nheld item simultaneously.\nIt can't steal if the user holds an item.", "Le lanceur attaque la cible et vole\nson objet. Le lanceur ne peut rien\nvoler s'il tient déjà un objet.", "Erlaubt es, das Item des Zieles zu\nstehlen, solang der Anwender selbst\nkeins bei sich trägt.", "Chi la usa attacca il bersaglio e può\nrubargli uno strumento, se non ne tiene\ngià uno.", "こうげきと　どうじに　どうぐを　ぬすむ。\nじぶんが　どうぐを　もっている　ばあいは\nぬすめない。", "攻撃と　同時に　道具を　盗む。\n自分が　道具を　持っている　場合は\n盗めない。", "공격과 동시에 도구를 훔친다.\n자신이 도구를 지니고 있을 경우에는\n훔칠 수 없다.", "Ataca y le quita al objetivo el objeto\nque lleve. Si el agresor lleva\nun objeto, no robará el del objetivo.") },
            // { PBEMove.169, new PBELocalizedString("The user ensnares the target with thin,\ngooey silk so it can't flee from battle.", "Le lanceur enserre l'ennemi à l'aide d'une\nfine soie gluante pour l'empêcher de fuir\nle combat.", "Wickelt das Ziel ein. Flucht oder\nTausch unmöglich.", "Copre il nemico con un filo di seta sottile\ne appiccicoso. Il nemico non può fuggire.", "ネバネバした　ほそい　いとを\nグルグルと　からませて　あいてを\nせんとうから　にげられなく　する。", "ネバネバした　細い　糸を\nグルグルと　からませて　相手を\n戦闘から　逃げられなくする。", "끈적끈적하고 가는 실을\n칭칭 휘감아 상대를\n배틀에서 도망칠 수 없게 한다.", "Enreda al objetivo para evitar que\nabandone la batalla.") },
            // { PBEMove.170, new PBELocalizedString("The user senses the target's movements\nwith its mind to ensure its next\nattack does not miss the target.", "Le lanceur analyse les mouvements de\nl'ennemi pour être sûr de toucher\nau coup suivant.", "Ahnt Bewegungen des Zieles voraus,\num zu gewährleisten, dass die\nnächste eigene Attacke trifft.", "Chi la usa prevede i movimenti del nemico\nper mandare a segno l'attacco successivo.", "あいての　うごきを　こころで　かんじて\nつぎの　こうげきが　かならず\nあいてに　あたるように　する。", "相手の　動きを　心で　感じて\n次の　攻撃が　必ず\n相手に　当たるように　する。", "상대의 움직임을 마음으로 읽고\n다음 공격이 반드시\n상대에게 명중되게 한다.", "El usuario adivina los movimientos\ndel objetivo para hacer que su siguiente\nataque no falle.") },
            // { PBEMove.171, new PBELocalizedString("A sleeping target sees a nightmare\nthat inflicts some damage every turn.", "Un cauchemar qui inflige des dégâts à\nchaque tour à un ennemi endormi.", "Dem schlafenden Ziel wird durch einen\nAlptraum in jeder Runde Schaden\nzugefügt, solang es schläft.", "Il nemico addormentato ha un incubo e\nperde PS ad ogni turno.", "ねむり　じょうたいの　あいてに\nあくむを　みせて　まいターン　すこしずつ\nＨＰを　へらしていく。", "眠り状態の　相手に\n悪夢を　みせて　毎ターン　少しずつ\nＨＰを　減らしていく。", "잠듦 상태의 상대에게\n악몽을 꾸게 하여 매 턴 조금씩\nHP를 떨어뜨려 간다.", "El objetivo dormido sufre una pesadilla\nque le hace perder PS en cada turno.") },
            { PBEMove.FlameWheel, new PBELocalizedString("The user cloaks itself in fire and\ncharges at the target.\nIt may also leave the target with a burn.", "Le lanceur s'entoure de feu et charge\nl'ennemi. Peut aussi brûler l'ennemi.", "Feuer-Attacke, die das Ziel eventuell\nverbrennt.", "Chi la usa si copre di fuoco e carica\nil nemico. Può anche scottarlo.", "ほのおを　まとい\nあいてに　とっしんして　こうげきする。\nやけど　じょうたいに　することが　ある。", "炎を　まとい\n相手に　突進して　攻撃する。\nやけど状態に　することが　ある。", "불꽃을 둘러\n상대에게 돌진하여 공격한다.\n화상 상태로 만들 때가 있다.", "Ataca envuelto en fuego.\nPuede causar quemaduras.") },
            { PBEMove.Snore, new PBELocalizedString("An attack that can be used only if the\nuser is asleep. The harsh noise may also\nmake the target flinch.", "Une attaque qui ne fonctionne que si le\nlanceur est endormi. Le boucan peut aussi\napeurer l'ennemi.", "Attacke nur im Schlaf möglich.\nZiel schreckt eventuell zurück.", "Mossa da usare solo mentre si dorme.\nIl chiasso assordante può anche far\ntentennare il nemico.", "じぶんが　ねている　ときに\nざつおんを　だして　こうげきする。　\nあいてを　ひるませる　ことが　ある。", "自分が　寝ているときに\n雑音を　だして　攻撃する。　\n相手を　ひるませることが　ある。", "자신이 잠들어있을 때\n소음을 내어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Fuerte ronquido que solo puede usarse\ndormido. Puede hacer retroceder\nal objetivo.") },
            { PBEMove.Curse, new PBELocalizedString("A move that works differently for the\nGhost type than for all other types.", "Une capacité à l'effet différent selon que\nle lanceur est un Pokémon Spectre ou non.", "Attacke, deren Wirkung davon abhängt, ob\nder Anwender ein Geist-Pokémon ist.", "Una mossa che agisce in modo diverso\nse chi la usa è di tipo Spettro.", "つかう　ポケモンが\nゴーストタイプと　それいがい　とでは\nこうかが　かわる。", "使う　ポケモンが\nゴーストタイプと　それ以外　とでは\n効果が　変わる。", "기술을 쓰는 포켓몬이\n고스트타입일 때와 그 이외의\n타입일 때는 효과가 다르다.", "Un movimiento que tiene efectos\ndistintos si el usuario es de tipo\nFantasma o no.") },
            { PBEMove.Flail, new PBELocalizedString("The user flails about aimlessly to attack.\nIt becomes more powerful the less HP\nthe user has.", "Le lanceur fait tournoyer son fléau.\nPlus ses PV sont bas, plus l'attaque\nest puissante.", "Attacke richtet mehr Schaden\nan, wenn eigene KP niedrig sind.", "Chi la usa si dimena per attaccare. È più\nefficace se i suoi PS sono bassi.", "じたばた　あばれて　こうげきする。\nじぶんの　ＨＰが　すくないほど\nわざの　いりょくは　あがる。", "じたばた　暴れて　攻撃する。\n自分の　ＨＰが　少ないほど\n技の　威力は　あがる。", "바둥바둥 난동부려서 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 올라간다.", "Ataque frenético.\nCuantos menos PS tenga el usuario,\nmás daño produce.") },
            // { PBEMove.176, new PBELocalizedString("The user changes its type to make itself\nresistant to the type of the attack the\nopponent used last.", "Le lanceur change de type pour être\nrésistant au type de la dernière\nattaque lancée par sa cible.", "Anwender ändert Typ und wird gegen\nletzten Angriffstyp resistent.", "Chi la usa cambia tipo per rendersi\nresistente al tipo dell'ultima mossa\nusata dal bersaglio.", "あいてが　さいごに　つかった　わざに\nていこう　できる　ように\nじぶんの　タイプを　へんか　させる。", "相手が　最後に　使った技に\n抵抗できる　ように\n自分の　タイプを　変化させる。", "상대가 마지막으로 쓴 기술에\n저항할 수 있도록\n자신의 타입을 변화시킨다.", "El usuario cambia de tipo para hacerse\nresistente al último tipo de movimiento\nusado por el objetivo.") },
            { PBEMove.Aeroblast, new PBELocalizedString("A vortex of air is shot at the target to\ninflict damage.\nCritical hits land more easily.", "Le lanceur projette une tornade sur\nl'ennemi pour infliger des dégâts. Taux\nde critiques élevé.", "Erzeugt Luftstrudel gegen das Ziel.\nHohe Volltrefferquote.", "Colpisce il nemico con un vortice d'aria\nper danneggiarlo. Probabile brutto colpo.", "くうきの　うずを\nはっしゃして　こうげきする。\nきゅうしょに　あたりやすい。", "空気の　渦を\n発射して　攻撃する。\n急所に　当たりやすい。", "공기의 소용돌이를\n발사하여 공격한다.\n급소에 맞기 쉽다.", "Lanza un chorro de aire que suele dar\nun golpe crítico.") },
            // { PBEMove.178, new PBELocalizedString("The user releases cotton-like spores\nthat cling to the target,\nharshly reducing its Speed stat.", "Le lanceur libère des spores cotonneuses\nqui collent à l'ennemi et baissent\nfortement sa Vitesse.", "Wattebäusche heften sich an das\nZiel. Der Initiative-Wert sinkt stark.", "Rilascia spore simili al cotone che si\nattaccano al nemico e riducono di molto\nla sua Velocità.", "わたのような　フワフワの　ほうしを\nまとわり　つかせて\nあいての　すばやさを　がくっと　さげる。", "綿のような　フワフワの　胞子を\nまとわり　つかせて\n相手の　素早さを　がくっと　さげる。", "솜처럼 폭신폭신한 포자를\n착 달라붙게 해서\n상대의 스피드를 크게 떨어뜨린다.", "Adhiere esporas al objetivo para reducir\nmucho su Velocidad.") },
            { PBEMove.Reversal, new PBELocalizedString("An all-out attack that becomes more\npowerful the less HP the user has.", "Le lanceur ne retient plus ses coups. Plus\nses PV sont bas et plus l'attaque est\npuissante.", "Richtet mehr Schaden an,\nwenn eigene KP niedrig sind.", "Chi la usa attacca con tutte le sue forze.\nPiù i PS sono bassi, maggiore è la potenza\ndi questa mossa.", "ちからを　ふりしぼり　こうげきする。\nじぶんの　ＨＰが　すくないほど\nわざの　いりょくは　あがる。", "力を　ふりしぼり　攻撃する。\n自分の　ＨＰが　少ないほど\n技の　威力は　あがる。", "힘을 쥐어짜서 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 올라간다.", "Ataque desesperado que causa\nmás daño cuantos menos PS\ntenga el usuario.") },
            // { PBEMove.180, new PBELocalizedString("The user unleashes its grudge on the move\nlast used by the target by cutting 4 PP\nfrom it.", "Le lanceur exprime son ressentiment\nen retirant 4 PP de la dernière attaque\nde l'ennemi.", "AP der letzten Attacke des Zieles\nwerden um 4 gesenkt.", "Chi la usa sfoga la propria rabbia\nsull'ultima mossa usata dal bersaglio\ne le sottrae quattro PP.", "あいてが　さいごに　つかった　わざに\nうらみを　いだいて\nそのわざの　ＰＰを　４だけ　へらす。", "相手が　最後に　使った技に\n恨みを　抱いて\nその技の　ＰＰを　４だけ　減らす。", "상대가 마지막으로\n사용한 기술에 원한을 품어\n그 기술의 PP를 4만큼 줄인다.", "Da rienda suelta a su rencor\npara reducir cuatro PP del último\nmovimiento usado por el objetivo.") },
            { PBEMove.PowderSnow, new PBELocalizedString("The user attacks with a chilling gust\nof powdery snow.\nIt may also freeze the targets.", "Le lanceur projette de la neige\npoudreuse. Peut aussi geler l'ennemi.", "Angriff mit Schnee. Gegner wird\neventuell eingefroren.", "Attacca i nemici con una raffica di neve\nfarinosa e può anche congelarli.", "つめたい　こなゆきを\nあいてに　ふきつけて　こうげきする。\nこおり　じょうたいに　することが　ある。", "冷たい　粉雪を\n相手に　吹きつけて　攻撃する。\nこおり状態に　することが　ある。", "차가운 가랑눈을\n상대에게 내뿜어 공격한다.\n얼음 상태로 만들 때가 있다.", "Lanza nieve que puede llegar\na congelar.") },
            { PBEMove.Protect, new PBELocalizedString("It enables the user to evade all attacks.\nIts chance of failing rises if it is used in\nsuccession.", "Le lanceur esquive toutes les attaques.\nPlus la capacité est utilisée de fois à la\nsuite, plus elle risque d'échouer.", "Anwender weicht jeder Attacke aus.\nScheitert eventuell bei Wiederholung.", "Permette di eludere tutti gli attacchi.\nSe usata in successione può fallire.", "あいての　こうげきを\nまったく　うけない。\nれんぞくで　だすと　しっぱい　しやすい。", "相手の　攻撃を\nまったく　受けない。\n連続で　だすと　失敗しやすい。", "상대의 공격을\n전혀 받지 않는다.\n연속으로 쓰면 실패하기 쉽다.", "Frena todos los ataques, pero puede\nfallar si se usa repetidamente.") },
            { PBEMove.MachPunch, new PBELocalizedString("The user throws a punch at blinding\nspeed. It is certain to strike first.", "Coup de poing fulgurant.\nFrappe en premier.", "Extrem schneller Hieb, der stets\nzuerst trifft.", "Chi la usa tira un pugno a velocità\nimpressionante e colpisce di sicuro\nper primo.", "めにも　とまらぬ　ものすごい　はやさで\nパンチを　くりだす。\nかならず　せんせい　こうげき　できる。", "目にも　留まらぬ　ものすごい　速さで\nパンチを　くりだす。\n必ず　先制攻撃　できる。", "눈에 보이지 않는 굉장한 속도로\n펀치를 날린다.\n반드시 선제공격을 할 수 있다.", "Puñetazo que se da rápido para golpear\nprimero.") },
            { PBEMove.ScaryFace, new PBELocalizedString("The user frightens the target with a scary\nface to harshly reduce its Speed stat.", "Une grimace qui effraie l'ennemi et\nréduit fortement sa Vitesse.", "Jagt dem Ziel mit einer Grimasse\nAngst ein. Dessen Initiative-Wert\nsinkt stark.", "Chi la usa spaventa il nemico con una\nfaccia terribile e ne riduce di molto\nla Velocità.", "おそろしい　かおで　にらみ　おびえさせて\nあいての　すばやさを　がくっと　さげる。\n", "恐ろしい　顔で　にらみ　おびえさせて\n相手の　素早さを　がくっと　さげる。\n", "무서운 얼굴로 노려보고 겁주어\n상대의 스피드를 크게 떨어뜨린다.", "Asusta al objetivo para reducir mucho\nsu Velocidad.") },
            { PBEMove.FaintAttack, new PBELocalizedString("The user approaches the target\ndisarmingly, then throws a sucker punch.\nIt hits without fail.", "Le lanceur s'approche l'air de rien avant\nde frapper par surprise. N'échoue jamais.", "Anwender nähert sich mit Unschuldsmiene\ndem Ziel und schlägt zu, sobald dieses\nunachtsam wird. Ein Treffer ist gewiss.", "Chi la usa si avvicina al nemico facendo\nfinta di niente, per poi scagliare un pugno\ninfallibile a tradimento.", "さりげなく　あいてに　ちかづき\nゆだんした　すきを　みて　なぐりつける。\nこうげきは　かならず　めいちゅう　する。", "さりげなく　相手に　ちかづき\n油断した　すきを　みて　なぐりつける。\n攻撃は　必ず　命中する。", "슬금슬금 상대에게 다가가\n방심한 틈을 타서 세게 때린다.\n공격은 반드시 명중한다.", "Engaña al objetivo para acercarse\ny dar un puñetazo que no falla.") },
            { PBEMove.SweetKiss, new PBELocalizedString("The user kisses the target with a sweet,\nangelic cuteness that causes confusion.", "Le lanceur envoie un bisou si mignon\net désarmant qu'il plonge l'ennemi dans\nla confusion.", "Anwender küsst Ziel, das durch\ndiese Niedlichkeit verwirrt wird.", "Chi la usa bacia il nemico con una dolcezza\nangelica, confondendolo.", "てんしのように　かわいく　キスして\nあいてを　こんらん　させる。\n", "天使のように　かわいく　キスして\n相手を　混乱させる。\n", "천사처럼 귀엽게 키스하여\n상대를 혼란시킨다.", "Da un beso con tal dulzura que\ncausa confusión.") },
            // { PBEMove.187, new PBELocalizedString("The user maximizes its Attack stat in\nexchange for HP equal to half its max HP.", "Améliore l'Attaque au maximum en\nsacrifiant la moitié des PV max.", "Der Anwender maximiert den Angriffs-Wert\nauf Kosten der Hälfte seiner maximalen KP.", "Chi la usa massimizza l'Attacco in cambio\ndi metà dei PS massimi.", "じぶんの　ＨＰを　さいだい　ＨＰの\nはんぶん　へらして　じぶんの　こうげきを\nさいだいに　あげる。", "自分の　ＨＰを　最大ＨＰの\n半分　減らして　自分の　攻撃を\n最大に　あげる。", "자신의 HP를 최대 HP의\n절반으로 감소시켜 자신의 공격을\n최대로 올린다.", "Reduce la mitad de los PS máximos\npara mejorar al máximo el Ataque.") },
            { PBEMove.SludgeBomb, new PBELocalizedString("Unsanitary sludge is hurled at the target.\nIt may also poison the target.", "Des détritus toxiques sont projetés sur\nl'ennemi. Peut aussi l'empoisonner.", "Wirft Schlamm auf das Ziel. Dieses wird\neventuell vergiftet.", "Chi la usa attacca lanciando fango\nsul bersaglio. Può anche avvelenarlo.", "きたない　ヘドロを\nあいてに　なげつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "汚い　ヘドロを\n相手に　投げつけて　攻撃する。\n毒状態に　することが　ある。", "더러운 오물을\n상대에게 내던져서 공격한다.\n독 상태로 만들 때가 있다.", "Arroja residuos al objetivo.\nPuede llegar a envenenar.") },
            { PBEMove.MudSlap, new PBELocalizedString("The user hurls mud in the target's face to\ninflict damage and lower its accuracy.", "Le lanceur envoie de la boue au visage\nde l'ennemi pour infliger des dégâts\net baisser sa Précision.", "Schadet dem Ziel durch Matsch.\nDessen Genauigkeit sinkt.", "Chi la usa butta fango in faccia al nemico\nper arrecargli danni e ridurne\nla precisione.", "あいての　かおなどに\nドロを　なげつけて　こうげきする。\nめいちゅうりつを　さげる。", "相手の　顔などに\n泥を　投げつけて　攻撃する。\n命中率を　さげる。", "상대의 얼굴 등에\n진흙을 내던져서 공격한다.\n명중률을 떨어뜨린다.", "Echa lodo en la cara para bajar\nla Precisión.") },
            { PBEMove.Octazooka, new PBELocalizedString("The user attacks by spraying ink in the\ntarget's face or eyes.\nIt may also lower the target's accuracy.", "Le lanceur attaque en projetant de\nl'encre au visage de l'ennemi. Peut aussi\nbaisser la Précision de l'ennemi.", "Schießt mit Tinte, um Schaden anzurichten\nund die Genauigkeit zu senken.", "Chi la usa spruzza inchiostro in faccia al\nnemico. Può anche ridurne la precisione.", "あいての　かおなどに\nすみを　ふきかけて　こうげきする。\nめいちゅうりつを　さげることが　ある。", "相手の　顔などに\n墨を　吹きかけて　攻撃する。\n命中率を　さげることが　ある。", "상대의 얼굴 등에\n먹물을 내뿜어 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Dispara tinta a la cara.\nPuede bajar la Precisión.") },
            { PBEMove.Spikes, new PBELocalizedString("The user lays a trap of spikes at the\nopposing team's feet. The trap hurts\nPokémon that switch into battle.", "Le lanceur disperse des piquants sur le\nsol pour blesser tout ennemi qui entre\nau combat.", "Der Anwender verteilt Stacheln, die\ngegnerische Pokémon verletzen,\ndie in den Kampf gerufen werden.", "Chi la usa piazza sul terreno una trappola\ndi punte che danneggia i nemici quando\nscendono in campo.", "あいての　あしもとに　まきびしを\nしかける。こうたいで　でてきた　あいての\nポケモンに　ダメージを　あたえる。", "相手の　足下に　まきびしを\nしかける。交代で　でてきた　相手の\nポケモンに　ダメージを　与える。", "상대의 발밑에 압정을\n뿌린다. 교체된 상대\n포켓몬에게 데미지를 준다.", "Esparce púas en el equipo rival.\nLas púas hieren a los Pokémon\nrivales que entran en combate.") },
            { PBEMove.ZapCannon, new PBELocalizedString("The user fires an electric blast like a\ncannon to inflict damage and\ncause paralysis.", "Un boulet de canon électrifié qui inflige\ndes dégâts et paralyse l'ennemi.", "Kanonenähnlicher Elektro-Schuss,\nder schadet und paralysiert.", "Chi la usa provoca un'esplosione elettrica\nche infligge danni e paralizza il nemico.", "たいほうの　ような\nでんきを　はっしゃして　こうげきする。\nあいてを　まひの　じょうたいに　する。", "大砲の　ような\n電気を　発射して　攻撃する。\n相手を　まひの　状態に　する。", "대포처럼\n전기를 발사해서 공격한다.\n상대를 마비 상태로 만든다.", "Dispara una descarga eléctrica que causa\ndaño y parálisis.") },
            // { PBEMove.193, new PBELocalizedString("Enables a Ghost-type target to be hit by\nNormal- and Fighting-type attacks. It also\nenables an evasive target to be hit.", "Permet de toucher un Pokémon Spectre\navec n'importe quelle capacité et de\ntoucher un ennemi insaisissable.", "Erlaubt es, Geist-Pokémon mit Normal-\nund Kampf-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Chi la usa rende i Pokémon di tipo Spettro\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "ゴーストタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "ゴーストタイプに　効果がない　技や\n回避率の　高い　相手に\n攻撃が　当たるように　なる。", "고스트타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permite atacar con cualquier movimiento\na objetivos de tipo Fantasma y golpear\na Pokémon evasivos.") },
            // { PBEMove.194, new PBELocalizedString("When this move is used, if the user faints,\nthe Pokémon that landed the knockout\nhit also faints.", "Quand cette capacité est activée,\nelle met K.O. un ennemi qui porte\nun coup fatal au lanceur.", "Wird der Anwender nach Einsatz dieser\nAttacke besiegt, führt dies auch\nbeim Gegner zum K.O.", "Se chi la usa va KO prima del proprio turno,\nchi ha sferrato il colpo da KO fa la stessa\nfine.", "わざを　だしたあと　こうげきを　うけて\nひんしに　なったとき\nこうげき　あいても　ひんしに　する。", "技を　だしたあと　攻撃を　受けて\nひんしに　なったとき\n攻撃　相手も　ひんしに　する。", "기술을 쓴 뒤 공격을 받아\n기절했을 때\n길동무의 대상도 기절하게 한다.", "Si el usuario se debilita por un ataque\nrival antes de usar otro movimiento,\nel Pokémon rival se debilitará también.") },
            // { PBEMove.195, new PBELocalizedString("Any Pokémon that hears this song\nfaints in three turns, unless it switches\nout of battle.", "Tout Pokémon qui entend ce requiem\nest K.O. dans 3 tours à moins qu'il\nne quitte le combat.", "Wer diese Musik hört, wird nach drei\nRunden besiegt. Rettung ist durch\nEintausch eines neuen Pokémon möglich.", "Ogni Pokémon che sente questo canto va\nKO in tre turni, se non lo si sostituisce.", "うたを　きいた　ポケモンは\n３ターン　たつと　ひんしに　なる。\nこうたいすると　こうかは　なくなる。", "歌を　聴いた　ポケモンは\n３ターン　たつと　ひんしに　なる。\n交代すると　効果は　なくなる。", "노래를 들은 포켓몬은\n3턴이 지나면 기절한다.\n교체되면 효과가 없어진다.", "Si un Pokémon escucha este canto\ny no es cambiado por otro en\ntres turnos, acaba debilitándose.") },
            { PBEMove.IcyWind, new PBELocalizedString("The user attacks with a gust of\nchilled air. It also reduces the targets'\nSpeed stat.", "Une bourrasque de vent froid blesse\nl'ennemi. Réduit aussi sa Vitesse.", "Eis-Attacke, die dem Gegner Schaden\nzufügt und seinen Initiative-Wert senkt.", "Chi la usa attacca i nemici con una folata\ndi aria gelida e ne riduce anche\nla Velocità.", "つめたい　れいきを\nあいてに　ふきつけて　こうげきする。\nあいての　すばやさを　さげる。", "凍てつく　冷気を\n相手に　吹きつけて　攻撃する。\n相手の　素早さを　さげる。", "차가운 냉기를\n상대에게 내뿜어 공격한다.\n상대의 스피드를 떨어뜨린다.", "Ataque con aire helado que baja\nla Velocidad del objetivo.") },
            { PBEMove.Detect, new PBELocalizedString("It enables the user to evade all attacks.\nIts chance of failing rises if it is used\nin succession.", "Le lanceur esquive toutes les attaques.\nPlus la capacité est utilisée de fois à la\nsuite, plus elle risque d'échouer.", "Anwender weicht jeder Attacke aus.\nScheitert eventuell bei Wiederholung.", "Permette di eludere tutti gli attacchi.\nSe usata in successione può fallire.", "あいての　こうげきを\nまったく　うけない。\nれんぞくで　だすと　しっぱい　しやすい。", "相手の　攻撃を\nまったく　受けない。\n連続で　だすと　失敗しやすい。", "상대의 공격을\n전혀 받지 않는다.\n연속으로 쓰면 실패하기 쉽다.", "Frena todos los ataques, pero puede\nfallar si se usa repetidamente.") },
            // { PBEMove.198, new PBELocalizedString("The user strikes the target with a hard\nbone two to five times in a row.", "Le lanceur frappe l'ennemi\n2 à 5 fois avec un os.", "Greift Ziel 2- bis 5-mal in Folge mit\neinem harten Knochen an.", "Chi la usa colpisce il nemico con un osso\nda due a cinque volte di fila.", "かたい　ホネで\nあいてを　なぐりつけて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "硬い　ホネで\n相手を　なぐりつけて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "단단한 뼈로\n상대를 세게 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Hueso en ristre, aporrea al objetivo\nde dos a cinco veces.") },
            // { PBEMove.199, new PBELocalizedString("The user takes sure aim at the target.\nIt ensures the next attack does not fail\nto hit the target.", "Verrouille l'ennemi pour ne\npas le rater au tour suivant.", "Visiert das Ziel an und trifft in der\nnächsten Runde garantiert.", "Chi la usa punta il nemico con precisione.\nLa mossa successiva andrà a segno.", "しょうじゅんを　しっかり　あわせて\nつぎの　こうげきが　かならず　\nあいてに　あたるように　する。", "照準を　しっかり　あわせて\n次の　攻撃が　必ず　\n相手に　当たるように　する。", "조준을 잘 맞춰\n다음 공격이 반드시\n상대에게 명중하도록 한다.", "Fija el blanco para que el siguiente\nataque no falle.") },
            // { PBEMove.200, new PBELocalizedString("The user rampages and attacks for two\nto three turns.\nIt then becomes confused, however.", "Le lanceur laisse éclater sa rage et\nattaque pendant 2 à 3 tours avant de\ncéder à la confusion.", "Attacke über 2 bis 3 Runden,\ndie den Angreifer verwirrt.", "Chi la usa sfoga la sua ira e attacca\nil nemico per due o tre turni prima di\nessere lasciato in preda alla confusione.", "２ー３ターンの　あいだ\nあばれまくって　こうげきする。\nあばれた　あとは　こんらん　する。", "２ー３ターンの　あいだ\n暴れまくって　攻撃する。\n暴れたあとは　混乱する。", "2-3턴 동안\n마구 난동부려서 공격한다.\n난동부린 뒤에는 혼란에 빠진다.", "Ataca de dos a tres turnos y acaba\nconfundiendo al agresor.") },
            { PBEMove.Sandstorm, new PBELocalizedString("A five-turn sandstorm is summoned\nto hurt all combatants except the\nRock, Ground, and Steel types.", "Une tempête de sable de 5 tours\nqui blesse tous les Pokémon sauf\nles types Roche, Sol et Acier.", "Sandsturm für fünf Runden. Fügt Pokémon\nvon jedem Typ außer Gestein, Boden und\nStahl Schaden zu.", "Causa una tempesta di sabbia per cinque\nturni che danneggia tutti i tipi in campo\nesclusi Terra, Roccia e Acciaio.", "５ターンの　あいだ　すなあらしで\nいわ　じめん　はがねタイプ　いがいの\nポケモンに　ダメージを　あたえる。", "５ターンの　あいだ　砂あらしで\nいわ　じめん　はがねタイプ　以外の\nポケモンに　ダメージを　与える。", "5턴 동안 모래바람으로\n바위, 땅, 강철타입 이외의\n포켓몬에게 데미지를 준다.", "Tormenta de arena que dura cinco\nturnos y hiere a todos, excepto\na los de tipo Roca, Tierra y Acero.") },
            { PBEMove.GigaDrain, new PBELocalizedString("A nutrient-draining attack. The user's\nHP is restored by half the damage\ntaken by the target.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Das Ziel wird angegriffen und die\nHälfte des zugefügten Schadens\ndem Angreifer als KP gutgeschrieben.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "ようぶんを　すいとり　こうげきする。\nあたえた　ダメージの\nはんぶんの　ＨＰを　かいふく　できる。", "養分を　吸い取り　攻撃する。\n与えた　ダメージの\n半分の　ＨＰを　回復できる。", "양분을 흡수하여 공격한다.\n입힌 데미지의 절반에 해당하는\nHP를 회복할 수 있다.", "Un ataque que absorbe nutrientes.\nQuien lo usa recupera la mitad de\nlos PS del daño que produce.") },
            // { PBEMove.203, new PBELocalizedString("The user endures any attack with at least\n1 HP. Its chance of failing rises if it is\nused in succession.", "Le lanceur résiste aux attaques avec\n1 PV. Peut échouer si utilisée plusieurs\nfois de suite.", "Nach fatalen Attacken bleibt stets\n1 KP übrig. Misserfolg bei Wiederholung\nmöglich.", "Chi la usa resta con un PS anche se\nsubisce un colpo da KO in quel turno.\nUsata in successione può fallire.", "こうげきを　うけても\nＨＰを　かならず　１だけ　のこせる。\nれんぞくで　だすと　しっぱい　しやすい。", "攻撃を　受けても\nＨＰを　必ず　１だけ　残せる。\n連続で　だすと　失敗しやすい。", "공격을 받아도\nHP를 반드시 1만큼은 남긴다.\n연속으로 쓰면 실패하기 쉽다.", "Resiste cualquier ataque y deja\nal menos un PS. Puede fallar\nsi se usa repetidamente.") },
            { PBEMove.Charm, new PBELocalizedString("The user gazes at the target rather\ncharmingly, making it less wary.\nThe target's Attack is harshly lowered.", "Le lanceur fait les yeux doux\npour berner l'ennemi et réduire\nconsidérablement son Attaque.", "Betört das Ziel und reduziert\ndessen Angriff stark.", "Ammalia il nemico con lo sguardo per\nrenderlo meno cauto. Ne riduce molto\nl'Attacco.", "かわいく　みつめて　ゆだんを　さそい\nあいての　こうげきを　がくっと　さげる。\n", "かわいく　みつめて　油断を　誘い\n相手の　攻撃を　がくっと　さげる。\n", "귀엽게 바라보고 방심을 유도하여\n상대의 공격을 크게 떨어뜨린다.", "Engatusa al objetivo y reduce bastante\nsu Ataque.") },
            // { PBEMove.205, new PBELocalizedString("The user continually rolls into the target\nover five turns. It becomes stronger\neach time it hits.", "Un rocher roule sur l'ennemi pendant 5\ntours. L'attaque gagne en puissance\nà chaque coup.", "Attacke, die fünf Runden dauert.\nDie Härte nimmt von Mal zu Mal zu.", "Chi la usa colpisce il nemico rotolando\nper cinque turni, con aumento progressivo\ndella potenza ogni volta che va a segno.", "５ターンの　あいだ　ころがりつづけて\nこうげきする。わざが　あたる　たびに\nいりょくが　あがる。", "５ターンの　あいだ　転がり続けて\n攻撃する。技が　当たるたびに\n威力が　あがる。", "5턴 동안 구르기를 반복하여\n공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "El atacante rueda contra el objetivo\ndurante cinco turnos, cada vez\ncon mayor fuerza.") },
            // { PBEMove.206, new PBELocalizedString("A restrained attack that prevents the\ntarget from fainting.\nThe target is left with at least 1 HP.", "Le lanceur retient ses coups pour\nque l'ennemi garde au moins 1 PV et\nne tombe pas K.O.", "Ein Angriff, der dem Ziel\nzumindest 1 KP lässt.", "Chi la usa trattiene il colpo per impedire\nal nemico di andare KO, lasciandolo con\nalmeno un PS.", "あいての　ＨＰが　\nかならず　１だけ　のこる　ように\nてかげん　して　こうげきする。", "相手の　ＨＰが　\n必ず　１だけ　残るように\n手加減して　攻撃する。", "상대의 HP가\n반드시 1만큼 남도록\n조절하여 공격한다.", "Ataque moderado que no debilita\nal objetivo y le deja al menos un PS.") },
            { PBEMove.Swagger, new PBELocalizedString("The user enrages and confuses the target.\nHowever, it also sharply raises the\ntarget's Attack stat.", "Fait enrager la cible et la plonge dans\nla confusion, mais augmente fortement\nson Attaque.", "Verwirrt das Ziel und erhöht\ndessen Angriffs-Wert stark.", "Chi la usa provoca il bersaglio e lo\nconfonde, facendo aumentare però\ndi molto il suo Attacco.", "あいてを　おこらせて　こんらん　させる。\nいかりで　あいての　こうげきは\nぐーんと　あがってしまう。", "相手を　怒らせて　混乱させる。\n怒りで　相手の　攻撃は\nぐーんと　あがってしまう。", "상대를 화내게 해서 혼란시킨다.\n분노로 상대의 공격은\n크게 올라가 버린다.", "Provoca confusión en el objetivo,\npero también sube mucho su Ataque.") },
            { PBEMove.MilkDrink, new PBELocalizedString("The user restores its own HP\nby up to half of its maximum HP.\nMay also be used in the field to heal HP.", "Le lanceur récupère jusqu'à la moitié de\nses PV max. En dehors des combats, permet\nde transférer des PV du lanceur à un allié.", "KP des Anwenders werden um 50 % der\nmaximalen KP aufgefüllt. Heilung eines Ver-\nbündeten außerhalb von Kämpfen möglich.", "Chi la usa recupera metà dei propri PS\nmassimi. Fuori dalla lotta può anche far\ntrasferire PS ai propri compagni.", "さいだい　ＨＰの　はんぶん\nじぶんの　ＨＰを　かいふく　する。\nなかまに　ＨＰを　わけることも　できる。", "最大ＨＰの　半分\n自分の　ＨＰを　回復する。\n仲間に　ＨＰを　わけることも　できる。", "자신의 최대 HP 절반을\n회복한다. 동료의 HP를\n회복시킬 수도 있다.", "Restaura la mitad de los PS máximos del\nusuario. Fuera de combate se usa para\ntransferir parte de sus PS a un aliado.") },
            { PBEMove.Spark, new PBELocalizedString("The user throws an electrically charged\ntackle at the target. It may also leave\nthe target with paralysis.", "Lance une charge électrique sur\nl'ennemi. Peut aussi le paralyser.", "Elektro-Hieb, der das Ziel\nparalysieren kann.", "Colpisce il nemico con una carica elettrica\ne può anche paralizzarlo.", "でんきを　まとい\nあいてに　とっしんして　こうげきする。\nまひ　じょうたいに　することが　ある。", "電気を　まとい\n相手に　突進して　攻撃する。\nまひ状態に　することが　ある。", "전기를 둘러\n상대에게 돌진하여 공격한다.\n마비 상태로 만들 때가 있다.", "Ataque eléctrico que puede llegar\na paralizar.") },
            // { PBEMove.210, new PBELocalizedString("The target is slashed with scythes or\nclaws. Its power increases if it hits\nin succession.", "Un coup de faux ou de griffe dont\nla force augmente quand il touche\nplusieurs fois d'affilée.", "Eine Attacke mit Scheren oder Klauen,\nderen Härte bei aufeinanderfolgenden\nTreffern zunimmt.", "Colpisce il nemico con falci o artigli. Se\nusata in successione aumenta di potenza\nogni volta che va a segno.", "カマや　ツメ　などで　あいてを\nきりつけて　こうげきする。れんぞくで\nあてると　いりょくが　あがる。", "カマや　ツメなどで　相手を\n切りつけて　攻撃する。\n連続で　当てると　威力が　あがる。", "낫이나 발톱 등으로 상대를\n베어 공격한다.\n연속으로 맞히면 위력이 올라간다.", "Ataque con garras o guadaña que crece\nen intensidad si se usa repetidas veces.") },
            { PBEMove.SteelWing, new PBELocalizedString("The target is hit with wings of steel.\nIt may also raise the user's Defense stat.", "Le lanceur frappe l'ennemi avec des\nailes d'acier. Peut aussi augmenter\nla Défense du lanceur.", "Trifft das Ziel mit Stahlflügeln.\nVerteidigungs-Wert des Anwenders\nsteigt eventuell.", "Colpisce il nemico con ali d'acciaio. Può\nanche aumentare la Difesa di chi la usa.", "かたい　つばさを　あいてに　たたきつけて\nこうげきする。じぶんの　ぼうぎょが\nあがることが　ある。", "硬い　翼を　相手に　たたきつけて\n攻撃する。自分の　防御が\nあがることが　ある。", "단단한 날개를 상대에게 부딪쳐서\n공격한다. 자신의 방어가\n올라갈 때가 있다.", "Alas macizas que golpean al objetivo\ny pueden subir la Defensa\ndel usuario.") },
            // { PBEMove.212, new PBELocalizedString("The user pins the target with a dark,\narresting look.\nThe target becomes unable to flee.", "Le lanceur pétrifie l'ennemi en lui lançant\nun regard noir. Il devient incapable de\ns'enfuir.", "Böser Blick, der die Flucht des\nZieles vereitelt.", "Chi la usa blocca il nemico con uno sguardo\noscuro e ammaliante, impedendogli la fuga.", "すいこまれる　ような　くろい　まなざしで\nじっと　みつめて　あいてを\nせんとうから　にげられなく　する。", "吸いこまれるような　黒い　まなざしで\nじっと　みつめて　相手を\n戦闘から　逃げられなくする。", "빨려들어갈 것 같은 까만 눈빛으로\n가만히 응시하여 상대를\n배틀에서 도망갈 수 없게 한다.", "Mal de ojo que impide al objetivo huir\nde la batalla.") },
            // { PBEMove.213, new PBELocalizedString("If it is the opposite gender of the user,\nthe target becomes infatuated and less\nlikely to attack.", "Si l'ennemi est du sexe opposé, il tombe\namoureux et rechigne alors à attaquer.", "Angriff auf Anwender vom anderen\nGeschlecht wird unwahrscheinlich.", "Se il nemico è del sesso opposto, s'infatua\ne attacca con meno probabilità.", "♂なら♀を　♀なら♂を　ゆうわくして\nメロメロに　する。\nあいては　わざが　だしにくく　なる。", "♂なら♀を　♀なら♂を　誘惑して\nメロメロに　する。\n相手は　技が　だしにくくなる。", "수컷은 암컷을 암컷은 수컷을 유혹하여\n헤롱헤롱하게 만든다.\n상대가 기술을 쓰기 어려워진다.", "Si el objetivo es del sexo opuesto,\nse enamorará y bajará la posibilidad\nde que ataque.") },
            // { PBEMove.214, new PBELocalizedString("While it is asleep, the user randomly uses\none of the moves it knows.", "Le lanceur utilise un de ses coups\nau hasard pendant qu'il dort.", "Anwender setzt per Zufall eine ihm\nbekannte Attacke im Schlaf ein.", "Chi la usa sfodera a caso una delle proprie\nmosse mentre sta dormendo.", "じぶんが　おぼえている　わざの　うち\nどれか　１つを　くりだす。\nじぶんが　ねている　ときだけ　つかえる。", "自分が　おぼえている　技の　うち\nどれか　１つを　くりだす。\n自分が　寝ているときだけ　使える。", "자신이 배운 기술 중\n하나를 무작위로 날린다.\n자신이 잠들어 있을 때만 쓸 수 있다.", "Mientras duerme, usa uno de sus\nmovimientos elegido al azar.") },
            // { PBEMove.215, new PBELocalizedString("The user makes a soothing bell chime\nto heal the status problems of all the\nparty Pokémon.", "Carillon apaisant qui soigne les problèmes\nde statut de tous les Pokémon de l'équipe.", "Läutet beruhigend und heilt alle\nStatusprobleme im Team.", "Chi la usa produce uno scampanellio che\nrisolve i problemi di stato dei Pokémon\ndi tutta la squadra.", "ここちよい　すずの　ねいろを　きかせて\nみかた　ぜんいんの\nじょうたい　いじょうを　かいふく　する。", "心地好い　鈴の　音色を　聞かせて\n味方　全員の\n状態異常を　回復　する。", "기분 좋은 방울소리를\n들려주어 같은 편 전원의\n상태 이상을 회복한다.", "Tañido que cura los problemas de estado\nde todos los Pokémon del equipo.") },
            { PBEMove.Return, new PBELocalizedString("A full-power attack that grows more\npowerful the more the user likes\nits Trainer.", "Une attaque furieuse dont la puissance\naugmente quand le Pokémon apprécie\nson Dresseur.", "Angriff, dessen Kraft bei Freundschaft\nzum Trainer größer wird.", "Mossa che diventa tanto più potente\nquanto maggiore è il grado di affezione\ndel Pokémon per il proprio Allenatore.", "トレーナーの　ために　ぜんりょくで\nあいてを　こうげきする。\nなついて　いるほど　いりょくは　あがる。", "トレーナーの　ために　全力で\n相手を　攻撃する。\nなついているほど　威力は　あがる。", "트레이너를 위해 전력으로\n상대를 공격한다.\n친밀할수록 위력이 올라간다.", "Cuanto mayor sea la amistad con el\nEntrenador, más poderoso será\neste ataque.") },
            // { PBEMove.217, new PBELocalizedString("The user attacks by giving the target a\ngift with a hidden trap. It restores\nHP sometimes, however.", "Le lanceur attaque en offrant un cadeau\npiégé à la cible. Peut à l'inverse\nrestaurer certains de ses PV.", "Eine Bombe als Geschenk. Kann auch\nKP des Zieles wiederherstellen.", "Chi la usa dà un regalo bomba al bersaglio.\nA volte, però, può fargli recuperare PS.", "わなを　しかけた　はこを\nあいてに　わたして　こうげきする。ＨＰが\nかいふくして　しまうことも　ある。", "わなを　しかけた　箱を\n相手に　わたして　攻撃する。ＨＰが\n回復して　しまうことも　ある。", "덫을 설치한 상자를\n상대에게 건네어 공격한다.\nHP가 회복해버릴 때도 있다.", "Quien lo usa ataca al objetivo dándole\nun regalo con bomba trampa.\nSin embargo, a veces restaura sus PS.") },
            { PBEMove.Frustration, new PBELocalizedString("A full-power attack that grows more\npowerful the less the user likes\nits Trainer.", "Moins le Pokémon aime son Dresseur, plus\ncette attaque est puissante.", "Die Attacke wird stärker, je weniger der\nAnwender seinen Trainer mag.", "Mossa che diventa tanto più potente\nquanto minore è il grado di affezione\ndel Pokémon per il proprio Allenatore.", "ふまんを　はらすため　ぜんりょくで\nあいてを　こうげきする。なついて\nいないほど　いりょくは　あがる。", "不満を　はらすため　全力で\n相手を　攻撃する。\nなついていないほど　威力は　あがる。", "불만을 풀기 위해 전력으로\n상대를 공격한다.\n친밀하지 않을수록 위력이 올라간다.", "Cuanto menor sea la amistad con el\nEntrenador, más poderoso será\neste ataque.") },
            // { PBEMove.219, new PBELocalizedString("The user creates a protective field that\nprevents status problems for five turns.", "Champ protecteur empêchant tous les\nproblèmes de statut pendant 5 tours.", "Team des Anwenders ist fünf Runden\nvor Statusproblemen geschützt.", "Chi la usa crea un campo protettivo che\ndifende tutta la squadra dai problemi di\nstato per cinque turni.", "５ターンの　あいだ\nふしぎな　ちからに　まもられて\nじょうたい　いじょうに　ならなくなる。", "５ターンの　あいだ\n不思議な　力に　守られて\n状態異常に　ならなくなる。", "5턴 동안\n이상한 힘의 보호를 받아\n상태 이상이 되지 않는다.", "Crea un campo protector que evita\nproblemas de estado durante cinco turnos.") },
            { PBEMove.PainSplit, new PBELocalizedString("The user adds its HP to the target's HP,\nthen equally shares the combined HP\nwith the target.", "Le lanceur ajoute ses PV à ceux de\nsa cible et les répartit équitablement.", "Addiert KP von Anwender und\nZiel. Teilt sie gerecht auf.", "Chi la usa somma i propri PS a quelli\ndi un altro Pokémon per poi dividerli\nin parti uguali.", "じぶんの　ＨＰと　あいての　ＨＰを\nあわせて　それを　じぶんと　あいてで\nなかよく　わける。", "自分の　ＨＰと　相手の　ＨＰを\nあわせて　それを　自分と　相手で\nなかよく　わける。", "자신의 HP와 상대의 HP를\n합친 것을 자신과 상대가\n사이좋게 나눈다.", "Suma los PS del usuario a los del objetivo\ny los reparte a partes iguales.") },
            { PBEMove.SacredFire, new PBELocalizedString("The target is razed with a mystical fire\nof great intensity. It may also leave the\ntarget with a burn.", "Un feu mystique d'une intensité\nredoutable attaque l'ennemi.\nPeut aussi le brûler.", "Mystische Feuer-Attacke, durch die\ndas Ziel eventuell Verbrennungen\nerleidet.", "Colpisce il nemico con un fuoco mistico di\nenorme intensità che può anche causargli\nuna scottatura.", "しんぴの　ほのおで\nあいてを　やきつくして　こうげきする。\nやけど　じょうたいに　することが　ある。", "神秘の　炎で\n相手を　焼きつくして　攻撃する。\nやけど状態に　することが　ある。", "신비한 불꽃으로\n상대를 태워서 공격한다.\n화상 상태로 만들 때가 있다.", "Fuego místico de gran intensidad\nque puede causar quemaduras.") },
            { PBEMove.Magnitude, new PBELocalizedString("The user looses a ground-shaking quake\naffecting everyone around the user.\nIts power varies.", "Un tremblement de terre d'intensité\nvariable qui affecte tous les Pokémon\nalentour. L'efficacité varie.", "Erdbebenartiger Angriff von zufälliger\nStärke gegen andere Pokémon in der\nUmgebung des Anwenders.", "Chi la usa scatena un terremoto\nd'intensità variabile che danneggia\ngli altri Pokémon in campo.", "じめんを　ゆらして　じぶんの\nまわりに　いるものを　こうげきする。\nわざの　いりょくは　いろいろ　かわる。", "地面を　揺らして　自分の\n周りに　いるものを　攻撃する。\n技の　威力は　いろいろ　変わる。", "땅을 흔들어서 자신의\n주위에 있는 포켓몬을 공격한다.\n기술의 위력이 여러모로 바뀐다.", "Sacudida sísmica de intensidad\nvariable que afecta a los Pokémon\nadyacentes en combate.") },
            { PBEMove.DynamicPunch, new PBELocalizedString("The user punches the target with full,\nconcentrated power.\nIt confuses the target if it hits.", "Le lanceur rassemble ses forces et\nenvoie un coup de poing à l'ennemi.\nS'il est touché, il est confus.", "Kräftiger Schlag, der das Ziel\nbei Erfolg verwirrt.", "Colpisce il nemico con un pugno davvero\nforte. Se va a segno, lo confonde.", "こんしんの　ちからで\nパンチを　くりだして　こうげきする。\nあいてを　かならず　こんらん　させる。", "こん身の　力で\nパンチを　くりだして　攻撃する。\n相手を　必ず　混乱させる。", "혼신의 힘으로\n펀치를 날려서 공격한다.\n상대를 반드시 혼란시킨다.", "Puñetazo con toda la fuerza concentrada.\nCausa confusión si atina.") },
            { PBEMove.Megahorn, new PBELocalizedString("Using its tough and impressive horn,\nthe user rams into the target\nwith no letup.", "Le lanceur utilise ses gigantesques\ncornes pour charger l'ennemi.", "Brutaler Ramm-Angriff mit spitzem,\nbeeindruckendem Horn.", "Chi la usa utilizza il suo robusto e\nimponente corno per colpire il nemico\ncon tutto se stesso.", "かたくて　りっぱな　つので　おもいっきり\nあいてを　つきさして　こうげきする。\n", "硬くて　りっぱな　つので　おもいっきり\n相手を　突き刺して　攻撃する。\n", "단단하고 훌륭한 뿔로 마음껏\n상대를 꿰찔러서 공격한다.", "Violenta embestida con cuernos\nimponentes.") },
            { PBEMove.DragonBreath, new PBELocalizedString("The user exhales a mighty gust that\ninflicts damage. It may also leave the\ntarget with paralysis.", "Le lanceur souffle fort sur l'ennemi pour\ninfliger des dégâts. Peut aussi le\nparalyser.", "Fegt das Ziel mit zerstörerisch\nheißem Atem weg. Paralysiert\ndas Ziel eventuell.", "Investe il nemico con una raffica\npotentissima che arreca danni.\nPuò anche paralizzarlo.", "ものすごい　いきを\nあいてに　ふきつけて　こうげきする。\nまひ　じょうたいに　することが　ある。", "ものすごい　息を\n相手に　吹きつけて　攻撃する。\nまひ状態に　することが　ある。", "굉장한 숨결을\n상대에게 내뿜어 공격한다.\n마비 상태로 만들 때가 있다.", "Poderosa ráfaga de aliento que golpea\nal objetivo y puede paralizarlo.") },
            // { PBEMove.226, new PBELocalizedString("The user switches places with a party\nPokémon in waiting, passing along any\nstat changes.", "Le lanceur échange sa place et tout\nchangement de stat avec un Pokémon\nde l'équipe.", "Tauscht Pokémon aus. Alle\nStatusveränderungen\nbleiben bestehen.", "Chi la usa è sostituito da un Pokémon\ndella squadra, che eredita anche ogni\nmodifica alle statistiche.", "ひかえの　ポケモンと　いれかわる。\nのうりょく　へんかは　かわった\nポケモンが　そのまま　うけつぐ。", "控えの　ポケモンと　入れ替わる。\n能力変化は　替わった\nポケモンが　そのまま　受けつぐ。", "교대 포켓몬과 바뀐다.\n능력 변화는 바뀐 포켓몬이\n그대로 이어받는다.", "Cambia el puesto con un compañero y le\npasa los cambios de características.") },
            // { PBEMove.227, new PBELocalizedString("The user compels the target\nto keep using only the move\nit last used for three turns.", "Oblige l'ennemi à répéter la dernière\ncapacité utilisée durant 3 tours.", "Das Ziel wiederholt letzte Attacke drei\nRunden lang.", "Chi la usa obbliga per tre turni il nemico a\nripetere l'ultima mossa eseguita.", "あいてが　さいごに　つかった　わざを\n３ターンの　あいだ\nずっと　ださせる。", "相手が　最後に　使った技を\n３ターンの　あいだ\nずっと　ださせる。", "상대가 마지막으로 사용한\n기술을 3턴 동안\n계속 쓰게 한다.", "El objetivo repite su último movimiento\ndurante tres turnos.") },
            // { PBEMove.228, new PBELocalizedString("An attack move that inflicts double damage\nif used on a target that is switching out\nof battle.", "Une attaque qui inflige deux fois plus de\ndégâts à un ennemi qui quitte le combat.", "Die Attacke richtet beim Ziel doppelten\nSchaden an, falls es ausgetauscht wird.", "Una mossa d'attacco che infligge un danno\ndoppio se il nemico è in fase di\nsostituzione.", "あいて　ポケモンが　いれかわる　ときに\nわざを　だしていると\nばいの　いりょくで　こうげき　できる。", "相手　ポケモンが　入れ替わるときに\n技を　だしていると\n倍の　威力で　攻撃できる。", "상대 포켓몬이 교체될 때\n기술을 쓰면 2배의 위력으로\n공격할 수 있다.", "Hace el doble de daño al objetivo que pide\nel relevo.") },
            // { PBEMove.229, new PBELocalizedString("A spin attack that can also eliminate\nsuch moves as Bind, Wrap, Leech Seed,\nand Spikes.", "Une attaque tournoyante pouvant aussi\nannuler par ex. Étreinte, Ligotage,\nVampigraine ou Picots.", "Trifft das Ziel mit einer Dreh-Attacke.\nBefreit sich unter anderem von Wickel,\nKlammergriff, Egelsamen und Stachler.", "Attacco rotante che elimina gli effetti di\nmosse come Legatutto, Avvolgibotta, Punte\ne Parassiseme.", "かいてんして　あいてを　こうげきする。\nしめつける　まきつく　やどりぎのタネ\nまきびし　なども　ふきとばせる。", "回転して　相手を　攻撃する。\nしめつける　まきつく　やどりぎのタネ\nまきびし　なども　吹きとばせる。", "회전해서 상대를 공격한다.\n조이기, 김밥말이, 씨뿌리기,\n압정뿌리기 등도 날려버린다.", "Ataque giratorio que puede eliminar\nmovimientos como Atadura,\nRepetición, Drenadoras y Púas.") },
            { PBEMove.SweetScent, new PBELocalizedString("A sweet scent that lowers the opposing\nteam's evasiveness. It also lures wild\nPokémon if used in grass, etc.", "Un doux parfum qui réduit l'Esquive\nde l'ennemi. Attire aussi\nles Pokémon sauvages.", "Lockt Gegner an und senkt deren\nFluchtwert. Lockt im Gras auch\nwilde Pokémon an.", "Un dolce profumo che riduce l'elusione dei\nnemici. Fuori dalla lotta attira i Pokémon\nselvatici.", "かおりで　あいての　かいひりつを\nさげる。くさむら　などで　つかうと\nポケモンが　よってくる。", "香りで　相手の　回避率を　さげる。\n草むら　などで　使うと\nポケモンが　よってくる。", "향기로 상대의 회피율을 떨어뜨린다.\n풀밭 등에서 쓰면\n포켓몬이 다가온다.", "Engatusa al objetivo para reducir\nsu Evasión. En la hierba alta sirve\npara atraer Pokémon salvajes.") },
            { PBEMove.IronTail, new PBELocalizedString("The target is slammed with a steel-hard\ntail. It may also lower the target's\nDefense stat.", "Attaque l'ennemi avec une queue de fer.\nPeut aussi baisser la Défense de l'ennemi.", "Attacke mit hartem Eisenschweif.\nSenkt eventuell den Verteidigungs-Wert\ndes Zieles.", "Il nemico viene colpito da una robusta\ncoda d'acciaio. Può anche ridurne\nla Difesa.", "かたい　しっぽで　あいてを　たたきつけて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "硬い　しっぽで\n相手を　たたきつけて　攻撃する。\n相手の　防御を　さげることが　ある。", "단단한 꼬리로\n상대를 힘껏 쳐서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Ataca con una cola férrea y puede bajar\nla Defensa del objetivo.") },
            { PBEMove.MetalClaw, new PBELocalizedString("The target is raked with steel claws.\nIt may also raise the user's Attack stat.", "Attaque avec des griffes d'acier. Peut\naussi augmenter l'Attaque du lanceur.", "Klauen-Attacke, die eventuell den\nAngriffs-Wert des Anwenders erhöht.", "Colpisce il nemico con artigli d'acciaio.\nPuò anche aumentare l'Attacco di chi\nla usa.", "こうてつの　ツメで　あいてを　きりさいて\nこうげきする。じぶんの　こうげきが\nあがることが　ある。", "鋼鉄の　ツメで\n相手を　切り裂いて　攻撃する。\n自分の　攻撃が　あがることが　ある。", "강철의 발톱으로\n상대를 베어 갈라 공격한다.\n자신의 공격이 올라갈 때도 있다.", "Ataque con garras de acero que puede\naumentar el Ataque del usuario.") },
            { PBEMove.VitalThrow, new PBELocalizedString("The user attacks last.\nIn return, this throw move is\nguaranteed not to miss.", "Le lanceur porte son coup en\ndernier. En échange, cette\ncapacité n'échoue jamais.", "Anwender greift als Letzter an, hat dafür\naber eine Treffergarantie beim eigenen\nAngriff.", "Chi la usa attacca per ultimo, ma il colpo\nè sempre infallibile.", "あいてより　あとに　こうげきする。\nそのかわり　じぶんの　こうげきは\nかならず　めいちゅうする。", "相手より　あとに　攻撃する。\nそのかわり　自分の　攻撃は\n必ず　命中する。", "상대보다 나중에 공격한다.\n그 대신 자신의 공격은\n반드시 명중한다.", "El usuario ataca el último,\npero no falla.") },
            { PBEMove.MorningSun, new PBELocalizedString("The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "じぶんの　ＨＰを　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "自分の　ＨＰを　回復する。\n天気に　よって\n回復の　量が　変化する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.") },
            { PBEMove.Synthesis, new PBELocalizedString("The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "じぶんの　ＨＰを　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "自分の　ＨＰを　回復する。\n天気に　よって\n回復の　量が　変化する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.") },
            { PBEMove.Moonlight, new PBELocalizedString("The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "じぶんの　ＨＰを　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "自分の　ＨＰを　回復する。\n天気に　よって\n回復の　量が　変化する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.") },
            { PBEMove.HiddenPower, new PBELocalizedString("A unique attack that varies in type and\nintensity depending on the Pokémon\nusing it.", "Attaque dont la puissance et le type\ndépendent du Pokémon qui l'utilise.", "Wirkung und Typ der Attacke\nhängen vom Anwender ab.", "Mossa singolare che cambia tipo e\npotenza a seconda del Pokémon che\nla usa.", "わざを　つかった　ポケモンに　よって\nあいてに　あたえる\nわざの　タイプと　いりょくが　かわる。", "技を　使った　ポケモンに　よって\n相手に　与える\n技の　タイプと　威力が　変わる。", "기술을 배운 포켓몬의\n숨겨진 능력으로\n기술 타입과 위력이 바뀐다.", "Ataque único cuyo tipo y potencia varían\nsegún el agresor.") },
            { PBEMove.CrossChop, new PBELocalizedString("The user delivers a double chop with its\nforearms crossed.\nCritical hits land more easily.", "Le lanceur délivre un coup double en\ncroisant les avant-bras. Taux de\ncritiques élevé.", "Doppelter Hieb mit den Unterarmen.\nHohe Volltrefferquote.", "Investe il nemico con un colpo sferrato\ncon entrambe le braccia incrociate.\nProbabile brutto colpo.", "りょうて　チョップを\nあいてに　たたきつけて　こうげきする。\nきゅうしょに　あたりやすい。", "両手チョップを\n相手に　たたきつけて　攻撃する。\n急所に　当たりやすい。", "양손으로 당수를\n상대에게 힘껏 쳐서 공격한다.\n급소에 맞기 쉽다.", "Corte doble que suele propinar\nun golpe crítico.") },
            // { PBEMove.239, new PBELocalizedString("The user whips up a vicious tornado\nto tear at the opposing team.\nIt may also make targets flinch.", "Déclenche un terrible ouragan sur\nl'ennemi. Peut aussi l'apeurer.", "Trifft Gegner in der Umgebung mit\nheftigem Wirbelsturm, welche\neventuell zurückschrecken.", "Un potente tornado si abbatte sul nemico.\nPuò anche farlo tentennare.", "たつまきを　おこして\nあいてを　まきこみ　こうげきする。\nあいてを　ひるませる　ことが　ある。", "竜巻を　おこして\n相手を　まきこみ　攻撃する。\n相手を　ひるませることが　ある。", "회오리를 일으켜\n상대를 끌어들여 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Crea un violento tornado\npara hacer trizas al enemigo.\nPuede hacerle retroceder.") },
            { PBEMove.RainDance, new PBELocalizedString("The user summons a heavy rain\nthat falls for five turns,\npowering up Water-type moves.", "Invoque de fortes pluies qui durent\n5 tours et améliorent les capacités\nde type Eau.", "Anwender erzeugt starken Regen.\nDie Stärke von Wasser-Attacken\nerhöht sich fünf Runden lang.", "Chi la usa provoca una forte pioggia per\ncinque turni, potenziando le mosse di\ntipo Acqua.", "５ターンの　あいだ　あめを　ふらせて\nみずタイプの\nわざの　いりょくを　あげる。", "５ターンの　あいだ　雨を　降らせて\nみずタイプの\n技の　威力を　あげる。", "5턴 동안 비를 내리게 하여\n물타입 기술의\n위력을 올린다.", "Genera una fuerte lluvia que refuerza\nlos movimientos de tipo Agua durante\ncinco turnos.") },
            { PBEMove.SunnyDay, new PBELocalizedString("The user intensifies the sun for\nfive turns, powering up\nFire-type moves.", "Fait briller le soleil pendant 5 tours et\naméliore les capacités de type Feu.", "Die Sonne brennt unbarmherzig fünf\nRunden lang. Dadurch werden Attacken\nvom Typ Feuer verstärkt.", "Chi la usa intensifica i raggi solari per\ncinque turni, potenziando le mosse di tipo\nFuoco.", "５ターンの　あいだ　ひざしを\nつよくして　ほのおタイプの\nわざの　いりょくを　あげる。", "５ターンの　あいだ　日差しを\n強くして　ほのおタイプの\n技の　威力を　あげる。", "5턴 동안 햇살을\n강하게 해서 불꽃타입\n기술의 위력을 올린다.", "Quien lo usa intensifica el sol durante\ncinco turnos, lo que potencia los\nmovimientos de tipo Fuego.") },
            { PBEMove.Crunch, new PBELocalizedString("The user crunches up the target\nwith sharp fangs. It may also lower\nthe target's Defense stat.", "Le lanceur mord l'ennemi de ses\ncrocs pointus. Peut aussi baisser\nla Défense de l'ennemi.", "Beißt mit scharfen Reißzähnen\nzu und senkt eventuell die\nVerteidigung.", "Il nemico viene morso con denti affilati.\nPuò anche ridurne la Difesa.", "するどい　はで　あいてを　かみくだいて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "鋭い　歯で\n相手を　かみくだいて　攻撃する。\n相手の　防御を　さげることが　ある。", "날카로운 이빨로\n상대를 깨물어 부숴서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Tritura con afilados colmillos y puede\nbajar la Defensa del objetivo.") },
            // { PBEMove.243, new PBELocalizedString("A retaliation move that counters any\nspecial attack, inflicting double the\ndamage taken.", "Une riposte qui contre n'importe quelle\nattaque spéciale en infligeant le double\ndes dégâts subis.", "Kontert den Spezial-Angriff des Gegners\nmit doppeltem Schaden.", "Mossa che replica ogni attacco speciale,\narrecando il doppio del danno ricevuto.", "あいてから　うけた　とくしゅ　こうげきの\nダメージを　２ばいに　して\nそのあいてに　かえす。", "相手から　受けた　特殊攻撃の\nダメージを　２倍に　して\nその相手に　返す。", "상대에게 받은 특수공격의\n데미지를 2배로 만들어\n그 상대에게 돌려준다.", "Responde a un ataque especial\nocasionando el doble del daño\nrecibido.") },
            { PBEMove.PsychUp, new PBELocalizedString("The user hypnotizes itself into\ncopying any stat change made\nby the target.", "Une autohypnose qui permet au lanceur\nde copier les changements de\nstats de la cible.", "Der Anwender hypnotisiert sich selbst, um\ndie Statusveränderungen des Zieles\nzu kopieren.", "Chi la usa s'ipnotizza per copiare ogni\nmodifica alle statistiche del bersaglio.", "じぶんに　あんじを　かけることで\nのうりょく　へんかの　じょうたいを\nあいてと　おなじにする。", "自分に　暗示を　かけることで\n能力変化の　状態を\n相手と　同じにする。", "자신에게 암시를 걸어서\n능력 변화 상태를\n상대와 똑같은 상태로 만든다.", "Quien lo usa se hipnotiza y copia\ncualquier cambio que haya en las\ncaracterísticas de su objetivo.") },
            { PBEMove.ExtremeSpeed, new PBELocalizedString("The user charges the target at blinding\nspeed. This attack always goes\nbefore any other move.", "Le lanceur charge à une vitesse\nrenversante. Cette attaque a\ntoujours l'initiative.", "Extrem schnelle und kraftvolle\nAttacke, die stets zuerst trifft.", "Chi la usa carica il nemico a velocità\nimpressionante ed attacca sempre per\nprimo.", "めにも　とまらぬ　ものすごい　はやさで\nあいてに　とっしんして　こうげきする。\nかならず　せんせい　こうげき　できる。", "目にも　留まらぬ　ものすごい　速さで\n相手に　突進して　攻撃する。\n必ず　先制攻撃　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진하여 공격한다.\n반드시 선제공격을 할 수 있다.", "Ataque muy rápido que siempre\nse realiza el primero.") },
            { PBEMove.AncientPower, new PBELocalizedString("The user attacks with a prehistoric power.\nIt may also raise all the user's stats\nat once.", "Une attaque préhistorique qui peut\naugmenter toutes les stats du lanceur\nd'un seul coup.", "Angriff mit antiker Kraft, der alle\nStatuswerte erhöhen kann.", "Colpisce il nemico con una forza\nprimordiale. Può aumentare tutte\nle statistiche.", "げんしの　ちからで　こうげきする。\nじぶんの　すべての\nのうりょくが　あがることが　ある。", "原始の　力で　攻撃する。\n自分の　すべての\n能力が　あがることが　ある。", "원시의 힘으로 공격한다.\n자신의 모든\n능력이 오를 때가 있다.", "Ataque prehistórico que puede subir todas\nlas características.") },
            { PBEMove.ShadowBall, new PBELocalizedString("The user hurls a shadowy blob at the\ntarget. It may also lower the target's\nSp. Def stat.", "Projette une grande ombre sur\nl'ennemi. Peut aussi faire baisser\nsa Défense Spéciale.", "Bewirft das Ziel mit gruseligem Ball und\nsenkt eventuell die Spezial-Verteidigung.", "Lancia sul nemico una sfera nera.\nPuò anche ridurne la Difesa Speciale.", "くろいかげの　かたまりを　なげつけて\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "黒い影の　塊を　投げつけて\n攻撃する。相手の　特防を\nさげることが　ある。", "까만 그림자의 덩어리를 내던져서\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Lanza una bola oscura que puede bajar\nla Defensa Especial del objetivo.") },
            // { PBEMove.248, new PBELocalizedString("Two turns after this move is used,\na hunk of psychic energy\nattacks the target.", "De l'énergie psychique vient frapper\nl'ennemi 2 tours après l'utilisation\nde cette capacité.", "Zwei Runden, nachdem Seher eingesetzt\nwurde, erfolgt der Angriff.", "Due turni dopo l'utilizzo di questa mossa,\nil nemico viene attaccato con energia\npsichica.", "わざを　つかった　２ターン　あとに\nあいてに　ねんりきの\nかたまりを　おくって　こうげきする。", "技を　使った　２ターン後に\n相手に　念力の\n塊を　送って　攻撃する。", "기술을 사용한 2턴 뒤에\n상대에게 염동력의\n덩어리를 보내어 공격한다.", "Concentra energía psíquica para golpear\nal objetivo dos turnos después.") },
            { PBEMove.RockSmash, new PBELocalizedString("The user attacks with a punch that can\nshatter a rock. It may also lower the\ntarget's Defense stat.", "Porte un coup dévastateur à l'ennemi.\nPeut briser des rochers fissurés.\nPeut baisser la Défense.", "Steinbrechende Attacke, die den\nVerteidigungs-Wert des Zieles\nsenken kann.", "Il nemico viene colpito da un pugno in\ngrado di frantumare anche la roccia.\nPuò anche ridurne la Difesa.", "いわを　くだくような\nパンチで　こうげきする。あいての\nぼうぎょを　さげる　ことが　ある。", "岩をも　くだくような\nパンチで　攻撃する。相手の\n防御を　さげる　ことが　ある。", "바위를 깨는 듯한\n펀치로 공격한다. 상대의\n방어를 떨어뜨릴 때가 있다.", "Ataca con puñetazos que pueden\nromper rocas. Puede bajar\nla Defensa del objetivo.") },
            // { PBEMove.250, new PBELocalizedString("Traps foes in a violent swirling\nwhirlpool for four to five turns.", "Piège l'ennemi dans une trombe\nd'eau pendant 4 à 5 tours.", "Das Ziel wird für 4 bis 5 Runden in einer\nWasserhose gefangen.", "Intrappola il nemico in un turbine d'acqua\nche dura per quattro o cinque turni\ninfliggendogli dei danni ogni turno.", "はげしく　うずをまく　みずの　なかに\n４ー５ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "激しく　渦をまく　水の中に\n４ー５ターンの　あいだ\n相手を　閉じこめて　攻撃する。", "세차게 소용돌이치는\n물속에 4-5턴 동안\n상대를 가두어 공격한다.", "Una tromba de agua atrapa al objetivo\ndurante cuatro o cinco turnos.") },
            // { PBEMove.251, new PBELocalizedString("The user gets all party Pokémon to attack\nthe target. The more party Pokémon,\nthe greater the number of attacks.", "Le lanceur appelle tous les Pokémon de\nson équipe à attaquer. Plus ils sont\nnombreux, plus il y a d'attaques.", "Das gesamte Team nimmt aktiv am Kampf\nteil. Je mehr Pokémon, desto höher die\nAnzahl der Angriffe.", "Chi la usa chiama in aiuto i Pokémon della\nsquadra: più ce ne sono, maggiore è\nil numero di attacchi.", "みかた　ぜんいんで　こうげきする。\nなかまの　ポケモンが　おおいほど\nわざの　こうげきかいすうが　ふえる。", "味方　全員で　攻撃する。\n仲間の　ポケモンが　多いほど\n技の　攻撃回数が　増える。", "같은 편 전원이 공격한다.\n동료 포켓몬이 많을수록\n기술의 공격 횟수가 증가한다.", "Ataque de todo el equipo Pokémon.\nCuantos más haya, más veces ataca.") },
            // { PBEMove.252, new PBELocalizedString("An attack that hits first and makes the\ntarget flinch. It only works the first turn\nthe user is in battle.", "Permet de frapper en premier et\napeure l'ennemi. Ne fonctionne\nqu'au premier tour.", "Diese Attacke trifft zuerst. Das Ziel\nschreckt zurück. Gelingt nur in der\nersten Runde eines Kampfes.", "Mossa che fa agire per primo e fa\ntentennare il nemico. Funziona solo\nappena sceso in campo.", "せんせい　こうげきで　あいてを\nひるませる。せんとうに　でたら\nすぐに　ださないと　せいこう　しない。", "先制攻撃で　相手を　ひるませる。\n戦闘に　でたら\nすぐに　ださないと　成功しない。", "선제공격으로 상대를 풀죽게 한다.\n배틀에 나가서\n바로 쓰지 않으면 성공할 수 없다.", "Ataca primero y, además, hace retroceder\nal objetivo. Solo sirve en el primer turno.") },
            // { PBEMove.253, new PBELocalizedString("The user attacks in an uproar for\nthree turns. Over that time,\nno one can fall asleep.", "Le lanceur attaque en rugissant durant\n3 tours. Pendant ce temps, personne\nne peut s'endormir.", "Anwender greift an, indem er über drei\nRunden hinweg einen Aufruhr erzeugt.\nVerhindert Schlaf.", "Chi la usa attacca per tre turni con un\nfrastuono che non fa dormire nessuno.", "３ターンの　あいだ\nさわいで　あいてを　こうげきする。\nそのあいだは　だれも　ねむれなく　なる。", "３ターンの　あいだ\n騒いで　相手を　攻撃する。\nそのあいだは　だれも　眠れなくなる。", "3턴 동안\n소란피워 공격한다.\n그 동안은 아무도 잠들지 않게 된다.", "Ataca de forma alborotada durante tres\nturnos. Mantiene despiertos a todos.") },
            // { PBEMove.254, new PBELocalizedString("The user charges up power and raises\nboth its Defense and Sp. Def. The move\ncan be used three times.", "Le lanceur accumule de la puissance et\naugmente sa Défense et sa Défense\nSpéciale. Peut être utilisé 3 fois.", "Lädt Kraft für später auf. Erhöht\nVerteidigung und Spezial-Verteidigung.\nKann bis zu dreimal eingesetzt werden.", "Chi la usa accumula energia aumentando\nla Difesa e la Difesa Speciale.\nSi può utilizzare tre volte.", "ちからを　たくわえて　じぶんの\nぼうぎょと　とくぼうを　あげる。\nさいだい　３かいまで　たくわえられる。", "力を　蓄えて　自分の\n防御と　特防を　あげる。\n最大　３回まで　蓄えられる。", "힘을 비축해서 자신의\n방어와 특수방어를 올린다.\n최대 3회까지 비축할 수 있다.", "Acumula energía y sube la Defensa y\nla Defensa Especial. Puede utilizarse\nhasta tres veces.") },
            // { PBEMove.255, new PBELocalizedString("The power stored using the move Stockpile\nis released at once in an attack. The more\npower is stored, the greater the damage.", "Libère dans une attaque la puissance\nprécédemment accumulée avec Stockage.", "Entlädt die Kraft, die während des\nEinsatzes von Horter gesammelt wurde.", "Tutta l'energia accumulata in precedenza\ncon Accumulo è rilasciata nell'attacco.\nMaggiore è l'energia, più danni si arrecano.", "たくわえた　ちからを　あいてに　ぶつけて\nこうげきする。たくわえて　いるほど\nいりょくが　あがる。", "蓄えた　力を\n相手に　ぶつけて　攻撃する。\n蓄えているほど　威力が　あがる。", "비축된 힘을\n상대에게 부딪쳐서 공격한다.\n비축된 만큼 위력이 올라간다.", "Libera de una vez la energía acumulada\ncon Reserva.") },
            // { PBEMove.256, new PBELocalizedString("The power stored using the move Stockpile\nis absorbed by the user to heal its HP.\nStoring more power heals more HP.", "Le lanceur absorbe la puissance accumulée\navec Stockage pour restaurer ses PV.", "Absorbiert die gehortete Kraft,\num KP aufzufüllen.", "Chi la usa assorbe l'energia raccolta\ncon la mossa Accumulo e recupera PS.\nMaggiore è l'energia, più PS si recuperano.", "たくわえた　ちからを　のみこんで\nじぶんの　ＨＰを　かいふく　する。\nたくわえて　いるほど　かいふく　する。", "蓄えた　力を　のみこんで\n自分の　ＨＰを　回復する。\n蓄えているほど　回復する。", "비축된 힘을 꿀꺽해서\n자신의 HP를 회복한다.\n비축된 만큼 회복한다.", "Absorbe la energía acumulada\ncon Reserva y restaura PS.") },
            { PBEMove.HeatWave, new PBELocalizedString("The user attacks by exhaling hot breath\non the opposing team. It may also leave\ntargets with a burn.", "Le lanceur provoque une vague de\nchaleur. Peut aussi brûler l'ennemi.", "Gegner wird von Sturm aus heißer\nLuft getroffen und verbrennt sich\neventuell.", "Chi la usa investe il nemico con una folata\ndi vento caldo. Può anche scottarlo.", "あつい　いきを\nあいてに　ふきつけて　こうげきする。\nやけど　じょうたいに　することが　ある。", "熱い　息を\n相手に　吹きつけて　攻撃する。\nやけど状態に　することが　ある。", "뜨거운 숨결을\n상대에게 내뿜어 공격한다.\n화상 상태로 만들 때가 있다.", "Provoca un viento abrasador que puede\nquemar al objetivo.") },
            { PBEMove.Hail, new PBELocalizedString("The user summons a hailstorm lasting five\nturns. It damages all Pokémon except the\nIce type.", "Invoque une tempête de grêle qui dure 5\ntours. Ne blesse pas les Pokémon de type\nGlace.", "Hagelsturm für fünf Runden. Schadet\nallen, außer Eis-Pokémon.", "Chi la usa causa una grandinata che dura\ncinque turni. Danneggia tutti i Pokémon\ntranne quelli di tipo Ghiaccio.", "５ターンの　あいだ　あられを　ふらして\nこおりタイプで　ない　ポケモン\nぜんいんに　ダメージを　あたえる。", "５ターンの　あいだ　あられを　降らして\nこおりタイプで　ない　ポケモン\n全員に　ダメージを　与える。", "5턴 동안 싸라기눈을 내리게 해\n얼음타입이 아닌 포켓몬\n모두에게 데미지를 준다.", "Tormenta de granizo que dura cinco\nturnos. Hiere a todos, excepto a\nlos de tipo Hielo.") },
            // { PBEMove.259, new PBELocalizedString("The user torments and enrages the\ntarget, making it incapable of using\nthe same move twice in a row.", "Le lanceur irrite l'ennemi pour\nl'empêcher d'utiliser la même\ncapacité 2 fois de suite.", "Erzürnt das Ziel, um wiederholten\nEinsatz derselben Attacke zu\nverhindern.", "Chi la usa tormenta e fa infuriare\nil nemico, impedendogli di usare\nla stessa mossa due volte di seguito.", "あいてに　いちゃもんを　つけて　\nおなじ　わざを　２かい　れんぞくで\nだせなくする。", "相手に　いちゃもんを　つけて　\n同じ　技を　２回連続で\nだせなくする。", "상대에게 트집을 잡아서\n똑같은 기술을 2회 연속으로\n쓸 수 없게 한다.", "Atormenta y enfurece al objetivo, que no\npuede usar dos veces seguidas\nel mismo movimiento.") },
            { PBEMove.Flatter, new PBELocalizedString("Flattery is used to confuse the target.\nHowever, it also raises the target's\nSp. Atk stat.", "Rend la cible confuse, mais\naugmente son Attaque Spéciale.", "Schmeichelt dem Ziel, um es zu verwirren.\nErhöht dessen Spezial-Angriff.", "Adula il bersaglio e lo confonde, ma ne\naumenta l'Attacco Speciale.", "あいてを　おだてて　こんらん　させる。\nどうじに　あいての　とくこうも\nあげて　しまう。", "相手を　おだてて　混乱させる。\n同時に　相手の　特攻も\nあげてしまう。", "상대를 부추겨서 혼란시킨다.\n동시에 상대의 특수공격도\n올라가 버린다.", "Halaga al objetivo y lo confunde, pero\ntambién sube su Ataque Especial.") },
            { PBEMove.WillOWisp, new PBELocalizedString("The user shoots a sinister, bluish-white\nflame at the target to inflict a burn.", "Lance une sinistre flamme violette à\nl'ennemi pour lui infliger une brûlure.", "Angriff mit unheimlicher Flamme,\ndie das Ziel verbrennt.", "Fiamme intense di colore viola causano\nuna scottatura al nemico.", "ぶきみで　あやしい　ほのおを　はなって\nあいてを　やけどの　じょうたいに　する。\n", "不気味で　怪しい　炎を　放って\n相手を　やけどの　状態に　する。\n", "으스스하고 괴상한 불꽃을 쏘아\n상대를 화상 상태로 만든다.", "Siniestra llama morada que produce\nquemaduras.") },
            // { PBEMove.262, new PBELocalizedString("The user faints when using this move.\nIn return, it harshly lowers the target's\nAttack and Sp. Atk.", "Le lanceur est mis K.O., mais l'Attaque\net l'Attaque Spéciale de l'ennemi baissent\nbeaucoup.", "Der Anwender wird besiegt und senkt\nden Angriffs-Wert und den Spezial-\nAngriff des Zieles stark.", "Chi la usa va KO. Tuttavia, riduce di molto\nl'Attacco e l'Attacco Speciale del nemico.", "じぶんは　ひんしに　なるが　そのかわりに\nあいての　こうげきと　とくこうを\nがくっと　さげる。", "自分は　ひんしに　なるが　そのかわりに\n相手の　攻撃と　特攻を\nがくっと　さげる。", "자신은 기절하게 되지만 그 대신\n상대의 공격과 특수공격을\n크게 떨어뜨린다.", "El usuario se debilita, pero baja mucho\ntanto el Ataque como el Ataque Especial\ndel objetivo.") },
            { PBEMove.Facade, new PBELocalizedString("An attack move that doubles its power if\nthe user is poisoned, burned, or\nhas paralysis.", "Une attaque dont la puissance double\nlorsque le lanceur est empoisonné,\nparalysé ou brûlé.", "Doppelte Stärke nach Verbrennung,\nParalyse oder Vergiftung.", "Mossa d'attacco che raddoppia la potenza\nse chi la usa è scottato, avvelenato\no paralizzato.", "じぶんが　どく　まひ　やけど\nじょうたいの　とき　あいてに　くりだすと\nわざの　いりょくが　２ばいに　なる。", "自分が　毒　まひ　やけど\n状態のとき　相手に　くりだすと\n技の　威力が　２倍に　なる。", "자신이 독, 마비, 화상\n상태일 때 날리면\n기술의 위력이 2배가 된다.", "Ataca con el doble de potencia\nsi el usuario está quemado,\nparalizado o envenenado.") },
            // { PBEMove.264, new PBELocalizedString("The user focuses its mind before\nlaunching a punch. It will fail if the user\nis hit before it is used.", "Le lanceur se concentre avant\nd'attaquer. Échoue s'il est touché\navant d'avoir frappé.", "Anwender konzentriert sich, bevor er\nangreift. Wird er vorher getroffen, ist\ndie Attacke erfolglos.", "Chi la usa prende la mira prima di sferrare\nun pugno. Fallirà se verrà colpito prima\ndi eseguire la mossa.", "せいしんを　たかめて　パンチを\nくりだす。わざを　だす　までに\nこうげきを　うけると　しっぱい　する。", "精神を　高めて　パンチを　くりだす。\n技を　だすまでに\n攻撃を　受けると　失敗する。", "정신력을 높여 펀치를 날린다.\n기술을 쓰기 전에\n공격을 받으면 실패한다.", "Se concentra para dar un puñetazo.\nFalla si se sufre un golpe antes de su uso.") },
            // { PBEMove.265, new PBELocalizedString("This attack inflicts double damage on a\ntarget with paralysis. It also cures the\ntarget's paralysis, however.", "Cette attaque est doublement efficace\nsur les Pokémon paralysés, mais elle\nsoigne leur paralysie.", "Doppelt wirksam gegen paralysierte\nGegner, heilt sie aber auch davon.", "Infligge un danno doppio ad un bersaglio\nparalizzato, ma ne cura anche la paralisi.", "まひ　じょうたいの　あいてには\nいりょくが　２ばいに　なるが\nかわりに　あいての　まひが　なおる。", "まひ状態の　相手には\n威力が　２倍に　なるが\nかわりに　相手の　まひが　治る。", "마비 상태의 상대에게는\n위력이 2배가 되지만\n대신 상대의 마비가 풀린다.", "Hace el doble de daño a objetivos\nparalizados, pero también cura\nla parálisis.") },
            // { PBEMove.266, new PBELocalizedString("The user draws attention to itself,\nmaking all targets take aim\nonly at the user.", "Attire l'attention. Les ennemis\nn'attaquent que le lanceur.", "Zieht Aufmerksamkeit auf sich.\nGegner greift nur Anwender an.", "Chi la usa attrae l'attenzione su di sé,\ncostringendo i nemici a sceglierlo sempre\ncome bersaglio.", "じぶんに　ちゅうもく　させて\nあいてからの　こうげきを\nすべて　じぶんに　むけさせる。", "自分に　注目させて\n相手からの　攻撃を\nすべて　自分に　むけさせる。", "자신에게 주목시켜\n상대로부터의 공격을\n모두 자신에게 향하게 한다.", "Llama la atención para concentrar\ntodos los ataques de todos los del\nequipo rival hacia sí mismo.") },
            // { PBEMove.267, new PBELocalizedString("An attack that makes use of nature's\npower. Its effects vary depending on the\nuser's environment.", "Une attaque qui tire sa force de la\nnature. Son type varie selon le terrain.", "Angriff mit der Kraft der Natur, dessen\nTyp vom Ort abhängt, wo er durchgeführt\nwird.", "Mossa che fa uso della forza della natura.\nIl suo effetto varia in base all'ambiente.", "しぜんの　ちからで　こうげきする。\nつかう　ばしょで\nでてくる　わざが　へんかする。", "自然の　力で　攻撃する。\n使う　場所で\nでてくる　技が　変化する。", "자연의 힘으로 공격한다.\n사용하는 장소에 따라\n나오는 기술이 변화한다.", "Usa el poder de la naturaleza.\nSu efecto varía según el entorno\nde combate.") },
            // { PBEMove.268, new PBELocalizedString("The user boosts the power of the Electric\nmove it uses on the next turn. It also\nraises the user's Sp. Def stat.", "Le lanceur concentre sa puissance pour\nsa prochaine attaque Électrik.\nAugmente sa Défense Spéciale.", "Lädt Energie für die kommende\nElektro-Attacke auf. Erhöht die\nSpezial-Verteidigung.", "Potenzia la mossa di tipo Elettro usata\nsubito dopo. Aumenta anche la Difesa\nSpeciale di chi la usa.", "つぎの　ターンに　だす　でんきタイプの\nわざの　いりょくを　あげる。\nじぶんの　とくぼうも　あがる。", "次の　ターンに　だす　でんきタイプの\n技の　威力を　あげる。\n自分の　特防も　あがる。", "다음 턴에 쓸 전기타입\n기술의 위력을 올린다.\n자신의 특수방어도 올라간다.", "Recarga energía para potenciar el\nsiguiente movimiento de tipo Eléctrico.\nTambién sube la Defensa Especial.") },
            // { PBEMove.269, new PBELocalizedString("The target is taunted into a rage that\nallows it to use only attack moves\nfor three turns.", "Provoque l'ennemi. L'oblige à n'utiliser\nque des attaques pendant 3 tours.", "Bringt das Ziel in Rage. Dieses\nkann über drei Runden hinweg nur\nnoch angreifen.", "Provoca il nemico, inducendolo ad usare\nsolo mosse d'attacco per tre turni.", "あいてを　おこらせる。３ターンの\nあいだ　あいては　ダメージを\nあたえる　わざしか　だせなく　なる。", "相手を　怒らせる。３ターンの\nあいだ　相手は　ダメージを\n与える　技しか　だせなくなる。", "상대를 화나게 한다.\n3턴 동안 상대는 데미지를\n주는 기술밖에 쓸 수 없게 된다.", "Enfurece al objetivo para que solo\nuse movimientos de ataque\ndurante tres turnos.") },
            { PBEMove.HelpingHand, new PBELocalizedString("The user assists an ally by boosting\nthe power of its attack.", "Une capacité qui augmente la puissance\nd'attaque de l'allié pendant un tour.", "Anwender steigert die Kraft eines\nAngriffes eines Freundes.", "Mossa che aumenta la potenza dell'attacco\ndi un alleato.", "なかまを　たすける。\nてだすけ　された　ポケモンの　わざの\nいりょくは　いつもより　おおきく　なる。", "仲間を　助ける。\nてだすけ　された　ポケモンの　技の\n威力は　いつもより　大きくなる。", "동료를 돕는다.\n도움받은 포켓몬이 쓰는 기술의\n위력은 여느 때보다 커진다.", "El usuario ayuda a un aliado\nreforzando la potencia de\nsu ataque.") },
            // { PBEMove.271, new PBELocalizedString("The user catches the target off guard\nand swaps its held item with its own.", "Le lanceur prend la cible au dépourvu et\nl'oblige à échanger son objet contre\nle sien.", "Erwischt das Ziel auf dem falschen Fuß.\nGehaltene Items werden mit Anwender\ngetauscht.", "Chi la usa coglie il bersaglio in\ncontropiede e l'obbliga a cambiare\nil suo strumento con il proprio.", "あいての　すきを　ついて\nじぶんと　あいての\nもちものを　こうかんする。", "相手の　すきを　ついて\n自分と　相手の\n持ち物を　交換する。", "상대의 빈틈을 노려\n자신과 상대가 지닌 물건을\n교환한다.", "Engaña al objetivo desprevenido e\nintercambia objetos.") },
            // { PBEMove.272, new PBELocalizedString("The user mimics the target completely,\ncopying the target's natural Ability.", "Imite la cible et copie\nsa capacité spéciale.", "Parodiert das Ziel und kopiert seine\nFähigkeit.", "Chi la usa mima in tutto il bersaglio,\ncopiandone l'abilità.", "あいてに　なりきって　じぶんも　あいてと\nおなじ　とくせいに　へんかする。\n", "相手に　なりきって　自分も　相手と\n同じ　特性に　変化する。\n", "상대의 역할을 하여 자신도 상대와\n같은 특성으로 변화한다.", "Imita al objetivo por completo y copia\nsu habilidad.") },
            // { PBEMove.273, new PBELocalizedString("One turn after this move is used,\nthe target's HP is restored by\nhalf the user's maximum HP.", "Un vœu qui permet de récupérer la\nmoitié des PV max au tour suivant.", "Ein Wunsch füllt in der nächsten Runde\n50 % der KP des Anwenders bei diesem\noder einem eingewechselten Pokémon auf.", "Permette di recuperare metà dei PS massimi\nal turno successivo.", "つぎの　ターンに　\nじぶんの　ＨＰを　さいだい　ＨＰの　\nはんぶん　かいふく　する。", "次の　ターンに　\n自分の　ＨＰを　最大ＨＰの　\n半分　回復する。", "다음 턴에\n자신의 HP를 최대 HP의\n절반만큼 회복한다.", "Cumple el deseo de restaurar la mitad\nde los PS máximos en el siguiente turno.") },
            // { PBEMove.274, new PBELocalizedString("The user hurriedly and randomly uses a\nmove among those known by other\nPokémon in the party.", "Le lanceur se dépêche d'utiliser une\ncapacité au hasard parmi celles des\nPokémon de l'équipe.", "Greift zufällig mit einer Attacke eines\nTeampartners an.", "Chi la usa utilizza in fretta e a caso una\ndelle mosse degli altri Pokémon della\nsquadra.", "おおいそぎで　みかたの　たすけを　かりて\nひかえの　ポケモンが　おぼえている\nわざを　どれか　１つ　つかう。", "大急ぎで　味方の　助けを　かりて\n控えの　ポケモンが　おぼえている\n技を　どれか　１つ　使う。", "서둘러서 같은 편의 도움을 받아\n교대 포켓몬이 기억하고 있는\n기술 중 하나를 쓴다.", "Usa un movimiento de un miembro del equipo\nelegido al azar.") },
            // { PBEMove.275, new PBELocalizedString("The user lays roots that restore\nits HP on every turn. Because it is\nrooted, it can't switch out.", "Le lanceur plante ses racines et récupère\ndes PV à chaque tour. Une fois enraciné, il\nne peut plus fuir.", "Verwurzelung füllt jede Runde KP auf.\nAustausch ist unmöglich.", "Chi la usa mette delle radici che gli fanno\nrecuperare PS ad ogni turno. Non può\nessere sostituito.", "だいちに　ねを　はり　まいターン\nじぶんの　ＨＰを　かいふく　する。\nねを　はっているので　いれかえられない。", "大地に　根を　張り\n毎ターン　自分の　ＨＰを　回復する。\n根を　張っているので　入れ替えられない。", "대지에 뿌리를 박아\n매 턴마다 자신의 HP를 회복한다.\n뿌리 박고 있으므로 교체할 수 없다.", "Echa raíces para recuperar PS en cada\nturno, pero impide el relevo.") },
            { PBEMove.Superpower, new PBELocalizedString("The user attacks the target with great\npower. However, it also lowers the\nuser's Attack and Defense.", "Une attaque puissante, mais qui baisse\nl'Attaque et la Défense du lanceur.", "Starke Attacke, die sowohl Angriff als\nauch Verteidigung des Anwenders senkt.", "Chi la usa attacca il nemico con grande\nforza, ma il suo Attacco e la sua Difesa\npeggiorano.", "すごい　ちからを　はっきして\nあいてを　こうげきする。じぶんの\nこうげきと　ぼうぎょが　さがる。", "すごい　力を　発揮して\n相手を　攻撃する。自分の\n攻撃と　防御が　さがる。", "엄청난 힘을 발휘하여\n상대를 공격한다. 자신의\n공격과 방어가 떨어진다.", "Ataque de gran potencia, pero que reduce\nel Ataque y la Defensa del agresor.") },
            // { PBEMove.277, new PBELocalizedString("A barrier reflects back to the target\nmoves like Leech Seed and moves\nthat damage status.", "Une barrière qui renvoie les capacités\ncomme Vampigraine et celles affectant\nle statut et les stats.", "Egelsamen und alle Attacken mit Status\nverändernden Effekten prallen ab.", "Una barriera rimanda al mittente l'effetto\ndi mosse come Parassiseme e di mosse\nche influenzano lo stato.", "じょうたい　いじょうに　なる　ワザや\nやどりぎのタネ　などを\nだされたとき　あいてに　はねかえす。", "状態異常に　なる　技や\nやどりぎのタネ　などを\nだされたとき　相手に　跳ね返す。", "상대가 상태 이상이 되는 기술이나\n씨뿌리기 등을 썼을 때 되받아친다.", "Barrera capaz de devolver al agresor\nmovimientos como Drenadoras y otros que\nalteran el estado o las características.") },
            // { PBEMove.278, new PBELocalizedString("The user recycles a held item that\nhas been used in battle so it can be\nused again.", "Recycle un objet tenu à usage unique\ndéjà utilisé lors du combat pour pouvoir\nl'utiliser à nouveau.", "Recycling eines getragenen Items, das\nzuvor im Kampf verwendet wurde.", "Chi la usa ricicla uno strumento tenuto,\ngià usato nella lotta, e lo può riutilizzare.", "せんとうちゅうに　つかって　なくなった\nじぶんの　もちものを　さいせい　させて\nつかえるように　する。", "戦闘中に　使って　なくなった\n自分の　持ち物を　再生させて\n使えるように　する。", "배틀 중에 사용하여 없어진\n자신의 지닌 물건을 재생시켜\n사용할 수 있게 한다.", "Recicla y así recupera el objeto\nequipado de un solo uso que ya\nha sido empleado en el combate.") },
            // { PBEMove.279, new PBELocalizedString("An attack move that inflicts double the\ndamage if the user has been hurt by the\nopponent in the same turn.", "Une attaque deux fois plus puissante\nsi le lanceur a été blessé par l'ennemi\ndurant ce tour.", "Schaden verdoppelt sich, wenn Anwender\nin der Runde bereits Schaden vom Ziel des\nAngriffes genommen hat.", "Mossa d'attacco che infligge un danno\ndoppio se si è stati colpiti dal nemico\nnello stesso turno.", "あいてから　わざを　うけていると\nその　あいてに　たいして\nあたえる　ダメージが　２ばいに　なる。", "相手から　技を　受けていると\nその相手に　対して\n与える　ダメージが　２倍に　なる。", "상대에게 기술을 받으면\n그 상대에게 주는 데미지가\n2배가 된다.", "Ataque que produce el doble de daño si\nel usuario es herido en el mismo turno.") },
            { PBEMove.BrickBreak, new PBELocalizedString("The user attacks with a swift chop. It\ncan also break any barrier such as Light\nScreen and Reflect.", "Une attaque avec le tranchant de la main.\nPermet aussi de briser les barrières\ncomme Mur Lumière et Protection.", "Ein beherzter Handkantenschlag.\nDurchbricht Barrieren wie Lichtschild\nund Reflektor.", "Colpisce il nemico con una mano e rompe\nbarriere come Riflesso e Schermoluce.", "しゅとうを　いきおいよく　ふりおろして\nあいてを　こうげきする。ひかりのかべや\nリフレクターも　はかいできる。", "手刀を　勢いよく　振りおろして\n相手を　攻撃する。ひかりのかべや\nリフレクターも　破壊できる。", "수도로 기세 좋게 내려쳐서\n상대를 공격한다. 빛의장막이나\n리플렉터도 파괴할 수 있다.", "Potente ataque que también es capaz\nde destruir barreras como Pantalla\nde Luz y Reflejo.") },
            // { PBEMove.281, new PBELocalizedString("The user lets loose a huge yawn that\nlulls the target into falling asleep\non the next turn.", "Fait bâiller l'ennemi qui\ns'endort au tour suivant.", "Angreifer gähnt und das Ziel schläft in der\nnächsten Runde ein.", "Chi la usa fa un grande sbadiglio che\naddormenta il nemico al turno seguente.", "おおきな　あくびで　ねむけを　さそう。\nつぎの　ターンに\nあいてを　ねむり　じょうたいに　する。", "大きな　あくびで　眠気を　誘う。\n次の　ターンに\n相手を　眠り状態に　する。", "큰 하품으로 졸음을 유도한다.\n다음 턴에 상대를\n잠듦 상태로 만든다.", "Gran bostezo que induce al sueño\nal objetivo en el siguiente turno.") },
            // { PBEMove.282, new PBELocalizedString("The user slaps down the target's\nheld item, preventing that item\nfrom being used in the battle.", "Le lanceur fait tomber l'objet tenu\npar l'ennemi pour le rendre inutilisable\ndurant le combat.", "Schlägt das Item des Zieles weg\nund vereitelt so dessen Gebrauch\nwährend des Kampfes.", "Attacco che blocca anche lo strumento\ntenuto dal nemico, impedendone l'uso\nnella lotta.", "あいての　もちものを　はたき　おとして\nせんとうが　おわるまで\nつかえなく　する。", "相手の　持ち物を　はたき　落として\n戦闘が　終わるまで\n使えなくする。", "상대의 지닌 물건을 탁 쳐서 떨어뜨려\n배틀이 끝날 때까지\n사용할 수 없게 한다.", "Impide al objetivo usar el objeto que lleva\ndurante el combate.") },
            { PBEMove.Endeavor, new PBELocalizedString("An attack move that cuts down the\ntarget's HP to equal the user's HP.", "Une attaque qui réduit les PV de\nl'ennemi au niveau des PV du lanceur.", "Trifft nur, wenn KP des Anwenders geringer\nals KP des Zieles sind. Senkt dessen\nKP auf Niveau der KP des Anwenders.", "Attacco che riduce i PS del nemico a una\nquantità pari ai PS di chi la usa.", "あいての　ＨＰが　じぶんの　ＨＰと\nおなじ　くらいに　なるように\nダメージを　あたえる。", "相手の　ＨＰが　自分の　ＨＰと\n同じくらいに　なるように\nダメージを　与える。", "상대의 HP가 자신의 HP와\n같아지도록\n데미지를 준다.", "Reduce los PS del objetivo para que igualen\na los del atacante.") },
            { PBEMove.Eruption, new PBELocalizedString("The user attacks the opposing team with\nexplosive fury. The lower the user's HP,\nthe less powerful this attack becomes.", "Le lanceur laisse exploser sa colère.\nPlus ses PV sont bas et moins l'attaque\nest puissante.", "Explosiver Angriff. Je höher die KP\ndes Anwenders sind, desto mehr Schaden\nwird angerichtet.", "Attacco impetuoso ed esplosivo la cui\npotenza è proporzionale ai PS di chi\nlo usa.", "いかりを　ばくはつ　させて　あいてを\nこうげきする。じぶんの　ＨＰが　すくない\nほど　わざの　いりょくは　さがる。", "怒りを　爆発させて　相手を\n攻撃する。自分の　ＨＰが\n少ないほど　技の　威力は　さがる。", "분노를 폭발시켜 상대를\n공격한다. 자신의 HP가\n적을수록 기술의 위력이 떨어진다.", "Furia explosiva. Cuanto menor sea\nel número de PS del usuario, menos\ndaño hará el ataque.") },
            // { PBEMove.285, new PBELocalizedString("The user employs its psychic power to\nexchange Abilities with the target.", "Le lanceur utilise ses pouvoirs psychiques\npour échanger sa capacité spéciale\navec la cible.", "Anwender tauscht Fähigkeit mit\ndem Ziel.", "Chi la usa sfrutta le sue facoltà mentali\nper scambiare l'abilità con il bersaglio.", "ちょうのうりょくで　じぶんの　とくせいと\nあいての　とくせいを　いれかえる。\n", "超能力で　自分の　特性と\n相手の　特性を　入れ替える。\n", "초능력으로 자신의 특성과\n상대의 특성을 바꾼다.", "Usa el poder psíquico para intercambiar\nhabilidades con el objetivo.") },
            // { PBEMove.286, new PBELocalizedString("If the opponents know any move also known\nby the user, the opponents are prevented\nfrom using it.", "Si l'ennemi et le lanceur ont des\ncapacités en commun, l'ennemi ne\npourra pas les utiliser.", "Hindert Gegner am Einsatz von Attacken,\ndie der Anwender selbst auch kennt.", "Chi la usa impedisce al nemico di usare\nmosse che conoscono entrambi.", "あいてが　じぶんと　おなじ　わざを\nおぼえていたら　あいてだけ\nそのわざを　つかえなく　する。", "相手が　自分と　同じ　技を\nおぼえていたら　相手だけ\nその技を　使えなくする。", "상대가 자신과 같은 기술을\n기억하고 있으면 상대만\n그 기술을 사용할 수 없게 한다.", "Impide a los contrincantes usar ataques\nconocidos por el usuario durante\nel combate.") },
            // { PBEMove.287, new PBELocalizedString("The user rests to cure itself of a\npoisoning, burn, or paralysis.", "Le lanceur se repose pour guérir\nd'un empoisonnement, d'une brûlure\nou d'une paralysie.", "Selbstheilung bei Vergiftung,\nParalyse und Verbrennung.", "Chi la usa riposa per curarsi da\navvelenamento, paralisi e scottatura.", "からだを　やすめて　じぶんが　おっている\nどく　まひ　やけどの\nじょうたい　いじょうを　なおす。", "体を　やすめて　自分が　おっている\n毒　まひ　やけどの\n状態異常を　治す。", "몸을 쉬게 하여 자신이 입은\n독, 마비, 화상의\n상태 이상을 치료한다.", "Descansa para curar parálisis,\nenvenenamiento o quemaduras.") },
            // { PBEMove.288, new PBELocalizedString("If the user faints, the user's grudge\nfully depletes the PP of the opponent's\nmove that knocked it out.", "Si le lanceur est mis K.O., sa rancune\népuise les PP de la capacité utilisée\npour le mettre K.O.", "Bei K.O. des Anwenders werden die AP der\nAttacke, durch die er besiegt wurde,\nauf null herabgesetzt.", "Se chi la usa va KO, i PP della mossa\nnemica che lo ha messo fuori gioco\nsi azzerano.", "あいての　わざで　ひんしに　されたとき\nおんねんを　かけて\nそのわざの　ＰＰを　０に　する。", "相手の　技で　ひんしに　されたとき\nおんねんを　かけて\nその技の　ＰＰを　０に　する。", "상대의 기술로 기절하면\n원념을 담아\n그 기술의 PP를 0으로 만든다.", "Si el usuario se debilita al recibir un\nataque, todos los PP de este último\nataque serán eliminados.") },
            // { PBEMove.289, new PBELocalizedString("The user steals the effects of any\nhealing or stat-changing move the\nopponent attempts to use.", "Le lanceur vole l'effet des capacités\nde soin ou de changement de stats\nutilisées par la cible.", "Raubt den Effekt der heilenden\noder Werte verändernden Attacke\ndes Gegners.", "Chi la usa ruba e utilizza la mossa\ncurativa o modifica-statistiche che\nil bersaglio stava per usare.", "あいてが　つかおうと　した\nかいふくわざや　のうりょく　へんかの\nわざを　うばって　じぶんに　つかう。", "相手が　使おうと　した\n回復技や　能力変化の\n技を　うばって　自分に　使う。", "상대가 사용하려고 한\n회복 기술이나 능력 변화의\n기술을 빼앗아 자신에게 쓴다.", "Roba el efecto de movimientos de curación\no de cambio de características que intente\nusar un combatiente.") },
            // { PBEMove.290, new PBELocalizedString("The user attacks the target with a\nsecret power. Its added effects vary\ndepending on the user's environment.", "Les effets de cette attaque varient en\nfonction de l'environnement.", "Angriff, der abhängig vom Anwendungsort\neinen unterschiedlichen Zusatzeffekt\nbesitzt.", "Attacco che può avere un effetto\naggiuntivo a seconda del luogo\nin cui si trova chi lo usa.", "ひみつの　ちからで　\nあいてを　こうげきする。つかう　ばしょで\nついかこうかが　へんかする。", "秘密の　力で　\n相手を　攻撃する。使う　場所で\n追加効果が　変化する。", "비밀의 힘으로 상대를\n공격한다. 사용 장소에 따라\n추가 효과가 변화한다.", "Ataque con poder secreto cuyos efectos\nsecundarios varían según el entorno\nde combate.") },
            { PBEMove.Dive, new PBELocalizedString("Diving on the first turn, the user floats\nup and attacks on the second turn.\nIt can be used to dive deep in the ocean.", "Le lanceur plonge sous l'eau au\n1⑩ tour et frappe au 2⒅. Permet\naussi de plonger au fond de l'eau.", "Taucht in Runde 1 ab und greift in\nRunde 2 aus der Tiefe an. Ermöglicht\nTauchgänge zum Meeresgrund.", "Chi la usa si tuffa in acqua per emergere e\nattaccare al turno seguente. Fuori dalla\nlotta permette di immergersi sott'acqua.", "１ターンめで　もぐり　２ターンめに\nうきあがって　こうげきする。うみの\nおくふかくに　もぐる　ことも　できる。", "１ターン目で　潜り　２ターン目に\n浮きあがって　攻撃する。\n海の　奥深くに　潜ることも　できる。", "1턴째에 잠수했다가 2턴째에\n떠올라 공격한다.\n바닷속 깊숙이 잠수할 수도 있다.", "Primer turno: se sumerge en el mar.\nSegundo turno: emerge y ataca.") },
            // { PBEMove.292, new PBELocalizedString("The user looses a flurry of open-palmed\narm thrusts that hit two to five times in\na row.", "Un déluge de coups adressés avec la\npaume qui frappe de 2 à 5 fois d'affilée.", "Schläge mit geradem Arm, die\ndas Ziel 2- bis 5-mal treffen.", "Raffica di ceffoni che colpisce da due a\ncinque volte di fila.", "ひらいた　りょうてで\nあいてを　つっぱって　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "ひらいた　両手で\n相手を　つっぱって　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "펼친 양손으로\n상대를 번갈아 쳐서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Empujones directos que golpean de dos\na cinco veces seguidas.") },
            // { PBEMove.293, new PBELocalizedString("The user's type is changed depending on\nits environment, such as at water's edge,\nin grass, or in a cave.", "Modifie le type du lanceur en fonction\ndu terrain, comme une berge, une\ngrotte, l'herbe, etc.", "Der Typ des Anwenders passt sich\nder Umgebung an, sei es im Wasser,\nim Gras oder in einer Höhle.", "Modifica il tipo di chi la usa a seconda del\nluogo, ad esempio sull'acqua, nell'erba\no in una grotta.", "みずべや　くさむら　どうくつなど\nいる　ばしょに　あわせて\nじぶんの　タイプを　かえる。", "水辺や　草むら　どうくつなど\nいる　場所に　あわせて\n自分の　タイプを　変える。", "물가나 풀밭, 동굴 등\n있는 장소에 맞춰서\n자신의 타입을 바꾼다.", "Modifica el tipo del Pokémon según\nel terreno de combate donde esté.") },
            { PBEMove.TailGlow, new PBELocalizedString("The user stares at flashing lights to\nfocus its mind, drastically raising its\nSp. Atk stat.", "Le lanceur regarde un flash lumineux\nfixement. Augmente considérablement\nson Attaque Spéciale.", "Ein blinkendes Licht, das den\nSpezial-Angriff drastisch erhöht.", "Chi la usa fissa una luce forte per\nconcentrarsi e aumentare moltissimo\nl'Attacco Speciale.", "てんめつする　ひかりを　ながめて\nじぶんの　せいしんを　とういつし\nとくこうを　ぐぐーんと　あげる。", "点滅する　光を　眺めて\n自分の　精神を　統一し\n特攻を　ぐぐーんと　あげる。", "깜빡거리는 빛을 바라보고\n자신의 정신을 통일하여\n특수공격을 매우 크게 올린다.", "Se concentra en una ráfaga de luz que\nsube muchísimo el Ataque Especial.") },
            { PBEMove.LusterPurge, new PBELocalizedString("The user lets loose a damaging burst\nof light. It may also reduce the target's\nSp. Def stat.", "Le lanceur libère un éclair lumineux.\nPeut aussi baisser la Défense\nSpéciale de l'ennemi.", "Angriff mit grellem Licht, der die\nSpezial-Verteidigung des Zieles\neventuell senkt.", "Chi la usa scatena un'esplosione\nabbagliante che può anche ridurre\nla Difesa Speciale del Pokémon colpito.", "まばゆい　ひかりを　かいほうして　\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "まばゆい　光を\n解放して　攻撃する。\n相手の　特防を　さげることが　ある。", "눈부신 빛을 개방하여\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Fogonazo de luz que puede bajar\nla Defensa Especial del objetivo.") },
            { PBEMove.MistBall, new PBELocalizedString("A mistlike flurry of down envelops and\ndamages the target. It may also lower\nthe target's Sp. Atk.", "Une bulle de brume inflige des dégâts\nà l'ennemi. Peut aussi réduire son\nAttaque Spéciale.", "Angriff mit einer Kugel aus Wasser,\ndie Nebel enthält. Senkt eventuell den\nSpezial-Angriff des Zieles.", "Una sfera coperta di nebbia danneggia\nil nemico. Può anche ridurne l'Attacco\nSpeciale.", "きりじょうの　うもうで　つつみこみ　\nこうげきする。あいての　とくこうを\nさげることが　ある。", "霧状の　羽毛で　包みこみ　\n攻撃する。\n相手の　特攻を　さげることが　ある。", "안개의 깃털로 둘러싸\n공격한다. 상대의 특수공격을\n떨어뜨릴 때가 있다.", "Banco de niebla que puede bajar\nel Ataque Especial del objetivo.") },
            { PBEMove.FeatherDance, new PBELocalizedString("The user covers the target's body with a\nmass of down that harshly lowers its\nAttack stat.", "Une montagne de plumes ensevelit\nl'ennemi et réduit considérablement\nson Attaque.", "Hüllt das Ziel in Daunen und senkt\ndessen Angriffs-Wert stark.", "Chi la usa copre il nemico con un manto\ndi piume che riduce di molto il suo Attacco.", "うもうを　ふりまいて\nあいての　からだに　からませる。\nあいての　こうげきを　がくっと　さげる。", "羽毛を　ふりまいて\n相手の　体に　からませる。\n相手の　攻撃を　がくっと　さげる。", "깃털을 흩뿌려\n상대의 몸에 휘감는다.\n상대의 공격을 크게 떨어뜨린다.", "Envuelve al objetivo con un manto de\nplumas para reducir mucho su Ataque.") },
            { PBEMove.TeeterDance, new PBELocalizedString("The user performs a wobbly dance that\nconfuses the Pokémon around it.", "Danse qui rend confus tous les\nPokémon autour du lanceur.", "Ein Wackeltanz, der andere\nPokémon in der Umgebung\ndes Anwenders verwirrt.", "Chi la usa esegue una danza goffa che\nconfonde tutti i Pokémon attorno.", "フラフラと　ダンスを　おどって\nじぶんの　まわりに　いるものを\nこんらん　じょうたいに　させる。", "フラフラと　ダンスを　おどって\n自分の　周りに　いるものを\n混乱状態に　させる。", "흔들흔들 댄스를 춰서\n주위에 있는 포켓몬을\n혼란 상태로 만든다.", "Danza histérica que confunde a los\nPokémon que están alrededor\ndel usuario.") },
            { PBEMove.BlazeKick, new PBELocalizedString("The user launches a kick that lands a\ncritical hit more easily.\nIt may also leave the target with a burn.", "Le lanceur envoie un coup de pied\nau taux de critiques élevé.\nPeut aussi brûler la cible.", "Starker Tritt mit hoher Volltrefferquote.\nVerursacht eventuell Verbrennung.", "Chi la usa tira un calcio. Probabile brutto\ncolpo. Può anche scottare il bersaglio.", "こうげきした　あいてを\nやけど　じょうたいに　することが　ある。\nきゅうしょにも　あたりやすい。", "攻撃した　相手を\nやけど状態に　することが　ある。\n急所にも　当たりやすい。", "공격한 상대를\n화상 상태로 만들 때가 있다.\n급소에도 맞기 쉽다.", "Patada que suele ser un golpe crítico\ny puede causar quemaduras.") },
            // { PBEMove.300, new PBELocalizedString("The user covers itself with mud. It\nweakens Electric-type moves while the\nuser is in the battle.", "Le lanceur se couvre de boue\npour affaiblir les capacités\nÉlectrik quand il combat.", "Schwächt Elektro-Attacken, solang\nder Anwender am Kampf teilnimmt.", "Chi la usa si ricopre di fango indebolendo\nle mosse di tipo Elettro finché resta\nin campo.", "どろを　かぶって　どろどろに　なる。\nじぶんが　いるあいだ\nでんきタイプの　わざを　よわめる。", "泥を　かぶって　どろどろに　なる。\n自分が　いるあいだ\nでんきタイプの　技を　弱める。", "진흙투성이가 된다. 기술을 쓴\n포켓몬이 배틀에 나와 있는 동안\n전기타입의 기술을 약하게 만든다.", "El usuario se cubre de lodo y debilita\nlos movimientos de tipo Eléctrico\nmientras está en combate.") },
            // { PBEMove.301, new PBELocalizedString("The user continually rolls into the target\nover five turns. It becomes stronger\neach time it hits.", "Envoie une balle de glace pendant 5 tours.\nL'attaque gagne en puissance\nà chaque coup.", "Attacke, die fünf Runden dauert.\nDie Härte nimmt von Mal zu Mal zu.", "Chi la usa attacca il nemico rotolando\nper cinque turni, con aumento progressivo\ndella potenza ogni volta che va a segno.", "５ターンの　あいだ　ころがりつづけて\nあいてを　こうげきする。わざが\nあたるたび　いりょくが　あがる。", "５ターンの　あいだ　転がり続けて\n相手を　攻撃する。技が　当たるたび\n威力が　あがる。", "5턴 동안 구르기를 반복하여\n상대를 공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "El atacante rueda contra el objetivo\ndurante cinco turnos, cada vez\ncon mayor fuerza.") },
            { PBEMove.NeedleArm, new PBELocalizedString("The user attacks by wildly swinging its\nthorny arms. It may also make the\ntarget flinch.", "Le lanceur attaque en fouettant l'ennemi\nde ses bras épineux. Peut aussi l'apeurer.", "Angriff mit dornigen Armen. Das Ziel\nschreckt eventuell zurück.", "Chi la usa attacca colpendo il nemico\ncon i suoi arti pieni di spine. Può far\ntentennare il Pokémon colpito.", "トゲの　うでを\nはげしく　ふるって　こうげきする。\nあいてを　ひるませる　ことが　ある。", "トゲの　腕を\n激しく　ふるって　攻撃する。\n相手を　ひるませることが　ある。", "바늘팔을\n세차게 흔들어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Pega con brazos de pinchos y puede\nhacer retroceder al objetivo.") },
            { PBEMove.SlackOff, new PBELocalizedString("The user slacks off, restoring its own HP\nby up to half of its maximum HP.", "Le lanceur se tourne les pouces et\nrécupère jusqu'à la moitié de ses PV max.", "Durch Müßiggang werden KP des\nAnwenders um 50 % der maximalen\nKP aufgefüllt.", "Chi la usa si rilassa recuperando metà\ndei propri PS massimi.", "なまけて　やすむ。\nじぶんの　ＨＰを　さいだい　ＨＰの\nはんぶん　かいふく　する。", "怠けて　やすむ。\n自分の　ＨＰを　最大ＨＰの\n半分　回復する。", "게으름 피우며 쉰다.\n자신의 HP를 최대 HP의\n절반만큼 회복한다.", "El usuario se relaja y restaura la mitad\nde sus PS máximos.") },
            { PBEMove.HyperVoice, new PBELocalizedString("The user lets loose a horribly echoing\nshout with the power to inflict damage.", "Le lanceur pousse un cri dont l'écho\nterrifiant a le pouvoir d'infliger\ndes dégâts.", "Laute Attacke mit Schallwellen.", "Chi la usa lancia un urlo straziante che\ndanneggia i nemici.", "うるさく　ひびく　おおきな　しんどうを\nあいてに　あたえて　こうげきする。\n", "うるさく　響く　大きな　振動を\n相手に　与えて　攻撃する。\n", "시끄럽게 울려서 큰 진동을\n상대에게 전달하여 공격한다.", "Grito desgarrador que inflige\ndaño al objetivo.") },
            { PBEMove.PoisonFang, new PBELocalizedString("The user bites the target with toxic\nfangs. It may also leave the target\nbadly poisoned.", "Le lanceur mord l'ennemi de ses crocs\ntoxiques. Peut aussi l'empoisonner\ngravement.", "Angriff mit giftigen Reißzähnen.\nDas Ziel wird eventuell\nschwer vergiftet.", "Chi la usa morde il nemico con denti\navvelenati che possono anche\niperavvelenarlo.", "どくの　ある　キバで\nあいてに　かみついて　こうげきする。\nもうどくを　おわせる　ことが　ある。", "毒の　ある　キバで\n相手に　かみついて　攻撃する。\n猛毒を　おわせる　ことが　ある。", "독이 있는 이빨로\n상대를 물어서 공격한다.\n맹독을 주입할 때가 있다.", "Colmillos tóxicos que pueden envenenar\ngravemente al objetivo.") },
            { PBEMove.CrushClaw, new PBELocalizedString("The user slashes the target with hard\nand sharp claws.\nIt may also lower the target's Defense.", "Lacère l'ennemi avec des griffes\nsolides et aiguisées.\nPeut aussi baisser sa Défense.", "Angriff mit scharfen Klauen. Senkt\neventuell den Verteidigungs-Wert.", "Colpisce il nemico con artigli robusti e\naffilati che possono ridurne la Difesa.", "かたく　するどい　ツメで　きりさいて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "硬く　鋭い　ツメで\n切り裂いて　攻撃する。\n相手の　防御を　さげることが　ある。", "단단하고 날카로운 손톱으로\n베어 갈라서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Hace trizas al objetivo con garras\nafiladas y puede bajar su Defensa.") },
            // { PBEMove.307, new PBELocalizedString("The target is razed by a fiery explosion.\nThe user must rest on the\nnext turn, however.", "Une explosion ardente souffle\nl'adversaire. Le lanceur doit\nse reposer au tour suivant.", "Das Ziel wird von starker Explosion\ngetroffen. Angreifer setzt eine\nRunde aus.", "Potente esplosione che danneggia\nil nemico, ma fa saltare il turno\nsuccessivo a chi la provoca.", "ばくはつの　ほのおで\nあいてを　やきつくして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "爆発の　炎で\n相手を　焼きつくして　攻撃する。\n次の　ターンは　動けなくなる。", "폭발하는 불꽃으로\n상대를 태워서 공격한다.\n다음 턴은 움직일 수 없다.", "Explosión de fuego. El atacante debe\ndescansar el siguiente turno.") },
            // { PBEMove.308, new PBELocalizedString("The target is hit with a watery blast.\nThe user must rest on the\nnext turn, however.", "Une trombe d'eau heurte l'ennemi.\nLe lanceur doit se reposer au tour\nsuivant.", "Das Ziel wird von Wasserkanone\ngetroffen. Angreifer setzt eine\nRunde aus.", "Colpisce il nemico con un potente getto\nd'acqua. Chi la usa salta il turno\nsuccessivo.", "みずの　たいほうを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "水の　大砲を\n相手に　発射して　攻撃する。\n次の　ターンは　動けなくなる。", "물의 대포를\n상대에게 발사해서 공격한다.\n다음 턴은 움직일 수 없다.", "Disparo de agua. El atacante debe\ndescansar el siguiente turno.") },
            { PBEMove.MeteorMash, new PBELocalizedString("The target is hit with a hard punch fired\nlike a meteor. It may also raise\nthe user's Attack.", "Un coup de poing lancé à la vitesse d'un\nmétéore. Peut aussi augmenter l'Attaque\ndu lanceur.", "Angriff mit einem harten, schnellen\nSchlag. Erhöht eventuell Angriffs-Wert\ndes Anwenders.", "Colpisce il nemico con un pugno veloce\ncome una meteora. Può far pure salire\nl'Attacco di chi la usa.", "すいせいの　ごとく　パンチを　くりだして\nあいてを　こうげきする。じぶんの　\nこうげきが　あがることが　ある。", "すい星の　ごとく　パンチを　くりだして\n相手を　攻撃する。自分の　\n攻撃が　あがることが　ある。", "혜성과 같은 펀치를 날려서\n상대를 공격한다. 자신의\n공격이 올라갈 때가 있다.", "Puñetazo que impacta como un meteorito\ny puede subir el Ataque del agresor.") },
            { PBEMove.Astonish, new PBELocalizedString("The user attacks the target while shouting\nin a startling fashion.\nIt may also make the target flinch.", "Le lanceur attaque l'ennemi en poussant\nun cri terrifiant. Peut aussi l'apeurer.", "Anwender greift mit einem Schrei an.\nEin Angriff, der das Ziel eventuell\nzurückschrecken lässt.", "Chi la usa attacca il bersaglio emettendo\nun verso terrificante. Può anche farlo\ntentennare.", "おおきな　こえなどで\nふいに　おどろかして　こうげきする。\nあいてを　ひるませる　ことが　ある。", "大きな　声などで\n不意に　驚かして　攻撃する。\n相手を　ひるませることが　ある。", "큰 소리 등으로\n불시에 놀래켜서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Impresiona tanto que puede hacer\nretroceder al objetivo.") },
            { PBEMove.WeatherBall, new PBELocalizedString("An attack move that varies in power and\ntype depending on the weather.", "Une attaque dont la puissance et le type\nvarient en fonction du temps qu'il fait.", "Typ und Stärke der Attacke sind\nvom Wetter zum Zeitpunkt der\nAnwendung abhängig.", "Mossa d'attacco che varia tipo e forza in\nbase alle condizioni atmosferiche.", "つかった　ときの　てんきに　よって\nわざの　タイプと　いりょくが　かわる。\n", "使ったときの　天気に　よって\n技の　タイプと　威力が　変わる。\n", "사용했을 때의 날씨에 따라서\n기술 타입과 위력이 바뀐다.", "El tipo y fuerza del ataque varían según\nel tiempo que haga.") },
            // { PBEMove.312, new PBELocalizedString("The user releases a soothing scent that\nheals all status problems affecting\nthe user's party.", "Le lanceur libère un parfum apaisant\nqui guérit tous les problèmes de\nstatut de l'équipe.", "Heilt alle Statusprobleme des Teams\nmit beruhigendem Duft.", "Chi la usa rilascia un dolce profumo\nche risolve tutti i problemi di stato\ndella sua squadra.", "ここちよい　やすらぐ　かおりを　かがせて\nみかた　ぜんいんの\nじょうたい　いじょうを　かいふく　する。", "心地好い　やすらぐ　香りを　かがせて\n味方全員の　状態異常を　回復する。\n", "기분 좋은 평온한 향기를 맡게 하여\n같은 편 모두의 상태 이상을 회복한다.", "Cura todos los problemas de estado\ndel equipo con un suave aroma.") },
            { PBEMove.FakeTears, new PBELocalizedString("The user feigns crying to fluster\nthe target, harshly lowering its\nSp. Def stat.", "Le lanceur fait semblant de pleurer\npour troubler l'ennemi et baisser\nfortement sa Défense Spéciale.", "Täuscht Weinen vor, um die\nSpezial-Verteidigung des Zieles\nstark zu senken.", "Chi la usa inscena un pianto teatrale per\ncommuovere il nemico. Ne riduce di molto la\nDifesa Speciale.", "ないた　ふりをして　なみだを　ながす。\nこまらせる　ことで\nあいての　とくぼうを　がくっと　さげる。", "ないた　ふりをして　涙を　流す。\nこまらせる　ことで\n相手の　特防を　がくっと　さげる。", "우는 척을 하며 눈물을 흘린다.\n난처하게 만들어\n상대의 특수방어를 크게 떨어뜨린다.", "Lágrimas de cocodrilo que bajan mucho\nla Defensa Especial del objetivo.") },
            { PBEMove.AirCutter, new PBELocalizedString("The user launches razor-like wind to\nslash the opposing team.\nCritical hits land more easily.", "Le lanceur appelle des vents tranchants\nqui lacèrent l'ennemi.\nTaux de critiques élevé.", "Greift mit rasierklingenartigem\nWind an. Hohe Volltrefferquote.", "Chi la usa provoca un vento tagliente che\nsferza i nemici. Probabile brutto colpo.", "するどい　かぜで\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "鋭い　風で\n相手を　切りつけて　攻撃する。\n急所に　当たりやすい。", "날카로운 바람으로\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Viento cortante que azota.\nSuele ser un golpe crítico.") },
            { PBEMove.Overheat, new PBELocalizedString("The user attacks the target at full power.\nThe attack's recoil harshly reduces the\nuser's Sp. Atk stat.", "Attaque l'ennemi à pleine puissance.\nLe contrecoup baisse énormément\nl'Attaque Spéciale du lanceur.", "Angriff mit voller Kraft, der den\nSpezial-Angriff des Anwenders durch\nden Rückstoß stark senkt.", "Chi la usa sferra un potente attacco,\nma il contraccolpo riduce di molto\nil suo Attacco Speciale.", "フルパワーで　あいてを　こうげきする。\nつかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "フルパワーで　相手を　攻撃する。\n使うと　反動で\n自分の　特攻が　がくっと　さがる。", "풀 파워로 상대를 공격한다.\n쓰면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Ataque en toda regla que baja mucho\nel Ataque Especial de quien lo usa.") },
            // { PBEMove.316, new PBELocalizedString("Enables a Ghost-type target to be hit with\nNormal- and Fighting-type attacks. It also\nenables an evasive target to be hit.", "Permet de toucher un Pokémon Spectre\navec n'importe quelle capacité et de\ntoucher un ennemi insaisissable.", "Erlaubt es, Geist-Pokémon mit Normal-\nund Kampf-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Chi la usa rende i Pokémon di tipo Spettro\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "ゴーストタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "ゴーストタイプに　効果がない　技や\n回避率の　高い　相手に\n攻撃が　当たるように　なる。", "고스트타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permite atacar con cualquier movimiento\na objetivos de tipo Fantasma y golpear\na Pokémon evasivos.") },
            { PBEMove.RockTomb, new PBELocalizedString("Boulders are hurled at the target. It also\nlowers the target's Speed by preventing\nits movement.", "Des rochers frappent l'ennemi. Réduit\naussi sa Vitesse en l'empêchant\nde se déplacer.", "Angriff mit Felsen. Bei Erfolg wird der\nInitiative-Wert des Zieles gesenkt.", "Colpisce il nemico con rocce. Inoltre,\nlo rallenta riducendone la Velocità.", "がんせきを　なげつけて　こうげきする。\nあいての　うごきを　ふうじることで\nすばやさを　さげる。", "岩石を　投げつけて　攻撃する。\n相手の　動きを　封じることで\n素早さを　さげる。", "암석을 내던져서 공격한다.\n상대의 움직임을 봉인함으로써\n스피드를 떨어뜨린다.", "Tira rocas que detienen al objetivo y\nbajan su Velocidad.") },
            { PBEMove.SilverWind, new PBELocalizedString("The target is attacked with powdery\nscales blown by wind.\nIt may also raise all the user's stats.", "Vent qui projette des écailles poudreuses\nsur l'ennemi. Peut aussi monter toutes\nles stats du lanceur.", "Angriff mit Silberstaub. Eventuell\nwerden alle Statuswerte des\nAnwenders erhöht.", "Attacca con un forte vento di polvere di\nsquame. Tutte le statistiche di chi la\nusa possono salire.", "かぜに　りんぷんを　のせて　あいてを\nこうげきする。じぶんの　すべての\nのうりょくが　あがることが　ある。", "風に　りんぷんを　のせて　相手を\n攻撃する。自分の　すべての\n能力が　あがることが　ある。", "바람에 날개 가루를 날려서 상대를\n공격한다. 자신의 모든\n능력이 올라갈 때가 있다.", "Fuerte viento con polvo de escamas.\nPuede subir todas las características\nde quien lo usa.") },
            { PBEMove.MetalSound, new PBELocalizedString("A horrible sound like scraping metal\nharshly reduces the target's\nSp. Def stat.", "Un cri horrible tel un crissement\nmétallique qui réduit fortement\nla Défense Spéciale de l'ennemi.", "Stößt einen spitzen Schrei aus, der\ndie Spezial-Verteidigung des Zieles\nstark senkt.", "Orribile stridio, simile a quello prodotto\ndal metallo, che riduce di molto\nla Difesa Speciale del nemico.", "きんぞくを　こすって　でるような\nいやな　おとを　きかせる。\nあいての　とくぼうを　がくっと　さげる。", "金属を　こすって　でるような\nいやな　音を　聞かせる。\n相手の　特防を　がくっと　さげる。", "금속을 긁을 때 나는 듯한\n싫은 소리를 들려준다.\n상대의 특수방어를 크게 떨어뜨린다.", "Horrible chirrido metálico que baja mucho\nla Defensa Especial del objetivo.") },
            { PBEMove.GrassWhistle, new PBELocalizedString("The user plays a pleasant melody that\nlulls the target into a deep sleep.", "Le lanceur joue une douce mélodie qui\nplonge l'ennemi dans un profond sommeil.", "Versetzt das Ziel durch eine\nschöne Melodie in Tiefschlaf.", "Una dolce melodia culla il nemico e\nlo costringe ad addormentarsi.", "ここちよい　ふえの　ねいろを　きかせて\nあいてを　ねむりの　じょうたいに　する。\n", "心地好い　笛の　音色を　聞かせて\n相手を　眠りの　状態に　する。\n", "기분 좋은 피리 소리를 들려주어\n상대를 잠듦 상태로 만든다.", "Agradable melodía que adormece\nal objetivo.") },
            { PBEMove.Tickle, new PBELocalizedString("The user tickles the target into laughing,\nreducing its Attack and Defense stats.", "Le lanceur chatouille l'ennemi, ce qui\nbaisse son Attaque et sa Défense.", "Bringt das Ziel zum Lachen und senkt\ndadurch dessen Angriff und Verteidigung.", "Chi la usa solletica il nemico e lo fa\nridere, riducendo il suo Attacco e la\nsua Difesa.", "からだを　くすぐり　わらわせる　ことで\nあいての　こうげきと　ぼうぎょを\nさげる。", "体を　くすぐり　笑わせる　ことで\n相手の　攻撃と　防御を　さげる。\n", "몸을 간질여 웃게 만들어서\n상대의 공격과 방어를 떨어뜨린다.", "Hace reír al objetivo para bajar el Ataque\ny la Defensa.") },
            { PBEMove.CosmicPower, new PBELocalizedString("The user absorbs a mystical power from\nspace to raise its Defense and\nSp. Def stats.", "Le lanceur absorbe un pouvoir mystique\nspatial qui augmente sa Défense\net sa Défense Spéciale.", "Erhöht Verteidigung und\nSpezial-Verteidigung durch\neine mystische Kraft.", "Chi la usa assorbe una forza mistica\ndallo spazio che aumenta la Difesa\ne la Difesa Speciale.", "うちゅう　から　しんぴの　ちからを\nとりこむ　ことで　じぶんの\nぼうぎょと　とくぼうを　あげる。", "宇宙から　神秘の　力を\nとりこむ　ことで\n自分の　防御と　特防を　あげる。", "우주로부터 신비한 힘을\n손에 넣음으로써\n자신의 방어와 특수방어를 올린다.", "Sube la Defensa y la Defensa Especial\npropias con energía mística.") },
            { PBEMove.WaterSpout, new PBELocalizedString("The user spouts water to damage the\nopposing team. The lower the user's HP,\nthe less powerful it becomes.", "Le lanceur attaque avec un jet d'eau.\nMoins il a de PV et moins l'attaque\nest puissante.", "Wasser-Attacke, die wirkungsvoller ist,\nwenn KP des Anwenders hoch sind.", "Lancia un getto d'acqua contro i nemici.\nLa potenza è proporzionale al numero di PS\ndi chi la usa.", "しおを　ふきつけて　こうげきする。\nじぶんの　ＨＰが　すくないほど\nわざの　いりょくは　さがる。", "潮を　吹きつけて　攻撃する。\n自分の　ＨＰが　少ないほど\n技の　威力は　さがる。", "바닷물을 내뿜어 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 떨어진다.", "Chorro de agua. Cuantos menos PS\ntenga el usuario, menos dañino será.") },
            { PBEMove.SignalBeam, new PBELocalizedString("The user attacks with a sinister beam of\nlight. It may also confuse the target.", "Le lanceur projette un rayon de\nlumière sinistre. Peut aussi\nrendre l'ennemi confus.", "Strahlenattacke, die das Ziel\neventuell verwirrt.", "Chi la usa attacca con uno strano raggio\ndi luce che può anche confondere\nil Pokémon colpito.", "ふしぎな　ひかりを\nはっしゃして　こうげきする。\nあいてを　こんらん　させることが　ある。", "不思議な　光を\n発射して　攻撃する。\n相手を　混乱させることが　ある。", "이상한 빛을\n발사해서 공격한다.\n상대를 혼란시킬 때가 있다.", "Ataca con un rayo de luz siniestro.\nPuede confundir al objetivo.") },
            { PBEMove.ShadowPunch, new PBELocalizedString("The user throws a punch from the shadows.\nThe punch lands without fail.", "Le lanceur surgit des ombres et donne\nun coup de poing. N'échoue jamais.", "Angriff mit der Faust aus dem\nSchattenreich. Ausweichen\nunmöglich.", "Il nemico riceve un pugno proveniente\ndalle tenebre. Questa mossa è infallibile.", "かげに　まぎれて　パンチを　くりだす。\nこうげきは　かならず　めいちゅう　する。\n", "影に　まぎれて　パンチを　くりだす。\n攻撃は　必ず　命中する。\n", "그림자에 섞여 펀치를 날린다.\n공격은 반드시 명중한다.", "Puñetazo ineludible procedente\nde las sombras.") },
            { PBEMove.Extrasensory, new PBELocalizedString("The user attacks with an odd,\nunseeable power.\nIt may also make the target flinch.", "Le lanceur attaque avec un pouvoir\nétrange et invisible. Peut aussi\napeurer l'ennemi.", "Besonderer Angriff mit einer unsichtbaren\nKraft, die das Ziel eventuell\nzurückschrecken lässt.", "Chi la usa attacca con una misteriosa\nforza invisibile. Può far tentennare\nil nemico.", "みえない　ふしぎな　ちからを\nおくって　こうげきする。\nあいてを　ひるませる　ことが　ある。", "みえない　不思議な　力を\n送って　攻撃する。\n相手を　ひるませることが　ある。", "보이지 않는 이상한 힘을\n보내어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Energía muy extraña que puede\nhacer retroceder al objetivo.") },
            { PBEMove.SkyUppercut, new PBELocalizedString("The user attacks the target with an\nuppercut thrown skyward with force.", "Le lanceur attaque avec un uppercut.\nIl envoie son poing vers le ciel de\ntoutes ses forces.", "Kinnhaken, der das Ziel gen\nHimmel schickt.", "Chi la usa attacca il nemico con un\nmontante che può arrivare fino in cielo.", "そらに　むかうような　たかい　アッパーで\nあいてを　つきあげて　こうげきする。\n", "空に　むかうような　高い　アッパーで\n相手を　突きあげて　攻撃する。\n", "하늘을 향하는 듯한 높은 업퍼로\n상대를 밀어올려 공격한다.", "Gancho ascendente de gran ímpetu.") },
            // { PBEMove.328, new PBELocalizedString("The user traps the target inside a harshly\nraging sandstorm for four to five turns.", "Le lanceur emprisonne l'ennemi dans\nune tempête de sable terrifiante qui\ndure de 4 à 5 tours.", "Das Ziel leidet für 4 bis 5\nRunden in einer Sandhose.", "Chi la usa intrappola il nemico in un turbine\ndi sabbia per quattro o cinque turni.", "はげしく　ふきあれる　すなあらしの\nなかに　４ー５ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "激しく　吹きあれる　砂あらしの\n中に　４ー５ターンの　あいだ\n相手を　閉じこめて　攻撃する。", "세차게 불어대는\n모래바람 속에 4-5턴 동안\n상대를 가두어 공격한다.", "Enreda al objetivo en un remolino de arena\nde cuatro a cinco turnos.") },
            { PBEMove.SheerCold, new PBELocalizedString("The target is attacked with a blast of\nabsolute-zero cold.\nThe target instantly faints if it hits.", "Une vague de froid glacial frappe\nl'ennemi. S'il est touché, il est mis\nK.O. sur le coup.", "Angriff mit Kälte, die das Ziel\nbei Erfolg besiegt.", "Ondata di freddo penetrante che, se va\na segno, fa andare KO il nemico.", "ぜったいれいどの　つめたさで\nあいてを　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "絶対零度の　冷たさで\n相手を　攻撃する。\n当たれば　一撃で　ひんしに　する。", "절대영도의 추위로\n상대를 공격한다.\n맞으면 일격에 기절한다.", "Ataque de frío polar que debilita\nal objetivo si le alcanza.") },
            { PBEMove.MuddyWater, new PBELocalizedString("The user attacks by shooting muddy water\nat the opposing team.\nIt may also lower the targets' accuracy.", "Le lanceur attaque en projetant de l'eau\nboueuse. Peut aussi réduire la Précision\nde l'ennemi.", "Greift mit Matsch an und senkt\neventuell die Genauigkeit des\nGegners.", "Chi la usa attacca con un getto di fango\nche può anche ridurre la precisione\ndei nemici.", "にごった　みずを\nあいてに　はっしゃして　こうげきする。\nめいちゅうりつを　さげることが　ある。", "濁った　水を\n相手に　発射して　攻撃する。\n命中率を　さげることが　ある。", "탁해진 물을\n상대에게 발사하여 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Ataque con agua lodosa que puede\nbajar la Precisión.") },
            // { PBEMove.331, new PBELocalizedString("The user forcefully shoots seeds at the\ntarget. Two to five seeds are shot in\nrapid succession.", "Le lanceur mitraille l'ennemi avec une\nrafale de graines. De 2 à 5 rafales sont\nlancées à la suite.", "Der Anwender wirft 2- bis 5-mal\nin rascher Folge Samen auf das\nZiel.", "Chi la usa spara da due a cinque raffiche\ndi semi contro il nemico in successione.", "タネを　いきおいよく\nあいてに　はっしゃして　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "タネを　勢いよく\n相手に　発射して　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "씨앗을 기세 좋게\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Dispara rápido de dos a cinco ráfagas\nde semillas de manera consecutiva.") },
            { PBEMove.AerialAce, new PBELocalizedString("The user confounds the target with speed,\nthen slashes.\nThe attack lands without fail.", "Le lanceur prend l'ennemi de vitesse\net le lacère. N'échoue jamais.", "Eine extrem schnelle Attacke, der\ndas Ziel nicht ausweichen kann.", "Chi la usa attacca il nemico a grande\nvelocità. Questa mossa è infallibile.", "すばやい　うごきで\nあいてを　ほんろうして　きりつける。\nこうげきは　かならず　めいちゅう　する。", "素早い　動きで\n相手を　ほんろうして　切りつける。\n攻撃は　必ず　命中する。", "재빠른 움직임으로\n상대를 농락해 벤다.\n공격은 반드시 명중한다.", "El usuario lanza un ataque muy rápido\ne ineludible.") },
            // { PBEMove.333, new PBELocalizedString("The user launches sharp icicles at the\ntarget. It strikes two to five times in\na row.", "Le lanceur jette des pics de glace sur\nl'ennemi, de 2 à 5 fois de suite.", "Feuert 2 bis 5 Eiszapfen auf\ndas Ziel.", "Chi la usa spara ghiaccioli affilati contro\nil nemico da due a cinque volte di fila.", "するどい　つららを\nあいてに　はっしゃして　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "鋭い　氷柱を\n相手に　発射して　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "날카로운 고드름을\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Ataca lanzando de dos a cinco ráfagas\nconsecutivas de carámbanos.") },
            { PBEMove.IronDefense, new PBELocalizedString("The user hardens its body's surface\nlike iron, sharply raising its\nDefense stat.", "L'épiderme du lanceur devient dur comme\ndu fer, ce qui augmente considérablement\nsa Défense.", "Anwender stärkt den Körper, um den\nVerteidigungs-Wert stark zu erhöhen.", "Il corpo di chi la usa si indurisce come\nil ferro, facendone salire di molto la\nDifesa.", "ひふを　てつのように\nかたくする　ことで\nじぶんの　ぼうぎょを　ぐーんと　あげる。", "皮膚を　鉄のように\n硬くする　ことで\n自分の　防御を　ぐーんと　あげる。", "피부를 쇠처럼\n단단하게 함으로써\n자신의 방어를 크게 올린다.", "Fortalece el cuerpo como si fuera\nde hierro y sube mucho la Defensa.") },
            // { PBEMove.335, new PBELocalizedString("The user blocks the target's way with arms\nspread wide to prevent escape.", "Le lanceur bloque la route de l'ennemi\npour empêcher sa fuite.", "Anwender versperrt den Fluchtweg des\nZieles.", "Chi la usa sbarra la strada al nemico\nimpedendone la fuga o la sostituzione.", "りょうてを　ひろげて　たちはだかり\nあいての　にげみちを　ふさいで\nにげられなく　する。", "両手を　ひろげて　たちはだかり\n相手の　逃げ道を　ふさいで\n逃げられなくする。", "양팔을 벌려 막아서서\n상대의 도주로를 가로막아\n도망칠 수 없게 한다.", "Le corta el paso al objetivo para que\nno pueda escapar.") },
            { PBEMove.Howl, new PBELocalizedString("The user howls loudly to raise its spirit,\nboosting its Attack stat.", "Le lanceur hurle pour se rassurer, ce qui\naugmente son Attaque.", "Anwender jault, um seinen Kampfgeist\nund seinen Angriffs-Wert zu erhöhen.", "Chi la usa emette un verso molto forte\nper darsi coraggio e aumentare l'Attacco.", "おおごえで　ほえて　きあいを　たかめ\nじぶんの　こうげきを　あげる。\n", "大声で　ほえて　気合を　高め\n自分の　攻撃を　あげる。\n", "큰 소리로 짖고 기합을 높여\n자신의 공격을 올린다.", "Aullido que sube el ánimo y aumenta\nel Ataque.") },
            { PBEMove.DragonClaw, new PBELocalizedString("The user slashes the target with huge,\nsharp claws.", "Le lanceur lacère l'ennemi de ses\ngrandes griffes aiguisées.", "Das Ziel wird mit riesigen, scharfen\nKlauen stark verletzt.", "Chi la usa attacca con artigli affilati che\ngraffiano il nemico rapidamente e con\ngrande forza.", "するどく　とがった　きょだいな　ツメで\nあいてを　きりさいて　こうげきする。\n", "鋭く　とがった　巨大な　ツメで\n相手を　切り裂いて　攻撃する。\n", "날카롭고 뾰족한 거대한 발톱으로\n상대를 베어 갈라서 공격한다.", "Araña al objetivo con garras afiladas.") },
            // { PBEMove.338, new PBELocalizedString("The user slams the target with\nan enormous tree.\nThe user can't move on the next turn.", "Un violent coup de racines s'abat sur\nl'ennemi. Immobilise le lanceur au tour\nsuivant.", "Angriff mit dickem Ast. Der Angreifer\nmuss eine Runde aussetzen.", "Un groviglio di radici colpisce il nemico.\nChi la usa salta il turno successivo.", "おおきな　じゅもくで\nあいてを　たたきつけて　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "大きな　樹木で\n相手を　たたきつけて　攻撃する。\n次の　ターンは　動けなくなる。", "큰 나무로\n상대를 힘껏 쳐서 공격한다.\n다음 턴은 움직일 수 없게 된다.", "Golpea con una enorme planta.\nQuien lo usa no puede moverse\nen el siguiente turno.") },
            { PBEMove.BulkUp, new PBELocalizedString("The user tenses its muscles to bulk up\nits body, boosting both its Attack and\nDefense stats.", "Le lanceur tend ses muscles pour se\ngonfler, ce qui booste son Attaque\net sa Défense.", "Pumpt den Körper auf, um den Angriff\nund die Verteidigung zu erhöhen.", "Chi la usa tende i muscoli per gonfiare\nil corpo, aumentando Difesa e Attacco.", "からだに　ちからを　こめて　きんにくを\nぶあつく　することで　じぶんの\nこうげきと　ぼうぎょを　あげる。", "体に　力を　こめて\n筋肉を　ぶあつく　することで\n自分の　攻撃と　防御を　あげる。", "몸에 힘을 담아\n근육을 두껍게 해서\n자신의 공격과 방어를 올린다.", "Robustece el cuerpo para subir el Ataque\ny la Defensa.") },
            // { PBEMove.340, new PBELocalizedString("The user bounces up high, then drops on\nthe target on the second turn. It may\nalso leave the target with paralysis.", "Le lanceur bondit très haut et plonge\nsur l'ennemi au 2⒅ tour. Peut aussi\nparalyser l'ennemi.", "Angreifer springt und landet in der\nnächsten Runde auf dem Ziel. Das\nZiel wird eventuell paralysiert.", "Chi la usa balza in alto e ricade sul nemico\ndopo un turno. Può anche paralizzare\nil bersaglio.", "そらたかく　とびはねて\n２ターンめに　あいてを　こうげきする。\nまひ　じょうたいに　することが　ある。", "空高く　飛び跳ねて\n２ターン目に　相手を　攻撃する。\nまひ状態に　することが　ある。", "하늘 높이 뛰어올라\n2턴째에 상대를 공격한다.\n마비 상태로 만들 때가 있다.", "Primer turno: bota.\nSegundo turno: golpea.\nPuede paralizar.") },
            { PBEMove.MudShot, new PBELocalizedString("The user attacks by hurling a blob of mud\nat the target.\nIt also reduces the target's Speed.", "Le lanceur attaque en projetant\nde la boue sur l'ennemi. Réduit\naussi la Vitesse de la cible.", "Angriff mit Lehm, der den Initiative-Wert\ndes Zieles senkt.", "Chi la usa attacca lanciando fango sul\nbersaglio, riducendone anche la Velocità.", "どろの　かたまりを\nあいてに　なげつけて　こうげきする。\nどうじに　あいての　すばやさを　さげる。", "泥の　塊を\n相手に　投げつけて　攻撃する。\n同時に　相手の　素早さを　さげる。", "진흙 덩어리를\n상대에게 내던져서 공격한다.\n동시에 상대의 스피드를 떨어뜨린다.", "El usuario lanza lodo al objetivo y reduce\nsu Velocidad.") },
            { PBEMove.PoisonTail, new PBELocalizedString("The user hits the target with its tail.\nIt may also poison the target.\nCritical hits land more easily.", "Attaque à taux de critiques élevé.\nPeut aussi empoisonner l'ennemi.", "Angriff mit hoher Volltrefferquote.\nDiese Schweifattacke vergiftet das\nZiel eventuell.", "Chi la usa colpisce con la coda e può\navvelenare il nemico. Probabile brutto\ncolpo.", "しっぽで　たたく。\nどく　じょうたいに　することが　あり\nきゅうしょにも　あたりやすい。", "しっぽで　たたく。\n毒状態に　することが　あり\n急所にも　当たりやすい。", "꼬리로 때린다.\n독 상태로 만들 때가 있고\n급소에도 맞기 쉽다.", "Puede envenenar y dar un golpe crítico.") },
            // { PBEMove.343, new PBELocalizedString("The user endearingly approaches\nthe target, then steals the target's\nheld item.", "Le lanceur s'approche de la cible avec\nun air angélique afin de dérober l'objet\nqu'elle tient.", "Bittet charmant um das gehaltene Item\ndes Zieles und stiehlt es dann.", "Chi la usa attacca il bersaglio sorridendo\ne gli ruba lo strumento che tiene.\n", "かわいく　あまえながら\nあいてに　ちかづき\nもっている　どうぐを　うばう。", "かわいく　あまえながら\n相手に　ちかづき\n持っている　道具を　うばう。", "귀엽게 애교부리며\n상대에게 다가가\n지니고 있는 도구를 뺏는다.", "Se acerca con ternura al objetivo, pero le\nataca pudiendo robar el objeto que lleve.") },
            { PBEMove.VoltTackle, new PBELocalizedString("The user electrifies itself, then charges.\nIt causes considerable damage to the user\nand may leave the target with paralysis.", "Le lanceur électrifie son corps avant de\ncharger. Le choc blesse aussi beaucoup\nle lanceur et peut paralyser l'ennemi.", "Angriff mit Elektro-Tackle. Der Anwender\nverletzt sich dabei. Das Ziel wird\neventuell paralysiert.", "Chi la usa si carica di elettricità e poi\nattacca. Può paralizzare il nemico.\nIl contraccolpo causa seri danni.", "でんきを　まとって　とっしんする。\nじぶんも　かなり ダメージを　うける\nまひ　じょうたいに　することが　ある。", "電気を　まとって　突進する。\n自分も　かなり　ダメージを　受ける。\nまひ状態に　することが　ある。", "전기를 한데 모아 돌진한다.\n자신도 상당한 데미지를 입는다.\n마비 상태로 만들 때가 있다.", "Quien lo usa electrifica su cuerpo para\nluego atacar. Se hiere mucho a sí mismo,\npero puede paralizar al objetivo.") },
            { PBEMove.MagicalLeaf, new PBELocalizedString("The user scatters curious leaves\nthat chase the target.\nThis attack will not miss.", "Le lanceur disperse d'étranges feuilles\nqui poursuivent l'ennemi. N'échoue jamais.", "Magischer Blattangriff, dem nicht\nauszuweichen ist.", "Chi la usa sparpaglia strane foglie che\ninseguono il nemico. Attacco infallibile.", "あいてを　ついせきする\nふしぎな　はっぱを まきちらす。\nこうげきは　かならず　めいちゅう　する。", "相手を　追跡する\n不思議な　はっぱを まきちらす。\n攻撃は　必ず　命中する。", "상대를 추적하는\n이상한 잎사귀를 흩뿌린다.\n공격은 반드시 명중한다.", "Esparce extrañas hojas que persiguen\nal objetivo. No se puede esquivar.") },
            // { PBEMove.346, new PBELocalizedString("The user soaks itself with water. The move\nweakens Fire-type moves while the user\nis in the battle.", "Le lanceur s'asperge d'eau. Affaiblit\nles capacités Feu quand le lanceur\nest au combat.", "Schwächt Feuer-Attacken, solang\nder Anwender am Kampf teilnimmt.", "Chi la usa s'impregna d'acqua indebolendo\nle mosse di tipo Fuoco finché resta\nin campo.", "みずを　かぶって　びしょびしょに　なる。\nじぶんが　いるあいだ\nほのおタイプの　わざを　よわめる。", "水を　かぶって　びしょびしょに　なる。\n自分が　いるあいだ\nほのおタイプの　技を　弱める。", "흠뻑 젖어 버린다. 기술을 쓴 포켓몬이\n배틀에 나와 있는 동안 불꽃타입의\n기술을 약하게 만든다.", "El usuario se moja y, mientras esté\nen combate, los movimientos de tipo\nFuego se debilitan.") },
            { PBEMove.CalmMind, new PBELocalizedString("The user quietly focuses its mind and\ncalms its spirit to raise its Sp. Atk and\nSp. Def stats.", "Le lanceur se concentre et fait le vide\ndans son esprit pour monter son\nAttaque Spéciale et sa Défense Spéciale.", "Erhöht Spezial-Angriff und\nSpezial-Verteidigung durch\nKonzentration.", "Chi la usa, meditando, placa il proprio\nspirito per aumentare l'Attacco Speciale\ne la Difesa Speciale.", "しずかに　せいしんを　とういつし\nこころを　しずめる　ことで　じぶんの\nとくこうと　とくぼうを　あげる。", "静かに　精神を　統一し\n心を　鎮めることで　自分の\n特攻と　特防を　あげる。", "조용히 정신을 통일하고\n마음을 가라앉혀서 자신의\n특수공격과 특수방어를 올린다.", "Aumenta la concentración y calma\nel espíritu para subir el Ataque Especial\ny la Defensa Especial.") },
            { PBEMove.LeafBlade, new PBELocalizedString("The user handles a sharp leaf like a\nsword and attacks by cutting its target.\nCritical hits land more easily.", "Une feuille coupante comme une lame\nentaille l'ennemi. Taux de critiques élevé.", "Hieb mit scharfkantigem\nBlatt. Hohe Volltrefferquote.", "Colpisce il nemico usando una foglia\naffilata come una spada. Probabile\nbrutto colpo.", "はっぱを　つるぎのように　あやつり\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "はっぱを　剣のように　あやつり\n相手を　切りつけて　攻撃する。\n急所に　当たりやすい。", "잎사귀를 칼처럼 이용해\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Acuchilla con una hoja fina.\nSuele dar un golpe crítico.") },
            { PBEMove.DragonDance, new PBELocalizedString("The user vigorously performs a mystic,\npowerful dance that boosts its Attack and\nSpeed stats.", "Une danse mystique dont le rythme\neffréné augmente l'Attaque et la\nVitesse du lanceur.", "Ein mystischer Tanz, der den\nAngriffs- und Initiative-Wert\nerhöht.", "Danza mistica e vigorosa che aumenta\nl'Attacco e la Velocità di chi la usa.", "しんぴてきで　ちからづよい　まいを\nはげしく　おどる。じぶんの\nこうげきと　すばやさを　あげる。", "神秘的で　力づよい　舞を\n激しく　おどる。自分の\n攻撃と　素早さを　あげる。", "신비롭고 힘센 춤을\n격렬하게 춘다. 자신의\n공격과 스피드를 올린다.", "Danza mística que sube el Ataque\ny la Velocidad.") },
            // { PBEMove.350, new PBELocalizedString("The user hurls hard rocks at the target.\nTwo to five rocks are launched in quick\nsuccession.", "Le lanceur projette un rocher sur\nl'ennemi de 2 à 5 fois d'affilée.", "Wirft 2- bis 5-mal in Folge Felsblöcke\nauf das Ziel.", "Colpisce il nemico con dei massi pesanti\nlanciati in rapida successione. Il numero\ndi massi varia da due a cinque.", "かたい　がんせきを\nあいてに　はっしゃして　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "硬い　岩石を\n相手に　発射して　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "단단한 암석을\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Lanza pedruscos al objetivo de dos a cinco\nveces consecutivas.") },
            { PBEMove.ShockWave, new PBELocalizedString("The user strikes the target with a quick\njolt of electricity.\nThis attack cannot be evaded.", "Le lanceur envoie un choc électrique\nrapide à l'ennemi. Impossible à esquiver.", "Angriff mit schnellem Elektro-Schlag.\nAusweichen nicht möglich.", "Chi la usa colpisce il nemico con una scossa\ndi elettricità. È impossibile eludere questa\nmossa.", "でんげきを　すばやく\nあいてに　あびせる。\nこうげきは　かならず　めいちゅう　する。", "電撃を　素早く\n相手に　浴びせる。\n攻撃は　必ず　命中する。", "전격을 재빠르게\n상대에게 날린다.\n공격은 반드시 명중한다.", "Ataque eléctrico muy rápido e ineludible.") },
            { PBEMove.WaterPulse, new PBELocalizedString("The user attacks the target with\na pulsing blast of water.\nIt may also confuse the target.", "Le lanceur envoie un puissant\njet d'eau sur l'ennemi. Peut\nrendre l'ennemi confus.", "Angriff mit Wasserwelle, die das\nZiel eventuell verwirren kann.", "Il nemico viene colpito da un getto d'acqua\npotentissimo che può anche confonderlo.", "みずの　しんどうを\nあいてに　あたえて　こうげきする。\nあいてを　こんらん　させることが　ある。", "水の　振動を\n相手に　与えて　攻撃する。\n相手を　混乱させることが　ある。", "물의 진동을\n상대에게 가하여 공격한다.\n상대를 혼란시킬 때가 있다.", "Ataca con un potente chorro de agua.\nPuede confundir al objetivo.") },
            // { PBEMove.353, new PBELocalizedString("Two turns after this move is used, the\nuser blasts the target with a\nconcentrated bundle of light.", "Le lanceur génère une sphère lumineuse\nqu'il projette sur l'ennemi 2 tours\nplus tard.", "Angriff mit gebündeltem Licht erfolgt\nzwei Runden nach Attackeneinsatz.", "Intensa luce solare che colpisce il nemico\ndopo due turni dall'uso della mossa.", "わざを　つかった　２ターン　あとに\nむすうの　ひかりの　たばで\nあいてを　こうげきする。", "技を　使った　２ターン後に\n無数の　光の　束で\n相手を　攻撃する。", "기술을 사용한 2턴 뒤에\n무수한 빛의 다발이\n상대를 공격한다.", "Concentra un haz de luz y ataca\ndos turnos después.") },
            { PBEMove.PsychoBoost, new PBELocalizedString("The user attacks the target at full power.\nThe attack's recoil harshly reduces the\nuser's Sp. Atk stat.", "Attaque l'ennemi à pleine puissance.\nLe contrecoup baisse énormément\nl'Attaque Spéciale du lanceur.", "Angriff mit voller Kraft, der den\nSpezial-Angriff des Anwenders durch\nden Rückstoß stark senkt.", "Chi la usa sferra un potente attacco,\nma il contraccolpo riduce di molto\nil suo Attacco Speciale.", "フルパワーで　あいてを　こうげきする。\nつかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "フルパワーで　相手を　攻撃する。\n使うと　反動で\n自分の　特攻が　がくっと　さがる。", "풀 파워로 상대를 공격한다.\n쓰면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Ataque en toda regla que baja mucho\nel Ataque Especial de quien lo usa.") },
            // { PBEMove.355, new PBELocalizedString("The user lands and rests its body.\nIt restores the user's HP by up to\nhalf of its max HP.", "Le lanceur atterrit et se repose.\nRestaure jusqu'à la moitié\nde ses PV max.", "Anwender landet und ruht sich aus.\nKP des Anwenders werden um 50 %\nder maximalen KP aufgefüllt.", "Chi la usa sta fermo e riposa, recuperando\nmetà dei propri PS massimi.", "じめんに　おりて　からだを　やすめる。\nさいだい　ＨＰの　はんぶんの\nＨＰを　かいふく　する。", "地面に　降りて　体を　やすめる。\n最大ＨＰの　半分の\nＨＰを　回復する。", "땅에 내려와 몸을 쉬게 한다.\n최대 HP의 절반만큼\nHP를 회복한다.", "Aterriza sobre la superficie para\ndescansar. Recupera hasta la\nmitad del total de sus PS.") },
            // { PBEMove.356, new PBELocalizedString("Gravity is intensified for five turns,\nmaking moves involving flying unusable\nand negating Levitate.", "La gravité augmente pendant 5 tours,\nce qui empêche les capacités volantes\net annule Lévitation.", "Die Gravitation wird für fünf Runden\nerhöht. Macht Fliegen unmöglich und\nverhindert Schwebe.", "Intensifica la gravità per cinque turni.\nLe mosse che fanno volare e Levitazione\nsono inutilizzabili.", "５ターンの　あいだ\nじゅうりょくを　つよくして　ふゆうや\nそらへ　とぶ　わざを　つかえなく　する。", "５ターンの　あいだ\n重力を　強くして　ふゆうや\n空へ　飛ぶ　技を　使えなくする。", "5턴 동안 중력을\n강하게 해서 부유나 하늘을 나는\n기술을 사용할 수 없게 한다.", "La gravedad aumenta durante cinco\nturnos, lo que impide acciones\nque impliquen volar o levitar.") },
            // { PBEMove.357, new PBELocalizedString("Enables a Dark-type target to be hit by\nPsychic-type attacks. It also enables\nan evasive target to be hit.", "Permet de toucher un Pokémon Ténèbres\navec toute capacité et de toucher un\nennemi insaisissable.", "Erlaubt es, Unlicht-Pokémon mit\nPsycho-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Chi la usa rende i Pokémon di tipo Buio\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "あくタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "あくタイプに　効果がない　技や\n回避率の　高い　相手に\n攻撃が　当たるように　なる。", "악타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permite atacar con cualquier movimiento\na objetivos de tipo Siniestro y golpear\na Pokémon evasivos.") },
            // { PBEMove.358, new PBELocalizedString("This attack inflicts big damage on a\nsleeping target. It also wakes the target\nup, however.", "Cette attaque inflige d'importants\ndégâts à un Pokémon endormi.\nMais elle le réveille également.", "Richtet großen Schaden bei einem\nschlafenden Ziel an, weckt es\naber auch auf.", "Questa mossa infligge un danno doppio\nad un bersaglio addormentato, ma allo\nstesso tempo lo risveglia.", "ねむり　じょうたいの　あいてに\nおおきな　ダメージを　あたえる。　\nかわりに　あいては　ねむりから　さめる。", "眠り状態の　相手に\n大きな　ダメージを　与える。　\nかわりに　相手は　眠りから　さめる。", "잠듦 상태의 상대에게\n큰 데미지를 준다.\n대신 상대는 잠에서 깬다.", "Inflige gran daño a objetivos dormidos.\nSin embargo, los bofetones también\nlos despiertan.") },
            { PBEMove.HammerArm, new PBELocalizedString("The user swings and hits with its strong\nand heavy fist.\nIt lowers the user's Speed, however.", "Le lanceur lâche un puissant coup de\npoing sur l'ennemi. Réduit la vitesse\ndu lanceur.", "Anwender trifft mit einem starken Hieb.\nSenkt Initiative des Anwenders.", "Chi la usa colpisce il nemico con il suo\npugno forte e pesante, ma perde Velocità.", "つよくて　おもい　こぶしを\nふるって　ダメージを　あたえる。\nじぶんの　すばやさが　さがる。", "強くて　重い　こぶしを\nふるって　ダメージを　与える。\n自分の　素早さが　さがる。", "강하고 무거운 주먹을\n휘둘러 데미지를 준다.\n자신의 스피드가 떨어진다.", "Gira con fuerza el puño y da un gran\ngolpe. No obstante, baja la Velocidad.") },
            // { PBEMove.360, new PBELocalizedString("The user tackles the target with a\nhigh-speed spin. The slower the\nuser, the greater the damage.", "Le lanceur effectue une rotation et\nfrappe l'ennemi. Plus le lanceur est\nlent, plus il fait de dégâts.", "Angriff mit hoher Geschwindigkeit. Je\nniedriger die Initiative des Anwenders,\ndesto mehr Schaden.", "Chi la usa colpisce il nemico con un vortice\nrapidissimo. Più lento è chi la usa, maggiore\nè il danno.", "からだを　こうそくに　かいてん　させて\nたいあたりする。あいてより　すばやさが\nおそいほど　つよい。", "体を　高速に　回転させて\n体当たりする。相手より　素早さが\n遅いほど　強い。", "몸을 고속으로 회전시켜\n몸통박치기한다. 상대보다\n스피드가 느릴수록 위력은 올라간다.", "Embiste al objetivo con un potente ataque\ngiratorio. Cuanto más lento es\nel usuario, más daño causa.") },
            // { PBEMove.361, new PBELocalizedString("The user faints. In return, the Pokémon\ntaking its place will have its HP restored\nand status cured.", "Le lanceur tombe K.O. pour soigner les\nPV et le statut du Pokémon qui passe\naprès lui.", "Anwender geht K.O. Das an seine\nStelle tretende Pokémon hat volle\nKP. Statusprobleme werden geheilt.", "Chi la usa va KO, ma il Pokémon che lo\nsostituisce recupera tutti i PS e risolve\ni problemi di stato.", "じぶんは　ひんしに　なるが　ひかえから\nでてくる　ポケモンの　じょうたい\nいじょうと　ＨＰを　かいふく　する。", "自分は　ひんしに　なるが\n控えから　でてくる　ポケモンの\n状態異常と　ＨＰを　回復する。", "자신은 기절하지만\n교대하여 나오는 포켓몬의\n상태 이상과 HP를 회복한다.", "El Pokémon cae debilitado, pero su\nsustituto recupera su estado y los PS.") },
            { PBEMove.Brine, new PBELocalizedString("If the target's HP is down to about half,\nthis attack will hit with double\nthe power.", "Cette attaque est deux fois plus\npuissante lorsque l'ennemi a moins\nde la moitié de ses PV.", "Hat das Ziel die Hälfte oder weniger\nseiner maximalen KP, trifft diese Attacke\nmit doppelter Kraft.", "Se i PS del nemico sono scesi a metà o\nmeno, questa mossa colpirà con il doppio\ndella forza.", "あいてが　ＨＰの　はんぶん　くらい\nきずを　おっていると　わざの　いりょくが\n２ばいに　なる。", "相手が　ＨＰの　半分くらい\nきずを　おっていると　技の　威力が\n２倍に　なる。", "상대가 HP의 절반 정도\n상처를 입고 있으면 기술의\n위력이 2배가 된다.", "Si al objetivo le queda la mitad o menos\nde sus PS, el ataque será el doble\nde fuerte.") },
            // { PBEMove.363, new PBELocalizedString("The user draws power to attack by using\nits held Berry.\nThe Berry determines its type and power.", "Avant d'attaquer, le lanceur rassemble\nses forces grâce à sa Baie. Elle\ndétermine le type et la puissance.", "Anwender zieht aus seiner derzeitigen\nBeere Kraft. Sie bestimmt Typ und\nStärke der Attacke.", "Chi la usa trae forza dalla Bacca che\ntiene. Da questa dipendono il tipo e\nla forza dell'attacco.", "きのみから　ちからを　もらい\nこうげきする。もたせた　きのみで\nわざの　タイプと　いりょくが　かわる。", "きのみから　力を　もらい\n攻撃する。持たせた　きのみで\n技の　タイプと　威力が　変わる。", "나무열매에서 힘을 얻어\n공격한다. 지니게 한 나무열매에 따라\n기술의 타입과 위력이 바뀐다.", "La Baya que lleva presta su fuerza\npara atacar. El tipo de ataque\ny su fuerza dependen de la Baya.") },
            // { PBEMove.364, new PBELocalizedString("An attack that hits a target using\nProtect or Detect. It also lifts\nthe effects of those moves.", "Une attaque capable de toucher un ennemi\nqui utilise Détection ou Abri. Annule aussi\nleur effet.", "Ziele, die Schutzschild oder Scanner\nverwenden, werden getroffen. Entfernt\nEffekte dieser Attacken.", "Mossa che colpisce anche un nemico che ha\nusato Protezione o Individua, annullandone\ngli effetti.", "まもるや　みきりを　している\nあいてに　こうげきが　できる。\nまもりの　こうかを　かいじょ　させる。", "まもるや　みきりを　している\n相手に　攻撃が　できる。\n守りの　効果を　解除させる。", "방어나 판별을 하고 있는\n상대에게 공격할 수 있다.\n방어 효과를 해제시킨다.", "Permite golpear a objetivos que usan\nProtección o Detección y anula\ndichos movimientos.") },
            // { PBEMove.365, new PBELocalizedString("The user pecks the target. If the target\nis holding a Berry, the user eats it and\ngains its effect.", "Le lanceur picore la cible. Si cette\ndernière tient une Baie, le lanceur\nla mange et profite de ses effets.", "Anwender pickt das Ziel, nimmt die\nBeere, falls das Ziel eine hält,\nund erhält ihren Effekt.", "Chi la usa becca il bersaglio. Inoltre, se\nquesti tiene una Bacca, gliela ruba e ne\nsfrutta gli effetti.", "くちばしで　こうげき。\nあいてが　きのみを　もっている　とき\nたべて　きのみの　こうかを　うけられる。", "くちばしで　攻撃。\n相手が　きのみを　持っているとき\n食べて　きのみの　効果を　受けられる。", "부리로 공격한다.\n상대가 나무열매를 지니고 있을 때\n먹어서 나무열매의 효과를 받을 수 있다.", "Picotea al objetivo. Si este sostiene una\nBaya, la picotea también y obtiene\nsus efectos.") },
            // { PBEMove.366, new PBELocalizedString("The user whips up a turbulent whirlwind\nthat ups the Speed of all party Pokémon\nfor four turns.", "Génère une rafale de vent qui augmente la\nVitesse des Pokémon de l'équipe pendant 4\ntours.", "Anwender erzeugt einen Wirbelwind, der\ndie Initiative aller Pokémon im Team für\nvier Runden steigert.", "Chi la usa scatena un turbine che aumenta\nla Velocità di tutti i Pokémon della squadra\nper quattro turni.", "はげしく　ふきあれる\nかぜのうずを　つくり　４ターンの　あいだ\nみかた　ぜんいんの　すばやさを　あげる。", "激しく　吹きあれる\n風の渦を　つくり　４ターンの　あいだ\n味方　全員の　素早さを　あげる。", "세차게 불어대는\n바람의 소용돌이를 만들어 4턴 동안\n같은 편 모두의 스피드를 올린다.", "Crea un fuerte remolino que aumenta\nla Velocidad de los Pokémon de tu equipo\ndurante cuatro turnos.") },
            // { PBEMove.367, new PBELocalizedString("The user applies pressure to stress\npoints, sharply boosting one of\nits stats.", "Le lanceur effectue des pressions\npour augmenter fortement l'une\nde ses stats.", "Anwender erhöht Druck auf\nStresspunkte und steigert einen\nseiner Statuswerte stark.", "Chi la usa esercita pressione su alcuni\npunti nevralgici e aumenta di molto\nuna statistica a caso.", "つぼおしで　からだを\nかっせいか　させる。のうりょくの\nどれか　１つを　ぐーんと　あげる。", "つぼおしで　体を　活性化させる。\n能力の　どれか　１つを\nぐーんと　あげる。", "경혈을 눌러 몸을 활성화시킨다.\n능력 중 하나를 크게 올린다.", "La presión en puntos clave del cuerpo\npotencia una de sus características.") },
            // { PBEMove.368, new PBELocalizedString("The user retaliates with much greater\npower against the target\nthat last inflicted damage on it.", "Le lanceur attaque le dernier ennemi\nl'ayant blessé durant le même tour\nen frappant plus fort.", "Attacke mit großer Kraft gegen das\nZiel, das dem Anwender in derselben\nRunde zuletzt Schaden zufügte.", "Chi la usa si vendica sul nemico che l'ha\nappena ferito con una mossa anche più\npotente.", "わざを　だすまえに\nさいごに　うけた　わざの　ダメージを\nおおきくして　だした　あいてに　かえす。", "技を　だす前に\n最後に　受けた　技の　ダメージを\n大きくして　だした　相手に　返す。", "기술을 쓰기 전에\n마지막으로 받은 기술의 데미지를\n늘려서 기술을 쓴 상대에게 돌려준다.", "Devuelve al objetivo el último ataque\nrecibido, pero con mucha más fuerza.") },
            // { PBEMove.369, new PBELocalizedString("After making its attack, the user\nrushes back to switch places with\na party Pokémon in waiting.", "Après son attaque, le lanceur revient à\ntoute vitesse et change de place avec\nun Pokémon de l'équipe prêt au combat.", "Nach der Attacke eilt der Anwender\nzurück und tauscht den Platz mit\neinem anderen Pokémon.", "Chi usa questa mossa si tira indietro\nper farsi sostituire dopo aver sferrato\nl'attacco.", "こうげき　したあと\nものすごい　スピードで　もどってきて\nひかえ　ポケモンと　いれかわる。", "攻撃したあと\nものすごい　スピードで　もどってきて\n控えの　ポケモンと　入れ替わる。", "공격한 뒤\n굉장한 스피드로 돌아와서\n교대 포켓몬과 교체한다.", "Tras atacar, vuelve a toda prisa\npara dar paso a otro Pokémon\ndel equipo.") },
            { PBEMove.CloseCombat, new PBELocalizedString("The user fights the target up close\nwithout guarding itself. It also cuts\nthe user's Defense and Sp. Def.", "Le lanceur combat au corps à corps sans\nse protéger. Baisse aussi sa Défense et\nsa Défense Spéciale.", "Nahkampf-Attacke ohne Rücksicht\nauf Verluste. Senkt Verteidigung und\nSpezial-Verteidigung des Anwenders.", "Chi la usa attacca abbassando la guardia.\nLa propria Difesa e la Difesa Speciale\nsi riducono.", "まもりを　すてて　あいての　ふところに\nとつげきする。じぶんの\nぼうぎょと　とくぼうが　さがる。", "守りを　捨てて　相手の　ふところに\n突撃する。自分の\n防御と　特防が　さがる。", "방어를 포기하고 상대 깊숙이\n돌격한다. 자신의\n방어와 특수방어가 떨어진다.", "Lucha abiertamente contra el objetivo sin\nprotegerse. También reduce la Defensa\ny la Defensa Especial del usuario.") },
            // { PBEMove.371, new PBELocalizedString("If the user moves after the target,\nthis attack's power will be doubled.", "Le lanceur charge son énergie, puis\nattaque. La puissance est doublée\nsi le lanceur agit après l'ennemi.", "Der Anwender lädt die Attacke auf.\nHandelt das Ziel vor dem Anwender,\nverdoppelt sich die Kraft der Attacke.", "Chi la usa accumula forza, poi attacca.\nLa potenza raddoppia se agisce dopo\nil Pokémon nemico.", "ためこんで　こうげきする。\nあいてより　あとに　こうげき　できると\nわざの　いりょくは　２ばいに　なる。", "ためこんで　攻撃する。\n相手より　あとに　攻撃できると\n技の　威力は　２倍に　なる。", "모아서 공격한다.\n상대보다 뒤에 공격할 수 있으면\n기술의 위력은 2배가 된다.", "El usuario contraataca con el doble\nde fuerza si el objetivo usa\nun movimiento antes.") },
            // { PBEMove.372, new PBELocalizedString("If the target has already taken some\ndamage in the same turn, this attack's\npower is doubled.", "Cette attaque est deux fois plus\nefficace si l'ennemi a déjà été blessé\ndurant ce tour.", "Hat der Gegner während der Runde bereits\nSchaden genommen, wird die Kraft der\nAttacke verdoppelt.", "Se il nemico ha già subito dei danni nello\nstesso turno, la potenza di questa mossa\nraddoppia.", "そのターンに　あいてが\nすでに　ダメージを　うけて　いたら\nわざの　いりょくは　２ばいに　なる。", "そのターンに　相手が\nすでに　ダメージを　受けていたら\n技の　威力は　２倍に　なる。", "그 턴에 상대가\n이미 데미지를 입었다면\n기술의 위력은 2배가 된다.", "Si el objetivo ya ha sufrido daño en ese\nturno, la fuerza del ataque se duplica.") },
            // { PBEMove.373, new PBELocalizedString("It prevents the target from using its held\nitem. Its Trainer is also prevented from\nusing items on it.", "Empêche l'ennemi d'utiliser un\nobjet tenu et son Dresseur\nd'utiliser un objet sur lui.", "Verhindert, dass auf das Ziel Items\nverwendet werden.", "Impedisce al nemico di usare lo strumento\nche tiene e al suo Allenatore di usarne\naltri sul Pokémon.", "もたせた　どうぐを　つかえなくする。\nトレーナーも　その　ポケモンには\nどうぐを　つかえない。", "持たせた　道具を　使えなくする。\nトレーナーも　その　ポケモンには\n道具を　使えない。", "지니게 한 도구를 쓸 수 없게 한다.\n트레이너도 그 포켓몬에게는\n도구를 쓸 수 없다.", "Impide al objetivo usar el objeto que\nlleva. Su Entrenador tampoco puede\nusar objetos sobre él.") },
            // { PBEMove.374, new PBELocalizedString("The user flings its held item at the target\nto attack. Its power and effects depend\non the item.", "Le lanceur envoie l'objet qu'il tient\nsur l'ennemi. La puissance et les\neffets dépendent de l'objet.", "Anwender schleudert sein Item auf\ndas Ziel. Kraft und Effekt der Attacke\nhängen vom Item ab.", "Chi la usa lancia sul nemico lo strumento\nche tiene. La forza e l'effetto dipendono\ndallo strumento.", "もたせた　どうぐを\nすばやく　なげつけて　こうげきする。\nどうぐで　いりょくと　こうかが　かわる。", "持たせた　道具を\n素早く　投げつけて　攻撃する。\n道具で　威力と　効果が　変わる。", "지니게 한 도구를\n재빠르게 내던져서 공격한다.\n도구에 따라 위력과 효과가 바뀐다.", "Lanza contra el objetivo el objeto que\nlleva. La fuerza del ataque y su efecto\nvarían según el objeto.") },
            // { PBEMove.375, new PBELocalizedString("Using its psychic power of suggestion,\nthe user transfers its status problems\nto the target.", "Le lanceur transfère ses problèmes de\nstatut à l'ennemi grâce à son pouvoir\nde suggestion.", "Anwender nutzt seine Suggestivkräfte, um\neigene Statusprobleme auf das Ziel zu\ntransferieren.", "Con la forza psichica e la suggestione,\nchi la usa può trasferire i suoi problemi\ndi stato al Pokémon colpito.", "ちょうのうりょくで　あんじを　かけて\nじぶんの　うけている　じょうたい\nいじょうを　あいてに　うつす。", "超能力で　暗示を　かけて\n自分の　受けている　状態異常を\n相手に　うつす。", "초능력으로 암시를 걸어서\n자신에게 걸려 있는 상태 이상을\n상대에게 옮긴다.", "Usa su poder mental para transferir\nal objetivo sus problemas de estado.") },
            // { PBEMove.376, new PBELocalizedString("The fewer PP this move has, the greater\nits attack power.", "Moins cette capacité possède de PP,\nplus elle est puissante.", "Je weniger AP diese Attacke hat, desto\nmehr Angriffskraft besitzt sie.", "La potenza di questa mossa aumenta man\nmano che i suoi PP diminuiscono.", "きりふだの　のこり　ＰＰが\nすくなければ　すくないほど\nわざの　いりょくが　あがる。", "きりふだの　残り　ＰＰが\n少なければ　少ないほど\n技の　威力が　あがる。", "마지막수단의 남은 PP가\n적으면 적을수록\n기술의 위력이 올라간다.", "Cuantos menos PP tenga el movimiento,\nmayor será la fuerza para atacar.") },
            // { PBEMove.377, new PBELocalizedString("For five turns, the user prevents the\nopposing team from using any moves,\nAbilities, or held items that recover HP.", "Le lanceur empêche l'ennemi d'utiliser ses\ncapacités, cap. spé. ou objets tenus pour\nrécupérer des PV pendant 5 tours.", "Anwender verhindert für fünf Runden, dass\nGegner durch Attacken, Fähigkeiten oder\nItems KP regenerieren.", "Chi la usa impedisce al nemico di utilizzare\nmosse o abilità recupera-PS per cinque\nturni.", "５ターンの　あいだ　わざや\nとくせいや　もっている　どうぐによって\nＨＰを　かいふく　できなく　する。", "５ターンの　あいだ　技や\n特性や　持っている　道具によって\nＨＰを　回復　できなくする。", "5턴 동안 기술이나 특성,\n지니고 있는 도구에 의한\nHP 회복을 할 수 없게 한다.", "Impide al objetivo usar movimientos,\nhabilidades y objetos equipados que\nrecuperan PS durante cinco turnos.") },
            // { PBEMove.378, new PBELocalizedString("The user powerfully wrings the target.\nThe more HP the target has, the greater\nthis attack's power.", "Le lanceur essore l'ennemi. Plus\nl'ennemi a de PV, plus cette attaque\nest puissante.", "Anwender presst sein Ziel aus.\nJe höher die KP des Zieles, desto\nkraftvoller die Attacke.", "Chi la usa stritola con forza il nemico.\nPiù PS ha il nemico, maggiore è la potenza\ndella mossa.", "つよく　しめあげて　こうげきを　する。\nあいての　ＨＰが　のこっている　ほど\nいりょくは　あがる。", "強く　締めあげて　攻撃を　する。\n相手の　ＨＰが　残っているほど\n威力は　あがる。", "강하게 조여 공격을 한다.\n상대의 HP가 많이 남아 있을수록\n위력이 올라간다.", "Estruja con fuerza al objetivo.\nCuantos más PS tenga el objetivo,\nmás fuerza tendrá el ataque.") },
            // { PBEMove.379, new PBELocalizedString("The user employs its psychic power to\nswitch its Attack with its Defense stat.", "Le lanceur utilise ses pouvoirs psychiques\npour échanger sa stat Défense et sa\nstat Attaque.", "Anwender setzt Psycho-Kräfte ein,\num eigenen Angriffs- mit Verteidigungs-\nWert auszutauschen.", "Mossa psichica che permette a chi la usa\ndi scambiare i valori delle sue statistiche\ndi Attacco e Difesa.", "ちょうのうりょくで\nじぶんの　こうげきと　ぼうぎょの　\nちからを　こうかん　する。", "超能力で\n自分の　攻撃と　防御の　\n力を　交換する。", "초능력으로\n자신의 공격과 방어의\n힘을 교환한다.", "Usa sus poderes mentales para\nintercambiar su característica de\nAtaque por Defensa.") },
            { PBEMove.GastroAcid, new PBELocalizedString("The user hurls up its stomach acids on\nthe target. The fluid eliminates the effect\nof the target's Ability.", "Le lanceur répand ses sucs digestifs sur\nl'ennemi. Le fluide neutralise la capacité\nspéciale de l'ennemi.", "Anwender greift das Ziel mit\neigenen Magensäften an. Entfernt\nEffekte von dessen Fähigkeit.", "Chi la usa lancia acidi gastrici sul nemico.\nIl fluido annulla l'abilità del nemico.", "いえきを　あいての\nからだに　はきつける。ついた　いえきは\nあいての　とくせいの　こうかを　けす。", "胃液を　相手の\n体に　吐きつける。ついた　胃液は\n相手の　特性の　効果を　消す。", "상대의 몸에 위액을 내뱉는다.\n달라붙은 위액은 상대의\n특성 효과를 지운다.", "El usuario arroja sus jugos biliares\nal objetivo, lo que anula el efecto de la\nhabilidad en uso.") },
            { PBEMove.LuckyChant, new PBELocalizedString("The user chants an incantation toward\nthe sky, preventing opposing Pokémon\nfrom landing critical hits.", "Le lanceur envoie une incantation vers le\nciel pour empêcher l'ennemi d'effectuer\ndes coups critiques.", "Anwender singt eine Beschwörungsformel,\ndie Volltreffer gegen ihn verhindert.", "Chi la usa rivolge un incantesimo al cielo,\nimpedendo al nemico di sferrare brutti\ncolpi alla squadra.", "てんに　むかって　おいのりを　ささげ\nあいての　こうげきを\nきゅうしょに　あたらなく　する。", "天に　むかって　おいのりを　ささげ\n相手の　攻撃を\n急所に　当たらなくする。", "하늘을 향해 기도를 올려\n상대의 공격을\n급소에 맞지 않게 한다.", "Lanza al cielo un conjuro que impide\nal objetivo asestar golpes críticos.") },
            // { PBEMove.382, new PBELocalizedString("The user tries to cut ahead of the target\nto steal and use the target's intended\nmove with greater power.", "Le lanceur vole la capacité prévue par\nl'ennemi et l'utilise en faisant plus de\ndégâts. Il doit frapper en premier.", "Anwender stiehlt und führt die Attacke\neines langsameren Gegners zuerst\nund mit größerer Kraft aus.", "Chi la usa precede un nemico più lento, gli\nruba l'attacco e glielo ritorce contro con\npotenza persino maggiore.", "いりょくを　あげて　あいてが\nだそうとする　わざを　さきにだす。\nさきに　だせないと　しっぱい　する。", "威力を　あげて　相手が\nだそうとする　技を　先にだす。\n先に　だせないと　失敗する。", "위력을 올려 상대가\n쓰려고 하는 기술을 먼저 쓴다.\n먼저 쓰지 않으면 실패한다.", "Se adelanta al movimiento que pretende\nusar el objetivo y lo lanza antes con más\nfuerza. Si el usuario es más lento, falla.") },
            // { PBEMove.383, new PBELocalizedString("The user mimics the move used immediately\nbefore it. The move fails if no other move\nhas been used yet.", "Le lanceur imite la dernière capacité\nemployée. Échoue si aucune capacité\nn'a été utilisée.", "Anwender imitiert gerade verwendete\nAttacke. Dies schlägt fehl, falls zuvor\nkeine Attacke verwendet wurde.", "Chi la usa mima l'ultima mossa eseguita dal\nnemico. Fallisce se non è stata ancora\nusata alcuna mossa.", "ちょくぜんに　でた　わざを　まねして\nおなじ　わざを　だす。\nわざが　でていないと　しっぱい　する。", "直前に　でた　技を　まねして\n同じ　技を　だす。\n技が　でていないと　失敗する。", "직전에 나온 기술을 흉내 내어\n같은 기술을 쓴다.\n기술이 나오지 않았으면 실패한다.", "Imita el movimiento usado justo antes.\nEl movimiento falla si no se ha usado\naún ninguno.") },
            // { PBEMove.384, new PBELocalizedString("The user employs its psychic power to\nswitch changes to its Attack and\nSp. Atk with the target.", "Pouvoir qui échange les modifications\nde l'Attaque Spéciale et de l'Attaque\ndu lanceur avec la cible.", "Psychische Kräfte tauschen Änderungen\nan Angriff und Spezial-Angriff mit denen\ndes Zieles.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche ad Attacco e\nAttacco Speciale con il bersaglio.", "ちょうのうりょくで　じぶんと　あいての\nこうげきと　とくこうの\nのうりょく　へんかを　いれかえる。", "超能力で　自分と　相手の\n攻撃と　特攻の\n能力変化を　入れ替える。", "초능력으로 자신과 상대의\n공격과 특수공격의\n능력 변화를 교체한다.", "El usuario emplea su poder mental para\nintercambiar los cambios en Ataque y\nAtaque Especial con el objetivo.") },
            // { PBEMove.385, new PBELocalizedString("The user employs its psychic power to\nswitch changes to its Defense and\nSp. Def with the target.", "Pouvoir qui échange les modifications de\nla Défense Spéciale et de la Défense\navec la cible.", "Psychische Kräfte tauschen Änderungen\nan Verteidigung und Spezial-Verteidigung\nmit denen des Zieles.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche a Difesa e a\nDifesa Speciale con il bersaglio.", "ちょうのうりょくで　じぶんと　あいての\nぼうぎょと　とくぼうの\nのうりょく　へんかを　いれかえる。", "超能力で　自分と　相手の\n防御と　特防の\n能力変化を　入れ替える。", "초능력으로 자신과 상대의\n방어와 특수방어의\n능력 변화를 교체한다.", "El usuario emplea su poder mental para\nintercambiar los cambios en Defensa y\nDefensa Especial con el objetivo.") },
            // { PBEMove.386, new PBELocalizedString("This attack's power increases\nthe more the target has powered\nup with stat changes.", "Plus l'ennemi a utilisé des augmentations\nde stats et plus cette capacité est\npuissante.", "Je stärker das Ziel durch Status-\nveränderungen ist, desto stärker\nwirkt diese Attacke.", "Questa mossa diventa più potente ogni\nvolta che il nemico aumenta le proprie\nstatistiche.", "のうりょく　へんかで\nあいてが　パワーアップ　しているほど\nわざの　いりょくが　あがる。", "能力変化で\n相手が　パワーアップ　しているほど\n技の　威力が　あがる。", "능력 변화로\n상대가 파워 업 한 만큼\n기술의 위력이 올라간다.", "La fuerza del ataque aumenta cuanto más\nse ha fortalecido el objetivo con cambios\nde características.") },
            // { PBEMove.387, new PBELocalizedString("This move can be used only after the user\nhas used all the other moves it knows\nin the battle.", "Cette capacité ne peut être utilisée\nqu'après que le lanceur a utilisé\ntoutes les autres.", "Diese Attacke kann nur eingesetzt\nwerden, nachdem alle verfügbaren\nAttacken ausgeführt wurden.", "Per usare questa mossa, bisogna prima\navvalersi in lotta di tutte le altre mosse\nconosciute.", "せんとうちゅうに　おぼえている　わざを\nすべて　つかうと　はじめて　だせる\nとっておきの　わざ。", "戦闘中に　おぼえている　技を\nすべて　使うと　はじめて　だせる\nとっておきの　技。", "배틀 중에 기억하고 있는 기술을\n모두 사용하면 그때부터 쓸 수 있는\n필살기이다.", "Este movimiento solo puede usarse tras\nhaber usado al menos una vez todos\nlos demás conocidos por el Pokémon.") },
            // { PBEMove.388, new PBELocalizedString("A seed that causes worry is planted on\nthe target. It prevents sleep by making\nits Ability Insomnia.", "Plante sur la cible une graine qui la rend\nsoucieuse et remplace sa capacité spéciale\npar Insomnia, l'empêchant ainsi de dormir.", "Ziel wird bepflanzt. Wandelt\nFähigkeit in Insomnia um.\nVerhindert so Schlaf.", "Un seme che causa ansia viene piantato\nsul bersaglio. Ne muta l'abilità in\nInsonnia e ne blocca il sonno.", "こころを　なやませる　タネを\nうえつける。あいてを　ねむれなく　して\nとくせいを　ふみんに　する。", "心を　なやませる　タネを\n植えつける。相手を　眠れなくして\n特性を　ふみんに　する。", "마음을 괴롭히는 씨앗을\n심는다. 상대를 잠잘 수 없게 해서\n특성을 불면으로 만든다.", "Se planta una semilla en el objetivo que le\ncausa pesar. Evita el sueño gracias a\nla habilidad Insomnio.") },
            { PBEMove.SuckerPunch, new PBELocalizedString("This move enables the user to attack\nfirst. It fails if the target is not\nreadying an attack, however.", "Permet au lanceur de frapper en premier.\nÉchoue si l'ennemi ne prépare pas\nune attaque.", "Ermöglicht den Erstschlag. Gelingt\naber nur, wenn das Ziel gerade eine\nAttacke vorbereitet.", "Chi la usa può attaccare per primo.\nFallisce se il nemico non sta preparando\nun attacco.", "あいてより　さきに　こうげき　できる。\nあいてが　だすわざが\nこうげきわざ　でないと　しっぱい　する。", "相手より　先に　攻撃　できる。\n相手が　だす技が\n攻撃技でないと　失敗する。", "상대보다 먼저 공격할 수 있다.\n상대가 쓴 기술이\n공격기술이 아니면 실패한다.", "Permite atacar primero.\nFalla si el objetivo no está preparando\nningún ataque.") },
            { PBEMove.ToxicSpikes, new PBELocalizedString("The user lays a trap of poison spikes at\nthe opponent's feet. They poison\nopponents that switch into battle.", "Lance des pics autour de l'ennemi. Ils\nempoisonnent les ennemis qui entrent\nau combat.", "Anwender legt eine Falle mit Giftdornen\naus. Gegner, die in den Kampf eingreifen,\nwerden vergiftet.", "Chi la usa piazza una trappola di punte\nche avvelenano i nemici che scendono\nin campo.", "あいての　あしもとに　どくびしを\nしかける。こうたいで　でてきた　あいての\nポケモンに　どくを　おわせる。", "相手の　足下に　どくびしを\nしかける。交代で　でてきた　相手の\nポケモンに　毒を　おわせる。", "상대의 발밑에 독압정을\n뿌린다. 교체로 나온 상대\n포켓몬에 독을 덮어씌운다.", "Lanza una trampa de púas tóxicas\na los pies del objetivo. El veneno afecta\na los Pokémon que entran.") },
            // { PBEMove.391, new PBELocalizedString("The user employs its psychic power to\nswitch stat changes with the target.", "Le lanceur utilise un pouvoir psychique\npour échanger ses changements de\nstats avec la cible.", "Anwender setzt Psycho-Kräfte ein,\num Statusveränderungen des Zieles\nmit den eigenen zu tauschen.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche alle statistiche\ncon il bersaglio.", "ちょうのうりょくで\nじぶんと　あいてに　かかっている\nのうりょく　へんかを　いれかえる。", "超能力で\n自分と　相手に　かかっている\n能力変化を　入れ替える。", "초능력으로\n자신과 상대에 걸려있는\n능력 변화를 교체한다.", "Usa la fuerza mental para intercambiar\ncon el objetivo los cambios en las\ncaracterísticas.") },
            // { PBEMove.392, new PBELocalizedString("The user envelops itself in a veil made\nof water. It regains some HP on\nevery turn.", "Un voile liquide enveloppe le lanceur.\nIl récupère des PV à chaque tour.", "Anwender umgibt sich mit einem Schleier\naus Wasser. Dabei regeneriert er\neinige KP pro Runde.", "Chi la usa si avvolge in un velo d'acqua.\nRecupera alcuni PS ad ogni turno.", "じぶんの　からだの　まわりを\nみずで　つくった　ベールで　おおう。\nまいターン　ＨＰを　かいふく　する。", "自分の　体の　周りを\n水で　つくった　ベールで　おおう。\n毎ターン　ＨＰを　回復する。", "자신의 몸 주변을\n물로 만든 베일로 덮는다.\n매 턴 HP를 회복한다.", "Un manto de agua cubre al Pokémon\nque lo usa. Recupera algunos PS en\ncada turno.") },
            // { PBEMove.393, new PBELocalizedString("The user levitates using electrically\ngenerated magnetism for five turns.", "Le lanceur utilise l'électricité pour\ngénérer un champ magnétique\net léviter durant 5 tours.", "Anwender schwebt für fünf Runden\ndurch elektrisch erzeugten\nMagnetismus.", "Chi la usa si solleva in aria per cinque\nturni grazie a un campo elettromagnetico.", "でんきで　つくった　じりょくの　ちからで\nちゅうに　うかぶ。\n５ターンの　あいだ　ふゆう　できる。", "電気で　つくった　磁力の　力で\n宙に　浮かぶ。\n５ターンの　あいだ　浮遊できる。", "전기로 만든 자력의 힘으로\n허공에 뜬다.\n5턴 동안 부유할 수 있다.", "Levita gracias a un campo magnético\ngenerado por electricidad durante\ncinco turnos.") },
            { PBEMove.FlareBlitz, new PBELocalizedString("The user cloaks itself in fire and charges\nat the target. The user sustains serious\ndamage and may leave the target burned.", "Le lanceur s'embrase avant de charger\nl'ennemi. Le choc blesse aussi gravement\nle lanceur. Peut brûler l'ennemi.", "Anwender hüllt sich in Flammen und stürmt\nauf das Ziel, das sich evtl. verbrennt.\nAnwender nimmt selbst großen Schaden.", "Chi la usa si ricopre di fuoco e carica\nil nemico, ma subisce il contraccolpo.\nPuò anche scottare il bersaglio.", "ほのおを　まとって　とっしんする。\nじぶんも　かなり　ダメージを　うける。\nやけど　じょうたいに　することが　ある。", "炎を　まとって　突進する。\n自分も　かなり　ダメージを　受ける。\nやけど状態に　することが　ある。", "불꽃을 두르고 돌진한다.\n자신도 상당한 데미지를 입는다.\n화상 상태로 만들 때가 있다.", "El Pokémon se cubre de llamas y carga\ncontra el objetivo, aunque él también\nrecibe daños. Puede quemar.") },
            { PBEMove.ForcePalm, new PBELocalizedString("The target is attacked with a shock wave.\nIt may also leave the target\nwith paralysis.", "Une onde de choc frappe l'ennemi.\nPeut aussi paralyser la cible.", "Das Ziel wird mit einer Schockwelle\nangegriffen, die es eventuell\nparalysiert.", "Chi la usa attacca con un'onda d'urto che\npuò anche paralizzare il bersaglio.", "あいての　からだに\nしょうげきはを　あてて　こうげきする。\nまひ　じょうたいに　することが　ある。", "相手の　体に\n衝撃波を　当てて　攻撃する。\nまひ状態に　することが　ある。", "상대의 몸에\n충격파를 부딪쳐 공격한다.\n마비 상태로 만들 때가 있다.", "Ataca al objetivo con una onda de choque\ny puede llegar a paralizarlo.") },
            { PBEMove.AuraSphere, new PBELocalizedString("The user looses a blast of aura power\nfrom deep within its body at the target.\nThis move is certain to hit.", "Le lanceur dégage une aura et projette\nde l'énergie. N'échoue jamais.", "Tief aus dem Inneren des Anwenders löst\nsich ein kraftvoller Stoß Auraenergie.\nTrifft in jedem Fall.", "Chi la usa rilascia una forza eterea dal\nprofondo del corpo. La mossa è infallibile.", "からだの　おくから　はどうの　ちからを\nあいてに　うちはなつ。\nこうげきは　かならず　めいちゅう　する。", "体の　奥から　波導の　力を\n相手に　うち放つ。\n攻撃は　必ず　命中する。", "몸속에서 파동의 힘을\n끌어내 쏜다.\n공격은 반드시 명중한다.", "Libera una descarga de la fuerza\ndel aura desde su interior.\nEs infalible.") },
            { PBEMove.RockPolish, new PBELocalizedString("The user polishes its body to reduce drag.\nIt can sharply raise the Speed stat.", "Le lanceur polit son corps pour\ndiminuer sa résistance au vent.\nAugmente fortement la Vitesse.", "Anwender reduziert so gut wie möglich\nden Luftwiderstand. Kann Initiative-Wert\nstark steigern.", "Chi la usa leviga il proprio corpo per\nridurne l'attrito. Aumenta di molto\nla Velocità.", "じぶんの　からだを　みがいて　くうきの\nていこうを　すくなくする。すばやさを\nぐーんと　あげることが　できる。", "自分の　体を　磨いて　空気の\n抵抗を　少なくする。素早さを\nぐーんと　あげることが　できる。", "자신의 몸을 닦아 공기의\n저항을 적게 한다. 스피드를\n크게 올릴 수 있다.", "Reduce la resistencia puliendo su cuerpo.\nAumenta la Velocidad considerablemente.") },
            { PBEMove.PoisonJab, new PBELocalizedString("The target is stabbed with a tentacle or\narm steeped in poison. It may also\npoison the target.", "Attaque l'ennemi avec un tentacule ou\nun bras plein de poison. Peut aussi\nl'empoisonner.", "Ziel wird mit vergiftetem Arm oder\nTentakel verletzt. Es wird dabei\neventuell vergiftet.", "Il nemico è colpito da un tentacolo o da\nun arto intriso di una sostanza tossica,\nche può anche avvelenarlo.", "どくに　そまった　しょくしゅや　うでで\nあいてを　つきさす。\nどく　じょうたいに　することが　ある。", "毒に　そまった　触手や　腕で\n相手を　突き刺す。\n毒状態に　することが　ある。", "독에 물든 촉수나 팔로\n상대를 꿰찌른다.\n독 상태로 만들 때가 있다.", "Pincha al objetivo con un tentáculo o\nbrazo envenenado. Puede llegar a\nenvenenar al objetivo.") },
            { PBEMove.DarkPulse, new PBELocalizedString("The user releases a horrible aura imbued\nwith dark thoughts.\nIt may also make the target flinch.", "Le lanceur dégage une horrible\naura chargée d'idées noires.\nPeut aussi apeurer l'ennemi.", "Anwender greift mit fürchterlicher Aura\nschlechter Gedanken an. Ziel schreckt\neventuell zurück.", "Chi la usa emana un'aura impregnata di\noscuri pensieri. Può anche far tentennare\nil Pokémon colpito.", "からだから　あくいに\nみちた　おそろしい　オーラを　はっする。\nあいてを　ひるませる　ことが　ある。", "体から　悪意に　みちた\n恐ろしい　オーラを　発する。\n相手を　ひるませることが　ある。", "몸에서 악의로 가득한\n무서운 오라를 발한다.\n상대를 풀죽게 만들 때가 있다.", "Libera una horrible aura llena de malos\npensamientos y puede hacer retroceder\nal objetivo.") },
            { PBEMove.NightSlash, new PBELocalizedString("The user slashes the target\nthe instant an opportunity arises.\nCritical hits land more easily.", "Le lanceur lacère l'ennemi à la\npremière occasion. Taux de\ncritiques élevé.", "Anwender greift bei der ersten\nGelegenheit mit scharfen Klauen\nan. Hohe Volltrefferquote.", "Chi la usa colpisce il nemico appena\nsi presenta l'occasione. Probabile brutto\ncolpo.", "いっしゅんの　すきを　ついて\nあいてを　きりはらう。\nきゅうしょに　あたりやすい。", "一瞬の　すきを　ついて\n相手を　切りはらう。\n急所に　当たりやすい。", "순간적으로 틈을 노려\n상대를 베어 버린다.\n급소에 맞기 쉽다.", "Ataca al objetivo a la primera oportunidad.\nSuele ser crítico.") },
            { PBEMove.AquaTail, new PBELocalizedString("The user attacks by swinging its tail as if\nit were a vicious wave in a raging storm.", "Le lanceur attaque en balançant sa\nqueue comme une lame de fond en\npleine tempête.", "Anwender attackiert mit dem Schweif,\nals ob dieser eine brutale Welle in\neinem tosenden Sturm sei.", "Chi la usa attacca agitando la coda\ncome se fosse una violenta ondata\nin una tempesta furiosa.", "はげしく　あれくるう　あらなみの　ように\nおおきな　しっぽを　ふって\nあいてを　こうげきする。", "激しく　あれくるう　荒波の　ように\n大きな　しっぽを　ふって\n相手を　攻撃する。", "세차게 날뛰는 거친 파도와 같이\n큰 꼬리를 흔들어서\n상대를 공격한다.", "Ataca agitando la cola como si fuera\nuna ola rabiosa en una tormenta\ndevastadora.") },
            { PBEMove.SeedBomb, new PBELocalizedString("The user slams a barrage of hard-shelled\nseeds down on the target from above.", "Le lanceur fait pleuvoir un déluge\nde graines solides sur l'ennemi.", "Anwender lässt eine Menge Samen\nmit harter Schale von oben auf das\nZiel fallen.", "Chi la usa emette una raffica di semi dal\nguscio duro che colpiscono il nemico\ndall'alto.", "かたい　からを　もつ　おおきな　タネを\nうえから　たたきつけて\nあいてを　こうげきする。", "硬い　殻を　もつ　大きな　タネを\n上から　たたきつけて\n相手を　攻撃する。", "단단한 껍질을 가지고 있는\n큰 씨앗을 힘껏 내던져\n상대를 공격한다.", "Lanza al objetivo una descarga de\nsemillas explosivas desde arriba.") },
            { PBEMove.AirSlash, new PBELocalizedString("The user attacks with a blade of air that\nslices even the sky. It may also make the\ntarget flinch.", "Le lanceur attaque avec une lame d'air\nqui fend tout. Peut aussi apeurer l'ennemi.", "Das Ziel wird mit einer Luftklinge\nangegriffen. Ziel schreckt\neventuell zurück.", "Chi la usa attacca con un vento tagliente\nche squarcia il cielo. Può anche far\ntentennare il Pokémon colpito.", "そらをも　きりさく\nくうきの　やいばで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "空をも　切り裂く\n空気の　刃で　攻撃する。\n相手を　ひるませることが　ある。", "하늘까지 베어 가르는\n공기의 칼날로 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Ataca con una hoja de aire que incluso\ncorta el cielo. También puede hacer\nretroceder al objetivo.") },
            { PBEMove.XScissor, new PBELocalizedString("The user slashes at the target by\ncrossing its scythes or claws as if\nthey were a pair of scissors.", "Le lanceur taillade l'ennemi en\nutilisant ses faux ou ses griffes\ncomme une paire de ciseaux.", "Der Anwender führt eine Attacke\naus, die einer Scherenbewegung\nähnelt.", "Chi la usa colpisce il nemico usando le sue\nfalci o i suoi artigli come se fossero delle\nforbici.", "カマや　ツメを　ハサミのように\nこうさ　させながら　あいてを　きりさく。\n", "カマや　ツメを　ハサミのように\n交差させながら　相手を　切り裂く。\n", "낫이나 발톱을 가위처럼\n교차시키면서 상대를 베어 가른다.", "Cruza las guadañas o las garras\npara atacar al objetivo como si fueran\nunas tijeras.") },
            { PBEMove.BugBuzz, new PBELocalizedString("The user vibrates its wings to generate a\ndamaging sound wave. It may also lower\nthe target's Sp. Def stat.", "Le lanceur fait vibrer ses ailes pour\nlancer une vague sonique. Peut aussi\nbaisser la Défense Spéciale de l'ennemi.", "Anwender schlägt mit den Flügeln und\nerzeugt eine Schockwelle. Senkt evtl.\nSpezial-Verteidigung des Zieles.", "Chi la usa fa vibrare le ali creando\nun'onda sonora pericolosa. Può anche\nridurre la Difesa Speciale del nemico.", "はねの　しんどうで　おんぱを　おこして\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "はねの　振動で　音波を　おこして\n攻撃する。相手の　特防を\nさげることが　ある。", "날개의 진동으로 음파를 일으켜서\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "El movimiento de las alas crea una onda\nsónica dañina. También puede disminuir\nla Defensa Especial del objetivo.") },
            { PBEMove.DragonPulse, new PBELocalizedString("The target is attacked with a shock wave\ngenerated by the user's gaping mouth.", "Le lanceur ouvre la bouche pour envoyer\nune onde de choc qui frappe l'ennemi.", "Das Ziel wird mit einer Schockwelle\nangegriffen, die aus dem offenen Maul\ndes Anwenders kommt.", "Chi la usa spalanca la bocca e genera\nun'onda d'urto che colpisce il nemico.", "おおきな　くちから　しょうげきはを\nまきおこして　あいてを　こうげきする。\n", "大きな　口から　衝撃波を\nまきおこして　相手を　攻撃する。\n", "큰 입으로 충격파를\n일으켜서 상대를 공격한다.", "Abre mucho la boca y libera una onda\nde choque que ataca al objetivo.") },
            { PBEMove.DragonRush, new PBELocalizedString("The user tackles the target while\nexhibiting overwhelming menace.\nIt may also make the target flinch.", "Le lanceur frappe l'ennemi d'un air\nmenaçant. Peut aussi apeurer l'ennemi.", "Anwender führt einen gefährlichen Angriff\naus. Das Ziel schreckt eventuell zurück.", "Chi la usa attacca con fare minaccioso e\nin questo modo può anche far tentennare\nil nemico.", "すさまじい　さっきで　いあつ　しながら\nたいあたりする。\nあいてを　ひるませる　ことが　ある。", "すさまじい　殺気で　威圧しながら\n体当たりする。\n相手を　ひるませることが　ある。", "굉장한 살기로 위압하면서\n몸통박치기한다.\n상대를 풀죽게 만들 때가 있다.", "Ataca de forma brutal mientras intimida\nal objetivo. También puede hacerlo\nretroceder.") },
            { PBEMove.PowerGem, new PBELocalizedString("The user attacks with a ray of light that\nsparkles as if it were made of gemstones.", "Le lanceur attaque avec un rayon de\nlumière qui scintille comme s'il était\ncomposé de gemmes.", "Anwender attackiert mit einem Lichtstrahl,\nder funkelt, als sei er aus Juwelen.", "Chi la usa attacca con un raggio di luce\nche brilla come se fosse fatto di pietre\npreziose.", "ほうせきの　ように　きらめく　ひかりを\nはっしゃして　あいてを　こうげきする。\n", "宝石のように　きらめく　光を\n発射して　相手を　攻撃する。\n", "보석처럼 반짝이는 빛을\n발사하여 상대를 공격한다.", "Ataca con un rayo de luz que centellea\ncomo si lo formaran miles de joyas.") },
            { PBEMove.DrainPunch, new PBELocalizedString("An energy-draining punch. The user's\nHP is restored by half the damage taken\nby the target.", "Un coup de poing qui draine l'énergie.\nConvertit la moitié des dégâts infligés\nen PV pour le lanceur.", "Entzieht dem Ziel Energie. Die Hälfte\ndes Schadens wird den KP des Anwenders\nzugerechnet.", "Pugno che assorbe energia. Fa recuperare\nuna quantità di PS pari alla metà del danno\ninferto.", "こぶしから　あいての　ちからを\nすいとる。あたえた　ダメージの\nはんぶんの　ＨＰを　かいふく　できる。", "こぶしから　相手の　力を　吸い取る。\n与えた　ダメージの\n半分の　ＨＰを　回復できる。", "주먹으로 상대의 힘을 흡수한다.\n입힌 데미지의 절반에\n해당하는 HP를 회복할 수 있다.", "Un golpe que drena energía. El Pokémon\nrecupera la mitad de los PS arrebatados\nal objetivo.") },
            { PBEMove.VacuumWave, new PBELocalizedString("The user whirls its fists to send a wave\nof pure vacuum at the target. This move\nalways goes first.", "Le lanceur agite son poing pour projeter\nune onde de vide. Frappe toujours en\npremier.", "Ein Faustwirbel sendet eine\nVakuumwelle auf das Ziel.\nErstschlaggarantie.", "Chi la usa rotea i pugni per lanciare\nun'onda di vuoto assoluto verso il nemico.\nAttacca per primo.", "こぶしを　ふって\nしんくうの　なみを　まきおこす。\nかならず　せんせい　こうげき　できる。", "こぶしを　ふって\n真空の　波を　まきおこす。\n必ず　先制攻撃できる。", "주먹을 흔들어\n진공의 파도를 일으킨다.\n반드시 선제공격을 할 수 있다.", "Gira los puños y libera una onda de vacío\ncontra el objetivo. Este movimiento\nsiempre va primero.") },
            { PBEMove.FocusBlast, new PBELocalizedString("The user heightens its mental focus and\nunleashes its power.\nIt may also lower the target's Sp. Def.", "Le lanceur rassemble ses forces et laisse\néclater son pouvoir. Peut aussi baisser la\nDéfense Spéciale de l'ennemi.", "Anwender erhöht seinen mentalen Fokus\nund greift dann an. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "Chi la usa si concentra e rilascia la sua\nforza. Può ridurre la Difesa Speciale del\nPokémon colpito.", "きあいを　たかめて　こんしんの　ちからを\nほうしゅつする。あいての　とくぼうを\nさげることが　ある。", "気合を　高めて\nありったけの　力を　放出する。\n相手の　特防を　さげることが　ある。", "기합을 높여서\n혼신의 힘을 방출한다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "Agudiza la concentración mental y\nlibera su poder. Puede disminuir\nla Defensa Especial del objetivo.") },
            { PBEMove.EnergyBall, new PBELocalizedString("The user draws power from nature and\nfires it at the target.\nIt may also lower the target's Sp. Def.", "Utilise les pouvoirs de la nature pour\nattaquer l'ennemi. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Anwender zieht Kraft aus der Natur und\nfeuert sie auf das Ziel. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "Chi la usa attinge energia dalla natura\ne la scaglia contro il nemico. Può anche\nridurne la Difesa Speciale.", "しぜんから　あつめた\nいのちの　ちからを　はっしゃする。\nあいての　とくぼうを　さげることが　ある。", "自然から　集めた\n命の力を　発射する。\n相手の　特防を　さげることが　ある。", "자연으로부터 모은\n생명의 힘을 발사한다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "Aúna fuerzas de la naturaleza y libera\nsu ataque. Puede disminuir la Defensa\nEspecial del objetivo.") },
            { PBEMove.BraveBird, new PBELocalizedString("The user tucks in its wings and charges\nfrom a low altitude.\nThe user also takes serious damage.", "Le lanceur replie ses ailes et charge\nen rase-mottes. Le lanceur subit aussi\nde graves dégâts.", "Anwender greift aus niedriger Höhe an.\nEr erleidet bei dieser Attacke selbst\ngroßen Schaden.", "Chi la usa si nasconde sotto le ali e carica\nda bassa quota. Tuttavia, subisce\nconsiderevoli danni.", "はねを　おりたたみ\nていくう　ひこうで　とつげきする。\nじぶんも　かなり　ダメージを　うける。", "はねを　おりたたみ\n低空飛行で　突撃する。\n自分も　かなり　ダメージを　受ける。", "날개를 접어\n저공비행으로 돌격한다.\n자신도 상당한 데미지를 입는다.", "Pliega sus alas y ataca con un vuelo\nrasante. El Pokémon que lo usa\ntambién resulta seriamente dañado.") },
            { PBEMove.EarthPower, new PBELocalizedString("The user makes the ground under\nthe target erupt with power.\nIt may also lower the target's Sp. Def.", "Des éruptions volcaniques ont lieu\nsous l'ennemi. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Der Boden unter dem Ziel erzittert\ndurch die Kraft der Erde. Senkt eventuell\nSpezial-Verteidigung.", "Dal terreno sotto il nemico si sprigiona\nuna forza devastante. Può anche ridurne\nla Difesa Speciale.", "あいての　あしもとへ　だいちの　ちからを\nほうしゅつする。あいての　とくぼうを\nさげることが　ある。", "相手の　足下へ　大地の力を\n放出する。相手の　特防を\nさげることが　ある。", "상대의 발밑에 대지의 힘을\n방출한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "La tierra a los pies del objetivo erupciona\nviolentamente. Puede disminuir\nla Defensa Especial del objetivo.") },
            // { PBEMove.415, new PBELocalizedString("The user trades held items with the target\nfaster than the eye can follow.", "Le lanceur échange son objet avec\ncelui de la cible à une vitesse que\nl'œil a du mal à suivre.", "Item wird in Windeseile mit dem\nZiel getauscht.", "Chi la usa scambia lo strumento che tiene\ncon quello del bersaglio ad una velocità\nimpressionante.", "めにも　とまらぬ　はやさで\nじぶんと　あいての　\nもちものを　こうかんする。", "目にも　留まらぬ　速さで\n自分と　相手の　\n持ち物を　交換する。", "눈에 보이지 않는 속도로\n자신과 상대가\n지닌 물건을 교환한다.", "Intercambia con el objetivo los objetos\nque llevan tan rápido que es imposible\nverlo a simple vista.") },
            // { PBEMove.416, new PBELocalizedString("The user charges at the target using\nevery bit of its power.\nThe user must rest on the next turn.", "Le lanceur charge l'ennemi de toute sa\npuissance. Il doit ensuite se reposer\nau tour suivant.", "Anwender rennt mit seiner ganzen Kraft\ngegen das Ziel an und muss dann\neine Runde ruhen.", "Chi la usa carica il nemico usando tutta\nla sua forza, ma al turno successivo\ndeve riposare.", "もてる　ちからを　すべて　つかって\nあいてに　とつげきする。\nつぎの　ターンは　うごけなく　なる。", "持てる　力を　すべて　使って\n相手に　突撃する。\n次の　ターンは　動けなくなる。", "가진 힘을 모두 사용해서\n상대에게 돌격한다.\n다음 턴은 움직일 수 없다.", "Carga contra el objetivo usando toda\nla fuerza que tiene. El Pokémon\ndescansa el turno siguiente.") },
            { PBEMove.NastyPlot, new PBELocalizedString("The user stimulates its brain by thinking\nbad thoughts.\nIt sharply raises the user's Sp. Atk.", "Stimule l'esprit par de mauvaises pensées.\nAugmente fortement l'Attaque Spéciale\ndu lanceur.", "Anwender stimuliert sein Gehirn\nund hat finstere Gedanken.\nSteigert Spezial-Angriff stark.", "Chi la usa stimola il cervello pensando\na cose cattive. Aumenta di molto\nl'Attacco Speciale.", "わるいことを　かんがえて\nあたまを　かっせいか　させる。\nじぶんの　とくこうを　ぐーんと　あげる。", "悪いことを　考えて\n頭を　活性化させる。\n自分の　特攻を　ぐーんと　あげる。", "나쁜 일을 생각해서\n머리를 활성화시킨다.\n자신의 특수공격을 크게 올린다.", "Estimula su cerebro pensando en cosas\nmalas. Aumenta considerablemente\nel Ataque Especial.") },
            { PBEMove.BulletPunch, new PBELocalizedString("The user strikes the target\nwith tough punches as fast as bullets.\nThis move always goes first.", "Le lanceur envoie des coups de poing aussi\nrapides que des balles de revolver. Frappe\ntoujours en premier.", "Das Ziel wird von ultraschnellen\nHieben getroffen. Erstschlaggarantie.", "Chi la usa attacca con una scarica di pugni\nveloci come proiettili. Con questa mossa\nsi colpisce per primi.", "だんがんの　ような　はやくて　かたい\nパンチを　あいてに　くりだす。\nかならず　せんせい　こうげき　できる。", "弾丸の　ような　速くて　硬い\nパンチを　相手に　くりだす。\n必ず　先制攻撃　できる。", "탄환처럼 빠르고 단단한\n펀치를 상대에게 날린다.\n반드시 선제공격을 할 수 있다.", "Ataca con fuertes puñetazos\ntan rápidos como proyectiles.\nEste movimiento siempre va primero.") },
            // { PBEMove.419, new PBELocalizedString("An attack move that inflicts double the\ndamage if the user has been hurt by the\ntarget in the same turn.", "Une attaque deux fois plus puissante si le\nlanceur a été blessé par l'ennemi durant\nle tour.", "Wurde der Anwender vom Gegner in dieser\nRunde getroffen, erzeugt diese Attacke\ndoppelten Schaden.", "Mossa d'attacco che infligge doppi danni,\nse chi la usa è stato ferito dal nemico\nnello stesso turno.", "あいてから　わざを　うけていると\nその　あいてに　たいして\nわざの　いりょくが　２ばいに　なる。", "相手から　技を　受けていると\nその　相手に　対して\n技の　威力が　２倍に　なる。", "상대로부터 기술을 받으면\n그 상대에 대해서\n기술의 위력이 2배가 된다.", "Este ataque inflige el doble de daño\na un objetivo que haya golpeado al usuario\nen ese mismo turno.") },
            { PBEMove.IceShard, new PBELocalizedString("The user flash freezes chunks of\nice and hurls them at the target.\nThis move always goes first.", "Le lanceur crée des éclats de glace qu'il\nenvoie sur l'ennemi. Frappe toujours en\npremier.", "Das Ziel wird mit Eisklumpen beworfen.\nDiese Attacke hat Erstschlaggarantie.", "Chi la usa crea dei pezzi di ghiaccio e\nli lancia. Con questa mossa si colpisce\nper primi.", "こおりの　かたまりを　いっしゅんで\nつくり　あいてに　すばやく　はなつ。\nかならず　せんせい　こうげき　できる。", "氷の塊を　一瞬で　つくり\n相手に　素早く　放つ。\n必ず　先制攻撃　できる。", "얼음 덩어리를 순식간에 만들어\n상대에게 빠르게 쏜다.\n반드시 선제공격을 할 수 있다.", "Crea bolas de hielo y las lanza a gran\nvelocidad. Este movimiento siempre\nva primero.") },
            { PBEMove.ShadowClaw, new PBELocalizedString("The user slashes with a sharp claw made\nfrom shadows.\nCritical hits land more easily.", "Attaque avec une griffe puissante faite\nd'ombres. Taux de critiques élevé.", "Das Ziel wird mit scharfen Klauen\naus der Schattenwelt attackiert.\nHohe Volltrefferquote.", "Chi la usa attacca con artigli d'ombra\nche colpiscono con gran forza. Probabile\nbrutto colpo.", "かげから　つくった　するどい　ツメで\nあいてを　きりさく。\nきゅうしょに　あたりやすい。", "影から　つくった　鋭い　ツメで\n相手を　切り裂く。\n急所に　当たりやすい。", "그림자로 만든 날카로운 발톱으로\n상대를 베어 가른다.\n급소에 맞기 쉽다.", "Ataca con una garra afilada hecha\nde sombras. Suele ser crítico.") },
            // { PBEMove.422, new PBELocalizedString("The user bites with electrified fangs.\nIt may also make the target flinch or\nleave it with paralysis.", "Le lanceur utilise une morsure électrifiée.\nPeut aussi paralyser ou apeurer l'ennemi.", "Anwender beißt mit elektrifizierten\nReißzähnen zu. Das Ziel schreckt\neventuell zurück oder wird paralysiert.", "Chi la usa morde con denti elettrificati\nche possono anche paralizzare o far\ntentennare il nemico.", "でんきを　ためた　キバで　かみつく。\nあいてを　ひるませたり\nまひ　じょうたいに　することが　ある。", "電気を　ためた　キバで　かみつく。\n相手を　ひるませたり\nまひ状態に　することが　ある。", "전기를 모은 이빨로 문다.\n상대를 풀죽게 하거나\n마비 상태로 만들 때가 있다.", "Usa colmillos electrificados para\nmorder. Puede hacer que el objetivo\nretroceda o paralizarlo.") },
            // { PBEMove.423, new PBELocalizedString("The user bites with cold-infused fangs.\nIt may also make the target flinch or\nleave it frozen.", "Le lanceur utilise une morsure glaciale.\nPeut aussi geler ou apeurer l'ennemi.", "Anwender beißt mit eiskalten Reißzähnen\nzu. Ziel schreckt eventuell zurück oder\nfriert ein.", "Chi la usa morde con denti ghiacciati.\nPuò anche congelare o far tentennare\nil nemico.", "れいきを　ひめた　キバで　かみつく。\nあいてを　ひるませたり\nこおり　じょうたいに　することが　ある。", "冷気を　ひめた　キバで　かみつく。\n相手を　ひるませたり\nこおり状態に　することが　ある。", "냉기를 품은 이빨로 문다.\n상대를 풀죽게 하거나\n얼음 상태로 만들 때가 있다.", "Usa colmillos helados para morder.\nPuede hacer que el objetivo retroceda\no congelarlo.") },
            // { PBEMove.424, new PBELocalizedString("The user bites with flame-cloaked fangs.\nIt may also make the target flinch or leave\nit burned.", "Le lanceur utilise une morsure enflammée.\nPeut aussi brûler ou apeurer l'ennemi.", "Anwender beißt mit flammenden\nReißzähnen zu. Ziel schreckt\neventuell zurück oder verbrennt sich.", "Chi la usa morde con denti infuocati. Può\nanche scottare o far tentennare il nemico.", "ほのおを　まとった　キバで　かみつく。\nあいてを　ひるませたり\nやけど　じょうたいに　することが　ある。", "炎を　まとった　キバで　かみつく。\n相手を　ひるませたり\nやけど状態に　することが　ある。", "불꽃을 두른 이빨로 문다.\n상대를 풀죽게 하거나\n화상 상태로 만들 때가 있다.", "Usa colmillos en llamas para morder.\nPuede hacer que el objetivo retroceda\no reciba quemaduras.") },
            { PBEMove.ShadowSneak, new PBELocalizedString("The user extends its shadow and attacks\nthe target from behind.\nThis move always goes first.", "Le lanceur étend son ombre pour frapper\npar derrière. Frappe toujours en premier.", "Anwender erweitert Schatten und\ngreift das Ziel von hinten an.\nErstschlaggarantie.", "Chi la usa estende la sua ombra e attacca\nil nemico alle spalle. Con questa mossa\nsi colpisce per primi.", "かげを　のばして\nあいての　はいごから　こうげきする。\nかならず　せんせい　こうげき　できる。", "影を　のばして\n相手の　背後から　攻撃する。\n必ず　先制攻撃　できる。", "그림자를 늘려\n상대의 배후에서 공격한다.\n반드시 선제공격할 수 있다.", "Extiende su sombra y ataca al objetivo\npor la espalda.\nEste movimiento siempre va primero.") },
            { PBEMove.MudBomb, new PBELocalizedString("The user launches a hard-packed\nmud ball to attack.\nIt may also lower the target's accuracy.", "Le lanceur attaque à l'aide d'une boule\nde boue solidifiée. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender greift mit einem festen\nSchlammklumpen an. Senkt\neventuell Genauigkeit des Zieles.", "Chi la usa lancia una compatta palla di\nfango. Può anche ridurre la precisione\ndel Pokémon colpito.", "かたい　どろのたまを\nあいてに　はっしゃして　こうげきする。\nめいちゅうりつを　さげることが　ある。", "硬い　泥の　弾を\n相手に　発射して　攻撃する。\n命中率を　さげることが　ある。", "단단한 진흙구슬을\n상대에게 발사하여 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Ataca lanzando una compacta bola de\nfango. Puede bajar la Precisión\ndel objetivo.") },
            { PBEMove.PsychoCut, new PBELocalizedString("The user tears at the target with blades\nformed by psychic power.\nCritical hits land more easily.", "Le lanceur entaille l'ennemi grâce à des\nlames faites de pouvoir psychique.\nTaux de critiques élevé.", "Das Ziel wird mit Klingen attackiert,\ndie aus Psycho-Energie bestehen.\nHohe Volltrefferquote.", "Chi la usa colpisce il nemico con lame fatte\ndi forza psichica. Probabile brutto colpo.", "じったいか　させた\nこころの　やいばで　あいてを　きりさく。\nきゅうしょに　あたりやすい。", "実体化させた\n心の　刃で　相手を　切り裂く。\n急所に　当たりやすい。", "실체화시킨\n마음의 칼날로 상대를 베어 가른다.\n급소에 맞기 쉽다.", "Ataca al objetivo con cuchillas\nformadas por energía psíquica.\nSuele ser crítico.") },
            { PBEMove.ZenHeadbutt, new PBELocalizedString("The user focuses its willpower to its head\nand attacks the target.\nIt may also make the target flinch.", "Le lanceur concentre sa volonté et\ndonne un coup de tête. Peut aussi\napeurer l'ennemi.", "Anwender konzentriert seinen\nWillen und rammt das Ziel.\nDieses schreckt eventuell zurück.", "Chi la usa concentra la forza nella testa\ne si lancia contro il nemico. Può anche\nfarlo tentennare.", "しねんの　ちからを\nひたいに　あつめて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "思念の　力を\n額に　集めて　攻撃する。\n相手を　ひるませることが　ある。", "사념의 힘을\n이마에 모아서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Concentra su energía psíquica en\nla cabeza para golpear. Puede hacer\nque el objetivo retroceda.") },
            { PBEMove.MirrorShot, new PBELocalizedString("The user looses a flash of energy at\nthe target from its polished body.\nIt may also lower the target's accuracy.", "Le corps poli du lanceur libère un\néclair d'énergie. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender feuert Energiestrahl aus\nseinem Körper ab. Senkt eventuell\nGenauigkeit des Zieles.", "Chi la usa rilascia fasci d'energia dal\ncorpo levigato. Può anche ridurre\nla precisione del nemico.", "みがき　あげられた　からだから\nせんこうの　ちからを　あいてに　はなつ。\nめいちゅうりつを　さげることが　ある。", "磨きあげられた　体から\nせん光の　力を　相手に　放つ。\n命中率を　さげることが　ある。", "갈고 닦은 몸에서\n섬광의 힘을 상대에게 쏜다.\n명중률을 떨어뜨릴 때가 있다.", "El usuario libera un haz de energía\ndesde su pulido cuerpo.\nPuede bajar la Precisión.") },
            { PBEMove.FlashCannon, new PBELocalizedString("The user gathers all its light energy and\nreleases it at once. It may also lower the\ntarget's Sp. Def stat.", "Le lanceur concentre son énergie\nlumineuse et la fait exploser. Peut aussi\nbaisser la Défense Spéciale de l'ennemi.", "Anwender sammelt Lichtenergie und\nfeuert sie auf einmal ab. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "Chi la usa attacca raccogliendo e\nrilasciando energia luminosa. Può\nridurre la Difesa Speciale del nemico.", "からだの　ひかりを　いってんに　あつめて\nちからを　はなつ。あいての　とくぼうを\nさげることが　ある。", "体の　光を　一点に　集めて\n力を　放つ。\n相手の　特防を　さげることが　ある。", "몸의 빛을 한곳에 모아서\n힘을 쏜다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "El usuario concentra toda la luz\ndel cuerpo y la libera. Puede bajar\nla Defensa Especial del objetivo.") },
            { PBEMove.RockClimb, new PBELocalizedString("The user attacks the target by smashing\ninto it with incredible force.\nIt may also confuse the target.", "Le lanceur se jette violemment sur\nl'ennemi. Peut aussi le rendre confus.", "Eine stürmische Attacke, die das Ziel\neventuell verwirrt.", "Chi la usa carica con impeto incredibile.\nIl colpo può confondere il nemico.", "すごい　いきおいで　あいてに\nつっこみ　こうげきする。\nあいてを　こんらん　させることが　ある。", "すごい　勢いで　相手に\nつっこみ　攻撃する。\n相手を　混乱させることが　ある。", "굉장한 기세로 상대에게\n돌진하여 공격한다.\n상대를 혼란시킬 때가 있다.", "Ataca con una gran embestida.\nPuede confundir al objetivo.") },
            // { PBEMove.432, new PBELocalizedString("A strong wind blows away the target's\nobstacles such as Reflect or Light Screen.\nIt also lowers the target's evasiveness.", "Un grand coup de vent qui disperse la\nProtection ou le Mur Lumière de l'ennemi.\nDiminue aussi son Esquive.", "Starker Wind hebt Attacken wie Reflektor\nund Lichtschild des Gegners auf.\nSenkt außerdem den Fluchtwert.", "Chi la usa spazza via barriere come\nRiflesso e Schermoluce con un forte vento\ne riduce la capacità d'elusione del nemico.", "つよいかぜで　あいての　リフレクターや\nひかりのかべ　などを　はらいのける。\nかいひりつも　さげる。", "強い風で　相手の　リフレクターや\nひかりのかべ　などを　はらいのける。\n回避率も　さげる。", "강한 바람으로 상대의 리플렉터나\n빛의장막 등을 제거한다.\n회피율도 떨어뜨린다.", "Potente viento que barre el Reflejo\no Pantalla de Luz del objetivo\ny puede reducir su Evasión.") },
            { PBEMove.TrickRoom, new PBELocalizedString("The user creates a bizarre area in which\nslower Pokémon get to move first for\nfive turns.", "Le lanceur crée une zone étrange où\nles Pokémon les plus lents frappent\nen 1⑩ pendant 5 tours.", "Anwender erzeugt einen bizarren Raum,\nin dem langsame Pokémon fünf Runden\nlang zuerst agieren.", "Chi la usa crea una dimensione in cui\ni Pokémon più lenti si muovono per primi\nper cinque turni.", "まかふしぎな　くうかんを　つくる。\n５ターンの　あいだ\nおそい　ポケモンから　こうどう　できる。", "まか不思議な　空間を　つくる。\n５ターンの　あいだ\n遅い　ポケモンから　行動できる。", "이상한 공간을 만든다.\n5턴 동안 느린 포켓몬부터\n행동할 수 있다.", "Se crea un espacio extraño en el que\nlos Pokémon lentos se mueven primero\ndurante cinco turnos.") },
            { PBEMove.DracoMeteor, new PBELocalizedString("Comets are summoned down from the sky\nonto the target. The attack's recoil\nharshly reduces the user's Sp. Atk stat.", "Le lanceur invoque des comètes.\nLe contrecoup réduit fortement\nson Attaque Spéciale.", "Kometen werden heraufbeschworen.\nDer Rückstoß reduziert den Spezial-\nAngriff des Anwenders stark.", "Attacca con meteore che cadono dal cielo.\nIl contraccolpo fa calare di molto\nl'Attacco Speciale di chi la usa.", "てんくうから　いんせきを　\nあいてに　おとす。つかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "天空から　いん石を　\n相手に　落とす。使うと　反動で\n自分の　特攻が　がくっと　さがる。", "천공에서 운석을\n떨어뜨린다. 사용하면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Hace que grandes cometas caigan del\ncielo. Baja mucho el Ataque Especial\nde quien lo usa.") },
            { PBEMove.Discharge, new PBELocalizedString("A flare of electricity is loosed to strike\nthe area around the user.\nIt may also cause paralysis.", "Un flamboiement d'électricité frappe\ntous les Pokémon autour du lanceur.\nPeut aussi paralyser.", "Anwender greift die Pokémon in\nseiner Umgebung mit Elektrizität\nan. Paralysiert eventuell.", "Chi la usa colpisce i Pokémon che ha\nintorno con un bagliore elettrico.\nPuò anche paralizzarli.", "まばゆい　でんげきで　じぶんの\nまわりに　いるものを　こうげきする。\nまひ　じょうたいに　することが　ある。", "まばゆい　電撃で　自分の\n周りに　いるものを　攻撃する。\nまひ状態に　することが　ある。", "눈부신 전격으로 자신의\n주위에 있는 포켓몬을 공격한다.\n마비 상태로 만들 때가 있다.", "Una deslumbradora onda eléctrica\nafecta a los Pokémon de alrededor\nen combate. Puede paralizar.") },
            { PBEMove.LavaPlume, new PBELocalizedString("An inferno of scarlet flames torches\neverything around the user. It may\nleave targets with a burn.", "Des boules de feu s'abattent sur tous\nles Pokémon autour du lanceur.\nPeut aussi brûler.", "Ein Flammeninferno, das über\nden Bereich um den Anwender\nhinwegfegt. Verbrennt eventuell.", "Chi la usa lancia fiamme scarlatte sugli\naltri Pokémon in campo, danneggiandoli.\nPuò anche scottarli.", "まっかな　ほのおで　じぶんの\nまわりに　いるものを　こうげきする。\nやけど　じょうたいに　することが　ある。", "真っ赤な　炎で　自分の\n周りに　いるものを　攻撃する。\nやけど状態に　することが　ある。", "새빨간 불꽃으로 자신의\n주위에 있는 포켓몬을 공격한다.\n화상 상태로 만들 때가 있다.", "Un infierno de llamas daña a los Pokémon\nadyacentes en combate. Puede quemar.") },
            { PBEMove.LeafStorm, new PBELocalizedString("The user whips up a storm of leaves around\nthe target. The attack's recoil harshly\nreduces the user's Sp. Atk stat.", "Invoque une tempête de feuilles acérées.\nLe contrecoup réduit fortement l'Attaque\nSpéciale du lanceur.", "Anwender erzeugt einen Sturm von\nscharfen Blättern. Rückstoß senkt\nSpezial-Angriff des Anwenders stark.", "Si forma una tempesta di foglie affilate.\nIl contraccolpo riduce di molto l'Attacco\nSpeciale di chi la usa.", "とがった　はっぱで　あいてに　あらしを\nおこす。つかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "とがった　はっぱで　相手に　あらしを\nおこす。使うと　反動で\n自分の　特攻が　がくっと　さがる。", "뾰족한 잎사귀로 상대에게 바람을\n일으킨다. 사용하면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Cae una lluvia de hojas afiladas.\nBaja mucho el Ataque Especial\nde quien lo usa.") },
            { PBEMove.PowerWhip, new PBELocalizedString("The user violently whirls its vines or\ntentacles to harshly lash the target.", "Le lanceur fait virevolter violemment\nses lianes ou ses tentacules pour\nfouetter l'ennemi.", "Anwender wirbelt seine Ranken oder\nTentakel peitschenartig gegen das\nZiel.", "Chi la usa agita violentemente liane o\ntentacoli per sferzare il nemico.", "ツタや　しょくしゅを　はげしく　ふるって\nあいてを　たたきつけ　こうげきする。\n", "ツタや　触手を　激しく　ふるって\n相手を　たたきつけ　攻撃する。\n", "덩굴이나 촉수를 세차게 흔들어\n상대를 힘껏 쳐서 공격한다.", "El usuario agita violentamente sus lianas\no tentáculos para golpear al objetivo.") },
            // { PBEMove.439, new PBELocalizedString("The user launches a huge boulder at the\ntarget to attack. It must rest on the\nnext turn, however.", "Le lanceur attaque en projetant un\ngros rocher sur l'ennemi. Il doit se\nreposer au tour suivant.", "Anwender wirft einen riesigen Felsen auf\ndas Ziel. In der nächsten Runde muss\nder Anwender ruhen.", "Chi la usa attacca il nemico con un enorme\nmasso, ma si deve riposare al turno\nsuccessivo.", "きょだいな　いわを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "巨大な　岩を\n相手に　発射して　攻撃する。\n次の　ターンは　動けなくなる。", "거대한 바위를\n상대에게 발사하여 공격한다.\n다음 턴은 움직일 수 없게 된다.", "Lanza una piedra enorme contra\nel objetivo, pero tiene que descansar\nel siguiente turno.") },
            { PBEMove.CrossPoison, new PBELocalizedString("A slashing attack with a poisonous blade\nthat may also leave the target poisoned.\nCritical hits land more easily.", "Un coup tranchant qui peut empoisonner\nl'ennemi. Taux de critiques élevé.", "Ein schneidender Hieb, der das\nZiel eventuell vergiftet. Hat\neine hohe Volltrefferquote.", "Attacco con zanne avvelenate che può\nanche avvelenare il Pokémon colpito.\nProbabile brutto colpo.", "どくの　やいばで　あいてを　きりさく。\nどく　じょうたいに　することが　あり\nきゅうしょにも　あたりやすい。", "毒の　刃で　相手を　切り裂く。\n毒状態に　することが　あり\n急所にも　当たりやすい。", "독 칼날로 상대를 베어 가른다.\n독 상태로 만들 때가 있고\n급소에도 맞기 쉽다.", "Tajo que puede envenenar al objetivo.\nSuele ser crítico.") },
            { PBEMove.GunkShot, new PBELocalizedString("The user shoots filthy garbage\nat the target to attack.\nIt may also poison the target.", "Le lanceur envoie des détritus sur\nl'ennemi. Peut aussi l'empoisonner.", "Anwender schießt mit Müll auf das Ziel.\nVergiftet dieses eventuell.", "Chi la usa attacca il nemico con rifiuti\nsudici che possono anche avvelenarlo.", "きたない　ゴミを\nあいてに　ぶつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "汚い　ゴミを\n相手に　ぶつけて　攻撃する。\n毒状態に　することが　ある。", "더러운 쓰레기를\n상대에게 부딪쳐서 공격한다.\n독 상태로 만들 때가 있다.", "Lanza contra el objetivo asquerosa\nbasura. Puede envenenar al objetivo.") },
            { PBEMove.IronHead, new PBELocalizedString("The user slams the target\nwith its steel-hard head.\nIt may also make the target flinch.", "Le lanceur heurte l'ennemi avec sa tête\ndure comme de l'acier. Peut aussi\napeurer l'ennemi.", "Ziel wird durch stahlharten Kopf des\nAnwenders getroffen und schreckt\neventuell zurück.", "Chi la usa colpisce il nemico con la sua\ntesta dura come l'acciaio. Può anche\nfarlo tentennare.", "はがねの　ような\nかたい　あたまで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "鋼の　ような\n硬い　頭で　攻撃する。\n相手を　ひるませることが　ある。", "강철과 같은\n단단한 머리로 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Ataca con su dura cabeza de hierro.\nPuede hacer que el objetivo retroceda.") },
            { PBEMove.MagnetBomb, new PBELocalizedString("The user launches steel bombs that\nstick to the target.\nThis attack will not miss.", "Le lanceur projette des bombes d'acier\nqui collent à l'ennemi. N'échoue jamais.", "Ziel wird durch Haftbomben getroffen.\nDiese Attacke trifft immer.", "Chi la usa lancia bombe d'acciaio che si\nattaccano al nemico. Una mossa infallibile.", "あいてに　すいつく\nはがねの　ばくだんを　はっしゃする。\nこうげきは　かならず　めいちゅう　する。", "相手に　吸いつく\n鋼の　爆弾を　発射する。\n攻撃は　必ず　命中　する。", "상대에게 달라붙는\n강철의 폭탄을 발사한다.\n공격은 반드시 명중한다.", "Lanza unas bombas de hierro que se pegan\nal adversario. No se puede esquivar.") },
            { PBEMove.StoneEdge, new PBELocalizedString("The user stabs the foe with\nsharpened stones from below.\nIt has a high critical-hit ratio.", "Fait surgir des pierres aiguisées sous\nl'ennemi. Taux de critiques élevé.", "Anwender sticht das Ziel mit spitzen\nSteinen. Hohe Volltrefferquote.", "Chi la usa colpisce il nemico dal\nbasso con pietre affilate. Probabile\nbrutto colpo.", "とがった　いわを\nあいてに　つきさして　こうげきする。\nきゅうしょに　あたりやすい。", "とがった　岩を\n相手に　突き刺して　攻撃する。\n急所に　当たりやすい。", "뾰족한 바위를\n상대에게 꿰찔러서 공격한다.\n급소에 맞기 쉽다.", "Clava piedras muy afiladas al objetivo.\nSuele ser crítico.") },
            // { PBEMove.445, new PBELocalizedString("If it is the opposite gender of the user,\nthe target is charmed into harshly\nlowering its Sp. Atk stat.", "Si l'ennemi est de sexe opposé au\nlanceur, il est séduit et son Attaque\nSpéciale baisse fortement.", "Charme-Attacke, die Spezial-Angriff\nstark senkt, falls das Ziel dem\nanderen Geschlecht angehört.", "Se il nemico è del sesso opposto di chi\nla usa, sarà ammaliato e il suo Attacco\nSpeciale diminuirà di molto.", "♂なら♀を　♀なら♂を　ゆうわくして\nあいての　とくこうを　がくっと　さげる。\n", "♂なら♀を　♀なら♂を　誘惑して\n相手の　特攻を　がくっと　さげる。\n", "수컷은 암컷을 암컷은 수컷을 유혹하여\n상대의 특수공격을 크게 떨어뜨린다.", "Si el objetivo es del sexo opuesto,\nqueda embelesado y baja mucho\nsu Ataque Especial.") },
            { PBEMove.StealthRock, new PBELocalizedString("The user lays a trap of levitating stones\naround the opponent's team. The trap\nhurts opponents that switch into battle.", "Lance des pierres flottantes autour\nde l'ennemi, qui blessent tout ennemi\nentrant au combat.", "Falle mit schwebenden Steinen.\nIn den Kampf eingreifende Gegner\nnehmen Schaden.", "Chi la usa piazza una trappola di rocce\nsospese che danneggia i nemici che entrano\nin lotta.", "あいての　まわりに　むすうの　いわを\nうかべて　こうたいで　でてきた　あいての\nポケモンに　ダメージを　あたえる。", "相手の　周りに　無数の　岩を\n浮かべて　交代で　でてきた　相手の\nポケモンに　ダメージを　与える。", "상대의 주위에 무수한 바위를\n띄워 교체해서 나온 상대\n포켓몬에게 데미지를 준다.", "Una trampa de rocas que flota\nen el aire y daña a los objetivos\nque entran en combate.") },
            { PBEMove.GrassKnot, new PBELocalizedString("The user snares the target with grass and\ntrips it. The heavier the target,\nthe greater the damage.", "L'ennemi est piégé dans de l'herbe qui\nle fait trébucher. Plus il est lourd,\nplus il subit de dégâts.", "Ziel wird durch Gras ins Straucheln\ngebracht. Je schwerer das Ziel,\ndesto mehr Schaden.", "Chi la usa intrappola il nemico con l'erba\ne lo fa cadere. Danneggia maggiormente\ni nemici più pesanti.", "くさを　からませて　あいてを\nころばせる。あいてが　おもいほど\nいりょくが　あがる。", "草を　からませて　相手を\n転ばせる。相手が　重いほど\n威力が　あがる。", "풀을 휘감아서 상대를\n쓰러뜨린다. 상대가 무거울수록\n위력이 올라간다.", "Enreda al objetivo con hierba y lo derriba.\nCuanto más pesado es el objetivo,\nmás daño inflige.") },
            { PBEMove.Chatter, new PBELocalizedString("The user attacks using a sound wave\nbased on words it has learned.\nIt may also confuse the target.", "Le lanceur envoie une onde musicale en\nrécitant des mots. Peut aussi rendre\nl'ennemi confus.", "Attacke mit Schallwellen.\nVerwirrt das Ziel eventuell.", "Chi la usa attacca creando un'onda\nsonora con le parole imparate. Può anche\nconfondere il nemico.", "おぼえた　ことばで\nおんぱを　おこして　こうげきする。\nあいてを　こんらん　させることが　ある。", "おぼえた　言葉で\n音波を　おこして　攻撃する。\n相手を　混乱させることが　ある。", "기억한 말로\n음파를 일으켜서 공격한다.\n상대를 혼란시킬 때가 있다.", "Ataca con una onda sónica compuesta\npor palabras que ha aprendido. Puede\nconfundir al objetivo.") },
            { PBEMove.Judgment, new PBELocalizedString("The user releases countless shots of\nlight at the target. Its type varies with\nthe kind of Plate the user is holding.", "Le lanceur libère une myriade de rayons de\nlumière. Le type varie selon la Plaque\nque tient le lanceur.", "Anwender feuert unzählige Lichtstrahlen\nab. Deren Typ hängt von der gehaltenen\nTafel ab.", "Chi la usa rilascia numerosi colpi di luce.\nIl tipo varia a seconda della Lastra\ntenuta.", "むすうの　こうだんを　あいてに\nほうしゅつする。じぶんの　もつ　\nプレートに　より　タイプが　かわる。", "無数の　光弾を　相手に　放出する。\n自分の　持つ　プレートに　より　\nタイプが　変わる。", "무수한 광탄을 상대에게 방출한다.\n자신이 가지고 있는 플레이트에 따라\n타입이 바뀐다.", "Emite incontables haces de luz.\nVaría según el tipo de Tabla\nque lleve el usuario.") },
            // { PBEMove.450, new PBELocalizedString("The user bites the target. If the target\nis holding a Berry, the user eats it and\ngains its effect.", "Le lanceur pique l'ennemi. Si ce dernier\ntient une Baie, le lanceur la dévore et\nobtient son effet.", "Anwender beißt das Ziel. Hält dieses\neine Beere, isst der Anwender sie und\nerhält ihren Effekt.", "Chi la usa morde il nemico. Inoltre, se\nquesti tiene una Bacca, gliela ruba e ne\nsfrutta gli effetti.", "かみついて　こうげきする。\nあいてが　きのみを　もっている　とき\nたべて　きのみの　こうかを　うけられる。", "かみついて　攻撃する。\n相手が　きのみを　持っているとき\n食べて　きのみの　効果を　受けられる。", "물어서 공격한다.\n상대가 나무열매를 지니고 있을 때\n먹어서 나무열매의 효과를 받을 수 있다.", "Pica al objetivo. Si el objetivo lleva\nuna Baya, el usuario se la come y\nse beneficia de su efecto.") },
            { PBEMove.ChargeBeam, new PBELocalizedString("The user attacks with an electric\ncharge. The user may use any remaining\nelectricity to raise its Sp. Atk stat.", "Le lanceur tire un rayon chargé\nd'électricité. Peut aussi augmenter\nson Attaque Spéciale.", "Ziel wird von einem Elektrostrahl\ngetroffen. Steigert eventuell Spezial-\nAngriff des Anwenders.", "Chi la usa lancia un fascio di elettricità\nmolto intensa. Può anche aumentare il suo\nAttacco Speciale.", "でんげきの　たばを　あいてに\nはっしゃする。でんきを　ためて　じぶんの\nとくこうを　あげることが　ある。", "電撃の　束を　相手に\n発射する。電気を　ためて　自分の\n特攻を　あげることが　ある。", "전격의 다발을 상대에게\n발사한다. 전기를 모아서 자신의\n특수공격을 올릴 때가 있다.", "Lanza un rayo eléctrico contra el\nobjetivo. Puede subir el Ataque\nEspecial de quien lo usa.") },
            { PBEMove.WoodHammer, new PBELocalizedString("The user slams its rugged body into the\ntarget to attack. The user also sustains\nserious damage.", "Le lanceur heurte l'ennemi de son corps\nrobuste. Inflige de sérieux dégâts au\nlanceur aussi.", "Anwender attackiert mit seinem robusten\nKörper. Er erleidet dabei auch selbst\ngroßen Schaden.", "Chi la usa si lancia con tutto il corpo\ncontro il nemico, ma subisce anche\nconsiderevoli danni.", "かたい　どうたいを\nあいてに　たたきつけて　こうげきする。\nじぶんも　かなり　ダメージを　うける。", "硬い　胴体を\n相手に　たたきつけて　攻撃する。\n自分も　かなり　ダメージを　受ける。", "단단한 몸통을\n상대에게 부딪쳐서 공격한다.\n자신도 상당한 데미지를 입는다.", "Arremete contra el objetivo con su\nrobusto cuerpo. El agresor también\nsufre bastante daño.") },
            { PBEMove.AquaJet, new PBELocalizedString("The user lunges at the target at a speed\nthat makes it almost invisible. It is sure\nto strike first.", "Le lanceur fonce sur l'ennemi si\nrapidement qu'on parvient à peine\nà le discerner. Frappe en premier.", "Sehr schneller Angriff mit\nErstschlaggarantie.", "Chi la usa colpisce sempre per primo e\nad una tale velocità da rendersi quasi\ninvisibile.", "めにも　とまらぬ　ものすごい　はやさで\nあいてに　つっこむ。\nかならず　せんせい　こうげき　できる。", "目にも　留まらぬ　ものすごい　速さで\n相手に　つっこむ。\n必ず　先制攻撃　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진한다.\n반드시 선제공격할 수 있다.", "Ataque rápido que permite golpear\nen primer lugar.") },
            { PBEMove.AttackOrder, new PBELocalizedString("The user calls out its underlings to\npummel the target.\nCritical hits land more easily.", "Le lanceur appelle ses sous-fifres pour\nfrapper l'ennemi. Taux de critiques\nélevé.", "Anwender ruft seine Untergebenen zum\nAngriff. Hat eine hohe Volltrefferquote.", "Chi la usa raduna i suoi sgherri per\ncolpire il nemico. Probabile brutto colpo.", "しもべを　よびだして\nあいてに　むかって　こうげき　させる。\nきゅうしょに　あたりやすい。", "しもべを　呼びだして\n相手に　むかって　攻撃させる。\n急所に　当たりやすい。", "부하를 불러내어\n상대를 향해서 공격시킨다.\n급소에 맞기 쉽다.", "El usuario llama a sus súbditos\npara que ataquen al objetivo.\nSuele ser crítico.") },
            { PBEMove.DefendOrder, new PBELocalizedString("The user calls out its underlings to\nshield its body, raising its Defense\nand Sp. Def stats.", "Le lanceur appelle ses sous-fifres pour\nformer un bouclier qui augmente sa Défense\net sa Défense Spéciale.", "Untergebene bilden einen lebenden Schild\num den Anwender. Steigert Verteidigung\nund Spezial-Verteidigung.", "Chi la usa raduna i suoi sgherri per creare\nuno scudo, aumentando Difesa e Difesa\nSpeciale.", "しもべを　よびだして　じぶんの　からだに\nおおい　つかせる。ぼうぎょと　とくぼうを\nあげることが　できる。", "しもべを　呼びだして　自分の　体に\nおおい　つかせる。防御と　特防を\nあげることが　できる。", "부하를 불러내어 자신의 몸을\n뒤덮게 한다. 방어와 특수방어를\n올릴 수 있다.", "El usuario llama a sus súbditos para\nque formen un escudo viviente.\nSube la Defensa y la Defensa Especial.") },
            { PBEMove.HealOrder, new PBELocalizedString("The user calls out its underlings to\nheal it. The user regains up to half of its\nmax HP.", "Le lanceur appelle ses sous-fifres pour\nle soigner. Il récupère jusqu'à la moitié\nde ses PV max.", "Untergebene heilen den Anwender. KP des\nAnwenders werden mit 50 % der max. KP\naufgefüllt.", "Chi la usa raduna i propri sgherri per farsi\ncurare. Recupera metà dei PS massimi.", "しもべを　よびだして　きずを　なおす。\nさいだい　ＨＰの　はんぶん\nじぶんの　ＨＰを　かいふく　する。", "しもべを　呼びだして　きずを　治す。\n最大ＨＰの　半分\n自分の　ＨＰを　回復する。", "부하를 불러내어 상처를 회복한다.\n최대 HP의 절반만큼\n자신의 HP를 회복한다.", "El usuario llama a sus súbditos para que\nlo curen. Recupera hasta la mitad de\nlos PS máximos.") },
            { PBEMove.HeadSmash, new PBELocalizedString("The user attacks the target with a\nhazardous, full-power headbutt.\nThe user also takes terrible damage.", "Le lanceur assène un coup de tête\ndésespéré. Blesse aussi gravement\nle lanceur.", "Anwender greift unter Einsatz seines\nLebens mit einem Kopfstoß an und nimmt\ndabei selbst jede Menge Schaden.", "Chi la usa attacca con tutta la potenza\ndi cui dispone, ma purtroppo subisce\ndanni considerevoli.", "いのちを　かけて　こんしんの　ちからで\nあいてに　ずつきを　する。じぶんも\nものすごい　ダメージを　うける。", "命を　懸けて　こん身の　力で\n相手に　ずつきを　する。自分も\nものすごい　ダメージを　受ける。", "목숨을 걸고 혼신의 힘으로\n상대에게 박치기를 한다.\n자신도 굉장한 데미지를 입는다.", "El usuario arriesga su vida y lanza\nun cabezazo con toda su fuerza.\nEl agresor resulta seriamente dañado.") },
            // { PBEMove.458, new PBELocalizedString("The user slams the target with a long tail,\nvines, or tentacle.\nThe target is hit twice in a row.", "Un coup de queue ou de liane qui frappe\nl'ennemi deux fois d'affilée.", "Anwender trifft das Ziel mit dem\nSchweif oder Ähnlichem. Ziel wird\ndoppelt getroffen.", "Chi la usa colpisce il nemico con la coda\ndue volte di fila.", "しっぽなどを　つかい　あいてを　たたいて\nこうげきする。２かい　れんぞくで　\nダメージを　あたえる。", "しっぽなどを　使い\n相手を　たたいて　攻撃する。\n２回連続で　ダメージを　与える。", "꼬리 등을 써서\n상대를 때려 공격한다.\n2회 연속으로 데미지를 준다.", "Golpea al objetivo dos veces seguidas\ncon la cola u otras partes de su cuerpo.") },
            // { PBEMove.459, new PBELocalizedString("The user blasts the target with power\nthat distorts even time.\nThe user must rest on the next turn.", "Le lanceur frappe si fort qu'il affecte\nle cours du temps. Il se repose au\ntour suivant.", "Anwender attackiert mit einer Kraft, die\nselbst die Zeit verzerrt. In der nächsten\nRunde muss er ruhen.", "Chi la usa colpisce il nemico con una forza\ncapace di alterare il tempo, ma deve stare\nfermo il turno dopo.", "じかんが　ゆがむほどの　ちからを\nうちだして　あいてを　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "時間が　ゆがむほどの　力を\nうちだして　相手を　攻撃する。\n次の　ターンは　動けなくなる。", "시간이 뒤틀릴 정도의 힘을\n사용해서 상대를 공격한다.\n다음 턴은 움직일 수 없다.", "Ataca al objetivo usando tal energía\nque el tiempo se distorsiona.\nEl usuario descansa el siguiente turno.") },
            { PBEMove.SpacialRend, new PBELocalizedString("The user tears the target along with the\nspace around it.\nCritical hits land more easily.", "Le lanceur déchire l'ennemi et l'espace\nautour de lui. Taux de critiques élevé.", "Schwere, raumgreifende Attacke.\nHohe Volltrefferquote.", "Chi la usa lacera il nemico e lo spazio che\nlo circonda. Probabile brutto colpo.", "まわりの　くうかんごと　あいてを\nひきさき　ダメージを　あたえる。\nきゅうしょに　あたりやすい。", "周りの　空間ごと　相手を\n引き裂き　ダメージを　与える。\n急所に　当たりやすい。", "주위의 공간과 더불어 상대를\n찢어서 데미지를 준다.\n급소에 맞기 쉽다.", "Desgarra al objetivo y el espacio\na su alrededor. Suele ser crítico.") },
            // { PBEMove.461, new PBELocalizedString("The user faints. In return, the Pokémon\ntaking its place will have its status and\nHP fully restored.", "Le lanceur tombe K.O. pour soigner le\nstatut et les PV du Pokémon qui prendra\nsa place au combat.", "Anwender geht K.O. Das an seine Stelle\ntretende Pokémon hat dafür volle KP/AP.\nStatusprobleme werden geheilt.", "Chi la usa va KO. Il Pokémon che lo\nsostituisce risolve i propri problemi\ndi stato e recupera PS e PP.", "じぶんは　ひんしに　なるが\nひかえから　でてくる　ポケモンの\nすべての　じょうたいを　かいふく　する。", "自分は　ひんしに　なるが\n控えから　でてくる　ポケモンの\nすべての　状態を　回復する。", "자신은 기절하지만\n교대하여 나오는 포켓몬의\n모든 상태를 회복한다.", "El usuario se debilita, pero el Pokémon\nque lo sustituye recupera su estado,\nlos PS y los PP.") },
            // { PBEMove.462, new PBELocalizedString("The target is crushed with great force.\nThe attack is more powerful the more\nHP the target has left.", "Une force puissante écrase l'ennemi.\nPlus il lui reste de PV et plus l'attaque\nest puissante.", "Ziel wird mit großer Kraft getroffen.\nJe höher die KP des Zieles, desto\nstärker die Attacke.", "Colpisce il nemico con grande forza.\nPiù PS ha il nemico, maggiore è la potenza\ndella mossa.", "すさまじい　ちからで　あいてを　にぎり\nつぶす。あいての　ＨＰが　のこっている\nほど　いりょくが　あがる。", "すさまじい　力で　相手を　にぎりつぶす。\n相手の　ＨＰが　残っているほど\n威力が　あがる。", "굉장한 힘으로 상대를 묵사발로\n만든다. 상대의 HP가 남아있을수록\n위력이 올라간다.", "Estruja al objetivo con gran fuerza.\nCuantos más PS le queden al\nobjetivo, más fuerte será el ataque.") },
            // { PBEMove.463, new PBELocalizedString("The target becomes trapped\nwithin a maelstrom of fire that rages\nfor four to five turns.", "L'ennemi est pris dans un tourbillon\nde feu qui dure de 4 à 5 tours.", "Das Ziel wird in einen Feuersog\ngezogen, der vier bis fünf\nRunden aktiv ist.", "Intrappola il nemico in un turbine di fuoco\nche dura per quattro o cinque turni.", "はげしく　もえたぎる　ほのおの　なかに\n４ー５ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "激しく　燃えたぎる　炎の　なかに\n４ー５ターンの　あいだ\n相手を　閉じこめて　攻撃する。", "세차게 타오르는 불꽃 속에\n4-5턴 동안 상대를\n가두어 공격한다.", "El objetivo queda atrapado en una\ntormenta de fuego que dura de\ncuatro a cinco turnos.") },
            { PBEMove.DarkVoid, new PBELocalizedString("Opposing Pokémon are dragged into\na world of total darkness that makes\nthem sleep.", "L'ennemi est plongé dans les ténèbres.\nIl tombe dans un profond sommeil.", "Das Ziel wird in eine Welt der\nDunkelheit gezogen und in Schlaf\nversetzt.", "Trascina i nemici in un mondo di totale\noscurità e li fa addormentare.", "あんこくの　せかいに　ひきずり　おとして\nあいてを　ねむり　じょうたいに　する。\n", "暗黒の　世界に　ひきずり　落として\n相手を　眠り状態に　する。\n", "암흑의 세계로 끌고 가서 떨어뜨려\n상대를 잠듦 상태로 만든다.", "El objetivo es enviado a un mundo de\ntinieblas que lo hace dormir.") },
            { PBEMove.SeedFlare, new PBELocalizedString("The user emits a shock wave from\nits body to attack its target. It may\nharshly lower the target's Sp. Def.", "Le corps du lanceur émet une onde de\nchoc. Peut aussi baisser grandement\nla Défense Spéciale de la cible.", "Anwender erzeugt eine Schockwelle.\nSpezial-Verteidigung des Zieles wird\nstark gesenkt.", "Chi la usa genera un'onda d'urto dal\nsuo corpo. Può anche ridurre di molto\nla Difesa Speciale del bersaglio.", "からだの　なかから　しょうげきはを\nはっせい　させる。あいての　とくぼうを\nがくっと　さげることが　ある。", "体の　中から　衝撃波を\n発生させる。相手の　特防を　\nがくっと　さげることが　ある。", "몸속에서 충격파를\n발생시킨다. 상대의 특수방어를\n크게 떨어뜨릴 때가 있다.", "Una onda de choque se libera del cuerpo.\nPuede bajar severamente la Defensa\nEspecial del objetivo.") },
            { PBEMove.OminousWind, new PBELocalizedString("The user blasts the target with a gust of\nrepulsive wind. It may also raise all the\nuser's stats at once.", "Le lanceur crée une violente bourrasque.\nPeut aussi augmenter toutes ses stats.", "Das Ziel treffen abscheuliche Winde.\nSteigert eventuell alle Statuswerte des\nAnwenders.", "Chi la usa attacca con una forte raffica\ndi vento che può aumentare tutte le sue\nstatistiche.", "みのけも　よだつ　とっぷうで　あいてを\nこうげきする。じぶんの　すべての\nのうりょくが　あがることが　ある。", "みのけも　よだつ　突風で　相手を\n攻撃する。自分の　すべての\n能力が　あがることが　ある。", "소름이 끼칠만한 돌풍으로 상대를\n공격한다. 자신의 모든\n능력이 올라갈 때가 있다.", "Produce un viento horripilante.\nPuede subir de golpe todas\nlas características del usuario.") },
            // { PBEMove.467, new PBELocalizedString("The user disappears, then strikes the\ntarget on the second turn.\nIt hits even if the target protects itself.", "Le lanceur disparaît et frappe l'ennemi\nau second tour. Fonctionne même si\nl'ennemi se protège.", "Anwender verschwindet in Runde 1 und\nattackiert in Runde 2. Trifft auch, wenn\nsich das Ziel selbst schützt.", "Chi la usa sparisce e poi colpisce il nemico\nal turno successivo. Evita pure Protezione\no Individua.", "１ターンめで　すがたを　けして\n２ターンめに　あいてを　こうげきする。\nまもっていても　こうげきは　あたる。", "１ターン目で　姿を　消して\n２ターン目に　相手を　攻撃する。\n守っていても　攻撃は　当たる。", "1턴째에 모습을 감춰\n2턴째에 상대를 공격한다.\n방어하고 있어도 공격은 맞는다.", "En el primer turno, desaparece.\nEn el segundo, golpea al objetivo\naunque se esté protegiendo.") },
            { PBEMove.HoneClaws, new PBELocalizedString("The user sharpens its claws to\nboost its Attack stat and accuracy.", "Le lanceur s'aiguise les griffes.\nAugmente l'Attaque et la Précision.", "Wetzt seine Klauen, um sie zu schärfen.\nErhöht Angriff und Genauigkeit des\nAnwenders.", "Chi la usa affila i propri artigli,\naumentando Attacco e precisione.", "ツメを　みがいて　するどく　する。\nじぶんの　こうげきと　\nめいちゅうりつを　あげる。", "ツメを　磨いて　鋭く　する。\n自分の　攻撃と　\n命中率を　あげる。", "손톱을 갈아 날카롭게 한다.\n자신의 공격과\n명중률을 올린다.", "El usuario se afila las garras para\naumentar su Ataque y Precisión.") },
            { PBEMove.WideGuard, new PBELocalizedString("The user and its allies are protected from\nwide-ranging attacks for one turn. If used\nin succession, its chance of failing rises.", "Annule les attaques visant toute l'équipe\npendant 1 tour. Peut échouer si utilisée\nplusieurs fois de suite.", "Schützt eine Runde lang vor Angriffen,\ndie alle Pokémon auf deiner Seite treffen.\nKlappt nur selten mehrmals in Folge.", "Chi la usa para tutti i colpi diretti alla\nintera squadra per un turno. Se usata\nin successione può fallire.", "みかた　ぜんいんに　あたる　こうげきを\n１ターンの　あいだ　ふせぐ。\nれんぞくで　だすと　しっぱい　しやすい。", "味方全員に　当たる　攻撃を\n１ターンの　あいだ　防ぐ。\n連続で　だすと　失敗しやすい。", "같은 편 전원에게 향하는 공격을\n1턴 동안 막는다.\n연속으로 쓰면 실패하기 쉽다.", "Bloquea los ataques lanzados contra todo\ntu equipo durante un turno. Su eficacia\nmerma si se usa repetidas veces.") },
            // { PBEMove.470, new PBELocalizedString("The user employs its psychic power to\naverage its Defense and Sp. Def stats\nwith those of its target's.", "Additionne la Défense et la Défense\nSpéciale du lanceur et de sa cible et les\nredistribue équitablement entre les deux.", "Durch Psycho-Kräfte werden Vert. und\nSpez.-Vert. des Anwenders und des Zieles\naddiert und in zwei gleiche Hälften geteilt.", "Chi la usa sfrutta la sua forza psichica\nper sommare Difesa e Difesa Speciale a\nquelle del bersaglio e dividerle equamente.", "ちょうのうりょくで　じぶんと　あいての\nぼうぎょと　とくぼうを　たして\nはんぶんに　わける。", "超能力で　自分と　相手の\n防御と　特防を　たして\n半分に　わける。", "초능력으로 자신과 상대의\n방어와 특수방어를 더해서\n반으로 나눈다.", "El usuario emplea sus poderes para hacer\nla media de su Defensa y Defensa Especial\ncon las de su objetivo y compartirlas.") },
            // { PBEMove.471, new PBELocalizedString("The user employs its psychic power to\naverage its Attack and Sp. Atk stats\nwith those of the target's.", "Additionne l'Attaque Spéciale et l'Attaque\ndu lanceur et de sa cible et les\nredistribue équitablement entre les deux.", "Durch Psycho-Kräfte werden Angriff und\nSpezial-Angriff addiert und in zwei gleiche\nHälften geteilt.", "Chi la usa sfrutta la sua forza psichica\nper sommare Attacco e Attacco Speciale a\nquelli del bersaglio e dividerli equamente.", "ちょうのうりょくで　じぶんと　あいての\nこうげきと　とくこうを　たして\nはんぶんに　わける。", "超能力で　自分と　相手の\n攻撃と　特攻を　たして\n半分に　わける。", "초능력으로 자신과 상대의\n공격과 특수공격을 더해서\n반으로 나눈다.", "El usuario emplea sus poderes para hacer\nla media de su Ataque y Ataque Especial\ncon los de su objetivo y compartirlos.") },
            // { PBEMove.472, new PBELocalizedString("The user creates a bizarre area in which\nPokémon's Defense and Sp. Def\nstats are swapped for five turns.", "Crée une zone étrange où pendant 5 tours,\nla Défense et la Défense Spéciale de tous\nles Pokémon sont inversées.", "Anwender erzeugt bizarren Raum, in dem\nüber fünf Runden die Vert. aller Pokémon\nmit ihrer Spez.-Vert. getauscht wird.", "Chi la usa crea una dimensione in cui Difesa\ne Difesa Speciale di tutti i Pokémon\nvengono scambiate per cinque turni.", "まかふしぎな　くうかんを　つくる。\n５ターンのあいだ　すべてのポケモンの\nぼうぎょと　とくぼうが　いれかわる。", "まか不思議な　空間を　つくる。\n５ターンのあいだ　すべてのポケモンの\n防御と　特防が　入れ替わる。", "이상한 공간을 만든다.\n5턴 동안 모든 포켓몬의\n방어와 특수방어가 바뀐다.", "Crea una zona misteriosa donde se\nintercambian la Defensa y Def. Especial\nen todos los Pokémon por cinco turnos.") },
            { PBEMove.Psyshock, new PBELocalizedString("The user materializes an odd\npsychic wave to attack the target.\nThis attack does physical damage.", "Le lanceur matérialise des ondes\nmystérieuses qu'il projette sur\nl'ennemi. Inflige des dégâts physiques.", "Anwender erzeugt eine seltsame\nEnergiewelle, die dem Ziel\nphysischen Schaden zufügt.", "Chi la usa attacca il bersaglio facendo\nmaterializzare un misterioso raggio\npsichico che provoca danni fisici.", "ふしぎな　ねんぱを　じったいかして\nあいてを　こうげきする。\nぶつりてきな　ダメージを　あたえる。", "不思議な　念波を　実体化して\n相手を　攻撃する。\n物理的な　ダメージを　与える。", "이상한 염력파를 실체화해서\n상대를 공격한다.\n물리적인 데미지를 준다.", "Crea una onda psíquica que golpea\nal objetivo y provoca un gran daño\nfísico.") },
            { PBEMove.Venoshock, new PBELocalizedString("The user drenches the target in a special\npoisonous liquid. Its power is doubled\nif the target is poisoned.", "Le lanceur inocule un poison spécial\nà l'ennemi. L'effet est doublé si\nl'ennemi est déjà empoisonné.", "Überschüttet das Ziel mit einer speziellen\ntoxischen Flüssigkeit. Doppelt so stark\ngegen vergiftete Ziele.", "Lancia uno speciale liquido tossico sul\nbersaglio. Se questi è avvelenato, il\ndanno provocato raddoppia.", "とくしゅな　どくえきを　あびせかける。\nどく　じょうたいの　あいてには\nいりょくが　２ばいに　なる。", "特殊な　毒液を　浴びせかける。\n毒状態の　相手には\n威力が　２倍に　なる。", "특수한 독액을 끼얹는다.\n독 상태의 상대에게는\n위력이 2배가 된다.", "Ataca cubriendo al objetivo con un líquido\nvenenoso. El daño será doble si este ya\nestá envenenado.") },
            // { PBEMove.475, new PBELocalizedString("The user sheds part of its body\nto make itself lighter and sharply\nraise its Speed stat.", "Le lanceur se débarrasse des parties\ninutiles de son corps. Son poids diminue\net sa Vitesse augmente fortement.", "Anwender trennt sich von überflüssigen\nKörperteilen und steigert seine Initiative\nstark. Sein Gewicht nimmt deutlich ab.", "Chi la usa si libera di tutti i pesi in\neccesso, alleggerendosi e aumentando di\nmolto la propria Velocità.", "からだの　ムダな　ぶぶんを　けずる。　\nじぶんの　すばやさを　ぐーんと　あげて\nたいじゅうも　かるく　なる。", "体の　ムダな　部分を　削る。　\n自分の　素早さを　ぐーんと　あげて\n体重も　軽くなる。", "몸의 쓸모없는 부분을 깎는다.\n자신의 스피드를 크게 올리고\n체중도 가벼워진다.", "El usuario se sacude para hacerse más\nligero y aumentar mucho su Velocidad.") },
            // { PBEMove.476, new PBELocalizedString("The user scatters a cloud of irritating\npowder to draw attention to itself.\nOpponents aim only at the user.", "Le lanceur s'asperge d'une poudre\nirritante pour attirer l'attention. Il\nattire toutes les attaques ennemies.", "Anwender zieht gegn. Aufmerksamkeit\nund Angriffe auf sich, indem er ein Wut\nerzeugendes Pulver über sich streut.", "Chi la usa attira l'attenzione dei nemici\ncospargendosi di una polvere irritante e\ndiventando bersaglio di tutti gli attacchi.", "イライラさせる　こなを　じぶんに\nふりかけて　ちゅういを　ひく。あいての\nこうげきを　すべて　じぶんに　むける。", "イライラさせる　粉を　自分に\nふりかけて　注意を　ひく。相手の\n攻撃を　すべて　自分に　むける。", "안절부절못하게 하는 가루를\n자신에게 뿌려서 주의를 끈다.\n상대의 공격은 모두 자신에게 향한다.", "Usa un polvo que irrita y centra\nen el usuario la atención y los\nataques de los rivales.") },
            // { PBEMove.477, new PBELocalizedString("The user makes the target float with its\npsychic power. The target is easier to\nhit for three turns.", "Un pouvoir qui fait flotter l'ennemi dans\nles airs. Pendant 3 tours, il devient plus\nfacile à atteindre.", "Bringt das Ziel durch Psycho-Kräfte zum\nSchweben. Dieses lässt sich so über drei\nRunden hinweg besonders leicht treffen.", "Chi la usa fa galleggiare in aria il\nbersaglio, rendendolo facile da\ncolpire per tre turni.", "ちょうのうりょくで　あいてを　うかせる。\n３ターンの　あいだ　こうげきが\nあいてに　あたりやすく　なる。", "超能力で　相手を　浮かせる。\n３ターンの　あいだ　攻撃が\n相手に　当たりやすく　なる。", "초능력으로 상대를 띄운다.\n3턴 동안 공격이\n상대에게 맞기 쉬워진다.", "El usuario emplea su poder mental para\nhacer flotar al objetivo, haciéndolo blanco\nfácil de sus ataques durante tres turnos.") },
            // { PBEMove.478, new PBELocalizedString("The user creates a bizarre area\nin which Pokémon's held items\nlose their effects for five turns.", "Le lanceur crée une zone étrange. Pendant\n5 tours, les objets tenus par tous les\nPokémon n'ont plus aucun effet.", "Anwender erzeugt einen bizarren Raum, in\ndem über fünf Runden die Wirkung aller von\nPokémon getragenen Items aufgehoben ist.", "Chi la usa crea una dimensione in cui\nl'effetto degli strumenti tenuti da tutti\ni Pokémon è annullato per cinque turni.", "まかふしぎな　くうかんを　つくる。\n５ターンのあいだ　すべてのポケモンの\nどうぐの　こうかが　なくなる。", "まか不思議な　空間を　つくる。\n５ターンのあいだ　すべてのポケモンの\n道具の　効果が　なくなる。", "이상한 공간을 만든다.\n5턴 동안 모든 포켓몬의\n도구의 효과가 사라진다.", "Crea un espacio misterioso que inutiliza\ntodos los objetos de los Pokémon\ndurante cinco turnos.") },
            // { PBEMove.479, new PBELocalizedString("The user throws a stone or projectile to\nattack an opponent. A flying Pokémon will\nfall to the ground when hit.", "Le lanceur jette toutes sortes\nde projectiles à un ennemi. Si ce\ndernier vole, il tombe au sol.", "Greift das Ziel mit Steinen und Wurfge-\nschossen an. Fliegende Ziele fallen dabei\nvom Himmel und landen auf dem Boden.", "Chi la usa lancia una pietra o un\nproiettile. Può colpire anche un\nbersaglio in volo e farlo cadere.", "いしや　たまを　なげて　とんでいる\nあいてを　こうげきする。あいては\nうちおとされて　じめんに　おちる。", "石や　弾を　投げて　飛んでいる\n相手を　攻撃する。相手は\nうち落とされて　地面に　落ちる。", "돌이나 구슬을 던져서 날고 있는\n상대를 공격한다.\n맞은 상대는 땅에 떨어진다.", "El usuario ataca lanzando una piedra\no un proyectil. Puede estrellar contra\nel suelo al objetivo si vuela.") },
            { PBEMove.StormThrow, new PBELocalizedString("The user strikes the target with a fierce\nblow. This attack always results in a\ncritical hit.", "Un coup très puissant dont l'effet\nest toujours critique.", "Ein Angriff mit voller Wucht\nund Volltreffergarantie.", "Chi la usa sferra un colpo micidiale\nal bersaglio, stritolandolo. Brutto colpo\nassicurato.", "きょうれつな　いちげきを\nあいてに　くりだす。こうげきは\nかならず　きゅうしょに　あたる。", "強烈な　一撃を\n相手に　くりだす。攻撃は\n必ず　急所に　当たる。", "강렬한 일격을\n상대에게 날린다. 공격은\n반드시 급소에 맞는다.", "Lanza un golpe fulminante.\nSiempre resulta en un golpe crítico.") },
            // { PBEMove.481, new PBELocalizedString("The user attacks the target with a\nbursting flame. The bursting flame damages\nPokémon next to the target as well.", "Quand l'attaque atteint sa cible, elle\nprojette des flammes qui touchent\ntout ennemi situé à côté.", "Bei Erfolg Angriff mit berstenden Feuer-\nblasen. Die Funken der geplatzten\nBlasen treffen auch benachbarte Ziele.", "Chi la usa emana una fiammata che colpisce\nil bersaglio e si propaga fino a raggiungere\ni Pokémon accanto.", "あたると　はじける　ほのおで　あいてを\nこうげきする。はじけた　ほのおは\nとなりの　あいてにも　ふりかかる。", "当たると　はじける　炎で　相手を\n攻撃する。はじけた　炎は\n隣の　相手にも　ふりかかる。", "맞으면 튀는 불꽃으로 상대를\n공격한다. 튕긴 불꽃은\n옆의 상대에게도 쏟아진다.", "Golpea al objetivo con una llamarada que\nafecta a sus Pokémon adyacentes.") },
            { PBEMove.SludgeWave, new PBELocalizedString("It swamps the area around the user with a\ngiant sludge wave.\nIt may also poison those hit.", "Une vague de détritus attaque tous\nles Pokémon autour du lanceur.\nPeut aussi empoisonner.", "Greift Pokémon in der Nähe des\nAnwenders mit einer Schlammwelle an.\nDiese werden eventuell vergiftet.", "Lancia un'onda di fango che attacca\ntutti i Pokémon nelle vicinanze.\nPuò anche avvelenarli.", "ヘドロの　なみで　じぶんの\nまわりに　いるものを　こうげきする。\nどく　じょうたいに　することが　ある。", "ヘドロの　波で　自分の\n周りに　いるものを　攻撃する。\n毒状態に　することが　ある。", "오물 파도로 자신의\n주위에 있는 포켓몬을 공격한다.\n독 상태로 만들 때가 있다.", "Una onda tóxica que daña a los Pokémon\nde alrededor. Puede envenenar.") },
            { PBEMove.QuiverDance, new PBELocalizedString("The user lightly performs a beautiful,\nmystic dance. It boosts the user's\nSp. Atk, Sp. Def, and Speed stats.", "Une danse mystique dont le rythme parfait\naugmente l'Attaque Spéciale, la Défense\nSpéciale et la Vitesse du lanceur.", "Anwender legt behände einen mystischen,\nformvollendeten Tanz aufs Parkett. Spez.-\nAng., Spez.-Vert. und Initiative steigen.", "Danza leggiadra ed elegante che aumenta\nl'Attacco Speciale, la Difesa Speciale\ne la Velocità di chi la usa.", "しんぴてきで　うつくしい　まいを\nかろやかに　おどる。じぶんの　とくこうと\nとくぼうと　すばやさを　あげる。", "神秘的で　美しい　舞を\n軽やかに　おどる。自分の　特攻と\n特防と　素早さを　あげる。", "신비롭고 아름다운 춤을\n경쾌하게 춘다. 자신의 특수공격과\n특수방어와 스피드를 올린다.", "Danza mística que sube el Ataque Especial,\nla Defensa Especial y la Velocidad.") },
            { PBEMove.HeavySlam, new PBELocalizedString("The user slams into the target with its\nheavy body. The more the user outweighs\nthe target, the greater its damage.", "Le lanceur se jette sur l'ennemi de tout\nson poids. S'il est plus lourd que l'ennemi,\nl'effet augmente en conséquence.", "Anwender rammt das Ziel mit massivem\nKörper. Je schwerer er im Vergleich zum\nZiel ist, desto stärker die Attacke.", "Chi la usa si lancia contro il bersaglio\ncon tutto il proprio peso. Più è pesante\nrispetto ad esso e più danni causa.", "おもたい　からだで　あいてに　ぶつかって\nこうげきする。じぶんが　あいてより\nおもいほど　いりょくが　あがる。", "重たい　体で　相手に　ぶつかって\n攻撃する。自分が　相手より\n重いほど　威力が　あがる。", "무거운 몸으로 상대에게 부딪쳐\n공격한다. 자신이 상대보다\n무거울수록 위력이 올라간다.", "El usuario golpea con todo su cuerpo.\nCuanto mayor sea su peso comparado\ncon el del objetivo, más daño causará.") },
            // { PBEMove.485, new PBELocalizedString("Using an odd shock wave, the user\ninflicts damage on any Pokémon of the same\ntype in the area around it.", "Des ondes mystérieuses blessent tous\nles Pokémon alentour qui sont du même\ntype que le lanceur.", "Fügt Pokémon vom selben Typ, die sich in\nder Nähe des Anwenders aufhalten, mit\nseltsamen Druckwellen Schaden zu.", "Chi la usa infligge danni a tutti i Pokémon\ndel suo stesso tipo che ha vicino usando\nmisteriose onde elettromagnetiche.", "ふしぎな　でんぱで　まわりに　いる\nじぶんと　おなじ　タイプの　\nポケモンに　ダメージを　あたえる。", "不思議な　電波で　周りに　いる\n自分と　同じ　タイプの　\nポケモンに　ダメージを　与える。", "이상한 전파로 주위에 있는\n자신과 같은 타입의\n포켓몬에게 데미지를 준다.", "Una extraña onda que daña a todos\nlos Pokémon adyacentes del mismo\ntipo que el que la ejecuta.") },
            // { PBEMove.486, new PBELocalizedString("The user hurls an electric orb\nat the target. The faster the user is\nthan the target, the greater the damage.", "Le lanceur envoie une boule d'électricité.\nSi sa Vitesse est plus grande que celle de\nl'ennemi, les dégâts augmentent d'autant.", "Je höher die Initiative des Anwenders\nim Vergleich zum Ziel ist, desto stärker\ntrifft dieses eine geballte Ladung Strom.", "Chi la usa attacca con una sfera d'energia\nelettrica. Più è rapido rispetto al\nbersaglio e più danni arreca.", "でんきの　かたまりを　あいてに\nぶつける。あいてより　すばやさが\nはやいほど　いりょくが　あがる。", "電気の　塊を　相手に\nぶつける。相手より　素早さが\n速いほど　威力が　あがる。", "전기 덩어리를 상대에게 부딪쳐서\n공격한다. 상대보다 스피드가\n빠를수록 위력이 올라간다.", "Lanza una bola eléctrica. Cuanto mayor\nsea la Velocidad del usuario sobre la del\nobjetivo, mayor será el daño causado.") },
            // { PBEMove.487, new PBELocalizedString("The user shoots a torrent of water\nat the target and changes\nthe target's type to Water.", "Le lanceur projette beaucoup d'eau sur\nsa cible, qui devient de type Eau.", "Überschüttet das Ziel mit Unmengen an\nWasser und ändert den Typ damit in\nWasser um.", "Chi la usa proietta un lungo getto d'acqua\ncontro il bersaglio e lo rende un Pokémon\ndi tipo Acqua.", "たくさんの　みずを　あびせかけて\nあいてを　みずタイプに　する。\n", "たくさんの　水を　浴びせかけて\n相手を　みずタイプに　する。\n", "많은 물을 끼얹어서\n상대를 물타입으로 바꾼다.", "Potente lluvia que transforma al objetivo\nen un Pokémon de tipo Agua.") },
            { PBEMove.FlameCharge, new PBELocalizedString("The user cloaks itself with flame and\nattacks. Building up more power,\nit raises the user's Speed stat.", "Le lanceur s'entoure de flammes pour\nattaquer l'ennemi. Il se concentre\net sa Vitesse augmente.", "Anwender hüllt sich in Flammen und greift\ndas Ziel an. Sammelt seine Energie und\nerhöht dadurch die eigene Initiative.", "Chi la usa si copre di fuoco e attacca\nil bersaglio. Concentrandosi aumenta,\ninoltre, la propria Velocità.", "ほのおを　まとい　あいてを\nこうげきする。ちからを　ためて　じぶんの\nすばやさを　あげる。", "炎を　まとい　相手を　攻撃する。\n力を　ためて　自分の\n素早さを　あげる。", "불꽃을 둘러 상대를 공격한다.\n힘을 모아서 자신의\n스피드를 올린다.", "Llamas que golpean al objetivo y\naumentan la Velocidad del atacante.") },
            { PBEMove.Coil, new PBELocalizedString("The user coils up and concentrates.\nThis raises its Attack and Defense stats\nas well as its accuracy.", "Le lanceur s'enroule sur lui-même et se\nconcentre. Son Attaque, sa Défense et\nsa Précision augmentent.", "Anwender rollt sich zusammen und sammelt\nsich. Dabei werden Angriff, Verteidigung\nund Genauigkeit erhöht.", "Chi la usa si concentra, aumentando\nAttacco, Difesa e precisione.", "とぐろを　まいて　しゅうちゅう　する。\nじぶんの　こうげきと　ぼうぎょと　\nめいちゅうりつを　あげる。", "とぐろを　まいて　集中する。\n自分の　攻撃と　防御と　\n命中率を　あげる。", "똬리를 틀어서 집중한다.\n자신의 공격과 방어와\n명중률을 올린다.", "El usuario se concentra, lo que le permite\naumentar su Ataque, Defensa y Precisión.") },
            { PBEMove.LowSweep, new PBELocalizedString("The user attacks the target's legs\nswiftly, reducing the target's\nSpeed stat.", "Un coup rapide qui vise les pieds\nde l'ennemi et diminue sa Vitesse.", "Anwender greift mit blitzschnellen\nBewegungen die Beine des Zieles\nan und senkt dessen Initiative.", "Chi la usa colpisce con un attacco fulmineo\nla parte inferiore del corpo del bersaglio,\nriducendone la Velocità.", "すばやい　うごきで　あいての　あしを\nねらって　こうげきする。\nあいての　すばやさを　さげる。", "素早い　動きで　相手の　足を\nねらって　攻撃する。\n相手の　素早さを　さげる。", "재빠른 움직임으로 상대의 다리를\n노려 공격한다.\n상대의 스피드를 떨어뜨린다.", "Un veloz ataque a los pies que\nreduce la Velocidad del objetivo.") },
            { PBEMove.AcidSpray, new PBELocalizedString("The user spits fluid that works to melt\nthe target. This harshly reduces\nthe target's Sp. Def stat.", "Un liquide acide qui fait fondre l'ennemi.\nSa Défense Spéciale diminue beaucoup.", "Anwender greift an, indem er eine ätzende\nFlüssigkeit auf das Ziel speit. Senkt\ndessen Spezial-Verteidigung stark.", "Chi la usa attacca il bersaglio con un acido\naltamente corrosivo. Il fluido riduce\ndi molto la Difesa Speciale del bersaglio.", "あいてを　とかす　えきたいを\nはきだして　こうげきする。\nあいての　とくぼうを　がくっと　さげる。", "相手を　とかす　液体を\n吐きだして　攻撃する。\n相手の　特防を　がくっと　さげる。", "상대를 녹이는 액체를\n토해내서 공격한다.\n상대의 특수방어를 크게 떨어뜨린다.", "Ataca con un líquido corrosivo,\nreduciendo mucho la Defensa\nEspecial del objetivo.") },
            { PBEMove.FoulPlay, new PBELocalizedString("The user turns the target's power\nagainst it. The higher the target's\nAttack stat, the greater the damage.", "Le lanceur utilise la force de l'ennemi.\nPlus l'Attaque de l'ennemi est élevée,\nplus le lanceur inflige de dégâts.", "Anwender macht sich die Kraft des Zieles\nzunutze. Je höher dessen Angriff, desto\nmehr Schaden richtet die Attacke an.", "Chi la usa sfrutta la forza del bersaglio.\nIl danno inflitto è proporzionale\nall'Attacco dell'avversario.", "あいての　ちからを　りようする。\nたたかっている　あいての　こうげきが\nたかいほど　ダメージが　あがる。", "相手の　力を　利用する。\n戦っている　相手の　攻撃が\n高いほど　ダメージが　あがる。", "상대의 힘을 이용한다.\n싸우고 있는 상대의 공격이\n높을수록 데미지가 올라간다.", "El usuario emplea la fuerza del objetivo\npara atacarlo. Cuanto mayor es el Ataque\ndel objetivo, más daño provoca.") },
            // { PBEMove.493, new PBELocalizedString("The user's mysterious psychic wave\nchanges the target's Ability to Simple.", "Le lanceur envoie des ondes\nmystérieuses à l'ennemi. Sa\ncapacité spéciale devient Simple.", "Bestrahlt das Ziel mit mysteriösen\nEnergiewellen. Bei einem Treffer wird\ndessen Fähigkeit zu Wankelmut.", "Chi la usa emette un misterioso raggio\npsichico che trasforma l'abilità del\nPokémon colpito in Disinvoltura.", "なぞの　ねんぱを　あいてに　おくる。\nねんぱを　うけとった　あいては　\nとくせいが　たんじゅんに　なる。", "なぞの　念波を　相手に　送る。\n念波を　受けとった　相手は　\n特性が　たんじゅんに　なる。", "수수께끼의 염력파를 상대에게\n보낸다. 염력파를 받은 상대는\n특성이 단순으로 바뀐다.", "Lanza una onda psíquica que hace que\nla habilidad del objetivo pase a ser Simple.") },
            // { PBEMove.494, new PBELocalizedString("The user dances with an odd rhythm that\ncompels the target to mimic it, making the\ntarget's Ability the same as the user's.", "Le lanceur danse sur un rythme étrange.\nIl force sa cible à l'imiter, ce qui lui fait\nadopter sa capacité spéciale.", "Anwender tanzt zu seltsamem Rhythmus und\nzwingt das Ziel mitzumachen. Dieses nimmt\ndabei die Fähigkeit des Anwenders an.", "Chi la usa saltella con un buffo ritmo,\ninvitando il bersaglio a imitarlo e rendendo\nla sua abilità identica alla propria.", "ふしぎな　リズムで　おどる。\nうごきを　まねさせて　じぶんと　あいての\nとくせいを　おなじに　する。", "不思議な　リズムで　おどる。\n動きを　まねさせて　自分と　相手の\n特性を　同じに　する。", "이상한 리듬으로 춤춘다.\n움직임을 흉내 내게 해서\n자신과 상대의 특성을 똑같게 만든다.", "Una extraña danza que hace que el usuario\ny el objetivo tengan la misma habilidad.") },
            // { PBEMove.495, new PBELocalizedString("The user helps the target and makes it\nuse its move right after the user.", "S'il est le premier à agir, le lanceur\npermet à sa cible d'utiliser une\ncapacité juste après lui.", "Anwender ermöglicht dem Ziel direkt\nnach ihm zu handeln, solange der\nAnwender als Erstes zum Zug kommt.", "Chi la usa aiuta un bersaglio più lento\npermettendogli di agire subito dopo.", "あいての　こうどうを　サポートして\nじぶんの　こうどうの　あとに\nつづけて　うごけるように　する。", "相手の　行動を　サポートして\n自分の　行動の　あとに\n続けて　動けるように　する。", "상대의 행동을 도와서\n자신이 행동한 뒤에 바로\n움직일 수 있도록 한다.", "Si el usuario es el más rápido, permite al\nobjetivo usar un movimiento justo tras él,\nadelantándose a Pokémon más rápidos.") },
            // { PBEMove.496, new PBELocalizedString("The user attacks the target with a song.\nOthers can join in the Round and make\nthe attack do greater damage.", "Le lanceur attaque l'ennemi en chantant.\nSi plusieurs Pokémon déclenchent cette\nattaque à la suite, l'effet augmente.", "Angriff mit Gesang. Singt der Anwender\nmit allen im Kanon, steigt die Stärke.", "Attacca il bersaglio con una melodia.\nSe usata durante lo stesso turno da\npiù Pokémon i danni inflitti aumentano.", "うたで　あいてを　こうげきする。\nみんなで　りんしょう　すると　つづけて\nだすことが　でき　いりょくも　あがる。", "歌で　相手を　攻撃する。\nみんなで　輪唱すると　続けて\nだすことが　でき　威力も　あがる。", "노래로 상대를 공격한다.\n함께 돌림노래를 하면 계속해서\n쓸 수 있고 위력도 올라간다.", "Un canto que ataca al objetivo.\nCuantos más Pokémon lo usan,\nmás aumenta de potencia.") },
            // { PBEMove.497, new PBELocalizedString("The user attacks the target with an\nechoing voice. If this move is used\nevery turn, it does greater damage.", "Un cri retentissant blesse l'ennemi. Si le\nlanceur ou d'autres Pokémon l'utilisent\nà chaque tour, l'effet augmente.", "Angriff mit widerhallender Stimme. Wenn in\njeder Runde ein Teilnehmer wiederholt die\nAttacke einsetzt, steigt die Stärke.", "Attacca il bersaglio con la propria voce\necheggiante. Se usata a ripetizione da uno\no più Pokémon il danno aumenta.", "ひびく　こえで　あいてを　こうげきする。\nまいターン　だれかが　わざを\nつかい　つづけると　いりょくが　あがる。", "響く　声で　相手を　攻撃する。\n毎ターン　だれかが　技を\n使い続けると　威力が　あがる。", "울리는 목소리로 상대를 공격한다.\n매 턴 누군가 기술을\n계속해서 쓰면 위력이 올라간다.", "Un susurro que aumenta de potencia\nconforme el usuario y otros Pokémon\nlo van utilizando.") },
            // { PBEMove.498, new PBELocalizedString("Looking for an opening, the user strikes\ncontinually. The target's stat changes\ndon't affect this attack's damage.", "Une attaque puissante quand l'ennemi\nbaisse sa garde. Inflige des dégâts sans\ntenir compte des changements de stats.", "Eine durchdachte Attacke zu rechter Zeit.\nRichtet unabhängig von den Status-\nveränderungen des Zieles Schaden an.", "Chi la usa attacca non appena il bersaglio\nabbassa la guardia. Il danno inflitto\nprescinde dalle modifiche alle statistiche.", "すきを　みて　けんじつに　こうげきする。\nあいての　のうりょく　へんかに　\nかんけいなく　ダメージを　あたえる。", "すきを　みて　堅実に　攻撃する。\n相手の　能力変化に　\n関係なく　ダメージを　与える。", "틈을 보며 착실하게 공격한다.\n상대의 능력 변화에\n관계없이 데미지를 준다.", "Un ataque que busca los puntos débiles\ndel objetivo y puede causarle daño\naunque cambien sus características.") },
            // { PBEMove.499, new PBELocalizedString("The user attacks by throwing a clump of\nspecial mud. All status changes are\nreturned to normal.", "Le lanceur jette un tas de détritus\nspéciaux sur la cible. Les changements\nde stats de la cible sont annulés.", "Anwender greift das Ziel mit spezial-\ngefertigten Schlammklumpen an. Setzt\nStatusveränderungen zurück.", "Attacca il bersaglio lanciandogli contro\nuna nuvola di fumo speciale, che annulla\nogni modifica alle statistiche.", "とくしゅな　どろの　かたまりを\nあいてに　なげつけて　こうげきする。\nのうりょく　へんかを　もとに　もどす。", "特殊な　泥の　塊を\n相手に　投げつけて　攻撃する。\n能力変化を　もとに　もどす。", "특수한 진흙 덩어리를\n상대에게 내던져서 공격한다.\n능력 변화를 원래대로 돌린다.", "Ataca al objetivo con una extraña niebla\nque elimina sus cambios de características.") },
            // { PBEMove.500, new PBELocalizedString("The user attacks the target with stored\npower. The more the user's stats are\nraised, the greater the damage.", "Le lanceur attaque l'ennemi avec une force\naccumulée. Plus les stats du lanceur sont\naugmentées, plus le coup est efficace.", "Angriff mit angesparter Energie. Je höher\ndie Statuswerte des Anwenders, desto\nstärker fällt die Attacke aus.", "Attacca il bersaglio con l'energia\naccumulata. Più sono state aumentate le\nstatistiche, maggiore è il danno inflitto.", "ちくせき　された　パワーで　あいてを\nこうげきする。じぶんの　のうりょくが\nあがって　いるほど　いりょくが　あがる。", "蓄積された　パワーで　相手を\n攻撃する。自分の　能力が\nあがっているほど　威力が　あがる。", "축적된 파워로 상대를\n공격한다. 자신의 능력이\n올라가 있는 만큼 위력이 오른다.", "Acumula poder para golpear.\nCuanto más suban las características\ndel usuario, mayor será el daño.") },
            // { PBEMove.501, new PBELocalizedString("The user protects itself and its allies\nfrom priority moves. If used in\nsuccession, its chance of failing rises.", "Le lanceur et son équipe sont protégés\ncontre les attaques prioritaires. Peut\néchouer si utilisée plusieurs fois de suite.", "Schützt Anwender und Mitstreiter vor\ngegnerischen Erstschlag-Attacken.\nGeht bei wiederholtem Einsatz oft daneben.", "Chi la usa protegge tutta la squadra dalle\nmosse dei nemici che fanno colpire per\nprimi. Se usata in successione può fallire.", "じぶんと　みかたを　あいての\nせんせい　こうげきから　まもる。\nれんぞくで　だすと　しっぱい　しやすい。", "自分と　味方を　相手の\n先制攻撃から　守る。\n連続で　だすと　失敗しやすい。", "자신과 같은 편을 상대의\n선제공격으로부터 지킨다.\n연속으로 쓰면 실패하기 쉽다.", "Protege a todo el equipo de ataques que\nse adelantan. Puede fallar si se utiliza\nrepetidamente.") },
            // { PBEMove.502, new PBELocalizedString("The user teleports using a strange power\nand switches its place with one of\nits allies.", "Le lanceur se téléporte à l'aide d'un\npouvoir mystérieux. Il échange sa place\navec celle d'un allié sur le terrain.", "Wundersame Kräfte teleportieren\nden Anwender an den Platz eines\nMitstreiters.", "Chi la usa si teletrasporta al posto\ndi un compagno in campo, grazie\nad un misterioso potere.", "ふしぎな　ちからで　テレポートして\nじぶんと　みかたの　いばしょを\nいれかえる。", "不思議な　力で　テレポートして\n自分と　味方の　居場所を\n入れ替える。", "이상한 힘으로 순간이동하여\n자신과 같은 편이 있는 장소를\n바꾼다.", "Un extraño poder que intercambia las\nposiciones del usuario y un aliado\nsobre el terreno de combate.") },
            { PBEMove.Scald, new PBELocalizedString("The user shoots boiling hot water at\nits target. It may also leave the target\nwith a burn.", "L'ennemi est attaqué par un jet d'eau\nbouillante. Peut aussi le brûler.", "Heizt dem Ziel mit einem Schwall siedend\nheißen Kochwassers ein. Das Ziel\nerleidet eventuell Verbrennungen.", "Chi la usa attacca il bersaglio con un\ngetto d'acqua bollente che può anche\nscottarlo.", "あつく　にえたぎる　みずを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "熱く　煮えたぎる　水を\n相手に　発射して　攻撃する。\nやけど状態に　することが　ある。", "뜨겁게 끓어오르는 물을\n상대에게 발사해서 공격한다.\n화상 상태로 만들 때가 있다.", "Ataca arrojando agua hirviendo\nal objetivo.\nPuede causar quemaduras.") },
            { PBEMove.ShellSmash, new PBELocalizedString("The user breaks its shell, lowering its\nDefense and Sp. Def stats but sharply\nraising Attack, Sp. Atk, and Speed stats.", "Le lanceur brise sa coquille. Il baisse sa\nDéfense et Déf. Spé., mais augmente forte-\nment son Attaque, Atq. Spé. et Vitesse.", "Anwender zerbricht seine Schale und senkt\nseine Vert. und Spez.-Vert., dafür steigen\nAngr., Spez.-Angr. und Initiative stark.", "Chi la usa si disfa del guscio. Difesa e\nDif. Sp. calano, ma aumentano di molto\nAttacco, Att. Sp. e Velocità.", "からを　やぶって　じぶんの　ぼうぎょ\nとくぼうを　さげるが　こうげき　とくこう\nすばやさを　ぐーんと　あげる。", "殻を　やぶって　自分の　防御\n特防を　さげるが　攻撃　特攻\n素早さを　ぐーんと　あげる。", "껍질을 깨서 자신의 방어와\n특수방어를 떨어뜨리지만 공격과\n특수공격, 스피드를 크게 올린다.", "El usuario rompe su coraza y baja su\nDefensa y Def. Esp., pero aumenta mucho\nsu Ataque, Ataque Especial y Velocidad.") },
            { PBEMove.HealPulse, new PBELocalizedString("The user emits a healing pulse which\nrestores the target's HP by up to\nhalf of its max HP.", "Une aura de bien-être fait récupérer\nla moitié de ses PV max à la cible.", "Anwender löst eine Schmerzen lindernde\nWelle aus und heilt das Ziel mit der Hälfte\nseiner maximalen KP.", "Chi la usa lancia un'onda rilassante che\nfa recuperare al bersaglio metà dei suoi\nPS massimi.", "いやしのはどうを　とばして\nさいだい　ＨＰの　はんぶん\nあいての　ＨＰを　かいふく　する。", "いやしのはどうを　とばして\n最大ＨＰの　半分\n相手の　ＨＰを　回復する。", "치유파동을 날려서\n최대 HP의 절반만큼\n상대의 HP를 회복한다.", "Una onda curativa restaura los PS\ndel objetivo a la mitad de su máximo.") },
            { PBEMove.Hex, new PBELocalizedString("This relentless attack does massive\ndamage to a target affected\nby status problems.", "Attaque acharnée qui cause\ndavantage de dégâts à l'ennemi\ns'il a un problème de statut.", "Eine Attacke, bei der der Anwender das\nZiel bedrängt. Fügt Zielen mit\nStatusveränderungen hohen Schaden zu.", "Attacco che causa un danno enorme\nse il bersaglio ha problemi di stato.", "たたみかける　ように　こうげきする。\nじょうたい　いじょうの　あいてに\nおおきな　ダメージを　あたえる。　", "たたみかける　ように　攻撃する。\n状態異常の　相手に\n大きな　ダメージを　与える。　", "엎친 데 덮친 격으로 공격한다.\n상태 이상인 상대에게\n큰 데미지를 준다.", "Ataque que causa un gran daño\na los objetivos que sufren\nproblemas de estado.") },
            // { PBEMove.507, new PBELocalizedString("The user takes the target into the sky,\nthen drops it during the next turn.\nThe target cannot attack while in the sky.", "Le lanceur emmène l'ennemi dans les airs\nau 1⑩ tour et le lâche dans le vide au\n2⒅. L'ennemi saisi ne peut pas attaquer.", "Steigt in Runde 1 mit dem Ziel in die\nLuft auf und lässt es in Runde 2 fallen.\nDas Opfer kann dabei nicht angreifen.", "Porta il bersaglio in cielo e lo scaglia a\nterra al turno successivo. Il bersaglio\ncatturato non può muoversi.", "１ターンめで　あいてを　そらへ　つれさり\n２ターンめに　おとして　こうげきする。\nつれさられた　あいては　うごけない。", "１ターン目で　相手を　空へ　連れさり\n２ターン目に　落として　攻撃する。\n連れさられた　相手は　動けない。", "1턴째에 상대를 하늘로 끌고 가서\n2턴째에 떨어뜨려 공격한다.\n끌려간 상대는 움직일 수 없다.", "Primer turno: lanza al objetivo al aire.\nSegundo turno: lo hace caer. Mientras\nestá en el aire, no lo deja moverse.") },
            { PBEMove.ShiftGear, new PBELocalizedString("The user rotates its gears, raising its\nAttack and sharply raising its Speed.", "Le lanceur fait tourner ses engrenages.\nCeci augmente son Attaque et augmente\nfortement sa Vitesse.", "Durch Drehen der Zahnräder erhöht sich\nnicht nur der Angriffs-Wert, sondern auch\ndie Initiative des Anwenders stark.", "Facendo ruotare gli ingranaggi, chi la usa\naumenta non solo il proprio Attacco, ma\nanche di molto la propria Velocità.", "はぐるまを　まわして\nじぶんの　こうげきを　あげる　だけでなく\nすばやさも　ぐーんと　あげる。", "歯車を　回して\n自分の　攻撃を　あげる　だけでなく\n素早さも　ぐーんと　あげる。", "톱니바퀴를 돌려서 자신의\n공격을 올리는 것뿐만 아니라\n스피드도 크게 올린다.", "Al hacer girar los engranajes, el usuario\nmejora su Ataque y aumenta su Velocidad\nespectacularmente.") },
            // { PBEMove.509, new PBELocalizedString("The target is thrown and switched.\nIn the wild, a battle against a single\nPokémon ends.", "Projette le Pokémon ennemi et le\nremplace par un autre. Dans la\nnature, met fin au combat.", "Schleudert das Ziel davon und bewirkt,\ndass ein anderes Pokémon eingewechselt\nwird. Beendet Kämpfe gegen wilde Pokémon.", "Il bersaglio è scaraventato via ed è\ncostretto a lasciare il posto a un altro.\nSe è selvatico, la lotta finisce.", "あいてを　なげとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "相手を　投げとばして\n控えの　ポケモンを　ひきずりだす。\n野生の　場合は　戦闘が　終わる。", "상대를 내던져서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Lanza por los aires al objetivo y hace que\nsalga otro Pokémon. Si es uno salvaje,\nacaba el combate.") },
            // { PBEMove.510, new PBELocalizedString("The user attacks the target with fire.\nIf the target is holding a Berry, the\nBerry becomes burnt up and unusable.", "Des flammes calcinent l'ennemi.\nS'il tient une Baie, elle est\nbrûlée et devient inutilisable.", "Eine Feuer-Attacke. Trägt das Ziel eine\nBeere bei sich, wird diese von den\nFlammen verzehrt und geht verloren.", "Attacca il nemico con una fiammata.\nSe il nemico ha una Bacca, viene\ndivorata dalle fiamme.", "ほのおで　あいてを　こうげきする。\nあいてが　きのみを　もっている　とき\nもやして　つかえなく　する。", "炎で　相手を　攻撃する。\n相手が　きのみを　持っているとき\n燃やして　使えなくする。", "불꽃으로 상대를 공격한다.\n상대가 나무열매를 지니고 있을 때\n불태워서 쓸 수 없게 만든다.", "Llamas que golpean a los objetivos\nadyacentes. Si estos llevan Bayas, estas\nse quemarán y ya no se podrán usar.") },
            // { PBEMove.511, new PBELocalizedString("The user suppresses the target and\nmakes its move go last.", "Retient la cible de force,\nl'obligeant à agir en dernier.", "Anwender stemmt sich gegen das Ziel\nund bewirkt, dass dieses erst als\nLetztes angreift.", "Chi la usa spinge via il bersaglio,\ncostringendolo ad agire per ultimo.", "あいてを　おさえつけて\nこうどうの　じゅんばんを\nさいごに　する。", "相手を　おさえつけて\n行動の　順番を\n最後に　する。", "상대를 억눌러서\n행동의 순서를\n마지막으로 만든다.", "El usuario intimida a su objetivo logrando\nque su movimiento sea el último del turno.") },
            { PBEMove.Acrobatics, new PBELocalizedString("The user nimbly strikes the target.\nIf the user is not holding an item,\nthis attack inflicts massive damage.", "Attaque agile. Si le lanceur ne tient\npas d'objet, l'attaque inflige\ndavantage de dégâts.", "Ein graziler Angriff auf das Ziel. Trägt\nder Anwender kein Item bei sich, richtet\ndie Attacke großen Schaden an.", "Attacca rapidamente il bersaglio.\nSe chi la usa non ha uno strumento,\ninfligge al nemico grossi danni.", "かろやかに　あいてを　こうげきする。\nじぶんが　どうぐを　もっていない　とき\nおおきな　ダメージを　あたえる。　", "軽やかに　相手を　攻撃する。\n自分が　道具を　持っていないとき\n大きな　ダメージを　与える。　", "경쾌하게 상대를 공격한다.\n자신이 도구를 지니고 있지 않을 때\n큰 데미지를 준다.", "Golpea ágilmente. Si el usuario no porta\nningún objeto, el objetivo resulta\nseriamente dañado.") },
            // { PBEMove.513, new PBELocalizedString("The user reflects the target's type,\nmaking it the same type as the target.", "Le lanceur copie le type de la cible\net devient du même type.", "Anwender bildet das Ziel nach und\nnimmt dabei dessen Typ an.", "Chi la usa cambia il proprio tipo in quello\ndel bersaglio.", "あいての　タイプを　はんしゃして\nじぶんも　おなじ　タイプに　なる。\n", "相手の　タイプを　反射して\n自分も　同じ　タイプに　なる。\n", "상대의 타입을 반사해서\n자신도 똑같은 타입이 된다.", "Cambia el tipo del Pokémon al mismo\ntipo que el del objetivo.") },
            { PBEMove.Retaliate, new PBELocalizedString("The user gets revenge for a fainted ally.\nIf an ally fainted in the previous turn,\nthis attack's damage increases.", "Venge un Pokémon de l'équipe mis K.O.\nSi un Pokémon de l'équipe a été mis\nK.O. au tour d'avant, l'effet augmente.", "Anwender nimmt Rache für einen besiegten\nMitstreiter. Wurde in der vorigen Runde ein\nMitstreiter besiegt, steigt die Kraft.", "Vendica un compagno messo KO. Se ciò è\naccaduto al turno precedente, il danno\nè maggiore.", "たおれた　みかたの　かたきを　うつ。\nまえの　ターンに　みかたが　たおされて\nいると　いりょくが　あがる。　", "倒れた　味方の　かたきを　討つ。\n前の　ターンに　味方が\n倒されていると　威力が　あがる。　", "쓰러진 같은 편의 원수를 갚는다.\n앞 턴에서 같은 편이\n쓰러졌다면 위력이 올라간다.", "Venga a los amigos derrotados. Si en el\nturno anterior han derrotado a uno,\nla potencia del ataque aumentará.") },
            { PBEMove.FinalGambit, new PBELocalizedString("The user risks everything to attack its\ntarget. The user faints but does damage\nequal to the user's HP.", "Une attaque très risquée. Le lanceur perd\ntous ses PV restants et inflige autant de\ndégâts à l'ennemi.", "Ein Angriff, der dem Ziel Schaden in Höhe\nder aktuellen KP des Anwenders zufügt.\nLetzterer wird dadurch selbst besiegt.", "Chi la usa attacca con tutta la potenza di\ncui dispone e va KO, ma infligge al bersaglio\nun danno pari ai PS che ha perso.", "いのちがけで　あいてを　こうげきする。\nじぶんは　ひんしに　なるが　あいてに\nＨＰぶんの　ダメージを　あたえる。", "命懸けで　相手を　攻撃する。\n自分は　ひんしに　なるが　相手に\nＨＰ分の　ダメージを　与える。", "목숨을 걸고 상대를 공격한다.\n자신은 기절하게 되지만 상대에게\nHP만큼의 데미지를 준다.", "El usuario se sacrifica causándole\nun daño al objetivo equivalente\na sus propios PS perdidos.") },
            // { PBEMove.516, new PBELocalizedString("The user passes its held item to the\ntarget when the target isn't holding\nan item.", "Si la cible ne tient pas d'objet, le\nlanceur lui donne l'objet qu'il tient.", "Trägt das Ziel gerade kein Item bei sich,\nerhält es das Item, das sich aktuell im\nBesitz des Anwenders befindet.", "Chi la usa consegna il proprio strumento\nal bersaglio se ne è sprovvisto.", "あいてが　どうぐを　もっていない　とき\nじぶんが　もっている　どうぐを\nあいてに　わたす。", "相手が　道具を　持っていないとき\n自分が　持っている　道具を\n相手に　わたす。", "상대가 도구를 지니고 있지 않을 때\n자신이 지니고 있는 도구를\n상대에게 건넨다.", "Entrega el objeto que lleva al objetivo\nen caso de que este no tenga ninguno.") },
            { PBEMove.Inferno, new PBELocalizedString("The user attacks by engulfing the target\nin an intense fire. It leaves the target\nwith a burn.", "L'ennemi est entouré d'un torrent de\nflammes ardentes qui le brûlent.", "Anwender greift das Ziel an, indem\ner es mit dichten Flammen umhüllt.\nZiel erleidet Verbrennungen.", "Il bersaglio viene avvolto da intense\nfiammate che causano scottature.", "はげしい　ほのおで\nあいてを　つつみこみ　こうげきする。\nやけど　じょうたいに　する。", "激しい　炎で\n相手を　包みこみ　攻撃する。\nやけど状態に　する。", "격렬한 불꽃으로\n상대를 둘러싸 공격한다.\n화상 상태로 만든다.", "Ataca con una gran ráfaga de fuego\nque causa quemaduras.") },
            // { PBEMove.518, new PBELocalizedString("A column of water strikes the target. When\ncombined with its fire equivalent, the\ndamage increases and a rainbow appears.", "Une masse d'eau s'abat sur l'ennemi.\nEn l'utilisant avec Aire de Feu, l'effet\naugmente et un arc-en-ciel apparaît.", "Ein Angriff mit Wassersäulen. Kombiniert\nmit Feuersäulen steigt die Wirkung\nund ein Regenbogen erscheint.", "Attacca il nemico con una colonna d'acqua.\nSe usata con Fiammapatto, aumentano gli\neffetti e un arcobaleno appare in cielo.", "みずの　はしらで　こうげきする。\nほのおと　くみあわせると　いりょくが\nあがって　そらに　にじが　かかる。", "水の柱で　攻撃する。\nほのおと　組みあわせると　威力が\nあがって　空に　にじが　かかる。", "물기둥으로 공격한다.\n불꽃과 조합하면 위력이\n올라가고 하늘에 무지개가 걸린다.", "Ataca con columnas de agua.\nCombinado con Voto Fuego, crea\nun arcoíris y aumenta su potencia.") },
            // { PBEMove.519, new PBELocalizedString("A column of fire hits opposing Pokémon.\nWhen used with its Grass equivalent, its\ndamage increases into a vast sea of fire.", "Une masse de feu s'abat sur l'ennemi.\nEn l'utilisant avec Aire d'Herbe, l'effet\naugmente et une mer de feu apparaît.", "Ein Angriff mit Feuersäulen. Kombiniert mit\nPflanzsäulen steigt die Wirkung und die\nUmgebung wird zu einem Meer aus Feuer.", "Attacca il nemico con una colonna di fuoco.\nSe usata con Erbapatto, aumentano gli\neffetti e il campo diventa un mare di fuoco.", "ほのおの　はしらで　こうげきする。\nくさと　くみあわせると　いりょくが\nあがって　あたりが　ひの　うみに　なる。", "炎の柱で　攻撃する。\nくさと　組みあわせると　威力が\nあがって　周りが　火の海に　なる。", "불꽃기둥으로 공격한다.\n풀과 조합하면 위력이\n올라가고 주위가 불바다가 된다.", "Ataca con columnas de fuego.\nCombinado con Voto Planta, crea\nun mar de llamas y aumenta su potencia.") },
            // { PBEMove.520, new PBELocalizedString("A column of grass hits opposing Pokémon.\nWhen used with its water equivalent, its\ndamage increases into a vast swamp.", "Une masse végétale s'abat sur l'ennemi.\nEn l'utilisant avec Aire d'Eau, l'effet\naugmente et un marécage apparaît.", "Ein Angriff mit Pflanzsäulen. Kombiniert\nmit Wassersäulen steigt die Wirkung\nund die Umgebung wird zu einem Sumpf.", "Attacca il nemico con una colonna d'erba.\nSe usata con Acquapatto, aumentano gli\neffetti e il campo diventa una palude.", "くさの　はしらで　こうげきする。\nみずと　くみあわせると　いりょくが\nあがって　あたりが　しつげんに　なる。", "草の柱で　攻撃する。\nみずと　組みあわせると　威力が\nあがって　あたりが　湿原に　なる。", "풀기둥으로 공격한다.\n물과 조합하면 위력이\n올라가고 주변이 습지초원이 된다.", "Ataca con columnas de hojas.\nCombinado con Voto Agua, crea\nun pantano y aumenta su potencia.") },
            // { PBEMove.521, new PBELocalizedString("After making its attack, the user\nrushes back to switch places with\na party Pokémon in waiting.", "Après son attaque, le lanceur revient à\ntoute vitesse et change de place avec\nun Pokémon de l'équipe prêt au combat.", "Anwender kehrt nach dem Angriff mit atem-\nberaubender Geschwindigkeit zurück und\ntauscht Platz mit einem anderen Pokémon.", "Chi usa questa mossa fa marcia indietro\nper farsi sostituire dopo aver sferrato\nl'attacco.", "こうげき　したあと\nものすごい　スピードで　もどってきて\nひかえ　ポケモンと　いれかわる。", "攻撃したあと\nものすごい　スピードで　もどってきて\n控えポケモンと　入れ替わる。", "공격한 뒤\n굉장한 스피드로 돌아와서\n교대 포켓몬과 교체한다.", "Tras atacar, vuelve a toda prisa para dar\npaso a otro Pokémon del equipo.") },
            { PBEMove.StruggleBug, new PBELocalizedString("While resisting, the user attacks the\nopposing Pokémon. The targets'\nSp. Atk stat is reduced.", "Le lanceur se débat de toutes ses forces,\net baisse l'Attaque Spéciale de l'ennemi.", "Anwender leistet Widerstand und greift an.\nDer Spezial-Angriff der Ziele sinkt.", "Colpisce i nemici opponendo resistenza e\nriducendo il loro Attacco Speciale.", "ていこう　して　あいてを　こうげきする。\nあいての　とくこうを　さげる。\n", "抵抗して　相手を　攻撃する。\n相手の　特攻を　さげる。\n", "저항해서 상대를 공격한다.\n상대의 특수공격을 떨어뜨린다.", "El usuario contraataca.\nAdemás baja el Ataque Especial\nde los oponentes.") },
            { PBEMove.Bulldoze, new PBELocalizedString("The user stomps down on the ground\nand attacks everything in the area. Hit\nPokémon's Speed stat is reduced.", "Le lanceur piétine le sol et inflige des\ndégâts à tous les Pokémon autour\nde lui. Baisse aussi la Vitesse.", "Anwender greift an, indem er den Boden\num sich herum plattwalzt. Die Initiative\naller betroffenen Pokémon sinkt.", "Chi la usa calpesta il terreno e scatena un\nterremoto che danneggia tutti i Pokémon\nnei paraggi e ne riduce anche la Velocità.", "じめんを　ふみならして　じぶんの\nまわりに　いるものを　こうげきする。\nあいての　すばやさを　さげる。", "地面を　踏みならして　自分の\n周りに　いるものを　攻撃する。\n相手の　素早さを　さげる。", "땅을 힘껏 밟아서 자신의\n주위에 있는 포켓몬을 공격한다.\n상대의 스피드를 떨어뜨린다.", "Ataca con una sacudida sísmica que afecta\na los Pokémon adyacentes en combate y\nbaja su Velocidad.") },
            { PBEMove.FrostBreath, new PBELocalizedString("The user blows a cold breath on the\ntarget. This attack always results in\na critical hit.", "Un souffle froid blesse l'ennemi.\nL'effet est toujours critique.", "Anwender greift an, indem er dem\nZiel eisigen Atem entgegenhaucht.\nVolltreffergarantie.", "Chi la usa attacca il bersaglio con un\nsoffio d'aria gelida. Brutto colpo\nassicurato.", "つめたい　いきを\nあいてに　ふきつけて　こうげきする。\nかならず　きゅうしょに　あたる。", "冷たい　息を\n相手に　吹きつけて　攻撃する。\n必ず　急所に　当たる。", "차가운 숨결을\n상대에게 내뿜어 공격한다.\n반드시 급소에 맞는다.", "Ataque con aire helado.\nSiempre resulta en un golpe crítico.") },
            // { PBEMove.525, new PBELocalizedString("The target is knocked away and switched.\nIn the wild, a battle against a single\nPokémon ends.", "Un coup puissant qui blesse la cible\net l'envoie balader. Dans la nature,\nmet fin au combat.", "Putzt das Ziel vom Feld und wechselt\nes mit einem anderen Pokémon aus.\nBeendet Kämpfe gegen wilde Pokémon.", "Chi la usa fa volar via il bersaglio in modo\nche venga sostituito. Se il bersaglio è un\nPokémon selvatico, la lotta finisce.", "あいてを　はじきとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "相手を　はじきとばして\n控えの　ポケモンを　ひきずりだす。\n野生の　場合は　戦闘が　終わる。", "상대를 튕겨내서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Ataca al objetivo y lo obliga a cambiarse\npor otro Pokémon. Si es uno salvaje,\nacaba el combate.") },
            { PBEMove.WorkUp, new PBELocalizedString("The user is roused, and its Attack\nand Sp. Atk stats increase.", "Le lanceur se rengorge.\nAugmente l'Attaque et l'Attaque Spéciale.", "Anwender erhält einen Kraftschub, der\nseinen Angriff und Spez.-Angr. erhöht.", "Chi la usa si tira su di morale, aumentando\nil proprio Attacco e l'Attacco Speciale.", "じぶんを　ふるいたてて\nこうげきと　とくこうを　あげる。\n", "自分を　奮いたてて\n攻撃と　特攻を　あげる。\n", "스스로 분발해서\n공격과 특수공격을 올린다.", "Movimiento que aumenta el Ataque\ny el Ataque Especial de quien lo usa.") },
            { PBEMove.Electroweb, new PBELocalizedString("The user captures and attacks opposing\nPokémon by using an electric net. It\nreduces the targets' Speed stat.", "Attrape l'ennemi dans un filet électrique.\nBaisse aussi la Vitesse de l'ennemi.", "Fängt Ziele mit einem elektrischen\nNetz und senkt deren Initiative.", "Chi la usa attacca i nemici catturandoli\ncon una ragnatela elettrica e riducendone\nla Velocità.", "でんきの　ネットで\nあいてを　つかまえて　こうげきする。\nあいての　すばやさを　さげる。", "電気の　ネットで\n相手を　捕まえて　攻撃する。\n相手の　素早さを　さげる。", "전기 네트로\n상대를 붙잡아서 공격한다.\n상대의 스피드를 떨어뜨린다.", "Atrapa y ataca a los objetivos con\nuna telaraña eléctrica. También\nreduce su Velocidad.") },
            { PBEMove.WildCharge, new PBELocalizedString("The user shrouds itself in electricity\nand smashes into its target.\nIt also damages the user a little.", "Une charge électrique violente qui blesse\naussi légèrement le lanceur.", "Anwender erzeugt Spannung und greift an,\nindem er auf Kollisionskurs geht. Er selbst\nerleidet dabei ebenfalls leichten Schaden.", "Chi la usa si carica di elettricità per poi\nscagliarsi sul bersaglio, ma subisce dei\ndanni per il contraccolpo.", "でんきを　まとって\nあいてに　ぶつかって　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "電気を　まとって\n相手に　ぶつかって　攻撃する。\n自分も　少し　ダメージを　受ける。", "전기를 두르고\n상대에게 부딪쳐 공격한다.\n자신도 조금 데미지를 입는다.", "Carga eléctrica muy potente que también\nhiere ligeramente a quien la usa.") },
            { PBEMove.DrillRun, new PBELocalizedString("The user crashes into its target while\nrotating its body like a drill.\nCritical hits land more easily.", "Le lanceur tourne sur lui-même comme\nune perceuse et se jette sur l'ennemi.\nTaux de critiques élevé.", "Anwender rammt das Ziel, während er\nseinen Körper wie einen Bohrer dreht.\nHohe Volltrefferquote.", "Chi la usa si scaglia sul bersaglio ruotando\nsu se stesso come un trapano perforante.\nProbabile brutto colpo.", "ドリルのように　からだを　かいてん\nしながら　あいてに　たいあたりする。\nきゅうしょに　あたりやすい。", "ドリルのように　体を　回転しながら\n相手に　体当たりする。\n急所に　当たりやすい。", "드릴처럼 몸을 회전시켜서\n상대에게 몸통박치기한다.\n급소에 맞기 쉽다.", "El usuario golpea usando\nsu cuerpo como un taladro.\nSuele ser crítico.") },
            // { PBEMove.530, new PBELocalizedString("The user attacks its target by hitting\nit with brutal strikes.\nThe target is hit twice in a row.", "Le lanceur frappe l'ennemi deux fois\nd'affilée avec les parties les plus\nrobustes de son corps.", "Versetzt dem Ziel mit massiven\nExtremitäten Hiebe. Angriff erfolgt\nzweimal hintereinander.", "Chi la usa attacca due volte il bersaglio\ncon dei colpi estremamente forti.", "からだの　かたいぶぶんで　あいてを\nたたいて　こうげきする。２かい\nれんぞくで　ダメージを　あたえる。", "体の　硬い部分で　相手を\nたたいて　攻撃する。\n２回連続で　ダメージを　与える。", "몸의 단단한 부분으로 상대를\n때려 공격한다. 2회 연속으로\n데미지를 준다.", "Golpea dos veces seguidas con la cola\nu otras partes de su cuerpo.") },
            { PBEMove.HeartStamp, new PBELocalizedString("The user unleashes a vicious blow after\nits cute act makes the target less wary.\nIt may also make the target flinch.", "Déconcentre l'ennemi avec des mouvements\nmignons avant de le frapper violemment.\nPeut apeurer l'ennemi.", "Verleitet Ziel durch Kokettieren zu Un-\nachtsamkeit und verpasst ihm dann einen\nharten Schlag. Ziel schreckt evtl. zurück.", "Chi la usa distrae il nemico con un faccino\ninnocente per poi sferrargli un colpo\ndevastante che può farlo tentennare.", "かわいい　しぐさで　ゆだん　させて\nきょうれつな　いちげきを　あびせる。\nあいてを　ひるませる　ことが　ある。", "かわいい　しぐさで　油断させて\n強烈な　一撃を　浴びせる。\n相手を　ひるませることが　ある。", "귀여운 모습으로 방심시켜서\n강렬한 일격을 날린다.\n상대를 풀죽게 만들 때가 있다.", "Grácil gesto que asesta un golpe tremendo\nal objetivo y puede hacerlo retroceder.") },
            { PBEMove.HornLeech, new PBELocalizedString("The user drains the target's energy with\nits horns. The user's HP is restored\nby half the damage taken by the target.", "Un coup de corne qui draine l'énergie\nde l'ennemi. Convertit la moitié des dégâts\ninfligés en PV pour le lanceur.", "Greift Ziel mit Astgeweih an und zapft\ndiesem Nährstoffe ab. Anwender wird um die\nHälfte des zugefügten Schadens geheilt.", "Chi la usa infilza il bersaglio con le corna\ne assorbe una quantità di PS pari a metà\ndel danno inferto.", "つのを　つきさして　あいての　ようぶんを\nすいとる。あたえた　ダメージの\nはんぶんの　ＨＰを　かいふく　できる。", "つのを　突き刺して　相手の　養分を\n吸い取る。与えた　ダメージの\n半分の　ＨＰを　回復できる。", "뿔을 꿰찔러서 상대의 양분을\n흡수한다. 입힌 데미지의 절반에\n해당하는 HP를 회복할 수 있다.", "Un golpe que drena energía.\nEl Pokémon recupera la mitad\nde los PS arrebatados al objetivo.") },
            // { PBEMove.533, new PBELocalizedString("The user attacks by slicing with its long\nhorns. The target's stat changes\ndon't affect this attack's damage.", "Un coup de lame violent qui lacère\nl'ennemi et lui inflige des dégâts quels\nque soient ses changements de stats.", "Schneideangriff mit langem Horn.\nRichtet Schaden unabhängig von\nStatusveränderungen des Zieles an.", "Chi la usa taglia il nemico con una spada\nmagica. Il danno inflitto ignora le modifiche\nalle statistiche del bersaglio.", "ながい　つので　きりつけて　こうげきする。\nあいての　のうりょく　へんかに　\nかんけいなく　ダメージを　あたえる。", "長い　つので　切りつけて　攻撃する。\n相手の　能力変化に　\n関係なく　ダメージを　与える。", "긴 뿔로 베어 공격한다.\n상대의 능력 변화에\n관계없이 데미지를 준다.", "El usuario ataca con una espada,\nignorando cualquier cambio en\nlas características del objetivo.") },
            { PBEMove.RazorShell, new PBELocalizedString("The user cuts its target with sharp\nshells. This attack may also lower the\ntarget's Defense stat.", "Un coquillage aiguisé lacère l'ennemi.\nPeut aussi baisser sa Défense.", "Schneideangriff mit einer scharfen\nMuschelschale. Senkt eventuell die\nVerteidigung des Zieles.", "Chi la usa colpisce il bersaglio con il suo\nguscio affilato. Il colpo può anche ridurre\nla Difesa del bersaglio.", "するどい　かいがらで　きりつけて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "鋭い　貝殻で　切りつけて\n攻撃する。相手の　防御を\nさげることが　ある。", "날카로운 조개껍질로 베어\n공격한다. 상대의 방어를\n떨어뜨릴 때가 있다.", "Una afilada vieira ataca al objetivo.\nTambién puede hacer disminuir su Defensa.") },
            { PBEMove.HeatCrash, new PBELocalizedString("The user slams its target with its flame-\ncovered body. The more the user outweighs\nthe target, the greater the damage.", "Le lanceur projette son corps enflammé\ncontre l'ennemi. S'il est plus lourd que\nl'ennemi, l'effet augmente en conséquence.", "Rempelattacke mit brennendem Körper.\nJe schwerer der Anwender im Vergleich\nzum Ziel ist, desto stärker die Attacke.", "Chi la usa carica con il suo corpo rovente.\nPiù è pesante rispetto al bersaglio e più\ndanni causa.", "もえる　からだで　あいてに　ぶつかって\nこうげきする。じぶんが　あいてより\nおもいほど　いりょくが　あがる。", "燃える　体で　相手に　ぶつかって\n攻撃する。自分が　相手より\n重いほど　威力が　あがる。", "불타는 몸으로 상대에게 부딪쳐서\n공격한다. 자신이 상대보다\n무거울수록 위력이 올라간다.", "El usuario ataca con su cuerpo ardiente.\nCuanto mayor sea su peso comparado\ncon el del objetivo, más daño causará.") },
            { PBEMove.LeafTornado, new PBELocalizedString("The user attacks its target by\nencircling it in sharp leaves. This attack\nmay also lower the target's accuracy.", "L'ennemi est pris dans un tourbillon de\nfeuilles acérées. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender greift an, indem er das Ziel\nin scharfes Blattwerk einwickelt. Senkt\neventuell die Genauigkeit.", "Chi la usa avvolge e attacca il bersaglio\ncon foglie affilate che possono anche\nridurne la precisione.", "するどい　はっぱで　あいてを\nつつみこんで　こうげきする。\nめいちゅうりつを　さげることが　ある。", "鋭い　はっぱで　相手を\n包みこんで　攻撃する。\n命中率を　さげることが　ある。", "날카로운 잎사귀로 상대를\n둘러싸서 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Tritura con afiladas hojas y puede bajar\nla Precisión del objetivo.") },
            { PBEMove.Steamroller, new PBELocalizedString("The user crushes its targets by rolling\nover them with its rolled-up body.\nThis attack may make the target flinch.", "Le lanceur se roule en boule et\nécrase son ennemi. Peut aussi\napeurer l'ennemi.", "Anwender rollt mit rundlichem Körper\nüber das Ziel und drückt es platt.\nZiel schreckt eventuell zurück.", "Chi la usa ruota su se stesso ad alta\nvelocità e schiaccia il bersaglio. Può\nanche farlo tentennare.", "まるめた　からだで　かいてんして\nあいてを　おしつぶす。\nあいてを　ひるませる　ことが　ある。", "まるめた　体で　回転して\n相手を　おしつぶす。\n相手を　ひるませることが　ある。", "둥글게 뭉친 몸을 회전하여\n상대를 뭉개 버린다.\n상대를 풀죽게 만들 때가 있다.", "El usuario se hace una bola y arrolla\nal objetivo con su cuerpo.\nPuede hacerlo retroceder.") },
            { PBEMove.CottonGuard, new PBELocalizedString("The user protects itself by wrapping\nits body in soft cotton, drastically\nraising the user's Defense stat.", "Le lanceur se protège en s'emmitouflant\ndans du coton. Sa Défense augmente\nfortement.", "Anwender schützt sich, indem er sich in\neinen luftigen Flaum hüllt. Erhöht die\nVerteidigung drastisch.", "Chi la usa avvolge il proprio corpo con\ndel cotone molto morbido, proteggendosi\ne aumentando moltissimo la propria Difesa.", "フワフワの　わたげで　じぶんの\nからだを　つつみこんで　まもる。\nぼうぎょを　ぐぐーんと　あげる。", "フワフワの　綿毛で　自分の\n体を　包みこんで　守る。\n防御を　ぐぐーんと　あげる。", "푹신푹신한 솜털로 자신의\n몸을 둘러싸서 지킨다.\n방어를 매우 크게 올린다.", "Cubre al Pokémon con una madeja\nprotectora. Aumenta muchísimo\nla Defensa.") },
            { PBEMove.NightDaze, new PBELocalizedString("The user lets loose a pitch-black shock\nwave at its target. It may also lower the\ntarget's accuracy.", "Le lanceur attaque l'ennemi avec une onde\nde choc ténébreuse. Peut aussi baisser la\nPrécision de l'ennemi.", "Anwender greift Ziel mit finsteren\nSchockwellen an. Senkt eventuell die\nGenauigkeit.", "Chi la usa attacca il bersaglio con un'onda\nd'urto oscura che può ridurne\nla precisione.", "あんこくの　しょうげきはを\nとばして　あいてを　こうげきする。\nめいちゅうりつを　さげることが　ある。", "暗黒の　衝撃波を\nとばして　相手を　攻撃する。\n命中率を　さげることが　ある。", "암흑의 충격파를\n날려서 상대를 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Ataca al objetivo con una onda siniestra.\nPuede bajar su Precisión.") },
            { PBEMove.Psystrike, new PBELocalizedString("The user materializes an odd\npsychic wave to attack the target.\nThis attack does physical damage.", "Le lanceur matérialise des ondes\nmystérieuses qu'il projette sur\nl'ennemi. Inflige des dégâts physiques.", "Anwender erzeugt seltsame Energiewellen,\ndie dem Ziel physischen Schaden\nzufügen.", "Chi la usa attacca il bersaglio facendo\nmaterializzare un misterioso raggio\npsichico che provoca danni fisici.", "ふしぎな　ねんぱを　じったいかして\nあいてを　こうげきする。\nぶつりてきな　ダメージを　あたえる。", "不思議な　念波を　実体化して\n相手を　攻撃する。\n物理的な　ダメージを　与える。", "이상한 염력파를 실체화해서\n상대를 공격한다.\n물리적인 데미지를 준다.", "Crea una onda psíquica que golpea\nal objetivo provocándole un daño físico.") },
            // { PBEMove.541, new PBELocalizedString("The user attacks by striking the target\nwith its hard tail. It hits the target two\nto five times in a row.", "Le lanceur frappe l'ennemi de 2 à 5 fois\nd'affilée avec sa queue robuste.", "Anwender greift das Ziel mit\nseiner schlagfesten Rute 2- bis 5-mal\nhintereinander an.", "Chi la usa colpisce il bersaglio con la sua\ncoda dura da due a cinque volte di fila.", "かたい　しっぽで\nあいてを　たたいて　こうげきする。\n２ー５かいの　あいだ　れんぞくで　だす。", "硬い　しっぽで\n相手を　たたいて　攻撃する。\n２ー５回の　あいだ　連続で　だす。", "단단한 꼬리로\n상대를 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Golpea con la cola u otras\npartes de su cuerpo de dos\na cinco veces seguidas.") },
            { PBEMove.Hurricane, new PBELocalizedString("The user attacks by wrapping its opponent\nin a fierce wind that flies up into the sky.\nIt may also confuse the target.", "Le lanceur déclenche une tempête de\nvents violents qui s'abat sur l'ennemi.\nPeut aussi le rendre confus.", "Anwender greift das Ziel an, indem er\nes mit heftigen Windböen umgibt.\nZiel wird eventuell verwirrt.", "Chi la usa attacca il bersaglio\navvolgendolo con un vento fortissimo.\nPuò anche confonderlo.", "きょうれつな　かぜで　あいてを\nつつみこんで　こうげきする。\nあいてを　こんらん　させることが　ある。", "強烈な　風で　相手を\n包みこんで　攻撃する。\n相手を　混乱させることが　ある。", "강렬한 바람으로 상대를\n둘러싸서 공격한다.\n상대를 혼란시킬 때가 있다.", "Golpea al objetivo con un fuerte\ntorbellino que envuelve al rival\ny puede confundirlo.") },
            { PBEMove.HeadCharge, new PBELocalizedString("The user charges its head into its\ntarget, using its powerful guard hair.\nIt also damages the user a little.", "Le lanceur donne un coup avec sa tête\ncouronnée d'une fière crinière.\nBlesse aussi légèrement le lanceur.", "Rempelattacke mit ausgeflippter\nRetrofrisur. Anwender nimmt selbst\nleichten Schaden.", "Chi la usa carica il bersaglio con la sua\ntesta in stile afro, ma subisce un po' di\ndanni per il contraccolpo.", "すごい　アフロの　あたまで\nあいてに　とっしんして　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "すごい　アフロの　頭で\n相手に　突進して　攻撃する。\n自分も　少し　ダメージを　受ける。", "굉장한 아프로 머리로\n상대에게 돌진하여 공격한다.\n자신도 조금 데미지를 입는다.", "Propina un tremendo cabezazo.\nTambién daña al usuario un poco.") },
            // { PBEMove.544, new PBELocalizedString("The user attacks by throwing\ntwo steel gears at its target.", "Le lanceur jette deux écrous d'acier qui\nfrappent l'ennemi deux fois d'affilée.", "Anwender greift an, indem er stählerne\nZahnräder auf das Ziel schleudert.\nAngriff erfolgt zweimal hintereinander.", "Chi la usa colpisce il bersaglio due volte\ndi fila lanciandogli contro dei dischi\nd'acciaio.", "こうてつの　ギアを　あいてに\nなげつけて　こうげきする。２かい\nれんぞくで　ダメージを　あたえる。", "鋼鉄の　ギアを　相手に\n投げつけて　攻撃する。\n２回連続で　ダメージを　与える。", "강철의 기어를 상대에게\n던져서 공격한다.\n2회 연속으로 데미지를 준다.", "Rota dos engranajes de hierro sobre\nel objetivo. Golpea dos veces.") },
            { PBEMove.SearingShot, new PBELocalizedString("An inferno of scarlet flames torches\neverything around the user. It may\nleave targets with a burn.", "Des flammes rougeoyantes s'abattent\nsur tous les Pokémon autour du lanceur.\nPeut aussi brûler.", "Greift alles in seiner Umgebung mit\ntiefroten Flammen an. Opfer erleidet\neventuell Verbrennungen.", "Chi la usa lancia fiamme scarlatte sui\nPokémon intorno a sé. Può anche scottarli.", "まっかな　ほのおで　じぶんの\nまわりに　いるものを　こうげきする\nやけど　じょうたいに　することが　ある。", "真っ赤な　炎で　自分の\n周りに　いるものを　攻撃する。\nやけど状態に　することが　ある。", "새빨간 불꽃으로 자신의\n주위에 있는 포켓몬을 공격한다.\n화상 상태로 만들 때가 있다.", "Un infierno de llamas daña a los Pokémon\nde alrededor en combate. Puede quemar.") },
            { PBEMove.TechnoBlast, new PBELocalizedString("The user fires a beam of light at\nits target. The type changes depending\non the Drive the user holds.", "Le lanceur projette un rayon lumineux sur\nl'ennemi. Le type varie selon le Module\nque tient le lanceur.", "Anwender feuert ein Lichtgeschoss auf das\nZiel ab. Der Typ der Attacke hängt von\ndem des Moduls ab.", "Chi la usa rilascia un colpo di luce contro\nil bersaglio. Il tipo varia a seconda del\nmodulo tenuto.", "こうだんを　あいてに\nほうしゅつする。じぶんの　もつ\nカセットに　より　タイプが　かわる。", "光弾を　相手に　放出する。\n自分の　持つ\nカセットにより　タイプが　変わる。", "광탄을 상대에게 방출한다.\n자신이 지니고 있는\n카세트에 의해 타입이 바뀐다.", "Ataca al objetivo con un gran láser.\nEl tipo del ataque lo determina el\ncartucho que porta el usuario.") },
            // { PBEMove.547, new PBELocalizedString("The user sings an ancient song and attacks\nby appealing to the hearts of those\nlistening. It may also induce sleep.", "Le lanceur attaque l'ennemi en lui\nchantant une chanson d'un autre temps.\nPeut endormir l'ennemi.", "Anwender greift mit Urgesang an, der\nGegner in der Nähe im tiefsten Inneren\nanspricht. Diese schlafen eventuell ein.", "Chi la usa attacca i nemici intonando\nun'antica melodia che colpisce il loro\nspirito. Può anche farli addormentare.", "いにしえのうたを　あいてに　きかせて\nこころに　うったえて　こうげきする。\nねむり　じょうたいに　することが　ある。", "いにしえのうたを　相手に　聞かせて\n心に　うったえて　攻撃する。\n眠り状態に　することが　ある。", "옛노래를 상대에게 들려주고\n마음에 호소하여 공격한다.\n잠듦 상태로 만들 때가 있다.", "Ataca conmoviendo a los rivales de\nalrededor con un antiguo canto.\nPuede dormirlos.") },
            { PBEMove.SecretSword, new PBELocalizedString("The user cuts with its long horn. The odd\npower contained in the horn does physical\ndamage to the target.", "L'ennemi est lacéré par une longue lame.\nLe pouvoir mystérieux de la lame inflige\ndes dégâts physiques.", "Schneideangriff mit dem langen Schwert des\nAnwenders. Die mysteriöse Kraft aus dem\nHorn erzeugt physischen Schaden.", "Chi la usa attacca il bersaglio tagliandolo\ncon una spada mistica. La misteriosa\nenergia sprigionata provoca danni fisici.", "ながい　つので　きりつけて　こうげきする。\nつのが　まとった　ふしぎな　ちからは\nぶつりてきな　ダメージを　あたえる。", "長い　つので　切りつけて　攻撃する。\nつのが　まとった　不思議な　力は\n物理的な　ダメージを　与える。", "긴 뿔로 베어 공격한다.\n뿔이 머금은 이상한 힘은\n물리적인 데미지를 준다.", "Ensarta al objetivo con un sable,\nhiriéndolo con su místico poder.\nProduce daño físico.") },
            { PBEMove.Glaciate, new PBELocalizedString("The user attacks by blowing freezing cold\nair at opposing Pokémon. This attack\nreduces the targets' Speed stat.", "Un souffle de vent qui congèle tout\nsur son passage s'abat sur l'ennemi.\nRéduit aussi sa Vitesse.", "Anwender greift an, indem er dem Ziel\nklirrend kalte Luft entgegenbläst. Senkt\ndie Initiative des Zieles.", "Chi la usa attacca i nemici con una folata\nd'aria gelida e ne riduce anche la Velocità.", "こごえる　ような　れいきを\nあいてに　ふきつけて　こうげきする。\nあいての　すばやさを　さげる。", "凍えるような　冷気を\n相手に　吹きつけて　攻撃する。\n相手の　素早さを　さげる。", "차가운 냉기를\n상대에게 내뿜어 공격한다.\n상대의 스피드를 떨어뜨린다.", "Ataque con aire helado que baja\nla Velocidad del objetivo.") },
            { PBEMove.BoltStrike, new PBELocalizedString("The user charges its target, surrounding\nitself with a great amount of electricity.\nIt may leave the target with paralysis.", "S'enveloppe d'une charge électrique\nsurpuissante et se jette sur l'ennemi.\nPeut aussi le paralyser.", "Lädt seinen Körper mit einer gewaltigen\nMenge an Elektrizität auf und rammt damit\ndas Ziel. Ziel wird evtl. paralysiert.", "Colpisce il bersaglio con una possente\ncarica elettrica e può anche paralizzarlo.", "ぼうだいな　でんきを　みに　まとって\nあいてに　とっしんして　こうげきする。\nまひ　じょうたいに　することが　ある。", "ぼうだいな　電気を　身に　まとって\n相手に　突進して　攻撃する。\nまひ状態に　することが　ある。", "방대한 전기를 몸에 둘러\n상대에게 돌진해서 공격한다.\n마비 상태로 만들 때가 있다.", "Ataca envolviéndose de una gran\ncarga eléctrica y embistiendo al\nobjetivo con ella. Puede paralizar.") },
            { PBEMove.BlueFlare, new PBELocalizedString("The user attacks by engulfing the target\nin an intense, yet beautiful, blue flame.\nIt may leave the target with a burn.", "De magnifiques et redoutables flammes\nbleues fondent sur l'ennemi.\nPeut aussi le brûler.", "Anwender greift an, indem er das Ziel in\nwunderschöne, intensiv blaue Flammen\nhüllt, die es eventuell verbrennen.", "Chi la usa attacca il bersaglio\navvolgendolo con magnifiche e intense\nfiamme blu che possono anche scottarlo.", "うつくしくも　はげしい　あおいほのおで\nあいてを　つつみこんで　こうげきする。\nやけど　じょうたいに　することが　ある。", "美しくも　激しい　青い炎で\n相手を　包みこんで　攻撃する。\nやけど状態に　することが　ある。", "아름다우면서도 격렬한 푸른불꽃으로\n상대를 둘러싸서 공격한다.\n화상 상태로 만들 때가 있다.", "Ataca con una bella pero potente\nllama azul que rodea al objetivo.\nPuede quemarlo.") },
            { PBEMove.FieryDance, new PBELocalizedString("Cloaked in flames, the user dances\nand flaps its wings. It may also\nraise the user's Sp. Atk stat.", "Le lanceur enveloppe l'ennemi de flammes.\nPeut aussi augmenter l'Attaque Spéciale\ndu lanceur.", "Hüllt das Ziel mit einer Feuerhose\nin Flammen. Erhöht eventuell den\nSpezial-Angriff des Anwenders.", "Il bersaglio viene avvolto dalle fiamme.\nPuò anche aumentare l'Attacco Speciale\ndi chi la usa.", "ほのおを　まとい　はばたいて　あいてを\nこうげきする。じぶんの　とくこうが\nあがることが　ある。", "炎を　まとい　はばたいて　相手を\n攻撃する。自分の　特攻が\nあがることが　ある。", "불꽃을 둘러 날개를 쳐서\n공격한다. 자신의 특수공격이\n오를 때가 있다.", "Envuelve en llamas y daña al objetivo.\nPuede aumentar el Ataque Especial\nde quien lo usa.") },
            // { PBEMove.553, new PBELocalizedString("On the second turn, the user hits the\ntarget with electrically charged ice.\nIt may leave the target with paralysis.", "Projette un bloc de glace électrifié\nsur l'ennemi au second tour.\nPeut aussi le paralyser.", "Feuert in der zweiten Runde elektrisch\ngeladene Eisklumpen auf das Ziel ab.\nParalysiert das Ziel eventuell.", "Chi la usa lancia contro il nemico al turno\nsuccessivo una sfera di ghiaccio ricoperta\ndi elettricità. Può anche paralizzarlo.", "でんきを　まとった　こおりの　かたまりで\n２ターンめに　あいてを　たたきつける。\nまひ　じょうたいに　することが　ある。", "電気を　まとった　氷の　塊で\n２ターン目に　相手を　たたきつける。\nまひ状態に　することが　ある。", "전기를 두른 얼음 덩어리로\n2턴째에 상대를 내리친다.\n마비 상태로 만들 때가 있다.", "El usuario carga un bloque de hielo con\nelectricidad en el primer turno y ataca\ncon él en el segundo. Puede paralizar.") },
            // { PBEMove.554, new PBELocalizedString("On the second turn, an ultracold,\nfreezing wind surrounds the target.\nThis may leave the target with a burn.", "Au second tour, le lanceur projette un\nsouffle de vent glacial dévastateur\nsur l'ennemi. Peut le brûler.", "Umgibt das Ziel in der nächsten Runde\nmit heftigen, alles gefrierenden Eisböen.\nFügt dem Ziel eventuell Verbrennungen zu.", "Chi la usa attacca il bersaglio al turno\nsuccessivo e lo avvolge in un soffio\nd'aria congelata. Può anche scottarlo.", "すべてを　こおらせる　はげしい　れいきで\n２ターンめに　あいてを　つつみこむ。\nやけど　じょうたいに　することが　ある。", "すべてを　凍らせる　激しい　冷気で\n２ターン目に　相手を　包みこむ。\nやけど状態に　することが　ある。", "모든 것을 얼려버리는 격렬한 냉기로\n2턴째에 상대를 둘러싼다.\n화상 상태로 만들 때가 있다.", "Ataca al objetivo en el segundo turno\nrodeándolo de un aire gélido.\nPuede causar quemaduras.") },
            { PBEMove.Snarl, new PBELocalizedString("The user yells as if it is ranting about\nsomething, making the targets' Sp. Atk\nstat decrease.", "Le lanceur hurle sur l'ennemi.\nBaisse l'Attaque Spéciale de l'ennemi.", "Wäscht Gegnern in der Nähe mit einer\nausführlichen Standpauke den Kopf\nund senkt dabei deren Spezial-Angriff.", "Chi la usa si mette a urlare per un po',\nriducendo l'Attacco Speciale dei nemici.", "まくしたてる　ように　どなりつけて\nあいての　とくこうを　さげる。\n", "まくしたてる　ように　怒鳴りつけて\n相手の　特攻を　さげる。\n", "호되게 호통을 쳐서\n상대의 특수공격을 떨어뜨린다.", "Ataca lanzando un chillido insoportable\nque baja el Ataque Especial de\nlos objetivos.") },
            { PBEMove.IcicleCrash, new PBELocalizedString("The user attacks by harshly dropping\nan icicle onto the target.\nIt may also make the target flinch.", "Envoie de gros blocs de glace sur\nl'ennemi pour lui infliger des dégâts.\nPeut aussi l'apeurer.", "Lässt große, schwere Eiszapfen\nauf das Ziel herabregnen.\nZiel schreckt eventuell zurück.", "Chi la usa attacca violentemente il nemico\ncon grosse stalattiti di ghiaccio che\npossono anche farlo tentennare.", "おおきな　つららを\nはげしく　ぶつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "大きな　氷柱を\n激しく　ぶつけて　攻撃する。\n相手を　ひるませることが　ある。", "큰 고드름을\n격렬하게 부딪쳐서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Lanza grandes carámbanos.\nPuede hacer retroceder al objetivo.") },
            { PBEMove.VCreate, new PBELocalizedString("With a hot flame on its forehead, the user\nhurls itself at its target. It lowers the\nuser's Defense, Sp. Def, and Speed stats.", "Le lanceur projette une flamme ardente de\nson front et se jette sur l'ennemi. Baisse\nla Défense, la Déf. Spé. et la Vitesse.", "Eine Verzweiflungsattacke. Anwender\nentfacht glühend heißes Feuer. Senkt\ndessen Vert., Spez.-Vert. und Initiative.", "Chi la usa carica emettendo fiamme ardenti\ndalla fronte, a costo di una riduzione di\nDifesa, Difesa Speciale e Velocità.", "しゃくねつの　ほのおを　ひたいから\nはっせいさせて　すてみの　たいあたり。\nぼうぎょ　とくぼう　すばやさが　さがる。", "しゃく熱の　炎を　額から\n発生させて　捨て身の　体当たり。\n防御　特防　素早さが　さがる。", "작열하는 불꽃을 이마에서\n발생시켜 이판사판으로 몸통박치기한다.\n방어, 특수방어, 스피드가 떨어진다.", "Golpea con una V de llamas al objetivo.\nBaja la Defensa, la Defensa Especial\ny la Velocidad de quien lo usa.") },
            // { PBEMove.558, new PBELocalizedString("The user brings down a giant flame.\nThis attack does greater damage when\ninfluenced by an enormous thunderbolt.", "Projette une boule de feu\ngigantesque. L'effet augmente\nsous l'influence d'Éclair Croix.", "Feuert eine monströse Flamme ab. Wird\ndie Attacke durch einen gigantischen\nBlitz modifiziert, steigt die Stärke.", "Chi la usa lancia una fiammata enorme.\nSe usata in combinazione con Incrotuono,\nil danno provocato dalla mossa aumenta.", "きょだいな　ほのおを　たたきつける。\nきょだいな　いかずちの　えいきょうをうけ\nわざの　いりょくが　あがる。", "巨大な　炎を　たたきつける。\n巨大な　雷の　影響を受け\n技の　威力が　あがる。", "거대한 불꽃을 내리친다.\n거대한 우뢰의 영향을 받아\n기술의 위력이 올라간다.", "Ataca con una llamarada gigantesca.\nAumenta su potencia si es influenciada\npor una gran energía eléctrica.") },
            // { PBEMove.559, new PBELocalizedString("The user throws down a giant thunderbolt.\nThis attack does greater damage\nwhen influenced by an enormous flame.", "Projette un orbe électrique\ngigantesque. L'effet augmente\nsous l'influence de Flamme Croix.", "Feuert einen monströsen Blitz ab.\nWird die Attacke durch eine gigantische\nFlamme modifiziert, steigt die Stärke.", "Chi la usa lancia un fulmine enorme.\nSe usata in combinazione con Incrofiamma,\nil danno provocato dalla mossa aumenta.", "きょだいな　いかずちを　たたきつける。\nきょだいな　ほのおの　えいきょうをうけ\nわざの　いりょくが　あがる。", "巨大な　雷を　たたきつける。\n巨大な　炎の　影響を受け\n技の　威力が　あがる。", "거대한 우뢰를 내리친다.\n거대한 불꽃의 영향을 받아\n기술의 위력이 올라간다.", "Ataca con una enorme descarga eléctrica.\nAumenta su potencia si es influenciada\npor una gigantesca llamarada.") }
        });
